sControlType] 'Allow'","            $ACEs = @()","","            if ($RightsGUID) {","                $GUIDs = @($RightsGUID)","            }","            else {","                $GUIDs = Switch ($Rights) {","                    # ResetPassword doesn't need to know the user's current password","                    'ResetPassword' { '00299570-246d-11d0-a768-00aa006e0529' }","                    # allows for the modification of group membership","                    'WriteMembers' { 'bf9679c0-0de6-11d0-a285-00aa003049e2' }","                    # 'DS-Replication-Get-Changes' = 1131f6aa-9c07-11d1-f79f-00c04fc2dcd2","                    # 'DS-Replication-Get-Changes-All' = 1131f6ad-9c07-11d1-f79f-00c04fc2dcd2","                    # 'DS-Replication-Get-Changes-In-Filtered-Set' = 89e95b76-444d-4c62-991a-0facbeda640c","                    #   when applied to a domain's ACL, allows for the use of DCSync","                    'DCSync' { '1131f6aa-9c07-11d1-f79f-00c04fc2dcd2', '1131f6ad-9c07-11d1-f79f-00c04fc2dcd2', '89e95b76-444d-4c62-991a-0facbeda640c'}","                }","            }","","            ForEach ($PrincipalObject in $Principals) {","                Write-Verbose \"[Add-DomainObjectAcl] Granting principal $($PrincipalObject.distinguishedname) '$Rights' on $($TargetObject.Properties.distinguishedname)\"","","                try {","                    $Identity = [System.Security.Principal.IdentityReference] ([System.Security.Principal.SecurityIdentifier]$PrincipalObject.objectsid)","","                    if ($GUIDs) {","                        ForEach ($GUID in $GUIDs) {","                            $NewGUID = New-Object Guid $GUID","                            $ADRights = [System.DirectoryServices.ActiveDirectoryRights] 'ExtendedRight'","                            $ACEs += New-Object System.DirectoryServices.ActiveDirectoryAccessRule $Identity, $ADRights, $ControlType, $NewGUID, $InheritanceType","                        }","                    }"," 