ers['ResultPageSize']) { $TargetSearcherArguments['ResultPageSize'] = $ResultPageSize }","        if ($PSBoundParameters['ServerTimeLimit']) { $TargetSearcherArguments['ServerTimeLimit'] = $ServerTimeLimit }","        if ($PSBoundParameters['Tombstone']) { $TargetSearcherArguments['Tombstone'] = $Tombstone }","        if ($PSBoundParameters['Credential']) { $TargetSearcherArguments['Credential'] = $Credential }","","        $PrincipalSearcherArguments = @{","            'Identity' = $PrincipalIdentity","            'Properties' = 'distinguishedname,objectsid'","        }","        if ($PSBoundParameters['PrincipalDomain']) { $PrincipalSearcherArguments['Domain'] = $PrincipalDomain }","        if ($PSBoundParameters['Server']) { $PrincipalSearcherArguments['Server'] = $Server }","        if ($PSBoundParameters['SearchScope']) { $PrincipalSearcherArguments['SearchScope'] = $SearchScope }","        if ($PSBoundParameters['ResultPageSize']) { $PrincipalSearcherArguments['ResultPageSize'] = $ResultPageSize }","        if ($PSBoundParameters['ServerTimeLimit']) { $PrincipalSearcherArguments['ServerTimeLimit'] = $ServerTimeLimit }","        if ($PSBoundParameters['Tombstone']) { $PrincipalSearcherArguments['Tombstone'] = $Tombstone }","        if ($PSBoundParameters['Credential']) { $PrincipalSearcherArguments['Credential'] = $Credential }","        $Principals = Get-DomainObject @PrincipalSearcherArguments","        if (-not $Principals) {","            throw \"Unable to resolve principal: $PrincipalIdentity\"","        }","    }","","    PROCESS {","        $TargetSearcherArguments['Identity'] = $TargetIdentity","        $Targets = Get-DomainObject @TargetSearcherArguments","","        ForEach ($TargetObject in $Targets) {","","            $InheritanceType = [System.DirectoryServices.ActiveDirectorySecurityInheritance] 'None'","            $ControlType = [System.Security.AccessControl.AccessControlType] 'Allow'","            $ACEs = @()","","            if ($RightsGUID) {","                $GUIDs = @($RightsGUID)","            }","            else {","                $GUIDs = Switch ($Rights) {","                    # ResetPassword doesn't need to know the user's current password","                    'ResetPassword' { '00299570-246d-11d0-a768-00aa006e0529' }","                    # allows for the modification of group membership","                    'WriteMembers' { 'bf9679c0-0de6-11d0-a285-00aa003049e2' }","                    # 'DS-Replication-Get-Changes' = 1131f6aa-9c07-11d1-f79f-00c04fc2dcd2","                    # 'DS-Replication-Get-Changes-All' = 1131f6ad-9c07-11d1-f79f-00c04fc2dcd2","                    # 'DS-Replication-Get-Changes-In-Filtered-Set' = 89e95b76-444d-4c62-991a-0facbeda640c","                    #   when applied to a domain's ACL, allows for the use of DCSync","                    'DCSync' { '1131f6aa-9c07-11d1-f79f-00c04fc2dcd2', '1131f6ad-9c07-11d1-f79f-00c04fc2dcd2', '89e95b76-444d-4c62-991a-0facbeda640c'}","                }","            }","","            ForEach ($PrincipalObject in $Principals) {","                Write-Verbose \"[Remove-DomainObjectAcl] Removing principal $($PrincipalObject.distinguishedname) '$Rights' from $($TargetObject.Properties.distinguishedname)\"","","                try {","                    $Identity = [System.Security.Principal.IdentityReference] ([System.Security.Principal.SecurityIdentifier]$PrincipalObject.objectsid)","","                    if ($GUIDs) {","                        ForEach ($GUID in $GUIDs) {","                            $NewGUID = New-Object Guid $GUID","                            $ADRights = [System.DirectoryServices.ActiveDirectoryRights] 'ExtendedRight'","                            $ACEs += New-Object System.DirectoryServices.ActiveDirectoryAccessRule $Identity, $ADRights, $ControlType, $NewGUID, $InheritanceType","                        }","                    }","                    else {","                        # deault to GenericAll rights","                        $ADRights = [System.DirectoryServices.ActiveDirectoryRights] 'GenericAll'","                        $ACEs += New-Object System.DirectoryServices.ActiveDirectoryAccessRule $Identity, $ADRights, $ControlType, $InheritanceType","                    }","","                    # remove all the specified ACEs from the specified object directory entry","                    ForEach ($ACE in $ACEs) {","                        Write-Verbose \"[Remove-DomainObjectAcl] Granting principal $($PrincipalObject.distinguishedname) rights GUID '$($ACE.ObjectType)' on $($TargetObject.Properties.distinguishedname)\"","                        $TargetEntry = $TargetObject.GetDirectoryEntry()","                        $TargetEntry.PsBase.Options.SecurityMasks = 'Dacl'","                        $TargetEntry.PsBase.ObjectSecurity.RemoveAccessRule($ACE)","                        $TargetEntry.PsBase.CommitChanges()","                    }","                }","                catch {","                    Write-Verbose \"[Remove-DomainObjectAcl] Error removing principal $($PrincipalObject.distinguishedname) '$Rights' from $($TargetObject.Properties.distinguishedname) : $_\"","                }","            }","        }","    }","}","","","function Find-InterestingDomainAcl {","\u003c#",".SYNOPSIS","","Finds object ACLs in the current (or specified) domain with modification","rights set to non-built in objects.","","Thanks Sean Metcalf (@pyrotek3) for the idea and guidance.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: Get-DomainObjectAcl, Get-DomainObject, Convert-ADName  ","",".DESCRIPTION","","This function enumerates the ACLs for every object in the domain with Get-DomainObjectAcl,","and for each returned ACE entry it checks if principal security identifier","is *-1000 (meaning the account is not built in), and also checks if the rights for","the ACE mean the object can be modified by the principal. If these conditions are met,","then the security identifier SID is translated, the domain object is retrieved, and","additional IdentityReference* information is appended to the output object.","",".PARAMETER Domain","","Specifies the domain to use for the query, defaults to the current domain.","",".PARAMETER ResolveGUIDs","","Switch. Resolve GUIDs to their display names.","",".PARAMETER LDAPFilter","","Specifies an LDAP query string that is used to filter Active Directory objects.","",".PARAMETER SearchBase","","The LDAP source to search through, e.g. \"LDAP://OU=secret,DC=testlab,DC=local\"","Useful for OU queries.","",".PARAMETER Server","","Specifies an Active Directory server (domain controller) to bind to.","",".PARAMETER SearchScope","","Specifies the scope to search under, Base/OneLevel/Subtree (default of Subtree).","",".PARAMETER ResultPageSize","","Specifies the PageSize to set for the LDAP searcher object.","",".PARAMETER ServerTimeLimit","","Specifies the maximum amount of time the server spends searching. Default of 120 seconds.","",".PARAMETER Tombstone","","Switch. Specifies that the searcher should also return deleted/tombstoned objects.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target domain.","",".EXAMPLE","","Find-InterestingDomainAcl","","Finds interesting object ACLS in the current domain.","",".EXAMPLE","","Find-InterestingDomainAcl -Domain dev.testlab.local -ResolveGUIDs","","Finds interesting object ACLS in the ev.testlab.local domain and","resolves rights GUIDs to display names.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Find-InterestingDomainAcl -Credential $Cred -ResolveGUIDs","",".OUTPUTS","","PowerView.ACL","","Custom PSObject with ACL entries.","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType('PowerView.ACL')]","    [CmdletBinding()]","    Param (","        [Parameter(Position = 0, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('DomainName', 'Name')]","        [String]","        $Domain,","","        [Switch]","        $ResolveGUIDs,","","        [String]","        [ValidateSet('All', 'ResetPassword', 'WriteMembers')]","        $RightsFilter,","","        [ValidateNotNullOrEmpty()]","        [Alias('Filter')]","        [String]","        $LDAPFilter,","","        [ValidateNotNullOrEmpty()]","        [Alias('ADSPath')]","        [String]","        $SearchBase,","","        [ValidateNotNullOrEmpty()]","        [Alias('DomainController')]","        [String]","        $Server,","","        [ValidateSet('Base', 'OneLevel', 'Subtree')]","        [String]","        $SearchScope = 'Subtree',","","        [ValidateRange(1, 10000)]","        [Int]","        $ResultPageSize = 200,","","        [ValidateRange(1, 10000)]","        [Int]","        $ServerTimeLimit,","","        [Switch]","        $Tombstone,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    BEGIN {","        $ACLArguments = @{}","        if ($PSBoundParameters['ResolveGUIDs']) { $ACLArguments['ResolveGUIDs'] = $ResolveGUIDs }","        if ($PSBoundParameters['RightsFilter']) { $ACLArguments['RightsFilter'] = $RightsFilter }","        if ($PSBoundParameters['LDAPFilter']) { $ACLArguments['LDAPFilter'] = $LDAPFilter }","        if ($PSBoundParameters['SearchBase']) { $ACLArguments['SearchBase'] = $SearchBase }","        if ($PSBoundParameters['Server']) { $ACLArguments['Server'] = $Server }","        if ($PSBoundParameters['SearchScope']) { $ACLArguments['SearchScope'] = $SearchScope }","        if ($PSBoundParameters['ResultPageSize']) { $ACLArguments['ResultPageSize'] = $ResultPageSize }","        if ($PSBoundParameters['ServerTimeLimit']) { $ACLArguments['ServerTimeLimit'] = $ServerTimeLimit }","        if ($PSBoundParameters['Tombstone']) { $ACLArguments['Tombstone'] = $Tombstone }","        if ($PSBoundParameters['Credential']) { $ACLArguments['Credential'] = $Credential }","","        $ObjectSearcherArguments = @{","            'Properties' = 'samaccountname,objectclass'","            'Raw' = $True","        }","        if ($PSBoundParameters['Server']) { $ObjectSearcherArguments['Server'] = $Server }","        if ($PSBoundParameters['SearchScope']) { $ObjectSearcherArguments['SearchScope'] = $SearchScope }","        if ($PSBoundParameters['ResultPageSize']) { $ObjectSearcherArguments['ResultPageSize'] = $ResultPageSize }","        if ($PSBoundParameters['ServerTimeLimit']) { $ObjectSearcherArguments['ServerTimeLimit'] = $ServerTimeLimit }","        if ($PSBoundParameters['Tombstone']) { $ObjectSearcherArguments['Tombstone'] = $Tombstone }","        if ($PSBoundParameters['Credential']) { $ObjectSearcherArguments['Credential'] = $Credential }","","        $ADNameArguments = @{}","        if ($PSBoundParameters['Server']) { $ADNameArguments['Server'] = $Server }","        if ($PSBoundParameters['Credential']) { $ADNameArguments['Credential'] = $Credential }","","        # ongoing list of built-up SIDs","        $ResolvedSIDs = @{}","    }","","    PROCESS {","        if ($PSBoundParameters['Domain']) {","            $ACLArguments['Domain'] = $Domain","            $ADNameArguments['Domain'] = $Domain","        }","","        Get-DomainObjectAcl @ACLArguments | ForEach-Object {","","            if ( ($_.ActiveDirectoryRights -match 'GenericAll|Write|Create|Delete') -or (($_.ActiveDirectoryRights -match 'ExtendedRight') -and ($_.AceQualifier -match 'Allow'))) {","                # only process SIDs \u003e 1000","                if ($_.SecurityIdentifier.Value -match '^S-1-5-.*-[1-9]\\d{3,}$') {","                    if ($ResolvedSIDs[$_.SecurityIdentifier.Value]) {","                        $IdentityReferenceName, $IdentityReferenceDomain, $IdentityReferenceDN, $IdentityReferenceClass = $ResolvedSIDs[$_.SecurityIdentifier.Value]","","                        $InterestingACL = New-Object PSObject","                        $InterestingACL | Add-Member NoteProperty 'ObjectDN' $_.ObjectDN","                        $InterestingACL | Add-Member NoteProperty 'AceQualifier' $_.AceQualifier","                        $InterestingACL | Add-Member NoteProperty 'ActiveDirectoryRights' $_.ActiveDirectoryRights","                        if ($_.ObjectAceType) {","                            $InterestingACL | Add-Member NoteProperty 'ObjectAceType' $_.ObjectAceType","                        }","                        else {","                            $InterestingACL | Add-Member NoteProperty 'ObjectAceType' 'None'","                        }","                        $InterestingACL | Add-Member NoteProperty 'AceFlags' $_.AceFlags","                        $InterestingACL | Add-Member NoteProperty 'AceType' $_.AceType","                        $InterestingACL | Add-Member NoteProperty 'InheritanceFlags' $_.InheritanceFlags","                        $InterestingACL | Add-Member NoteProperty 'SecurityIdentifier' $_.SecurityIdentifier","                        $InterestingACL | Add-Member NoteProperty 'IdentityReferenceName' $IdentityReferenceName","                        $InterestingACL | Add-Member NoteProperty 'IdentityReferenceDomain' $IdentityReferenceDomain","                        $InterestingACL | Add-Member NoteProperty 'IdentityReferenceDN' $IdentityReferenceDN","                        $InterestingACL | Add-Member NoteProperty 'IdentityReferenceClass' $IdentityReferenceClass","                        $InterestingACL","                    }","                    else {","                        $IdentityReferenceDN = Convert-ADName -Identity $_.SecurityIdentifier.Value -OutputType DN @ADNameArguments","                        # \"IdentityReferenceDN: $IdentityReferenceDN\"","","                        if ($IdentityReferenceDN) {","                            $IdentityReferenceDomain = $IdentityReferenceDN.SubString($IdentityReferenceDN.IndexOf('DC=')) -replace 'DC=','' -replace ',','.'","                            # \"IdentityReferenceDomain: $IdentityReferenceDomain\"","                            $ObjectSearcherArguments['Domain'] = $IdentityReferenceDomain","                            $ObjectSearcherArguments['Identity'] = $IdentityReferenceDN","                            # \"IdentityReferenceDN: $IdentityReferenceDN\"","                            $Object = Get-DomainObject @ObjectSearcherArguments","","                            if ($Object) {","                                $IdentityReferenceName = $Object.Properties.samaccountname[0]","                                if ($Object.Properties.objectclass -match 'computer') {","                                    $IdentityReferenceClass = 'computer'","                                }","                                elseif ($Object.Properties.objectclass -match 'group') {","                                    $IdentityReferenceClass = 'group'","                                }","                                elseif ($Object.Properties.objectclass -match 'user') {","                                    $IdentityReferenceClass = 'user'","                                }","                                else {","                                    $IdentityReferenceClass = $Null","                                }","","                                # save so we don't look up more than once","                                $ResolvedSIDs[$_.SecurityIdentifier.Value] = $IdentityReferenceName, $IdentityReferenceDomain, $IdentityReferenceDN, $IdentityReferenceClass","","                                $InterestingACL = New-Object PSObject","                                $InterestingACL | Add-Member NoteProperty 'ObjectDN' $_.ObjectDN","                                $InterestingACL | Add-Member NoteProperty 'AceQualifier' $_.AceQualifier","                                $InterestingACL | Add-Member NoteProperty 'ActiveDirectoryRights' $_.ActiveDirectoryRights","                                if ($_.ObjectAceType) {","                                    $InterestingACL | Add-Member NoteProperty 'ObjectAceType' $_.ObjectAceType","                                }","                                else {","                                    $InterestingACL | Add-Member NoteProperty 'ObjectAceType' 'None'","                                }","                                $InterestingACL | Add-Member NoteProperty 'AceFlags' $_.AceFlags","                                $InterestingACL | Add-Member NoteProperty 'AceType' $_.AceType","                                $InterestingACL | Add-Member NoteProperty 'InheritanceFlags' $_.InheritanceFlags","                                $InterestingACL | Add-Member NoteProperty 'SecurityIdentifier' $_.SecurityIdentifier","                                $InterestingACL | Add-Member NoteProperty 'IdentityReferenceName' $IdentityReferenceName","                                $InterestingACL | Add-Member NoteProperty 'IdentityReferenceDomain' $IdentityReferenceDomain","                                $InterestingACL | Add-Member NoteProperty 'IdentityReferenceDN' $IdentityReferenceDN","                                $InterestingACL | Add-Member NoteProperty 'IdentityReferenceClass' $IdentityReferenceClass","                                $InterestingACL","                            }","                        }","                        else {","                            Write-Warning \"[Find-InterestingDomainAcl] Unable to convert SID '$($_.SecurityIdentifier.Value )' to a distinguishedname with Convert-ADName\"","                        }","                    }","                }","            }","        }","    }","}","","","function Get-DomainOU {","\u003c#",".SYNOPSIS","","Search for all organization units (OUs) or specific OU objects in AD.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: Get-DomainSearcher, Convert-LDAPProperty  ","",".DESCRIPTION","","Builds a directory searcher object using Get-DomainSearcher, builds a custom","LDAP filter based on targeting/filter parameters, and searches for all objects","matching the criteria. To only return specific properties, use","\"-Properties whencreated,usnchanged,...\". By default, all OU objects for","the current domain are returned.","",".PARAMETER Identity","","An OU name (e.g. TestOU), DistinguishedName (e.g. OU=TestOU,DC=testlab,DC=local), or","GUID (e.g. 8a9ba22a-8977-47e6-84ce-8c26af4e1e6a). Wildcards accepted.","",".PARAMETER GPLink","","Only return OUs with the specified GUID in their gplink property.","",".PARAMETER Domain","","Specifies the domain to use for the query, defaults to the current domain.","",".PARAMETER LDAPFilter","","Specifies an LDAP query string that is used to filter Active Directory objects.","",".PARAMETER Properties","","Specifies the properties of the output object to retrieve from the server.","",".PARAMETER SearchBase","","The LDAP source to search through, e.g. \"LDAP://OU=secret,DC=testlab,DC=local\"","Useful for OU queries.","",".PARAMETER Server","","Specifies an Active Directory server (domain controller) to bind to.","",".PARAMETER SearchScope","","Specifies the scope to search under, Base/OneLevel/Subtree (default of Subtree).","",".PARAMETER ResultPageSize","","Specifies the PageSize to set for the LDAP searcher object.","",".PARAMETER ServerTimeLimit","","Specifies the maximum amount of time the server spends searching. Default of 120 seconds.","",".PARAMETER SecurityMasks","","Specifies an option for examining security information of a directory object.","One of 'Dacl', 'Group', 'None', 'Owner', 'Sacl'.","",".PARAMETER FindOne","","Only return one result object.","",".PARAMETER Tombstone","","Switch. Specifies that the searcher should also return deleted/tombstoned objects.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target domain.","",".PARAMETER Raw","","Switch. Return raw results instead of translating the fields into a custom PSObject.","",".EXAMPLE","","Get-DomainOU","","Returns the current OUs in the domain.","",".EXAMPLE","","Get-DomainOU *admin* -Domain testlab.local","","Returns all OUs with \"admin\" in their name in the testlab.local domain.","",".EXAMPLE","","Get-DomainOU -GPLink \"F260B76D-55C8-46C5-BEF1-9016DD98E272\"","","Returns all OUs with linked to the specified group policy object.","",".EXAMPLE","","\"*admin*\",\"*server*\" | Get-DomainOU","","Search for OUs with the specific names.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Get-DomainOU -Credential $Cred","",".OUTPUTS","","PowerView.OU","","Custom PSObject with translated OU property fields.","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType('PowerView.OU')]","    [CmdletBinding()]","    Param (","        [Parameter(Position = 0, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('Name')]","        [String[]]","        $Identity,","","        [ValidateNotNullOrEmpty()]","        [String]","        [Alias('GUID')]","        $GPLink,","","        [ValidateNotNullOrEmpty()]","        [String]","        $Domain,","","        [ValidateNotNullOrEmpty()]","        [Alias('Filter')]","        [String]","        $LDAPFilter,","","        [ValidateNotNullOrEmpty()]","        [String[]]","        $Properties,","","        [ValidateNotNullOrEmpty()]","        [Alias('ADSPath')]","        [String]","        $SearchBase,","","        [ValidateNotNullOrEmpty()]","        [Alias('DomainController')]","        [String]","        $Server,","","        [ValidateSet('Base', 'OneLevel', 'Subtree')]","        [String]","        $SearchScope = 'Subtree',","","        [ValidateRange(1, 10000)]","        [Int]","        $ResultPageSize = 200,","","        [ValidateRange(1, 10000)]","        [Int]","        $ServerTimeLimit,","","        [ValidateSet('Dacl', 'Group', 'None', 'Owner', 'Sacl')]","        [String]","        $SecurityMasks,","","        [Switch]","        $Tombstone,","","        [Alias('ReturnOne')]","        [Switch]","        $FindOne,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty,","","        [Switch]","        $Raw","    )","","    BEGIN {","        $SearcherArguments = @{}","        if ($PSBoundParameters['Domain']) { $SearcherArguments['Domain'] = $Domain }","        if ($PSBoundParameters['Properties']) { $SearcherArguments['Properties'] = $Properties }","        if ($PSBoundParameters['SearchBase']) { $SearcherArguments['SearchBase'] = $SearchBase }","        if ($PSBoundParameters['Server']) { $SearcherArguments['Server'] = $Server }","        if ($PSBoundParameters['SearchScope']) { $SearcherArguments['SearchScope'] = $SearchScope }","        if ($PSBoundParameters['ResultPageSize']) { $SearcherArguments['ResultPageSize'] = $ResultPageSize }","        if ($PSBoundParameters['ServerTimeLimit']) { $SearcherArguments['ServerTimeLimit'] = $ServerTimeLimit }","        if ($PSBoundParameters['SecurityMasks']) { $SearcherArguments['SecurityMasks'] = $SecurityMasks }","        if ($PSBoundParameters['Tombstone']) { $SearcherArguments['Tombstone'] = $Tombstone }","        if ($PSBoundParameters['Credential']) { $SearcherArguments['Credential'] = $Credential }","        $OUSearcher = Get-DomainSearcher @SearcherArguments","    }","","    PROCESS {","        if ($OUSearcher) {","            $IdentityFilter = ''","            $Filter = ''","            $Identity | Where-Object {$_} | ForEach-Object {","                $IdentityInstance = $_.Replace('(', '\\28').Replace(')', '\\29')","                if ($IdentityInstance -match '^OU=.*') {","                    $IdentityFilter += \"(distinguishedname=$IdentityInstance)\"","                    if ((-not $PSBoundParameters['Domain']) -and (-not $PSBoundParameters['SearchBase'])) {","                        # if a -Domain isn't explicitly set, extract the object domain out of the distinguishedname","                        #   and rebuild the domain searcher","                        $IdentityDomain = $IdentityInstance.SubString($IdentityInstance.IndexOf('DC=')) -replace 'DC=','' -replace ',','.'","                        Write-Verbose \"[Get-DomainOU] Extracted domain '$IdentityDomain' from '$IdentityInstance'\"","                        $SearcherArguments['Domain'] = $IdentityDomain","                        $OUSearcher = Get-DomainSearcher @SearcherArguments","                        if (-not $OUSearcher) {","                            Write-Warning \"[Get-DomainOU] Unable to retrieve domain searcher for '$IdentityDomain'\"","                        }","                    }","                }","                else {","                    try {","                        $GuidByteString = (-Join (([Guid]$IdentityInstance).ToByteArray() | ForEach-Object {$_.ToString('X').PadLeft(2,'0')})) -Replace '(..)','\\$1'","                        $IdentityFilter += \"(objectguid=$GuidByteString)\"","                    }","                    catch {","                        $IdentityFilter += \"(name=$IdentityInstance)\"","                    }","                }","            }","            if ($IdentityFilter -and ($IdentityFilter.Trim() -ne '') ) {","                $Filter += \"(|$IdentityFilter)\"","            }","","            if ($PSBoundParameters['GPLink']) {","                Write-Verbose \"[Get-DomainOU] Searching for OUs with $GPLink set in the gpLink property\"","                $Filter += \"(gplink=*$GPLink*)\"","            }","","            if ($PSBoundParameters['LDAPFilter']) {","                Write-Verbose \"[Get-DomainOU] Using additional LDAP filter: $LDAPFilter\"","                $Filter += \"$LDAPFilter\"","            }","","            $OUSearcher.filter = \"(\u0026(objectCategory=organizationalUnit)$Filter)\"","            Write-Verbose \"[Get-DomainOU] Get-DomainOU filter string: $($OUSearcher.filter)\"","","            if ($PSBoundParameters['FindOne']) { $Results = $OUSearcher.FindOne() }","            else { $Results = $OUSearcher.FindAll() }","            $Results | Where-Object {$_} | ForEach-Object {","                if ($PSBoundParameters['Raw']) {","                    # return raw result objects","                    $OU = $_","                }","                else {","                    $OU = Convert-LDAPProperty -Properties $_.Properties","                }","                $OU.PSObject.TypeNames.Insert(0, 'PowerView.OU')","                $OU","            }","            if ($Results) {","                try { $Results.dispose() }","                catch {","                    Write-Verbose \"[Get-DomainOU] Error disposing of the Results object: $_\"","                }","            }","            $OUSearcher.dispose()","        }","    }","}","","","function Get-DomainSite {","\u003c#",".SYNOPSIS","","Search for all sites or specific site objects in AD.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: Get-DomainSearcher, Convert-LDAPProperty  ","",".DESCRIPTION","","Builds a directory searcher object using Get-DomainSearcher, builds a custom","LDAP filter based on targeting/filter parameters, and searches for all objects","matching the criteria. To only return specific properties, use","\"-Properties whencreated,usnchanged,...\". By default, all site objects for","the current domain are returned.","",".PARAMETER Identity","","An site name (e.g. Test-Site), DistinguishedName (e.g. CN=Test-Site,CN=Sites,CN=Configuration,DC=testlab,DC=local), or","GUID (e.g. c37726ef-2b64-4524-b85b-6a9700c234dd). Wildcards accepted.","",".PARAMETER GPLink","","Only return sites with the specified GUID in their gplink property.","",".PARAMETER Domain","","Specifies the domain to use for the query, defaults to the current domain.","",".PARAMETER LDAPFilter","","Specifies an LDAP query string that is used to filter Active Directory objects.","",".PARAMETER Properties","","Specifies the properties of the output object to retrieve from the server.","",".PARAMETER SearchBase","","The LDAP source to search through, e.g. \"LDAP://OU=secret,DC=testlab,DC=local\"","Useful for OU queries.","",".PARAMETER Server","","Specifies an Active Directory server (domain controller) to bind to.","",".PARAMETER SearchScope","","Specifies the scope to search under, Base/OneLevel/Subtree (default of Subtree).","",".PARAMETER ResultPageSize","","Specifies the PageSize to set for the LDAP searcher object.","",".PARAMETER ServerTimeLimit","","Specifies the maximum amount of time the server spends searching. Default of 120 seconds.","",".PARAMETER SecurityMasks","","Specifies an option for examining security information of a directory object.","One of 'Dacl', 'Group', 'None', 'Owner', 'Sacl'.","",".PARAMETER Tombstone","","Switch. Specifies that the searcher should also return deleted/tombstoned objects.","",".PARAMETER FindOne","","Only return one result object.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target domain.","",".PARAMETER Raw","","Switch. Return raw results instead of translating the fields into a custom PSObject.","",".EXAMPLE","","Get-DomainSite","","Returns the current sites in the domain.","",".EXAMPLE","","Get-DomainSite *admin* -Domain testlab.local","","Returns all sites with \"admin\" in their name in the testlab.local domain.","",".EXAMPLE","","Get-DomainSite -GPLink \"F260B76D-55C8-46C5-BEF1-9016DD98E272\"","","Returns all sites with linked to the specified group policy object.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Get-DomainSite -Credential $Cred","",".OUTPUTS","","PowerView.Site","","Custom PSObject with translated site property fields.","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType('PowerView.Site')]","    [CmdletBinding()]","    Param (","        [Parameter(Position = 0, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('Name')]","        [String[]]","        $Identity,","","        [ValidateNotNullOrEmpty()]","        [String]","        [Alias('GUID')]","        $GPLink,","","        [ValidateNotNullOrEmpty()]","        [String]","        $Domain,","","        [ValidateNotNullOrEmpty()]","        [Alias('Filter')]","        [String]","        $LDAPFilter,","","        [ValidateNotNullOrEmpty()]","        [String[]]","        $Properties,","","        [ValidateNotNullOrEmpty()]","        [Alias('ADSPath')]","        [String]","        $SearchBase,","","        [ValidateNotNullOrEmpty()]","        [Alias('DomainController')]","        [String]","        $Server,","","        [ValidateSet('Base', 'OneLevel', 'Subtree')]","        [String]","        $SearchScope = 'Subtree',","","        [ValidateRange(1, 10000)]","        [Int]","        $ResultPageSize = 200,","","        [ValidateRange(1, 10000)]","        [Int]","        $ServerTimeLimit,","","        [ValidateSet('Dacl', 'Group', 'None', 'Owner', 'Sacl')]","        [String]","        $SecurityMasks,","","        [Switch]","        $Tombstone,","","        [Alias('ReturnOne')]","        [Switch]","        $FindOne,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty,","","        [Switch]","        $Raw","    )","","    BEGIN {","        $SearcherArguments = @{","            'SearchBasePrefix' = 'CN=Sites,CN=Configuration'","        }","        if ($PSBoundParameters['Domain']) { $SearcherArguments['Domain'] = $Domain }","        if ($PSBoundParameters['Properties']) { $SearcherArguments['Properties'] = $Properties }","        if ($PSBoundParameters['SearchBase']) { $SearcherArguments['SearchBase'] = $SearchBase }","        if ($PSBoundParameters['Server']) { $SearcherArguments['Server'] = $Server }","        if ($PSBoundParameters['SearchScope']) { $SearcherArguments['SearchScope'] = $SearchScope }","        if ($PSBoundParameters['ResultPageSize']) { $SearcherArguments['ResultPageSize'] = $ResultPageSize }","        if ($PSBoundParameters['ServerTimeLimit']) { $SearcherArguments['ServerTimeLimit'] = $ServerTimeLimit }","        if ($PSBoundParameters['SecurityMasks']) { $SearcherArguments['SecurityMasks'] = $SecurityMasks }","        if ($PSBoundParameters['Tombstone']) { $SearcherArguments['Tombstone'] = $Tombstone }","        if ($PSBoundParameters['Credential']) { $SearcherArguments['Credential'] = $Credential }","        $SiteSearcher = Get-DomainSearcher @SearcherArguments","    }","","    PROCESS {","        if ($SiteSearcher) {","            $IdentityFilter = ''","            $Filter = ''","            $Identity | Where-Object {$_} | ForEach-Object {","                $IdentityInstance = $_.Replace('(', '\\28').Replace(')', '\\29')","                if ($IdentityInstance -match '^CN=.*') {","                    $IdentityFilter += \"(distinguishedname=$IdentityInstance)\"","                    if ((-not $PSBoundParameters['Domain']) -and (-not $PSBoundParameters['SearchBase'])) {","                        # if a -Domain isn't explicitly set, extract the object domain out of the distinguishedname","                        #   and rebuild the domain searcher","                        $IdentityDomain = $IdentityInstance.SubString($IdentityInstance.IndexOf('DC=')) -replace 'DC=','' -replace ',','.'","                        Write-Verbose \"[Get-DomainSite] Extracted domain '$IdentityDomain' from '$IdentityInstance'\"","                        $SearcherArguments['Domain'] = $IdentityDomain","                        $SiteSearcher = Get-DomainSearcher @SearcherArguments","                        if (-not $SiteSearcher) {","                            Write-Warning \"[Get-DomainSite] Unable to retrieve domain searcher for '$IdentityDomain'\"","                        }","                    }","                }","                else {","                    try {","                        $GuidByteString = (-Join (([Guid]$IdentityInstance).ToByteArray() | ForEach-Object {$_.ToString('X').PadLeft(2,'0')})) -Replace '(..)','\\$1'","                        $IdentityFilter += \"(objectguid=$GuidByteString)\"","                    }","                    catch {","                        $IdentityFilter += \"(name=$IdentityInstance)\"","                    }","                }","            }","            if ($IdentityFilter -and ($IdentityFilter.Trim() -ne '') ) {","                $Filter += \"(|$IdentityFilter)\"","            }","","            if ($PSBoundParameters['GPLink']) {","                Write-Verbose \"[Get-DomainSite] Searching for sites with $GPLink set in the gpLink property\"","                $Filter += \"(gplink=*$GPLink*)\"","            }","","            if ($PSBoundParameters['LDAPFilter']) {","                Write-Verbose \"[Get-DomainSite] Using additional LDAP filter: $LDAPFilter\"","                $Filter += \"$LDAPFilter\"","            }","","            $SiteSearcher.filter = \"(\u0026(objectCategory=site)$Filter)\"","            Write-Verbose \"[Get-DomainSite] Get-DomainSite fil