operties']) { $SearcherArguments['Properties'] = $Properties }","        if ($PSBoundParameters['SearchBase']) { $SearcherArguments['SearchBase'] = $SearchBase }","        if ($PSBoundParameters['Server']) { $SearcherArguments['Server'] = $Server }","        if ($PSBoundParameters['SearchScope']) { $SearcherArguments['SearchScope'] = $SearchScope }","        if ($PSBoundParameters['ResultPageSize']) { $SearcherArguments['ResultPageSize'] = $ResultPageSize }","        if ($PSBoundParameters['ServerTimeLimit']) { $SearcherArguments['ServerTimeLimit'] = $ServerTimeLimit }","        if ($PSBoundParameters['SecurityMasks']) { $SearcherArguments['SecurityMasks'] = $SecurityMasks }","        if ($PSBoundParameters['Tombstone']) { $SearcherArguments['Tombstone'] = $Tombstone }","        if ($PSBoundParameters['Credential']) { $SearcherArguments['Credential'] = $Credential }","        $SubnetSearcher = Get-DomainSearcher @SearcherArguments","    }","","    PROCESS {","        if ($SubnetSearcher) {","            $IdentityFilter = ''","            $Filter = ''","            $Identity | Where-Object {$_} | ForEach-Object {","                $IdentityInstance = $_.Replace('(', '\\28').Replace(')', '\\29')","                if ($IdentityInstance -match '^CN=.*') {","                    $IdentityFilter += \"(distinguishedname=$IdentityInstance)\"","                    if ((-not $PSBoundParameters['Domain']) -and (-not $PSBoundParameters['SearchBase'])) {","                        # if a -Domain isn't explicitly set, extract the object domain out of the distinguishedname","                        #   and rebuild the domain searcher","                        $IdentityDomain = $IdentityInstance.SubString($IdentityInstance.IndexOf('DC=')) -replace 'DC=','' -replace ',','.'","                        Write-Verbose \"[Get-DomainSubnet] Extracted domain '$IdentityDomain' from '$IdentityInstance'\"","                        $SearcherArguments['Domain'] = $IdentityDomain","                        $SubnetSearcher = Get-DomainSearcher @SearcherArguments","                        if (-not $SubnetSearcher) {","                            Write-Warning \"[Get-DomainSubnet] Unable to retrieve domain searcher for '$IdentityDomain'\"","                        }","                    }","                }","                else {","                    try {","                        $GuidByteString = (-Join (([Guid]$IdentityInstance).ToByteArray() | ForEach-Object {$_.ToString('X').PadLeft(2,'0')})) -Replace '(..)','\\$1'","                        $IdentityFilter += \"(objectguid=$GuidByteString)\"","                    }","                    catch {","                        $IdentityFilter += \"(name=$IdentityInstance)\"","                    }","                }","            }","            if ($IdentityFilter -and ($IdentityFilter.Trim() -ne '') ) {","                $Filter += \"(|$IdentityFilter)\"","            }","","            if ($PSBoundParameters['LDAPFilter']) {","                Write-Verbose \"[Get-DomainSubnet] Using additional LDAP filter: $LDAPFilter\"","                $Filter += \"$LDAPFilter\"","            }","","            $SubnetSearcher.filter = \"(\u0026(objectCategory=subnet)$Filter)\"","            Write-Verbose \"[Get-DomainSubnet] Get-DomainSubnet filter string: $($SubnetSearcher.filter)\"","","            if ($PSBoundParameters['FindOne']) { $Results = $SubnetSearcher.FindOne() }","            else { $Results = $SubnetSearcher.FindAll() }","            $Results | Where-Object {$_} | ForEach-Object {","                if ($PSBoundParameters['Raw']) {","                    # return raw result objects","                    $Subnet = $_","                }","                else {","                    $Subnet = Convert-LDAPProperty -Properties $_.Properties","                }","                $Subnet.PSObject.TypeNames.Insert(0, 'PowerView.Subnet')","","                if ($PSBoundParameters['SiteName']) {","                