tch]","        $Raw","    )","","    BEGIN {","        $SearcherArguments = @{}","        if ($PSBoundParameters['Domain']) { $SearcherArguments['Domain'] = $Domain }","        if ($PSBoundParameters['Properties']) { $SearcherArguments['Properties'] = $Properties }","        if ($PSBoundParameters['SearchBase']) { $SearcherArguments['SearchBase'] = $SearchBase }","        if ($PSBoundParameters['Server']) { $SearcherArguments['Server'] = $Server }","        if ($PSBoundParameters['SearchScope']) { $SearcherArguments['SearchScope'] = $SearchScope }","        if ($PSBoundParameters['ResultPageSize']) { $SearcherArguments['ResultPageSize'] = $ResultPageSize }","        if ($PSBoundParameters['ServerTimeLimit']) { $SearcherArguments['ServerTimeLimit'] = $ServerTimeLimit }","        if ($PSBoundParameters['SecurityMasks']) { $SearcherArguments['SecurityMasks'] = $SecurityMasks }","        if ($PSBoundParameters['Tombstone']) { $SearcherArguments['Tombstone'] = $Tombstone }","        if ($PSBoundParameters['Credential']) { $SearcherArguments['Credential'] = $Credential }","        $GroupSearcher = Get-DomainSearcher @SearcherArguments","    }","","    PROCESS {","        if ($GroupSearcher) {","            if ($PSBoundParameters['MemberIdentity']) {","","                if ($SearcherArguments['Properties']) {","                    $OldProperties = $SearcherArguments['Properties']","                }","","                $SearcherArguments['Identity'] = $MemberIdentity","                $SearcherArguments['Raw'] = $True","","                Get-DomainObject @SearcherArguments | ForEach-Object {","                    # convert the user/group to a directory entry","                    $ObjectDirectoryEntry = $_.GetDirectoryEntry()","","                    # cause the cache to calculate the token groups for the user/group","                    $ObjectDirectoryEntry.RefreshCache('tokenGroups')","","                    $ObjectDirectoryEntry.TokenGroups | ForEach-Object {","                        # convert the token group sid","                        $GroupSid = (New-Object System.Security.Principal.SecurityIdentifier($_,0)).Value","","                        # ignore the built in groups","                        if ($GroupSid -notmatch '^S-1-5-32-.*') {","                            $SearcherArguments['Identity'] = $GroupSid","                            $SearcherArguments['Raw'] = $False","                            if ($OldProperties) { $SearcherArguments['Properties'] = $OldProperties }","                            $Group = Get-DomainObject @SearcherArguments","                            if ($Group) {","                                $Group.PSObject.TypeNames.Insert(0, 'PowerView.Group')","                                $Group","                            }","                        }","                    }","                }","            }","            else {","                $IdentityFilter = ''","                $Filter = ''","                $Identity | Where-Object {$_} | ForEach-Object {","                    $IdentityInstance = $_.Replace('(', '\\28').Replace(')', '\\29')","                    if ($IdentityInstance -match '^S-1-') {","                        $IdentityFilter += \"(objectsid=$IdentityInstance)\"","                    }","                    elseif ($IdentityInstance -match '^CN=') {","                        $IdentityFilter += \"(distinguishedname=$IdentityInstance)\"","                        if ((-not $PSBoundParameters['Domain']) -and (-not $PSBoundParameters['SearchBase'])) {","                            # if a -Domain isn't explicitly set, extract the object domain out of the distinguishedname","                            #   and rebuild the domain searcher","                            $IdentityDomain = $IdentityInstance.SubString($IdentityInstance.IndexOf('DC=')) -replace 'DC=','' -replace ',','.'","                            Write-Verbose \"[Get-DomainGroup] Extracted domain '$IdentityDomain' from '$IdentityInstance'\"","                            $SearcherArguments['Domain'] = $IdentityDomain","                            $GroupSearcher = Get-DomainSearcher @SearcherArguments","                            if (-not $GroupSearcher) {","                                Write-Warning \"[Get-DomainGroup] Unable to retrieve domain searcher for '$IdentityDomain'\"","                            }","                        }","                    }","                    elseif ($IdentityInstance -imatch '^[0-9A-F]{8}-([0-9A-F]{4}-){3}[0-9A-F]{12}$') {","                        $GuidByteString = (([Guid]$IdentityInstance).ToByteArray() | ForEach-Object { '\\' + $_.ToString('X2') }) -join ''","                        $IdentityFilter += \"(objectguid=$GuidByteString)\"","                    }","                    elseif ($IdentityInstance.Contains('\\')) {","                        $ConvertedIdentityInstance = $IdentityInstance.Replace('\\28', '(').Replace('\\29', ')') | Convert-ADName -OutputType Canonical","                        if ($ConvertedIdentityInstance) {","                            $GroupDomain = $ConvertedIdentityInstance.SubString(0, $ConvertedIdentityInstance.IndexOf('/'))","                            $GroupName = $IdentityInstance.Split('\\')[1]","                            $IdentityFilter += \"(samAccountName=$GroupName)\"","                            $SearcherArguments['Domain'] = $GroupDomain","                            Write-Verbose \"[Get-DomainGroup] Extracted domain '$GroupDomain' from '$IdentityInstance'\"","                            $GroupSearcher = Get-DomainSearcher @SearcherArguments","                        }","                    }","                    else {","                        $IdentityFilter += \"(|(samAccountName=$IdentityInstance)(name=$IdentityInstance))\"","                    }","                }","","                if ($IdentityFilter -and ($IdentityFilter.Trim() -ne '') ) {","                    $Filter += \"(|$IdentityFilter)\"","                }","","                if ($PSBoundParameters['AdminCount']) {","                    Write-Verbose '[Get-DomainGroup] Searching for adminCount=1'","                    $Filter += '(admincount=1)'","                }","                if ($PSBoundParameters['GroupScope']) {","                    $GroupScopeValue = $PSBoundParameters['GroupScope']","                    $Filter = Switch ($GroupScopeValue) {","                        'DomainLocal'       { '(groupType:1.2.840.113556.1.4.803:=4)' }","                        'NotDomainLocal'    { '(!(groupType:1.2.840.113556.1.4.803:=4))' }","                        'Global'            { '(groupType:1.2.840.113556.1.4.803:=2)' }","                        'NotGlobal'         { '(!(groupType:1.2.840.113556.1.4.803:=2))' }","                        'Universal'         { '(groupType:1.2.840.113556.1.4.803:=8)' }","                        'NotUniversal'      { '(!(groupType:1.2.840.113556.1.4.803:=8))' }","                    }","                    Write-Verbose \"[Get-DomainGroup] Searching for group scope '$GroupScopeValue'\"","                }","                if ($PSBoundParameters['GroupProperty']) {","                    $GroupPropertyValue = $PSBoundParameters['GroupProperty']","                    $Filter = Switch ($GroupPropertyValue) {","                        'Security'              { '(groupType:1.2.840.113556.1.4.803:=2147483648)' }","                        'Distribution'          { '(!(groupType:1.2.840.113556.1.4.803:=2147483648))' }","                        'CreatedBySystem'       { '(groupType:1.2.840.113556.1.4.803:=1)' }","                        'NotCreatedBySystem'    { '(!(groupType:1.2.840.113556.1.4.803:=1))' }","                    }","                    Write-Verbose \"[Get-DomainGroup] Searching for group property '$GroupPropertyValue'\"","                }","                if ($PSBoundParameters['LDAPFilter']) {","                    Write-Verbose \"[Get-DomainGroup] Using additional LDAP filter: $LDAPFilter\"","                    $Filter += \"$LDAPFilter\"","                }","","                $GroupSearcher.filter = \"(\u0026(objectCategory=group)$Filter)\"","                Write-Verbose \"[Get-DomainGroup] filter string: $($GroupSearcher.filter)\"","","                if ($PSBoundParameters['FindOne']) { $Results = $GroupSearcher.FindOne() }","                else { $Results = $GroupSearcher.FindAll() }","                $Results | Where-Object {$_} | ForEach-Object {","                    if ($PSBoundParameters['Raw']) {","                        # return raw result objects","                        $Group = $_","                    }","                    else {","                        $Group = Convert-LDAPProperty -Properties $_.Properties","                    }","                    $Group.PSObject.TypeNames.Insert(0, 'PowerView.Group')","                    $Group","                }","                if ($Results) {","                    try { $Results.dispose() }","                    catch {","                        Write-Verbose \"[Get-DomainGroup] Error disposing of the Results object\"","                    }","                }","                $GroupSearcher.dispose()","            }","        }","    }","}","","","function New-DomainGroup {","\u003c#",".SYNOPSIS","","Creates a new domain group (assuming appropriate permissions) and returns the group object.","","TODO: implement all properties that New-ADGroup implements (https://technet.microsoft.com/en-us/library/ee617253.aspx).","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: Get-PrincipalContext  ","",".DESCRIPTION","","First binds to the specified domain context using Get-PrincipalContext.","The bound domain context is then used to create a new","DirectoryServices.AccountManagement.GroupPrincipal with the specified","group properties.","",".PARAMETER SamAccountName","","Specifies the Security Account Manager (SAM) account name of the group to create.","Maximum of 256 characters. Mandatory.","",".PARAMETER Name","","Specifies the name of the group to create. If not provided, defaults to SamAccountName.","",".PARAMETER DisplayName","","Specifies the display name of the group to create. If not provided, defaults to SamAccountName.","",".PARAMETER Description","","Specifies the description of the group to create.","",".PARAMETER Domain","","Specifies the domain to use to search for user/group principals, defaults to the current domain.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target domain.","",".EXAMPLE","","New-DomainGroup -SamAccountName TestGroup -Description 'This is a test group.'","","Creates the 'TestGroup' group with the specified description.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","New-DomainGroup -SamAccountName TestGroup -Description 'This is a test group.' -Credential $Cred","","Creates the 'TestGroup' group with the specified description using the specified alternate credentials.","",".OUTPUTS","","DirectoryServices.AccountManagement.GroupPrincipal","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSUseShouldProcessForStateChangingFunctions', '')]","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType('DirectoryServices.AccountManagement.GroupPrincipal')]","    Param(","        [Parameter(Mandatory = $True)]","        [ValidateLength(0, 256)]","        [String]","        $SamAccountName,","","        [ValidateNotNullOrEmpty()]","        [String]","        $Name,","","        [ValidateNotNullOrEmpty()]","        [String]","        $DisplayName,","","        [ValidateNotNullOrEmpty()]","        [String]","        $Description,","","        [ValidateNotNullOrEmpty()]","        [String]","        $Domain,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    $ContextArguments = @{","        'Identity' = $SamAccountName","    }","    if ($PSBoundParameters['Domain']) { $ContextArguments['Domain'] = $Domain }","    if ($PSBoundParameters['Credential']) { $ContextArguments['Credential'] = $Credential }","    $Context = Get-PrincipalContext @ContextArguments","","    if ($Context) {","        $Group = New-Object -TypeName System.DirectoryServices.AccountManagement.GroupPrincipal -ArgumentList ($Context.Context)","","        # set all the appropriate group parameters","        $Group.SamAccountName = $Context.Identity","","        if ($PSBoundParameters['Name']) {","            $Group.Name = $Name","        }","        else {","            $Group.Name = $Context.Identity","        }","        if ($PSBoundParameters['DisplayName']) {","            $Group.DisplayName = $DisplayName","        }","        else {","            $Group.DisplayName = $Context.Identity","        }","","        if ($PSBoundParameters['Description']) {","            $Group.Description = $Description","        }","","        Write-Verbose \"[New-DomainGroup] Attempting to create group '$SamAccountName'\"","        try {","            $Null = $Group.Save()","            Write-Verbose \"[New-DomainGroup] Group '$SamAccountName' successfully created\"","            $Group","        }","        catch {","            Write-Warning \"[New-DomainGroup] Error creating group '$SamAccountName' : $_\"","        }","    }","}","","","function Get-DomainManagedSecurityGroup {","\u003c#",".SYNOPSIS","","Returns all security groups in the current (or target) domain that have a manager set.","","Author: Stuart Morgan (@ukstufus) \u003cstuart.morgan@mwrinfosecurity.com\u003e, Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: Get-DomainObject, Get-DomainGroup, Get-DomainObjectAcl  ","",".DESCRIPTION","","Authority to manipulate the group membership of AD security groups and distribution groups","can be delegated to non-administrators by setting the 'managedBy' attribute. This is typically","used to delegate management authority to distribution groups, but Windows supports security groups","being managed in the same way.","","This function searches for AD groups which have a group manager set, and determines whether that","user can manipulate group membership. This could be a useful method of horizontal privilege","escalation, especially if the manager can manipulate the membership of a privileged group.","",".PARAMETER Domain","","Specifies the domain to use for the query, defaults to the current domain.","",".PARAMETER SearchBase","","The LDAP source to search through, e.g. \"LDAP://OU=secret,DC=testlab,DC=local\"","Useful for OU queries.","",".PARAMETER Server","","Specifies an Active Directory server (domain controller) to bind to.","",".PARAMETER SearchScope","","Specifies the scope to search under, Base/OneLevel/Subtree (default of Subtree).","",".PARAMETER ResultPageSize","","Specifies the PageSize to set for the LDAP searcher object.","",".PARAMETER ServerTimeLimit","","Specifies the maximum amount of time the server spends searching. Default of 120 seconds.","",".PARAMETER Tombstone","","Switch. Specifies that the searcher should also return deleted/tombstoned objects.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target domain.","",".EXAMPLE","","Get-DomainManagedSecurityGroup | Export-PowerViewCSV -NoTypeInformation group-managers.csv","","Store a list of all security groups with managers in group-managers.csv","",".OUTPUTS","","PowerView.ManagedSecurityGroup","","A custom PSObject describing the managed security group.","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType('PowerView.ManagedSecurityGroup')]","    [CmdletBinding()]","    Param(","        [Parameter(Position = 0, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('Name')]","        [ValidateNotNullOrEmpty()]","        [String]","        $Domain,","","        [ValidateNotNullOrEmpty()]","        [Alias('ADSPath')]","        [String]","        $SearchBase,","","        [ValidateNotNullOrEmpty()]","        [Alias('DomainController')]","        [String]","        $Server,","","        [ValidateSet('Base', 'OneLevel', 'Subtree')]","        [String]","        $SearchScope = 'Subtree',","","        [ValidateRange(1, 10000)]","        [Int]","        $ResultPageSize = 200,","","        [ValidateRange(1, 10000)]","        [Int]","        $ServerTimeLimit,","","        [Switch]","        $Tombstone,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    BEGIN {","        $SearcherArguments = @{","            'LDAPFilter' = '(\u0026(managedBy=*)(groupType:1.2.840.113556.1.4.803:=2147483648))'","            'Properties' = 'distinguishedName,managedBy,samaccounttype,samaccountname'","        }","        if ($PSBoundParameters['SearchBase']) { $SearcherArguments['SearchBase'] = $SearchBase }","        if ($PSBoundParameters['Server']) { $SearcherArguments['Server'] = $Server }","        if ($PSBoundParameters['SearchScope']) { $SearcherArguments['SearchScope'] = $SearchScope }","        if ($PSBoundParameters['ResultPageSize']) { $SearcherArguments['ResultPageSize'] = $ResultPageSize }","        if ($PSBoundParameters['ServerTimeLimit']) { $SearcherArguments['ServerTimeLimit'] = $ServerTimeLimit }","        if ($PSBoundParameters['SecurityMasks']) { $SearcherArguments['SecurityMasks'] = $SecurityMasks }","        if ($PSBoundParameters['Tombstone']) { $SearcherArguments['Tombstone'] = $Tombstone }","        if ($PSBoundParameters['Credential']) { $SearcherArguments['Credential'] = $Credential }","    }","","    PROCESS {","        if ($PSBoundParameters['Domain']) {","            $SearcherArguments['Domain'] = $Domain","            $TargetDomain = $Domain","        }","        else {","            $TargetDomain = $Env:USERDNSDOMAIN","        }","","        # go through the list of security groups on the domain and identify those who have a manager","        Get-DomainGroup @SearcherArguments | ForEach-Object {","            $SearcherArguments['Properties'] = 'distinguishedname,name,samaccounttype,samaccountname,objectsid'","            $SearcherArguments['Identity'] = $_.managedBy","            $Null = $SearcherArguments.Remove('LDAPFilter')","","            # $SearcherArguments","            # retrieve the object that the managedBy DN refers to","            $GroupManager = Get-DomainObject @SearcherArguments","            # Write-Host \"GroupManager: $GroupManager\"","            $ManagedGroup = New-Object PSObject","            $ManagedGroup | Add-Member Noteproperty 'GroupName' $_.samaccountname","            $ManagedGroup | Add-Member Noteproperty 'GroupDistinguishedName' $_.distinguishedname","            $ManagedGroup | Add-Member Noteproperty 'ManagerName' $GroupManager.samaccountname","            $ManagedGroup | Add-Member Noteproperty 'ManagerDistinguishedName' $GroupManager.distinguishedName","","            # determine whether the manager is a user or a group","            if ($GroupManager.samaccounttype -eq 0x10000000) {","                $ManagedGroup | Add-Member Noteproperty 'ManagerType' 'Group'","            }","            elseif ($GroupManager.samaccounttype -eq 0x30000000) {","                $ManagedGroup | Add-Member Noteproperty 'ManagerType' 'User'","            }","","            $ACLArguments = @{","                'Identity' = $_.distinguishedname","                'RightsFilter' = 'WriteMembers'","            }","            if ($PSBoundParameters['Server']) { $ACLArguments['Server'] = $Server }","            if ($PSBoundParameters['SearchScope']) { $ACLArguments['SearchScope'] = $SearchScope }","            if ($PSBoundParameters['ResultPageSize']) { $ACLArguments['ResultPageSize'] = $ResultPageSize }","            if ($PSBoundParameters['ServerTimeLimit']) { $ACLArguments['ServerTimeLimit'] = $ServerTimeLimit }","            if ($PSBoundParameters['Tombstone']) { $ACLArguments['Tombstone'] = $Tombstone }","            if ($PSBoundParameters['Credential']) { $ACLArguments['Credential'] = $Credential }","","            # # TODO: correct!","            # # find the ACLs that relate to the ability to write to the group","            # $xacl = Get-DomainObjectAcl @ACLArguments -Verbose","            # # $ACLArguments","            # # double-check that the manager","            # if ($xacl.ObjectType -eq 'bf9679c0-0de6-11d0-a285-00aa003049e2' -and $xacl.AceType -eq 'AccessAllowed' -and ($xacl.ObjectSid -eq $GroupManager.objectsid)) {","            #     $ManagedGroup | Add-Member Noteproperty 'ManagerCanWrite' $True","            # }","            # else {","            #     $ManagedGroup | Add-Member Noteproperty 'ManagerCanWrite' $False","            # }","","            $ManagedGroup | Add-Member Noteproperty 'ManagerCanWrite' 'UNKNOWN'","","            $ManagedGroup.PSObject.TypeNames.Insert(0, 'PowerView.ManagedSecurityGroup')","            $ManagedGroup","        }","    }","}","","","function Get-DomainGroupMember {","\u003c#",".SYNOPSIS","","Return the members of a specific domain group.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: Get-DomainSearcher, Get-DomainGroup, Get-DomainGroupMember, Convert-ADName, Get-DomainObject, ConvertFrom-SID  ","",".DESCRIPTION","","Builds a directory searcher object using Get-DomainSearcher, builds a custom","LDAP filter based on targeting/filter parameters, and searches for the specified","group matching the criteria. Each result is then rebound and the full user","or group object is returned.","",".PARAMETER Identity","","A SamAccountName (e.g. Group1), DistinguishedName (e.g. CN=group1,CN=Users,DC=testlab,DC=local),","SID (e.g. S-1-5-21-890171859-3433809279-3366196753-1114), or GUID (e.g. 4c435dd7-dc58-4b14-9a5e-1fdb0e80d202)","specifying the group to query for. Wildcards accepted.","",".PARAMETER Domain","","Specifies the domain to use for the query, defaults to the current domain.","",".PARAMETER Recurse","","Switch. If the group member is a group, recursively try to query its members as well.","",".PARAMETER RecurseUsingMatchingRule","","Switch. Use LDAP_MATCHING_RULE_IN_CHAIN in the LDAP search query to recurse.","Much faster than manual recursion, but doesn't reveal cross-domain groups,","and only returns user accounts (no nested group objects themselves).","",".PARAMETER LDAPFilter","","Specifies an LDAP query string that is used to filter Active Directory objects.","",".PARAMETER SearchBase","","The LDAP source to search through, e.g. \"LDAP://OU=secret,DC=testlab,DC=local\"","Useful for OU queries.","",".PARAMETER Server","","Specifies an Active Directory server (domain controller) to bind to.","",".PARAMETER SearchScope","","Specifies the scope to search under, Base/OneLevel/Subtree (default of Subtree).","",".PARAMETER ResultPageSize","","Specifies the PageSize to set for the LDAP searcher object.","",".PARAMETER ServerTimeLimit","","Specifies the maximum amount of time the server spends searching. Default of 120 seconds.","",".PARAMETER SecurityMasks","","Specifies an option for examining security information of a directory object.","One of 'Dacl', 'Group', 'None', 'Owner', 'Sacl'.","",".PARAMETER Tombstone","","Switch. Specifies that the searcher should also return deleted/tombstoned objects.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target domain.","",".EXAMPLE","","Get-DomainGroupMember \"Desktop Admins\"","","GroupDomain             : testlab.local","GroupName               : Desktop Admins","GroupDistinguishedName  : CN=Desktop Admins,CN=Users,DC=testlab,DC=local","MemberDomain            : testlab.local","MemberName              : Testing Group","MemberDistinguishedName : CN=Testing Group,CN=Users,DC=testlab,DC=local","MemberObjectClass       : group","MemberSID               : S-1-5-21-890171859-3433809279-3366196753-1129","","GroupDomain             : testlab.local","GroupName               : Desktop Admins","GroupDistinguishedName  : CN=Desktop Admins,CN=Users,DC=testlab,DC=local","MemberDomain            : testlab.local","MemberName              : arobbins.a","MemberDistinguishedName : CN=Andy Robbins (admin),CN=Users,DC=testlab,DC=local","MemberObjectClass       : user","MemberSID               : S-1-5-21-890171859-3433809279-3366196753-1112","",".EXAMPLE","","'Desktop Admins' | Get-DomainGroupMember -Recurse","","GroupDomain             : testlab.local","GroupName               : Desktop Admins","GroupDistinguishedName  : CN=Desktop Admins,CN=Users,DC=testlab,DC=local","MemberDomain            : testlab.local","MemberName              : Testing Group","MemberDistinguishedName : CN=Testing Group,CN=Users,DC=testlab,DC=local","MemberObjectClass       : group","MemberSID               : S-1-5-21-890171859-3433809279-3366196753-1129","","GroupDomain             : testlab.local","GroupName               : Testing Group","GroupDistinguishedName  : CN=Testing Group,CN=Users,DC=testlab,DC=local","MemberDomain            : testlab.local","MemberName              : harmj0y","MemberDistinguishedName : CN=harmj0y,CN=Users,DC=testlab,DC=local","MemberObjectClass       : user","MemberSID               : S-1-5-21-890171859-3433809279-3366196753-1108","","GroupDomain             : testlab.local","GroupName               : Desktop Admins","GroupDistinguishedName  : CN=Desktop Admins,CN=Users,DC=testlab,DC=local","MemberDomain            : testlab.local","MemberName              : arobbins.a","MemberDistinguishedName : CN=Andy Robbins (admin),CN=Users,DC=testlab,DC=local","MemberObjectClass       : user","MemberSID               : S-1-5-21-890171859-3433809279-3366196753-1112","",".EXAMPLE","","Get-DomainGroupMember -Domain testlab.local -Identity 'Desktop Admins' -RecurseUingMatchingRule","","GroupDomain             : testlab.local","GroupName               : Desktop Admins","GroupDistinguishedName  : CN=Desktop Admins,CN=Users,DC=testlab,DC=local","MemberDomain            : testlab.local","MemberName              : harmj0y","MemberDistinguishedName : CN=harmj0y,CN=Users,DC=testlab,DC=local","MemberObjectClass       : user","MemberSID               : S-1-5-21-890171859-3433809279-3366196753-1108","","GroupDomain             : testlab.local","GroupName               : Desktop Admins","GroupDistinguishedName  : CN=Desktop Admins,CN=Users,DC=testlab,DC=local","MemberDomain            : testlab.local","MemberName              : arobbins.a","MemberDistinguishedName : CN=Andy Robbins (admin),CN=Users,DC=testlab,DC=local","MemberObjectClass       : user","MemberSID               : S-1-5-21-890171859-3433809279-3366196753-1112","",".EXAMPLE","","Get-DomainGroup *admin* -Properties samaccountname | Get-DomainGroupMember","",".EXAMPLE","","'CN=Enterprise Admins,CN=Users,DC=testlab,DC=local', 'Domain Admins' | Get-DomainGroupMember","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Get-DomainGroupMember -Credential $Cred -Identity 'Domain Admins'","",".EXAMPLE","","Get-Domain | Select-Object -Expand name","testlab.local","","'dev\\domain admins' | Get-DomainGroupMember -Verbose","VERBOSE: [Get-DomainSearcher] search string: LDAP://PRIMARY.testlab.local/DC=testlab,DC=local","VERBOSE: [Get-DomainGroupMember] Extracted domain 'd