agnostics.CodeAnalysis.SuppressMessageAttribute('PSUseDeclaredVarsMoreThanAssignments', '')]","    [OutputType('PowerView.GroupMember')]","    [CmdletBinding(DefaultParameterSetName = 'None')]","    Param(","        [Parameter(Position = 0, Mandatory = $True, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('DistinguishedName', 'SamAccountName', 'Name', 'MemberDistinguishedName', 'MemberName')]","        [String[]]","        $Identity,","","        [ValidateNotNullOrEmpty()]","        [String]","        $Domain,","","        [Parameter(ParameterSetName = 'ManualRecurse')]","        [Switch]","        $Recurse,","","        [Parameter(ParameterSetName = 'RecurseUsingMatchingRule')]","        [Switch]","        $RecurseUsingMatchingRule,","","        [ValidateNotNullOrEmpty()]","        [Alias('Filter')]","        [String]","        $LDAPFilter,","","        [ValidateNotNullOrEmpty()]","        [Alias('ADSPath')]","        [String]","        $SearchBase,","","        [ValidateNotNullOrEmpty()]","        [Alias('DomainController')]","        [String]","        $Server,","","        [ValidateSet('Base', 'OneLevel', 'Subtree')]","        [String]","        $SearchScope = 'Subtree',","","        [ValidateRange(1, 10000)]","        [Int]","        $ResultPageSize = 200,","","        [ValidateRange(1, 10000)]","        [Int]","        $ServerTimeLimit,","","        [ValidateSet('Dacl', 'Group', 'None', 'Owner', 'Sacl')]","        [String]","        $SecurityMasks,","","        [Switch]","        $Tombstone,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    BEGIN {","        $SearcherArguments = @{","            'Properties' = 'member,samaccountname,distinguishedname'","        }","        if ($PSBoundParameters['Domain']) { $SearcherArguments['Domain'] = $Domain }","        if ($PSBoundParameters['LDAPFilter']) { $SearcherArguments['LDAPFilter'] = $LDAPFilter }","        if ($PSBoundParameters['SearchBase']) { $SearcherArguments['SearchBase'] = $SearchBase }","        if ($PSBoundParameters['Server']) { $SearcherArguments['Server'] = $Server }","        if ($PSBoundParameters['SearchScope']) { $SearcherArguments['SearchScope'] = $SearchScope }","        if ($PSBoundParameters['ResultPageSize']) { $SearcherArguments['ResultPageSize'] = $ResultPageSize }","        if ($PSBoundParameters['ServerTimeLimit']) { $SearcherArguments['ServerTimeLimit'] = $ServerTimeLimit }","        if ($PSBoundParameters['Tombstone']) { $SearcherArguments['Tombstone'] = $Tombstone }","        if ($PSBoundParameters['Credential']) { $SearcherArguments['Credential'] = $Credential }","","        $ADNameArguments = @{}","        if ($PSBoundParameters['Domain']) { $ADNameArguments['Domain'] = $Domain }","        if ($PSBoundParameters['Server']) { $ADNameArguments['Server'] = $Server }","        if ($PSBoundParameters['Credential']) { $ADNameArguments['Credential'] = $Credential }","    }","","    PROCESS {","        $GroupSearcher = Get-DomainSearcher @SearcherArguments","        if ($GroupSearcher) {","            if ($PSBoundParameters['RecurseUsingMatchingRule']) {","                $SearcherArguments['Identity'] = $Identity","                $SearcherArguments['Raw'] = $True","                $Group = Get-DomainGroup @SearcherArguments","","                if (-not $Group) {","                    Write-Warning \"[Get-DomainGroupMember] Error searching for group with identity: $Identity\"","                }","                else {","                    $GroupFoundName = $Group.properties.item('samaccountname')[0]","                    $GroupFoundDN = $Group.properties.item('distinguishedname')[0]","","                    if ($PSBoundParameters['Domain']) {","                        $GroupFoundDomain = $Domain","                    }","                    else {","                        # if a domain isn't passed, try to extract it from the found group distinguished name","                        if ($GroupFoundDN) {","                            $GroupFoundDomain = $GroupFoundDN.SubString($GroupFoundDN.IndexOf('DC=')) -replace 'DC=','' -replace ',','.'","                        }","                    }","                    Write-Verbose \"[Get-DomainGroupMember] Using LDAP matching rule to recurse on '$GroupFoundDN', only user accounts will be returned.\"","                    $GroupSearcher.filter = \"(\u0026(samAccountType=805306368)(memberof:1.2.840.113556.1.4.1941:=$GroupFoundDN))\"","                    $GroupSearcher.PropertiesToLoad.AddRange(('distinguishedName'))","                    $Members = $GroupSearcher.FindAll() | ForEach-Object {$_.Properties.distinguishedname[0]}","                }","                $Null = $SearcherArguments.Remove('Raw')","            }","            else {","                $IdentityFilter = ''","                $Filter = ''","                $Identity | Where-Object {$_} | ForEach-Object {","                    $IdentityInstance = $_.Replace('(', '\\28').Replace(')', '\\29')","                    if ($IdentityInstance -match '^S-1-') {","                        $IdentityFilter += \"(objectsid=$IdentityInstance)\"","                    }","                    elseif ($IdentityInstance -match '^CN=') {","                        $IdentityFilter += \"(distinguishedname=$IdentityInstance)\"","                        if ((-not $PSBoundParameters['Domain']) -and (-not $PSBoundParameters['SearchBase'])) {","                            # if a -Domain isn't explicitly set, extract the object domain out of the distinguishedname","                            #   and rebuild the domain searcher","                            $IdentityDomain = $IdentityInstance.SubString($IdentityInstance.IndexOf('DC=')) -replace 'DC=','' -replace ',','.'","                            Write-Verbose \"[Get-DomainGroupMember] Extracted domain '$IdentityDomain' from '$IdentityInstance'\"","                            $SearcherArguments['Domain'] = $IdentityDomain","                            $GroupSearcher = Get-DomainSearcher @SearcherArguments","                            if (-not $GroupSearcher) {","                                Write-Warning \"[Get-DomainGroupMember] Unable to retrieve domain searcher for '$IdentityDomain'\"","                            }","                        }","                    }","                    elseif ($IdentityInstance -imatch '^[0-9A-F]{8}-([0-9A-F]{4}-){3}[0-9A-F]{12}$') {","                        $GuidByteString = (([Guid]$IdentityInstance).ToByteArray() | ForEach-Object { '\\' + $_.ToString('X2') }) -join ''","                        $IdentityFilter += \"(objectguid=$GuidByteString)\"","                    }","                    elseif ($IdentityInstance.Contains('\\')) {","                        $ConvertedIdentityInstance = $IdentityInstance.Replace('\\28', '(').Replace('\\29', ')') | Convert-ADName -OutputType Canonical","                        if ($ConvertedIdentityInstance) {","                            $GroupDomain = $ConvertedIdentityInstance.SubString(0, $ConvertedIdentityInstance.IndexOf('/'))","                            $GroupName = $IdentityInstance.Split('\\')[1]","                            $IdentityFilter += \"(samAccountName=$GroupName)\"","                            $SearcherArguments['Domain'] = $GroupDomain","                            Write-Verbose \"[Get-DomainGroupMember] Extracted domain '$GroupDomain' from '$IdentityInstance'\"","                            $GroupSearcher = Get-DomainSearcher @SearcherArguments","                        }","                    }","                    else {","                        $IdentityFilter += \"(samAccountName=$IdentityInstance)\"","                    }","                }","","                if ($IdentityFilter -and ($IdentityFilter.Trim() -ne '') ) {","                    $Filter += \"(|$IdentityFilter)\"","                }","","                if ($PSBoundParameters['LDAPFilter']) {","                    Write-Verbose \"[Get-DomainGroupMember] Using additional LDAP filter: $LDAPFilter\"","                    $Filter += \"$LDAPFilter\"","                }","","                $GroupSearcher.filter = \"(\u0026(objectCategory=group)$Filter)\"","                Write-Verbose \"[Get-DomainGroupMember] Get-DomainGroupMember filter string: $($GroupSearcher.filter)\"","                try {","                    $Result = $GroupSearcher.FindOne()","                }","                catch {","                    Write-Warning \"[Get-DomainGroupMember] Error searching for group with identity '$Identity': $_\"","                    $Members = @()","                }","","                $GroupFoundName = ''","                $GroupFoundDN = ''","","                if ($Result) {","                    $Members = $Result.properties.item('member')","","                    if ($Members.count -eq 0) {","                        # ranged searching, thanks @meatballs__ !","                        $Finished = $False","                        $Bottom = 0","                        $Top = 0","","                        while (-not $Finished) {","                            $Top = $Bottom + 1499","                            $MemberRange=\"member;range=$Bottom-$Top\"","                            $Bottom += 1500","                            $Null = $GroupSearcher.PropertiesToLoad.Clear()","                            $Null = $GroupSearcher.PropertiesToLoad.Add(\"$MemberRange\")","                            $Null = $GroupSearcher.PropertiesToLoad.Add('samaccountname')","                            $Null = $GroupSearcher.PropertiesToLoad.Add('distinguishedname')","","                            try {","                                $Result = $GroupSearcher.FindOne()","                                $RangedProperty = $Result.Properties.PropertyNames -like \"member;range=*\"","                                $Members += $Result.Properties.item($RangedProperty)","                                $GroupFoundName = $Result.properties.item('samaccountname')[0]","                                $GroupFoundDN = $Result.properties.item('distinguishedname')[0]","","                                if ($Members.count -eq 0) {","                                    $Finished = $True","                                }","                            }","                            catch [System.Management.Automation.MethodInvocationException] {","                                $Finished = $True","                            }","                        }","                    }","                    else {","                        $GroupFoundName = $Result.properties.item('samaccountname')[0]","                        $GroupFoundDN = $Result.properties.item('distinguishedname')[0]","                        $Members += $Result.Properties.item($RangedProperty)","                    }","","                    if ($PSBoundParameters['Domain']) {","                        $GroupFoundDomain = $Domain","                    }","                    else {","                        # if a domain isn't passed, try to extract it from the found group distinguished name","                        if ($GroupFoundDN) {","                            $GroupFoundDomain = $GroupFoundDN.SubString($GroupFoundDN.IndexOf('DC=')) -replace 'DC=','' -replace ',','.'","                        }","                    }","                }","            }","","            ForEach ($Member in $Members) {","                if ($Recurse -and $UseMatchingRule) {","                    $Properties = $_.Properties","                }","                else {","                    $ObjectSearcherArguments = $SearcherArguments.Clone()","                    $ObjectSearcherArguments['Identity'] = $Member","                    $ObjectSearcherArguments['Raw'] = $True","                    $ObjectSearcherArguments['Properties'] = 'distinguishedname,cn,samaccountname,objectsid,objectclass'","                    $Object = Get-DomainObject @ObjectSearcherArguments","                    $Properties = $Object.Properties","                }","","                if ($Properties) {","                    $GroupMember = New-Object PSObject","                    $GroupMember | Add-Member Noteproperty 'GroupDomain' $GroupFoundDomain","                    $GroupMember | Add-Member Noteproperty 'GroupName' $GroupFoundName","                    $GroupMember | Add-Member Noteproperty 'GroupDistinguishedName' $GroupFoundDN","","                    if ($Properties.objectsid) {","                        $MemberSID = ((New-Object System.Security.Principal.SecurityIdentifier $Properties.objectsid[0], 0).Value)","                    }","                    else {","                        $MemberSID = $Null","                    }","","                    try {","                        $MemberDN = $Properties.distinguishedname[0]","                        if ($MemberDN -match 'ForeignSecurityPrincipals|S-1-5-21') {","                            try {","                                if (-not $MemberSID) {","                                    $MemberSID = $Properties.cn[0]","                                }","                                $MemberSimpleName = Convert-ADName -Identity $MemberSID -OutputType 'DomainSimple' @ADNameArguments","","                                if ($MemberSimpleName) {","                                    $MemberDomain = $MemberSimpleName.Split('@')[1]","                                }","                                else {","                                    Write-Warning \"[Get-DomainGroupMember] Error converting $MemberDN\"","                                    $MemberDomain = $Null","                                }","                            }","                            catch {","                                Write-Warning \"[Get-DomainGroupMember] Error converting $MemberDN\"","                                $MemberDomain = $Null","                            }","                        }","                        else {","                            # extract the FQDN from the Distinguished Name","                            $MemberDomain = $MemberDN.SubString($MemberDN.IndexOf('DC=')) -replace 'DC=','' -replace ',','.'","                        }","                    }","                    catch {","                        $MemberDN = $Null","                        $MemberDomain = $Null","                    }","","                    if ($Properties.samaccountname) {","                        # forest users have the samAccountName set","                        $MemberName = $Properties.samaccountname[0]","                    }","                    else {","                        # external trust users have a SID, so convert it","                        try {","                            $MemberName = ConvertFrom-SID -ObjectSID $Properties.cn[0] @ADNameArguments","                        }","                        catch {","                            # if there's a problem contacting the domain to resolve the SID","                            $MemberName = $Properties.cn[0]","                        }","                    }","","                    if ($Properties.objectclass -match 'computer') {","                        $MemberObjectClass = 'computer'","                    }","                    elseif ($Properties.objectclass -match 'group') {","                        $MemberObjectClass = 'group'","                    }","                    elseif ($Properties.objectclass -match 'user') {","                        $MemberObjectClass = 'user'","                    }","                    else {","                        $MemberObjectClass = $Null","                    }","                    $GroupMember | Add-Member Noteproperty 'MemberDomain' $MemberDomain","                    $GroupMember | Add-Member Noteproperty 'MemberName' $MemberName","                    $GroupMember | Add-Member Noteproperty 'MemberDistinguishedName' $MemberDN","                    $GroupMember | Add-Member Noteproperty 'MemberObjectClass' $MemberObjectClass","                    $GroupMember | Add-Member Noteproperty 'MemberSID' $MemberSID","                    $GroupMember.PSObject.TypeNames.Insert(0, 'PowerView.GroupMember')","                    $GroupMember","","                    # if we're doing manual recursion","                    if ($PSBoundParameters['Recurse'] -and $MemberDN -and ($MemberObjectClass -match 'group')) {","                        Write-Verbose \"[Get-DomainGroupMember] Manually recursing on group: $MemberDN\"","                        $SearcherArguments['Identity'] = $MemberDN","                        $Null = $SearcherArguments.Remove('Properties')","                        Get-DomainGroupMember @SearcherArguments","                    }","                }","            }","            $GroupSearcher.dispose()","        }","    }","}","","","function Get-DomainGroupMemberDeleted {","\u003c#",".SYNOPSIS","","Returns information on group members that were removed from the specified","group identity. Accomplished by searching the linked attribute replication","metadata for the group using Get-DomainObjectLinkedAttributeHistory.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: Get-DomainObjectLinkedAttributeHistory","",".DESCRIPTION","","Wraps Get-DomainObjectLinkedAttributeHistory to return the linked attribute","replication metadata for the specified group. These are cases where the","'Version' attribute of group member in the replication metadata is even.","",".PARAMETER Identity","","A SamAccountName (e.g. harmj0y), DistinguishedName (e.g. CN=harmj0y,CN=Users,DC=testlab,DC=local),","SID (e.g. S-1-5-21-890171859-3433809279-3366196753-1108), or GUID (e.g. 4c435dd7-dc58-4b14-9a5e-1fdb0e80d201).","Wildcards accepted.","",".PARAMETER Domain","","Specifies the domain to use for the query, defaults to the current domain.","",".PARAMETER LDAPFilter","","Specifies an LDAP query string that is used to filter Active Directory objects.","",".PARAMETER SearchBase","","The LDAP source to search through, e.g. \"LDAP://OU=secret,DC=testlab,DC=local\"","Useful for OU queries.","",".PARAMETER Server","","Specifies an Active Directory server (domain controller) to bind to.","",".PARAMETER SearchScope","","Specifies the scope to search under, Base/OneLevel/Subtree (default of Subtree).","",".PARAMETER ResultPageSize","","Specifies the PageSize to set for the LDAP searcher object.","",".PARAMETER ServerTimeLimit","","Specifies the maximum amount of time the server spends searching. Default of 120 seconds.","",".PARAMETER Tombstone","","Switch. Specifies that the searcher should also return deleted/tombstoned objects.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target domain.","",".EXAMPLE","","Get-DomainGroupMemberDeleted | Group-Object GroupDN","","Count Name                      Group","----- ----                      -----","    2 CN=Domain Admins,CN=Us... {@{GroupDN=CN=Domain Admins,CN=Users,DC=test...","    3 CN=DomainLocalGroup,CN... {@{GroupDN=CN=DomainLocalGroup,CN=Users,DC=t...","",".EXAMPLE","","Get-DomainGroupMemberDeleted \"Domain Admins\" -Domain testlab.local","","","GroupDN               : CN=Domain Admins,CN=Users,DC=testlab,DC=local","MemberDN              : CN=testuser,CN=Users,DC=testlab,DC=local","TimeFirstAdded        : 2017-06-13T23:07:43Z","TimeDeleted           : 2017-06-13T23:26:17Z","LastOriginatingChange : 2017-06-13T23:26:17Z","TimesAdded            : 2","LastOriginatingDsaDN  : CN=NTDS Settings,CN=PRIMARY,CN=Servers,CN=Default-First","                        -Site-Name,CN=Sites,CN=Configuration,DC=testlab,DC=loca","                        l","","GroupDN               : CN=Domain Admins,CN=Users,DC=testlab,DC=local","MemberDN              : CN=dfm,CN=Users,DC=testlab,DC=local","TimeFirstAdded        : 2017-06-13T22:20:02Z","TimeDeleted           : 2017-06-13T23:26:17Z","LastOriginatingChange : 2017-06-13T23:26:17Z","TimesAdded            : 5","LastOriginatingDsaDN  : CN=NTDS Settings,CN=PRIMARY,CN=Servers,CN=Default-First","                        -Site-Name,CN=Sites,CN=Configuration,DC=testlab,DC=loca","                        l","",".OUTPUTS","","PowerView.DomainGroupMemberDeleted","","Custom PSObject with translated replication metadata fields.","",".LINK","","https://blogs.technet.microsoft.com/pie/2014/08/25/metadata-2-the-ephemeral-admin-or-how-to-track-the-group-membership/","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSUseDeclaredVarsMoreThanAssignments', '')]","    [OutputType('PowerView.DomainGroupMemberDeleted')]","    [CmdletBinding()]","    Param(","        [Parameter(Position = 0, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('DistinguishedName', 'SamAccountName', 'Name', 'MemberDistinguishedName', 'MemberName')]","        [String[]]","        $Identity,","","        [ValidateNotNullOrEmpty()]","        [String]","        $Domain,","","        [ValidateNotNullOrEmpty()]","        [Alias('Filter')]","        [String]","        $LDAPFilter,","","        [ValidateNotNullOrEmpty()]","        [Alias('ADSPath')]","        [String]","        $SearchBase,","","        [ValidateNotNullOrEmpty()]","        [Alias('DomainController')]","        [String]","        $Server,","","        [ValidateSet('Base', 'OneLevel', 'Subtree')]","        [String]","        $SearchScope = 'Subtree',","","        [ValidateRange(1, 10000)]","        [Int]","        $ResultPageSize = 200,","","        [ValidateRange(1, 10000)]","        [Int]","        $ServerTimeLimit,","","        [Switch]","        $Tombstone,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty,","","        [Switch]","        $Raw","    )","","    BEGIN {","        $SearcherArguments = @{","            'Properties'    =   'msds-replvaluemetadata','distinguishedname'","            'Raw'           =   $True","            'LDAPFilter'    =   '(objectCategory=group)'","        }","        if ($PSBoundParameters['Domain']) { $SearcherArguments['Domain'] = $Domain }","        if ($PSBoundParameters['LDAPFilter']) { $SearcherArguments['LDAPFilter'] = $LDAPFilter }","        if ($PSBoundParameters['SearchBase']) { $SearcherArguments['SearchBase'] = $SearchBase }","        if ($PSBoundParameters['Server']) { $SearcherArguments['Server'] = $Server }","        if ($PSBoundParameters['SearchScope']) { $SearcherArguments['SearchScope'] = $SearchScope }","        if ($PSBoundParameters['ResultPageSize']) { $SearcherArguments['ResultPageSize'] = $ResultPageSize }","        if ($PSBoundParameters['ServerTimeLimit']) { $SearcherArguments['ServerTimeLimit'] = $ServerTimeLimit }","        if ($PSBoundParameters['Tombstone']) { $SearcherArguments['Tombstone'] = $Tombstone }","        if ($PSBoundParameters['Credential']) { $SearcherArguments['Credential'] = $Credential }","    }","","    PROCESS {","        if ($PSBoundParameters['Identity']) { $SearcherArguments['Identity'] = $Identity }","","        Get-DomainObject @SearcherArguments | ForEach-Object {","            $ObjectDN = $_.Properties['distinguishedname'][0]","            ForEach($XMLNode in $_.Properties['msds-replvaluemetadata']) {","                $TempObject = [xml]$XMLNode | Select-Object -ExpandProperty 'DS_REPL_VALUE_META_DATA' -ErrorAction SilentlyContinue","                if ($TempObject) {","                    if (($TempObject.pszAttributeName -Match 'member') -and (($TempObject.dwVersion % 2) -eq 0 )) {","                        $Output = New-Object PSObject","                        $Output | Add-Member NoteProperty 'GroupDN' $ObjectDN","                        $Output | Add-Member NoteProperty 'MemberDN' $TempObject.pszObjectDn","                        $Output | Add-Member NoteProperty 'TimeFirstAdded' $TempObject.ftimeCreated","                        $Output | Add-Member NoteProperty 'TimeDeleted' $TempObject.ftimeDeleted","                        $Output | Add-Member NoteProperty 'LastOriginatingChange' $TempObject.ftimeLastOriginatingChange","                        $Output | Add-Member NoteProperty 'TimesAdded' ($TempObject.dwVersion / 2)","                        $Output | Add-Member NoteProperty 'LastOriginatingDsaDN' $TempObject.pszLastOriginatingDsaDN","                        $Output.PSObject.TypeNames.Insert(0, 'PowerView.DomainGroupMemberDeleted')","                        $Output","                    }","                }","                else {","                    Write-Verbose \"[Get-DomainGroupMemberDeleted] Error retrieving 'msds-replvaluemetadata' for '$ObjectDN'\"","                }","            }","        }","    }","}","","","function Add-DomainGroupMember {","\u003c#",".SYNOPSIS","","Adds a domain user (or group) to an existing domain group, assuming","appropriate permissions to do so.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: Get-PrincipalContext  ","",".DESCRIPTION","","First binds to the specified domain context using Get-PrincipalContext.","The bound domain context is then used to search for the specified -GroupIdentity,","which returns a DirectoryServices.AccountManagement.GroupPrincipal object. For","each entry in -Members, each member identity is similarly searched for and added","to the group.","",".PARAMETER Identity","","A group SamAccountName (e.g. Group1), DistinguishedName (e.g. CN=group1,CN=Users,DC=testlab,DC=local),","SID (e.g. S-1-5-21-890171859-3433809279-3366196753-1114), or GUID (e.g. 4c435dd7-dc58-4b14-9a5e-1fdb0e80d202)","specifying the group to add members to.","",".PARAMETER Members","","One or more member identities, i.e. SamAccountName (e.g. Group1), DistinguishedName","(e.g. CN=group1,CN=Users,DC=testlab,DC=local), SID (e.g. S-1-5-21-890171859-3433809279-3366196753-1114),","or GUID (e.g. 4c435dd7-dc58-4b14-9a5e-1fdb0e80d202).","",".PARAMETER Domain","","Specifies the domain to use to search for user/group principals, defaults to the current domain.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target domain.","",".EXAMPLE","","Add-DomainGroupMember -Identity 'Domain Admins' -Members 'harmj0y'","","Adds harmj0y to 'Domain Admins' in the current domain.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Add-DomainGroupMember -Identity 'Domain Admins' -Members 'harmj0y' -Credential $Cred","","Adds harmj0y to 'Domain Admins' in the current domain using the alternate credentials.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","$UserPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","New-DomainUser -SamAccountName andy -AccountPassword $UserPassword -Credential $Cred | Add-DomainGroupMember 'Domain Admins' -Credential $Cred","","Creates the 'andy' user with the specified description and password, using the specified","alternate credentials, and adds the user to 'domain admins' using Add-DomainGroupMember","and the alternate credentials.","",".LINK","","http://richardspowershellblog.wordpress.com/2008/05/25/system-directoryservices-accountmanagement/","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [CmdletBinding()]","    Param(","        [Parameter(Position = 0, Mandatory = $True)]","        [Alias('GroupName', 'GroupIdentity')]","        [String]","        $Identity,","","        [Parameter(Mandatory = $True, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('MemberIdentity', 'Member', 'DistinguishedName')]","        [String[]]","        $Members,","","        [ValidateNotNullOrEmpty()]","        [String]","        $Domain,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    BEGIN {","        $ContextArguments = @{","            'Identity' = $Identity","        }","        if ($PSBoundParameters['Domain']) { $ContextArguments['Domain'] = $Domain }","        if ($PSBoundParameters['Credential']) { $ContextArguments['Credential'] = $Credential }","","        $GroupContext = Get-PrincipalContext @ContextArguments","","        if ($GroupContext) {","            try {","                $Group = [System.DirectoryServices.AccountManagement.GroupPrincipal]::FindByIdentity($GroupContext.Context, $GroupContext.Identity)","            }","            catch {","                Write-Warning \"[Add-DomainGroupMember] Error finding the group identity '$Identity' : $_\"","            }","        }","    }","","    PROCESS {","        if ($Group) {","            ForEach ($Member in $Members) {","                if ($Member -match '.+\\\\.+') {","                    $ContextArguments['Identity'] = $Member","                    $UserContext = Get-PrincipalContext @ContextArguments","                    if ($UserContext) {","                        $UserIdentity = $UserContext.Identity","                    }","                }","                else {","                    $UserContext = $GroupContext","                    $UserIdentity = $Member","                }","                Write-Verbose \"[Add-DomainGroupMember] Adding member '$Member' to group '$Identity'\"","                $Member = [System.DirectoryServices.AccountManagement.Principal]::FindByIdentity($UserContext.Context, $UserIdentity)","                $Group.Members.Add($Member)","                $Group.Save()","            }","        }","    }","}","","","function Remove-DomainGroupMember {","\u003c#",".SYNOPSIS","","Removes a domain user (or group) from an existing domain group, assuming","appropriate permissions to do so.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: Get-PrincipalContext  ","",".DESCRIPTION","","First binds to the specified domain context using Get-PrincipalContext.","The bound domain context is then used to search for the specified -GroupIdentity,","which returns a DirectoryServices.AccountManagement.GroupPrincipal object. For","each entry in -Members, each member identity is similarly searched for and removed","from the group.","",".PARAMETER Identity","","A group SamAccountName (e.g. Group1), DistinguishedName (e.g. CN=group1,CN=Users,DC=testlab,DC=local),","SID (e.g. S-1-5-21-890171859-3433809279-3366196753-1114), or GUID (e.g. 4c435dd7-dc58-4b14-9a5e-1fdb0e80d202)","specifying the group to remove members from.","",".PARAMETER Members","","One or more member identities, i.e. SamAccountName (e.g. Group1), DistinguishedName","(e.g. CN=group1,CN=Users,DC=testlab,DC=local), SID (e.g. S-1-5-21-890171859-3433809279-3366196753-1114),","or GUID (e.g. 4c435dd7-dc58-4b14-9a5e-1fdb0e80d202).","",".PARAMETER Domain","","Specifies the domain to use to search for user/group principals, defaults to the current domain.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target domain.","",".EXAMPLE","","Remove-DomainGroupMember -Identity 'Domain Admins' -Members 'harmj0y'","","Removes harmj0y from 'Domain Admins' in the current domain.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Remove-DomainGroupMember -Identity 'Domain Admins' -Members 'harmj0y' -Credential $Cred","","Removes harmj0y from 'Domain Admins' in the current domain using the alternate credentials.","",".LINK","","http://richardspowershellblog.wordpress.com/2008/05/25/system-directoryservices-accountmanagement/","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [CmdletBinding()]","    Param(","        [Parameter(Position = 0, Mandatory = $True)]","        [Alias('GroupName', 'GroupIdentity')]","        [String]","        $Identity,","","        [Parameter(Mandatory = $True, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('MemberIdentity', 'Member', 'DistinguishedName')]","        [String[]]","        $Members,","","        [ValidateNotNullOrEmpty()]","        [String]","        $Domain,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    BEGIN {","        $ContextArguments = @{","            'Identity' = $Identity","        }","        if ($PSBoundParameters['Domain']) { $ContextArguments['Domain'] = $Domain }","        if ($PSBoundParameters['Credential']) { $ContextArguments['Credential'] = $Credential }","","        $GroupContext = Get-PrincipalContext @ContextArguments","","        if ($GroupContext) {","            try {","                $Group = [System.DirectoryServices.AccountManagement.GroupPrincipal]::FindByIdentity($GroupContext.Context, $GroupContext.Identity)","            }","            catch {","                Write-Warning \"[Remove-DomainGroupMember] Error finding the group identity '$Identity' : $_\"","            }","        }","    }","","    PROCESS {","        if ($Group) {","            ForEach ($Member in $Members) {","                if ($Member -match '.+\\\\.+') {","                    $ContextArguments['Identity'] = $Member","                    $UserContext = Get-PrincipalContext @ContextArguments","                    if ($UserContext) {","                        $UserIdentity = $UserContext.Identity","                    }","                }","                else {","                    $UserContext = $GroupContext","                    $UserIdentity = $Member","                }","                Write-Verbose \"[Remove-DomainGroupMember] Removing member '$Member' from group '$Identity'\"","                $Member = [System.DirectoryServices.AccountManagement.Principal]::FindByIdentity($UserContext.Context, $UserIdentity)","                $Group.Members.Remove($Member)","                $Group.Save()","            }","        }","    }","}","","","function Get-DomainFileServer {","\u003c#",".SYNOPSIS","","Returns a list of servers likely functioning as file servers.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: Get-DomainSearcher  ","",".DESCRIPTION","","Returns a list of likely fileservers by searching for all users in Active Directory","with non-null homedirectory, scriptpath, or profilepath fields, and extracting/uniquifying","the server names.","",".PARAMETER Domain","","Specifies the domain to use for the query, defaults to the current domain.","",".PARAMETER LDAPFilter","","Specifies an LDAP query string that is used to filter Active Directory objects.","",".PARAMETER SearchBase","","The LDAP source to search through, e.g. \"LDAP://OU=secret,DC=testlab,DC=local\"","Useful for OU queries.","",".PARAMETER Server","","Specifies an Active Directory server (domain controller) to bind to.","",".PARAMETER SearchScope","","Specifies the scope to search under, Base/OneLevel/Subtree (default of Subtree).","",".PARAMETER ResultPageSize","","Specifies the PageSize to set for the LDAP searcher object.","",".PARAMETER ServerTimeLimit","","Specifies the maximum amount of time the server spends searching. Default of 120 seconds.","",".PARAMETER Tombstone","","Switch. Specifies that the searcher should also return deleted/tombstoned objects.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target domain.","",".EXAMPLE","","Get-DomainFileServer","","Returns active file servers for the current domain.","",".EXAMPLE","","Get-DomainFileServer -Domain testing.local","","Returns active file servers for the 'testing.local' domain.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Get-DomainFileServer -Credential $Cred","",".OUTPUTS","","String","","One or more strings representing file server names.","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType([String])]","    [CmdletBinding()]","    Param(","        [Parameter( ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [ValidateNotNullOrEmpty()]","        [Alias('DomainName', 'Name')]","        [String[]]","        $Domain,","","        [ValidateNotNullOrEmpty()]","        [Alias('Filter')]","        [String]","        $LDAPFilter,","","        [ValidateNotNullOrEmpty()]","        [Alias('ADSPath')]","        [String]","        $SearchBase,","","        [ValidateNotNullOrEmpty()]","        [Alias('DomainController')]","        [String]","        $Server,","","        [ValidateSet('Base', 'OneLevel', 'Subtree')]","        [String]","        $SearchScope = 'Subtree',","","        [ValidateRange(1, 10000)]","        [Int]","        $ResultPageSize = 200,","","        [ValidateRange(1, 10000)]","        [Int]","        $ServerTimeLimit,","","        [Switch]","        $Tombstone,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    BEGIN {","        function Split-Path {","            # short internal helper to split UNC server paths","            Param([String]$Path)","","            if ($Path -and ($Path.split('\\\\').Count -ge 3)) {","                $Temp = $Path.split('\\\\')[2]","                if ($Temp -and ($Temp -ne '')) {","                    $Temp","                }","            }","        }","","        $SearcherArguments = @{","            'LDAPFilter' = '(\u0026(samAccountType=805306368)(!(userAccountControl:1.2.840.113556.1.4.803:=2))(|(homedirectory=*)(scriptpath=*)(profilepath=*)))'","            'Properties' = 'homedirectory,scriptpath,profilepath'","        }","        if ($PSBoundParameters['SearchBase']) { $SearcherArguments['SearchBase'] = $SearchBase }","        if ($PSBoundParameters['Server']) { $SearcherArguments['Server'] = $Server }","        if ($PSBoundParameters['SearchScope']) { $SearcherArguments['SearchScope'] = $SearchScope }","        if ($PSBoundParameters['ResultPageSize']) { $SearcherArguments['ResultPageSize'] = $ResultPageSize }","        if ($PSBoundParameters['ServerTimeLimit']) { $SearcherArguments['ServerTimeLimit'] = $ServerTimeLimit }","        if ($PSBoundParameters['Tombstone']) { $SearcherArguments['Tombstone'] = $Tombstone }","        if ($PSBoundParameters['Credential']) { $SearcherArguments['Credential'] = $Credential }","    }","","    PROCESS {","        if ($PSBoundParameters['Domain']) {","            ForEach ($TargetDomain in $Domain) {","                $SearcherArguments['Domain'] = $TargetDomain","                $UserSearcher = Get-DomainSearcher @SearcherArguments","                # get all results w/o the pipeline and uniquify them (I know it's not pretty)","                $(ForEach($UserResult in $UserSearcher.FindAll()) {if ($UserResult.Properties['homedirectory']) {Split-Path($UserResult.Properties['homedirectory'])}if ($UserResult.Properties['scriptpath']) {Split-Path($UserResult.Properties['scriptpath'])}if ($UserResult.Properties['profilepath']) {Split-Path($UserResult.Properties['profilepath'])}}) | Sort-Object -Unique","            }","        }","        else {","            $UserSearcher = Get-DomainSearcher @SearcherArguments","            $(ForEach($UserResult in $UserSearcher.FindAll()) {if ($UserResult.Properties['homedirectory']) {Split-Path($UserResult.Properties['homedirectory'])}if ($UserResult.Properties['scriptpath']) {Split-Path($UserResult.Properties['scriptpath'])}if ($UserResult.Properties['profilepath']) {Split-Path($UserResult.Properties['profilepath'])}}) | Sort-Object -Unique","        }","    }","}","","","function Get-DomainDFSShare {","\u003c#",".SYNOPSIS","","Returns a list of all fault-tolerant distributed file systems","for the current (or specified) domains.","","Author: Ben Campbell (@meatballs__)  ","License: BSD 3-Clause  ","Required Dependencies: Get-DomainSearcher  ","",".DESCRIPTION","","This function searches for all distributed file systems (either version","1, 2, or both depending on -Version X) by searching for domain objects","matching (objectClass=fTDfs) or (objectClass=msDFS-Linkv2), respectively","The server data is parsed appropriately and returned.","",".PARAMETER Domain","","Specifies the domains to use for the query, defaults to the current domain.","",".PARAMETER SearchBase","","The LDAP source to search through, e.g. \"LDAP://OU=secret,DC=testlab,DC=local\"","Useful for OU queries.","",".PARAMETER Server","","Specifies an Active Directory server (domain controller) to bind to.","",".PARAMETER SearchScope","","Specifies the scope to search under, Base/OneLevel/Subtree (default of Subtree).","",".PARAMETER ResultPageSize","","Specifies the PageSize to set for the LDAP searcher object.","",".PARAMETER ServerTimeLimit","","Specifies the maximum amount of time the server spends searching. Default of 120 seconds.","",".PARAMETER Tombstone","","Switch. Specifies that the searcher should also return deleted/tombstoned objects.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target domain.","",".EXAMPLE","","Get-DomainDFSShare","","Returns all distributed file system shares for the current domain.","",".EXAMPLE","","Get-DomainDFSShare -Domain testlab.local","","Returns all distributed file system shares for the 'testlab.local' domain.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Get-DomainDFSShare -Credential $Cred","",".OUTPUTS","","System.Management.Automation.PSCustomObject","","A custom PSObject describing the distributed file systems.","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSUseDeclaredVarsMoreThanAssignments', '')]","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSUseApprovedVerbs', '')]","    [OutputType('System.Management.Automation.PSCustomObject')]","    [CmdletBinding()]","    Param(","        [Parameter( ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [ValidateNotNullOrEmpty()]","        [Alias('DomainName', 'Name')]","        [String[]]","        $Domain,","","        [ValidateNotNullOrEmpty()]","        [Alias('ADSPath')]","        [String]","        $SearchBase,","","        [ValidateNotNullOrEmpty()]","        [Alias('DomainController')]","        [String]","        $Server,","","        [ValidateSet('Base', 'OneLevel', 'Subtree')]","        [String]","        $SearchScope = 'Subtree',","","        [ValidateRange(1, 10000)]","        [Int]","        $ResultPageSize = 200,","","        [ValidateRange(1, 10000)]","        [Int]","        $ServerTimeLimit,","","        [Switch]","        $Tombstone,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty,","","        [ValidateSet('All', 'V1', '1', 'V2', '2')]","        [String]","        $Version = 'All'","    )","","    BEGIN {","        $SearcherArguments = @{}","        if ($PSBoundParameters['SearchBase']) { $SearcherArguments['SearchBase'] = $SearchBase }","        if ($PSBoundParameters['Server']) { $SearcherArguments['Server'] = $Server }","        if ($PSBoundParameters['SearchScope']) { $SearcherArguments['SearchScope'] = $SearchScope }","        if ($PSBoundParameters['ResultPageSize']) { $SearcherArguments['ResultPageSize'] = $ResultPageSize }","        if ($PSBoundParameters['ServerTimeLimit']) { $SearcherArguments['ServerTimeLimit'] = $ServerTimeLimit }","        if ($PSBoundParameters['Tombstone']) { $SearcherArguments['Tombstone'] = $Tombstone }","        if ($PSBoundParameters['Credential']) { $SearcherArguments['Credential'] = $Credential }","","        function Parse-Pkt {","            [CmdletBinding()]","            Param(","                [Byte[]]","                $Pkt","            )","","            $bin = $Pkt","            $blob_version = [bitconverter]::ToUInt32($bin[0..3],0)","            $blob_element_count = [bitconverter]::ToUInt32($bin[4..7],0)","            $offset = 8","            #https://msdn.microsoft.com/en-us/library/cc227147.aspx","            $object_list = @()","            for($i=1; $i -le $blob_element_count; $i++){","                $blob_name_size_start = $offset","                $blob_name_size_end = $offset + 1","                $blob_name_size = [bitconverter]::ToUInt16($bin[$blob_name_size_start..$blob_name_size_end],0)","","                $blob_name_start = $blob_name_size_end + 1","                $blob_name_end = $blob_name_start + $blob_name_size - 1","                $blob_name = [System.Text.Encoding]::Unicode.GetString($bin[$blob_name_start..$blob_name_end])","","                $blob_data_size_start = $blob_name_end + 1","                $blob_data_size_end = $blob_data_size_start + 3","                $blob_data_size = [bitconverter]::ToUInt32($bin[$blob_data_size_start..$blob_data_size_end],0)","","                $blob_data_start = $blob_data_size_end + 1","                $blob_data_end = $blob_data_start + $blob_data_size - 1","                $blob_data = $bin[$blob_data_start..$blob_data_end]","                switch -wildcard ($blob_name) {","                    \"\\siteroot\" {  }","                    \"\\domainroot*\" {","                        # Parse DFSNamespaceRootOrLinkBlob object. Starts with variable length DFSRootOrLinkIDBlob which we parse first...","                        # DFSRootOrLinkIDBlob","                        $root_or_link_guid_start = 0","                        $root_or_link_guid_end = 15","                        $root_or_link_guid = [byte[]]$blob_data[$root_or_link_guid_start..$root_or_link_guid_end]","                        $guid = New-Object Guid(,$root_or_link_guid) # should match $guid_str","                        $prefix_size_start = $root_or_link_guid_end + 1","                        $prefix_size_end = $prefix_size_start + 1","                        $prefix_size = [bitconverter]::ToUInt16($blob_data[$prefix_size_start..$prefix_size_end],0)","                        $prefix_start = $prefix_size_end + 1","                        $prefix_end = $prefix_start + $prefix_size - 1","                        $prefix = [System.Text.Encoding]::Unicode.GetString($blob_data[$prefix_start..$prefix_end])","","                        $short_prefix_size_start = $prefix_end + 1","                        $short_prefix_size_end = $short_prefix_size_start + 1","                        $short_prefix_size = [bitconverter]::ToUInt16($blob_data[$short_prefix_size_start..$short_prefix_size_end],0)","                        $short_prefix_start = $short_prefix_size_end + 1","                        $short_prefix_end = $short_prefix_start + $short_prefix_size - 1","                        $short_prefix = [System.Text.Encoding]::Unicode.GetString($blob_data[$short_prefix_start..$short_prefix_end])","","                        $type_start = $short_prefix_end + 1","                        $type_end = $type_start + 3","                        $type = [bitconverter]::ToUInt32($blob_data[$type_start..$type_end],0)","","                        $state_start = $type_end + 1","                        $state_end = $state_start + 3","                        $state = [bitconverter]::ToUInt32($blob_data[$state_start..$state_end],0)","","                        $comment_size_start = $state_end + 1","                        $comment_size_end = $comment_size_start + 1","                        $comment_size = [bitconverter]::ToUInt16($blob_data[$comment_size_start..$comment_size_end],0)","                        $comment_start = $comment_size_end + 1","                        $comment_end = $comment_start + $comment_size - 1","                        if ($comment_size -gt 0)  {","                            $comment = [System.Text.Encoding]::Unicode.GetString($blob_data[$comment_start..$comment_end])","                        }","                        $prefix_timestamp_start = $comment_end + 1","                        $prefix_timestamp_end = $prefix_timestamp_start + 7","                        # https://msdn.microsoft.com/en-us/library/cc230324.aspx FILETIME","                        $prefix_timestamp = $blob_data[$prefix_timestamp_start..$prefix_timestamp_end] #dword lowDateTime #dword highdatetime","                        $state_timestamp_start = $prefix_timestamp_end + 1","                        $state_timestamp_end = $state_timestamp_start + 7","                        $state_timestamp = $blob_data[$state_timestamp_start..$state_timestamp_end]","                        $comment_timestamp_start = $state_timestamp_end + 1","                        $comment_timestamp_end = $comment_timestamp_start + 7","                        $comment_timestamp = $blob_data[$comment_timestamp_start..$comment_timestamp_end]","                        $version_start = $comment_timestamp_end  + 1","                        $version_end = $version_start + 3","                        $version = [bitconverter]::ToUInt32($blob_data[$version_start..$version_end],0)","","                        # Parse rest of DFSNamespaceRootOrLinkBlob here","                        $dfs_targetlist_blob_size_start = $version_end + 1","                        $dfs_targetlist_blob_size_end = $dfs_targetlist_blob_size_start + 3","                        $dfs_targetlist_blob_size = [bitconverter]::ToUInt32($blob_data[$dfs_targetlist_blob_size_start..$dfs_targetlist_blob_size_end],0)","","                        $dfs_targetlist_blob_start = $dfs_targetlist_blob_size_end + 1","                        $dfs_targetlist_blob_end = $dfs_targetlist_blob_start + $dfs_targetlist_blob_size - 1","                        $dfs_targetlist_blob = $blob_data[$dfs_targetlist_blob_start..$dfs_targetlist_blob_end]","                        $reserved_blob_size_start = $dfs_targetlist_blob_end + 1","                        $reserved_blob_size_end = $reserved_blob_size_start + 3","                        $reserved_blob_size = [bitconverter]::ToUInt32($blob_data[$reserved_blob_size_start..$reserved_blob_size_end],0)","","                        $reserved_blob_start = $reserved_blob_size_end + 1","                        $reserved_blob_end = $reserved_blob_start + $reserved_blob_size - 1","                        $reserved_blob = $blob_data[$reserved_blob_start..$reserved_blob_end]","                        $referral_ttl_start = $reserved_blob_end + 1","                        $referral_ttl_end = $referral_ttl_start + 3","                        $referral_ttl = [bitconverter]::ToUInt32($blob_data[$referral_ttl_start..$referral_ttl_end],0)","","                        #Parse DFSTargetListBlob","                        $target_count_start = 0","                        $target_count_end = $target_count_start + 3","                        $target_count = [bitconverter]::ToUInt32($dfs_targetlist_blob[$target_count_start..$target_count_end],0)","                        $t_offset = $target_count_end + 1","","                        for($j=1; $j -le $target_count; $j++){","                            $target_entry_size_start = $t_offset","                            $target_entry_size_end = $target_entry_size_start + 3","                            $target_entry_size = [bitconverter]::ToUInt32($dfs_targetlist_blob[$target_entry_size_start..$target_entry_size_end],0)","                            $target_time_stamp_start = $target_entry_size_end + 1","                            $target_time_stamp_end = $target_time_stamp_start + 7","                            # FILETIME again or special if priority rank and priority class 0","                            $target_time_stamp = $dfs_targetlist_blob[$target_time_stamp_start..$target_time_stamp_end]","                            $target_state_start = $target_time_stamp_end + 1","                            $target_state_end = $target_state_start + 3","                            $target_state = [bitconverter]::ToUInt32($dfs_targetlist_blob[$target_state_start..$target_state_end],0)","","                            $target_type_start = $target_state_end + 1","                            $target_type_end = $target_type_start + 3","                            $target_type = [bitconverter]::ToUInt32($dfs_targetlist_blob[$target_type_start..$target_type_end],0)","","                            $server_name_size_start = $target_type_end + 1","                            $server_name_size_end = $server_name_size_start + 1","                            $server_name_size = [bitconverter]::ToUInt16($dfs_targetlist_blob[$server_name_size_start..$server_name_size_end],0)","","                            $server_name_start = $server_name_size_end + 1","                            $server_name_end = $server_name_start + $server_name_size - 1","                            $server_name = [System.Text.Encoding]::Unicode.GetString($dfs_targetlist_blob[$server_name_start..$server_name_end])","","                            $share_name_size_start = $server_name_end + 1","                            $share_name_size_end = $share_name_size_start + 1","                            $share_name_size = [bitconverter]::ToUInt16($dfs_targetlist_blob[$share_name_size_start..$share_name_size_end],0)","                            $share_name_start = $share_name_size_end + 1","                            $share_name_end = $share_name_start + $share_name_size - 1","                            $share_name = [System.Text.Encoding]::Unicode.GetString($dfs_targetlist_blob[$share_name_start..$share_name_end])","","                            $target_list += \"\\\\$server_name\\$share_name\"","                            $t_offset = $share_name_end + 1","                        }","                    }","                }","                $offset = $blob_data_end + 1","                $dfs_pkt_properties = @{","                    'Name' = $blob_name","                    'Prefix' = $prefix","                    'TargetList' = $target_list","                }","                $object_list += New-Object -TypeName PSObject -Property $dfs_pkt_properties","                $prefix = $Null","                $blob_name = $Null","                $target_list = $Null","            }","","            $servers = @()","            $object_list | ForEach-Object {","                if ($_.TargetList) {","                    $_.TargetList | ForEach-Object {","                        $servers += $_.split('\\')[2]","                    }","                }","            }","","            $servers","        }","","        function Get-DomainDFSShareV1 {","            [CmdletBinding()]","            Param(","                [String]","                $Domain,","","                [String]","                $SearchBase,","","                [String]","                $Server,","","                [String]","                $SearchScope = 'Subtree',","","                [Int]","                $ResultPageSize = 200,","","                [Int]","                $ServerTimeLimit,","","                [Switch]","                $Tombstone,","","                [Management.Automation.PSCredential]","                [Management.Automation.CredentialAttribute()]","                $Credential = [Management.Automation.PSCredential]::Empty","            )","","            $DFSsearcher = Get-DomainSearcher @PSBoundParameters","","            if ($DFSsearcher) {","                $DFSshares = @()","                $DFSsearcher.filter = '(\u0026(objectClass=fTDfs))'","","                try {","                    $Results = $DFSSearcher.FindAll()","                    $Results | Where-Object {$_} | ForEach-Object {","                        $Properties = $_.Properties","                        $RemoteNames = $Properties.remoteservername","                        $Pkt = $Properties.pkt","","                        $DFSshares += $RemoteNames | ForEach-Object {","                            try {","                                if ( $_.Contains('\\') ) {","                                    New-Object -TypeName PSObject -Property @{'Name'=$Properties.name[0];'RemoteServerName'=$_.split('\\')[2]}","                                }","                            }","                            catch {","                                Write-Verbose \"[Get-DomainDFSShare] Get-DomainDFSShareV1 error in parsing DFS share : $_\"","                            }","                        }","                    }","                    if ($Results) {","                        try { $Results.dispose() }","                        catch {","                            Write-Verbose \"[Get-DomainDFSShare] Get-DomainDFSShareV1 error disposing of the Results object: $_\"","                        }","                    }","                    $DFSSearcher.dispose()","","                    if ($pkt -and $pkt[0]) {","                        Parse-Pkt $pkt[0] | ForEach-Object {","                            # If a folder doesn't have a redirection it will have a target like","                            # \\\\null\\TestNameSpace\\folder\\.DFSFolderLink so we do actually want to match","                            # on 'null' rather than $Null","                            if ($_ -ne 'null') {","                                New-Object -TypeName PSObject -Property @{'Name'=$Properties.name[0];'RemoteServerName'=$_}","                            }","                        }","                    }","                }","                catch {","                    Write-Warning \"[Get-DomainDFSShare] Get-DomainDFSShareV1 error : $_\"","                }","                $DFSshares | Sort-Object -Unique -Property 'RemoteServerName'","            }","        }","","        function Get-DomainDFSShareV2 {","            [CmdletBinding()]","            Param(","                [String]","                $Domain,","","                [String]","                $SearchBase,","","                [String]","                $Server,","","                [String]","                $SearchScope = 'Subtree',","","                [Int]","                $ResultPageSize = 200,","","                [Int]","                $ServerTimeLimit,","","                [Switch]","                $Tombstone,","","                [Management.Automation.PSCredential]","                [Management.Automation.CredentialAttribute()]","                $Credential = [Management.Automation.PSCredential]::Empty","            )","","            $DFSsearcher = Get-DomainSearcher @PSBoundParameters","","            if ($DFSsearcher) {","                $DFSshares = @()","                $DFSsearcher.filter = '(\u0026(objectClass=msDFS-Linkv2))'","                $Null = $DFSSearcher.PropertiesToLoad.AddRange(('msdfs-linkpathv2','msDFS-TargetListv2'))","","                try {","                    $Results = $DFSSearcher.FindAll()","                    $Results | Where-Object {$_} | ForEach-Object {","                        $Properties = $_.Properties","                        $target_list = $Properties.'msdfs-targetlistv2'[0]","                        $xml = [xml][System.Text.Encoding]::Unicode.GetString($target_list[2..($target_list.Length-1)])","                        $DFSshares += $xml.targets.ChildNodes | ForEach-Object {","                            try {","                                $Target = $_.InnerText","                                if ( $Target.Contains('\\') ) {","                                    $DFSroot = $Target.split('\\')[3]","                                    $ShareName = $Properties.'msdfs-linkpathv2'[0]","                                    New-Object -TypeName PSObject -Property @{'Name'=\"$DFSroot$ShareName\";'RemoteServerName'=$Target.split('\\')[2]}","                                }","                            }","                            catch {","                                Write-Verbose \"[Get-DomainDFSShare] Get-DomainDFSShareV2 error in parsing target : $_\"","                            }","                        }","                    }","                    if ($Results) {","                        try { $Results.dispose() }","                        catch {","                            Write-Verbose \"[Get-DomainDFSShare] Error disposing of the Results object: $_\"","                        }","                    }","                    $DFSSearcher.dispose()","                }","                catch {","                    Write-Warning \"[Get-DomainDFSShare] Get-DomainDFSShareV2 error : $_\"","                }","                $DFSshares | Sort-Object -Unique -Property 'RemoteServerName'","            }","        }","    }","","    PROCESS {","        $DFSshares = @()","","        if ($PSBoundParameters['Domain']) {","            ForEach ($TargetDomain in $Domain) {","                $SearcherArguments['Domain'] = $TargetDomain","                if ($Version -match 'all|1') {","                    $DFSshares += Get-DomainDFSShareV1 @SearcherArguments","                }","                if ($Version -match 'all|2') {","                    $DFSshares += Get-DomainDFSShareV2 @SearcherArguments","                }","            }","        }","        else {","            if ($Version -match 'all|1') {","                $DFSshares += Get-DomainDFSShareV1 @SearcherArguments","            }","            if ($Version -match 'all|2') {","                $DFSshares += Get-DomainDFSShareV2 @SearcherArguments","            }","        }","","        $DFSshares | Sort-Object -Property ('RemoteServerName','Name') -Unique","    }","}","","","########################################################","#","# GPO related functions.","#","########################################################","","function Get-GptTmpl {","\u003c#",".SYNOPSIS","","Helper to parse a GptTmpl.inf policy file path into a hashtable.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: Add-RemoteConnection, Remove-RemoteConnection, Get-IniContent  ","",".DESCRIPTION","","Parses a GptTmpl.inf into a custom hashtable using Get-IniContent. If a","GPO object is passed, GPOPATH\\MACHINE\\Microsoft\\Windows NT\\SecEdit\\GptTmpl.inf","is constructed and assumed to be the parse target. If -Credential is passed,","Add-RemoteConnection is used to mount \\\\TARGET\\SYSVOL with the specified creds,","the files are parsed, and the connection is destroyed later with Remove-RemoteConnection.","",".PARAMETER GptTmplPath","","Specifies the GptTmpl.inf file path name to parse.","",".PARAMETER OutputObject","","Switch. Output a custom PSObject instead of a hashtable.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the remote system.","",".EXAMPLE","","Get-GptTmpl -GptTmplPath \"\\\\dev.testlab.local\\sysvol\\dev.testlab.local\\Policies\\{31B2F340-016D-11D2-945F-00C04FB984F9}\\MACHINE\\Microsoft\\Windows NT\\SecEdit\\GptTmpl.inf\"","","Parse the default domain policy .inf for dev.testlab.local","",".EXAMPLE","","Get-DomainGPO testing | Get-GptTmpl","","Parse the GptTmpl.inf policy for the GPO with display name of 'testing'.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Get-GptTmpl -Credential $Cred -GptTmplPath \"\\\\dev.testlab.local\\sysvol\\dev.testlab.local\\Policies\\{31B2F340-016D-11D2-945F-00C04FB984F9}\\MACHINE\\Microsoft\\Windows NT\\SecEdit\\GptTmpl.inf\"","","Parse the default domain policy .inf for dev.testlab.local using alternate credentials.","",".OUTPUTS","","Hashtable","","Ouputs a hashtable representing the parsed GptTmpl.inf file.","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType([Hashtable])]","    [CmdletBinding()]","    Param (","        [Parameter(Mandatory = $True, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('gpcfilesyspath', 'Path')]","        [String]","        $GptTmplPath,","","        [Switch]","        $OutputObject,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    BEGIN {","        $MappedPaths = @{}","    }","","    PROCESS {","        try {","            if (($GptTmplPath -Match '\\\\\\\\.*\\\\.*') -and ($PSBoundParameters['Credential'])) {","                $SysVolPath = \"\\\\$((New-Object System.Uri($GptTmplPath)).Host)\\SYSVOL\"","                if (-not $MappedPaths[$SysVolPath]) {","                    # map IPC$ to this computer if it's not already","                    Add-RemoteConnection -Path $SysVolPath -Credential $Credential","                    $MappedPaths[$SysVolPath] = $True","                }","            }","","            $TargetGptTmplPath = $GptTmplPath","            if (-not $TargetGptTmplPath.EndsWith('.inf')) {","                $TargetGptTmplPath += '\\MACHINE\\Microsoft\\Windows NT\\SecEdit\\GptTmpl.inf'","            }","","            Write-Verbose \"[Get-GptTmpl] Parsing GptTmplPath: $TargetGptTmplPath\"","","            if ($PSBoundParameters['OutputObject']) {","                $Contents = Get-IniContent -Path $TargetGptTmplPath -OutputObject -ErrorAction Stop","                if ($Contents) {","                    $Contents | Add-Member Noteproperty 'Path' $TargetGptTmplPath","                    $Contents","                }","            }","            else {","                $Contents = Get-IniContent -Path $TargetGptTmplPath -ErrorAction Stop","                if ($Contents) {","                    $Contents['Path'] = $TargetGptTmplPath","                    $Contents","                }","            }","        }","        catch {","            Write-Verbose \"[Get-GptTmpl] Error parsing $TargetGptTmplPath : $_\"","        }","    }","","    END {","        # remove the SYSVOL mappings","        $MappedPaths.Keys | ForEach-Object { Remove-RemoteConnection -Path $_ }","    }","}","","","function Get-GroupsXML {","\u003c#",".SYNOPSIS","","Helper to parse a groups.xml file path into a custom object.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: Add-RemoteConnection, Remove-RemoteConnection, ConvertTo-SID  ","",".DESCRIPTION","","Parses a groups.xml into a custom object. If -Credential is passed,","Add-RemoteConnection is used to mount \\\\TARGET\\SYSVOL with the specified creds,","the files are parsed, and the connection is destroyed later with Remove-RemoteConnection.","",".PARAMETER GroupsXMLpath","","Specifies the groups.xml file path name to parse.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the remote system.","",".OUTPUTS","","PowerView.GroupsXML","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType('PowerView.GroupsXML')]","    [CmdletBinding()]","    Param (","        [Parameter(Mandatory = $True, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('Path')]","        [String]","        $GroupsXMLPath,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    BEGIN {","        $MappedPaths = @{}","    }","","    PROCESS {","        try {","            if (($GroupsXMLPath -Match '\\\\\\\\.*\\\\.*') -and ($PSBoundParameters['Credential'])) {","                $SysVolPath = \"\\\\$((New-Object System.Uri($GroupsXMLPath)).Host)\\SYSVOL\"","                if (-not $MappedPaths[$SysVolPath]) {","                    # map IPC$ to this computer if it's not already","                    Add-RemoteConnection -Path $SysVolPath -Credential $Credential","                    $MappedPaths[$SysVolPath] = $True","                }","            }","","            [XML]$GroupsXMLcontent = Get-Content -Path $GroupsXMLPath -ErrorAction Stop","","            # process all group properties in the XML","            $GroupsXMLcontent | Select-Xml \"/Groups/Group\" | Select-Object -ExpandProperty node | ForEach-Object {","","                $Groupname = $_.Properties.groupName","","                # extract the localgroup sid for memberof","                $GroupSID = $_.Properties.groupSid","                if (-not $GroupSID) {","                    if ($Groupname -match 'Administrators') {","                        $GroupSID = 'S-1-5-32-544'","                    }","                    elseif ($Groupname -match 'Remote Desktop') {","                        $GroupSID = 'S-1-5-32-555'","                    }","                    elseif ($Groupname -match 'Guests') {","                        $GroupSID = 'S-1-5-32-546'","                    }","                    else {","                        if ($PSBoundParameters['Credential']) {","                            $GroupSID = ConvertTo-SID -ObjectName $Groupname -Credential $Credential","                        }","                        else {","                            $GroupSID = ConvertTo-SID -ObjectName $Groupname","                        }","                    }","                }","","                # extract out members added to this group","                $Members = $_.Properties.members | Select-Object -ExpandProperty Member | Where-Object { $_.action -match 'ADD' } | ForEach-Object {","                    if ($_.sid) { $_.sid }","                    else { $_.name }","                }","","                if ($Members) {","                    # extract out any/all filters...I hate you GPP","                    if ($_.filters) {","                        $Filters = $_.filters.GetEnumerator() | ForEach-Object {","                            New-Object -TypeName PSObject -Property @{'Type' = $_.LocalName;'Value' = $_.name}","                        }","                    }","                    else {","                        $Filters = $Null","                    }","","                    if ($Members -isnot [System.Array]) { $Members = @($Members) }","","                    $GroupsXML = New-Object PSObject","                    $GroupsXML | Add-Member Noteproperty 'GPOPath' $TargetGroupsXMLPath","                    $GroupsXML | Add-Member Noteproperty 'Filters' $Filters","                    $GroupsXML | Add-Member Noteproperty 'GroupName' $GroupName","                    $GroupsXML | Add-Member Noteproperty 'GroupSID' $GroupSID","                    $GroupsXML | Add-Member Noteproperty 'GroupMemberOf' $Null","                    $GroupsXML | Add-Member Noteproperty 'GroupMembers' $Members","                    $GroupsXML.PSObject.TypeNames.Insert(0, 'PowerView.GroupsXML')","                    $GroupsXML","                }","            }","        }","        catch {","            Write-Verbose \"[Get-GroupsXML] Error parsing $TargetGroupsXMLPath : $_\"","        }","    }","","    END {","        # remove the SYSVOL mappings","        $MappedPaths.Keys | ForEach-Object { Remove-RemoteConnection -Path $_ }","    }","}","","","function Get-DomainGPO {","\u003c#",".SYNOPSIS","","Return all GPOs or specific GPO objects in AD.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: Get-DomainSearcher, Get-DomainComputer, Get-DomainUser, Get-DomainOU, Get-NetComputerSiteName, Get-DomainSite, Get-DomainObject, Convert-LDAPProperty  ","",".DESCRIPTION","","Builds a directory searcher object using Get-DomainSearcher, builds a custom","LDAP filter based on targeting/filter parameters, and searches for all objects","matching the criteria. To only return specific properties, use","\"-Properties samaccountname,usnchanged,...\". By default, all GPO objects for","the current domain are returned. To enumerate all GPOs that are applied to","a particular machine, use -ComputerName X.","",".PARAMETER Identity","","A display name (e.g. 'Test GPO'), DistinguishedName (e.g. 'CN={F260B76D-55C8-46C5-BEF1-9016DD98E272},CN=Policies,CN=System,DC=testlab,DC=local'),","GUID (e.g. '10ec320d-3111-4ef4-8faf-8f14f4adc789'), or GPO name (e.g. '{F260B76D-55C8-46C5-BEF1-9016DD98E272}'). Wildcards accepted.","",".PARAMETER ComputerIdentity","","Return all GPO objects applied to a given computer identity (name, dnsname, DistinguishedName, etc.).","",".PARAMETER UserIdentity","","Return all GPO objects applied to a given user identity (name, SID, DistinguishedName, etc.).","",".PARAMETER Domain","","Specifies the domain to use for the query, defaults to the current domain.","",".PARAMETER LDAPFilter","","Specifies an LDAP query string that is used to filter Active Directory objects.","",".PARAMETER Properties","","Specifies the properties of the output object to retrieve from the server.","",".PARAMETER SearchBase","","The LDAP source to search through, e.g. \"LDAP://OU=secret,DC=testlab,DC=local\"","Useful for OU queries.","",".PARAMETER Server","","Specifies an Active Directory server (domain controller) to bind to.","",".PARAMETER SearchScope","","Specifies the scope to search under, Base/OneLevel/Subtree (default of Subtree).","",".PARAMETER ResultPageSize","","Specifies the PageSize to set for the LDAP searcher object.","",".PARAMETER ServerTimeLimit","","Specifies the maximum amount of time the server spends searching. Default of 120 seconds.","",".PARAMETER SecurityMasks","","Specifies an option for examining security information of a directory object.","One of 'Dacl', 'Group', 'None', 'Owner', 'Sacl'.","",".PARAMETER Tombstone","","Switch. Specifies that the searcher should also return deleted/tombstoned objects.","",".PARAMETER FindOne","","Only return one result object.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target domain.","",".PARAMETER Raw","","Switch. Return raw results instead of translating the fields into a custom PSObject.","",".EXAMPLE","","Get-DomainGPO -Domain testlab.local","","Return all GPOs for the testlab.local domain","",".EXAMPLE","","Get-DomainGPO -ComputerName windows1.testlab.local","","Returns all GPOs applied windows1.testlab.local","",".EXAMPLE","","\"{F260B76D-55C8-46C5-BEF1-9016DD98E272}\",\"Test GPO\" | Get-DomainGPO","","Return the GPOs with the name of \"{F260B76D-55C8-46C5-BEF1-9016DD98E272}\" and the display","name of \"Test GPO\"","",".EXAMPLE","","Get-DomainGPO -LDAPFilter '(!primarygroupid=513)' -Properties samaccountname,lastlogon","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Get-DomainGPO -Credential $Cred","",".OUTPUTS","","PowerView.GPO","","Custom PSObject with translated GPO property fields.","","PowerView.GPO.Raw","","The raw DirectoryServices.SearchResult object, if -Raw is enabled.","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSUseDeclaredVarsMoreThanAssignments', '')]","    [OutputType('PowerView.GPO')]","    [OutputType('PowerView.GPO.Raw')]","    [CmdletBinding(DefaultParameterSetName = 'None')]","    Param(","        [Parameter(Position = 0, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('DistinguishedName', 'SamAccountName', 'Name')]","        [String[]]","        $Identity,","","        [Parameter(ParameterSetName = 'ComputerIdentity')]","        [Alias('ComputerName')]","        [ValidateNotNullOrEmpty()]","        [String]","        $ComputerIdentity,","","        [Parameter(ParameterSetName = 'UserIdentity')]","        [Alias('UserName')]","        [ValidateNotNullOrEmpty()]","        [String]","        $UserIdentity,","","        [ValidateNotNullOrEmpty()]","        [String]","        $Domain,","","        [ValidateNotNullOrEmpty()]","        [Alias('Filter')]","        [String]","        $LDAPFilter,","","        [ValidateNotNullOrEmpty()]","        [String[]]","        $Properties,","","        [ValidateNotNullOrEmpty()]","        [Alias('ADSPath')]","        [String]","        $SearchBase,","","        [ValidateNotNullOrEmpty()]","        [Alias('DomainController')]","        [String]","        $Server,","","        [ValidateSet('Base', 'OneLevel', 'Subtree')]","        [String]","        $SearchScope = 'Subtree',","","        [ValidateRange(1, 10000)]","        [Int]","        $ResultPageSize = 200,","","        [ValidateRange(1, 10000)]","        [Int]","        $ServerTimeLimit,","","        [ValidateSet('Dacl', 'Group', 'None', 'Owner', 'Sacl')]","        [String]","        $SecurityMasks,","","        [Switch]","        $Tombstone,","","        [Alias('ReturnOne')]","        [Switch]","        $FindOne,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty,","","        [Switch]","        $Raw","    )","","    BEGIN {","        $SearcherArguments = @{}","        if ($PSBoundParameters['Domain']) { $SearcherArguments['Domain'] = $Domain }","        if ($PSBoundParameters['Properties']) { $SearcherArguments['Properties'] = $Properties }","        if ($PSBoundParameters['SearchBase']) { $SearcherArguments['SearchBase'] = $SearchBase }","        if ($PSBoundParameters['Server']) { $SearcherArguments['Server'] = $Server }","        if ($PSBoundParameters['SearchScope']) { $SearcherArguments['SearchScope'] = $SearchScope }","        if ($PSBoundParameters['ResultPageSize']) { $SearcherArguments['ResultPageSize'] = $ResultPageSize }","        if ($PSBoundParameters['ServerTimeLimit']) { $SearcherArguments['ServerTimeLimit'] = $ServerTimeLimit }","        if ($PSBoundParameters['SecurityMasks']) { $SearcherArguments['SecurityMasks'] = $SecurityMasks }","        if ($PSBoundParameters['Tombstone']) { $SearcherArguments['Tombstone'] = $Tombstone }","        if ($PSBoundParameters['Credential']) { $SearcherArguments['Credential'] = $Credential }","        $GPOSearcher = Get-DomainSearcher @SearcherArguments","    }","","    PROCESS {","        if ($GPOSearcher) {","            if ($PSBoundParameters['ComputerIdentity'] -or $PSBoundParameters['UserIdentity']) {","                $GPOAdsPaths = @()","                if ($SearcherArguments['Properties']) {","                    $OldProperties = $SearcherArguments['Properties']","                }","                $SearcherArguments['Properties'] = 'distinguishedname,dnshostname'","                $TargetComputerName = $Null","","                if ($PSBoundParameters['ComputerIdentity']) {","                    $SearcherArguments['Identity'] = $ComputerIdentity","                    $Computer = Get-DomainComputer @SearcherArguments -FindOne | Select-Object -First 1","                    if(-not $Computer) {","                        Write-Verbose \"[Get-DomainGPO] Computer '$ComputerIdentity' not found!\"","                    }","                    $ObjectDN = $Computer.distinguishedname","                    $TargetComputerName = $Computer.dnshostname","                }","                else {","                    $SearcherArguments['Identity'] = $UserIdentity","                    $User = Get-DomainUser @SearcherArguments -FindOne | Select-Object -First 1","                    if(-not $User) {","                        Write-Verbose \"[Get-DomainGPO] User '$UserIdentity' not found!\"","                    }","                    $ObjectDN = $User.distinguishedname","                }","","                # extract all OUs the target user/computer is a part of","                $ObjectOUs = @()","                $ObjectOUs += $ObjectDN.split(',') | ForEach-Object {","                    if($_.startswith('OU=')) {","                        $ObjectDN.SubString($ObjectDN.IndexOf(\"$($_),\"))","                    }","                }","                Write-Verbose \"[Get-DomainGPO] object OUs: $ObjectOUs\"","","                if ($ObjectOUs) {","                    # find all the GPOs linked to the user/computer's OUs","                    $SearcherArguments.Remove('Properties')","                    $InheritanceDisabled = $False","                    ForEach($ObjectOU in $ObjectOUs) {","                        $SearcherArguments['Identity'] = $ObjectOU","                        $GPOAdsPaths += Get-DomainOU @SearcherArguments | ForEach-Object {","                            # extract any GPO links for this particular OU the computer is a part of","                            if ($_.gplink) {","                                $_.gplink.split('][') | ForEach-Object {","                                    if ($_.startswith('LDAP')) {","                                        $Parts = $_.split(';')","                                        $GpoDN = $Parts[0]","                                        $Enforced = $Parts[1]","","                                        if ($InheritanceDisabled) {","                                            # if inheritance has already been disabled and this GPO is set as \"enforced\"","                                            #   then add it, otherwise ignore it","                                            if ($Enforced -eq 2) {","                                                $GpoDN","                                            }","                                        }","                                        else {","                                            # inheritance not marked as disabled yet","                                            $GpoDN","                                        }","                                    }","                                }","                            }","","                            # if this OU has GPO inheritence disabled, break so additional OUs aren't processed","                            if ($_.gpoptions -eq 1) {","                                $InheritanceDisabled = $True","                            }","                        }","                    }","                }","","                if ($TargetComputerName) {","                    # find all the GPOs linked to the computer's site","                    $ComputerSite = (Get-NetComputerSiteName -ComputerName $TargetComputerName).SiteName","                    if($ComputerSite -and ($ComputerSite -notlike 'Error*')) {","                        $SearcherArguments['Identity'] = $ComputerSite","                        $GPOAdsPaths += Get-DomainSite @SearcherArguments | ForEach-Object {","                            if($_.gplink) {","                                # extract any GPO links for this particular site the computer is a part of","                                $_.gplink.split('][') | ForEach-Object {","                                    if ($_.startswith('LDAP')) {","                                        $_.split(';')[0]","                                    }","                                }","                            }","                        }","                    }","                }","","                # find any GPOs linked to the user/computer's domain","                $ObjectDomainDN = $ObjectDN.SubString($ObjectDN.IndexOf('DC='))","                $SearcherArguments.Remove('Identity')","                $SearcherArguments.Remove('Properties')","                $SearcherArguments['LDAPFilter'] = \"(objectclass=domain)(distinguishedname=$ObjectDomainDN)\"","                $GPOAdsPaths += Get-DomainObject @SearcherArguments | ForEach-Object {","                    if($_.gplink) {","                        # extract any GPO links for this particular domain the computer is a part of","                        $_.gplink.split('][') | ForEach-Object {","                            if ($_.startswith('LDAP')) {","                                $_.split(';')[0]","                            }","                        }","                    }","                }","                Write-Verbose \"[Get-DomainGPO] GPOAdsPaths: $GPOAdsPaths\"","","                # restore the old properites to return, if set","                if ($OldProperties) { $SearcherArguments['Properties'] = $OldProperties }","                else { $SearcherArguments.Remove('Properties') }","                $SearcherArguments.Remove('Identity')","","                $GPOAdsPaths | Where-Object {$_ -and ($_ -ne '')} | ForEach-Object {","                    # use the gplink as an ADS path to enumerate all GPOs for the computer","                    $SearcherArguments['SearchBase'] = $_","                    $SearcherArguments['LDAPFilter'] = \"(objectCategory=groupPolicyContainer)\"","                    Get-DomainObject @SearcherArguments | ForEach-Object {","                        if ($PSBoundParameters['Raw']) {","                            $_.PSObject.TypeNames.Insert(0, 'PowerView.GPO.Raw')","                        }","                        else {","                            $_.PSObject.TypeNames.Insert(0, 'PowerView.GPO')","                        }","                        $_","                    }","                }","            }","            else {","                $IdentityFilter = ''","                $Filter = ''","                $Identity | Where-Object {$_} | ForEach-Object {","                    $IdentityInstance = $_.Replace('(', '\\28').Replace(')', '\\29')","                    if ($IdentityInstance -match 'LDAP://|^CN=.*') {","                        $IdentityFilter += \"(distinguishedname=$IdentityInstance)\"","                        if ((-not $PSBoundParameters['Domain']) -and (-not $PSBoundParameters['SearchBase'])) {","                            # if a -Domain isn't explicitly set, extract the object domain out of the distinguishedname","                            #   and rebuild the domain searcher","                            $IdentityDomain = $IdentityInstance.SubString($IdentityInstance.IndexOf('DC=')) -replace 'DC=','' -replace ',','.'","                            Write-Verbose \"[Get-DomainGPO] Extracted domain '$IdentityDomain' from '$IdentityInstance'\"","                            $SearcherArguments['Domain'] = $IdentityDomain","                            $GPOSearcher = Get-DomainSearcher @SearcherArguments","                            if (-not $GPOSearcher) {","                                Write-Warning \"[Get-DomainGPO] Unable to retrieve domain searcher for '$IdentityDomain'\"","                            }","                        }","                    }","                    elseif ($IdentityInstance -match '{.*}') {","                        $IdentityFilter += \"(name=$IdentityInstance)\"","                    }","                    else {","                        try {","                            $GuidByteString = (-Join (([Guid]$IdentityInstance).ToByteArray() | ForEach-Object {$_.ToString('X').PadLeft(2,'0')})) -Replace '(..)','\\$1'","                            $IdentityFilter += \"(objectguid=$GuidByteString)\"","                        }","                        catch {","                            $IdentityFilter += \"(displayname=$IdentityInstance)\"","                        }","                    }","                }","                if ($IdentityFilter -and ($IdentityFilter.Trim() -ne '') ) {","                    $Filter += \"(|$IdentityFilter)\"","                }","","                if ($PSBoundParameters['LDAPFilter']) {","                    Write-Verbose \"[Get-DomainGPO] Using additional LDAP filter: $LDAPFilter\"","                    $Filter += \"$LDAPFilter\"","                }","","                $GPOSearcher.filter = \"(\u0026(objectCategory=groupPolicyContainer)$Filter)\"","                Write-Verbose \"[Get-DomainGPO] filter string: $($GPOSearcher.filter)\"","","                if ($PSBoundParameters['FindOne']) { $Results = $GPOSearcher.FindOne() }","                else { $Results = $GPOSearcher.FindAll() }","                $Results | Where-Object {$_} | ForEach-Object {","                    if ($PSBoundParameters['Raw']) {","                        # return raw result objects","                        $GPO = $_","                        $GPO.PSObject.TypeNames.Insert(0, 'PowerView.GPO.Raw')","                    }","                    else {","                        if ($PSBoundParameters['SearchBase'] -and ($SearchBase -Match '^GC://')) {","                            $GPO = Convert-LDAPProperty -Properties $_.Properties","                            try {","                                $GPODN = $GPO.distinguishedname","                                $GPODomain = $GPODN.SubString($GPODN.IndexOf('DC=')) -replace 'DC=','' -replace ',','.'","                                $gpcfilesyspath = \"\\\\$GPODomain\\SysVol\\$GPODomain\\Policies\\$($GPO.cn)\"","                                $GPO | Add-Member Noteproperty 'gpcfilesyspath' $gpcfilesyspath","                            }","                            catch {","                                Write-Verbose \"[Get-DomainGPO] Error calculating gpcfilesyspath for: $($GPO.distinguishedname)\"","                            }","                        }","                        else {","                            $GPO = Convert-LDAPProperty -Properties $_.Properties","                        }","                        $GPO.PSObject.TypeNames.Insert(0, 'PowerView.GPO')","                    }","                    $GPO","                }","                if ($Results) {","                    try { $Results.dispose() }","                    catch {","                        Write-Verbose \"[Get-DomainGPO] Error disposing of the Results object: $_\"","                    }","                }","                $GPOSearcher.dispose()","            }","        }","    }","}","","","function Get-DomainGPOLocalGroup {","\u003c#",".SYNOPSIS","","Returns all GPOs in a domain that modify local group memberships through 'Restricted Groups'","or Group Policy preferences. Also return their user membership mappings, if they exist.","","Author: @harmj0y  ","License: BSD 3-Clause  ","Required Dependencies: Get-DomainGPO, Get-GptTmpl, Get-GroupsXML, ConvertTo-SID, ConvertFrom-SID  ","",".DESCRIPTION","","First enumerates all GPOs in the current/target domain using Get-DomainGPO with passed","arguments, and for each GPO checks if 'Restricted Groups' are set with GptTmpl.inf or","group membership is set through Group Policy Preferences groups.xml files. For any","GptTmpl.inf files found, the file is parsed with Get-GptTmpl and any 'Group Membership'","section data is processed if present. Any found Groups.xml files are parsed with","Get-GroupsXML and those memberships are returned as well.","",".PARAMETER Identity","","A display name (e.g. 'Test GPO'), DistinguishedName (e.g. 'CN={F260B76D-55C8-46C5-BEF1-9016DD98E272},CN=Policies,CN=System,DC=testlab,DC=local'),","GUID (e.g. '10ec320d-3111-4ef4-8faf-8f14f4adc789'), or GPO name (e.g. '{F260B76D-55C8-46C5-BEF1-9016DD98E272}'). Wildcards accepted.","",".PARAMETER ResolveMembersToSIDs","","Switch. Indicates that any member names should be resolved to their domain SIDs.","",".PARAMETER Domain","","Specifies the domain to use for the query, defaults to the current domain.","",".PARAMETER LDAPFilter","","Specifies an LDAP query string that is used to filter Active Directory objects.","",".PARAMETER SearchBase","","The LDAP source to search through, e.g. \"LDAP://OU=secret,DC=testlab,DC=local\"","Useful for OU queries.","",".PARAMETER Server","","Specifies an Active Directory server (domain controller) to bind to.","",".PARAMETER SearchScope","","Specifies the scope to search under, Base/OneLevel/Subtree (default of Subtree).","",".PARAMETER ResultPageSize","","Specifies the PageSize to set for the LDAP searcher object.","",".PARAMETER ServerTimeLimit","","Specifies the maximum amount of time the server spends searching. Default of 120 seconds.","",".PARAMETER Tombstone","","Switch. Specifies that the searcher should also return deleted/tombstoned objects.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target domain.","",".EXAMPLE","","Get-DomainGPOLocalGroup","","Returns all local groups set by GPO along with their members and memberof.","",".EXAMPLE","","Get-DomainGPOLocalGroup -ResolveMembersToSIDs","","Returns all local groups set by GPO along with their members and memberof,","and resolve any members to their domain SIDs.","",".EXAMPLE","","'{0847C615-6C4E-4D45-A064-6001040CC21C}' | Get-DomainGPOLocalGroup","","Return any GPO-set groups for the GPO with the given name/GUID.","",".EXAMPLE","","Get-DomainGPOLocalGroup 'Desktops'","","Return any GPO-set groups for the GPO with the given display name.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Get-DomainGPOLocalGroup -Credential $Cred","",".LINK","","https://morgansimonsenblog.azurewebsites.net/tag/groups/","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType('PowerView.GPOGroup')]","    [CmdletBinding()]","    Param(","        [Parameter(Position = 0, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('DistinguishedName', 'SamAccountName', 'Name')]","        [String[]]","        $Identity,","","        [Switch]","        $ResolveMembersToSIDs,","","        [ValidateNotNullOrEmpty()]","        [String]","        $Domain,","","        [ValidateNotNullOrEmpty()]","        [Alias('Filter')]","        [String]","        $LDAPFilter,","","        [ValidateNotNullOrEmpty()]","        [Alias('ADSPath')]","        [String]","        $SearchBase,","","        [ValidateNotNullOrEmpty()]","        [Alias('DomainController')]","        [String]","        $Server,","","        [ValidateSet('Base', 'OneLevel', 'Subtree')]","        [String]","        $SearchScope = 'Subtree',","","        [ValidateRange(1, 10000)]","        [Int]","        $ResultPageSize = 200,","","        [ValidateRange(1, 10000)]","        [Int]","        $ServerTimeLimit,","","        [Switch]","        $Tombstone,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    BEGIN {","        $SearcherArguments = @{}","        if ($PSBoundParameters['Domain']) { $SearcherArguments['Domain'] = $Domain }","        if ($PSBoundParameters['LDAPFilter']) { $SearcherArguments['LDAPFilter'] = $Domain }","        if ($PSBoundParameters['SearchBase']) { $SearcherArguments['SearchBase'] = $SearchBase }","        if ($PSBoundParameters['Server']) { $SearcherArguments['Server'] = $Server }","        if ($PSBoundParameters['SearchScope']) { $SearcherArguments['SearchScope'] = $SearchScope }","        if ($PSBoundParameters['ResultPageSize']) { $SearcherArguments['ResultPageSize'] = $ResultPageSize }","        if ($PSBoundParameters['ServerTimeLimit']) { $SearcherArguments['ServerTimeLimit'] = $ServerTimeLimit }","        if ($PSBoundParameters['Tombstone']) { $SearcherArguments['Tombstone'] = $Tombstone }","        if ($PSBoundParameters['Credential']) { $SearcherArguments['Credential'] = $Credential }","","        $ConvertArguments = @{}","        if ($PSBoundParameters['Domain']) { $ConvertArguments['Domain'] = $Domain }","        if ($PSBoundParameters['Server']) { $ConvertArguments['Server'] = $Server }","        if ($PSBoundParameters['Credential']) { $ConvertArguments['Credential'] = $Credential }","","        $SplitOption = [System.StringSplitOptions]::RemoveEmptyEntries","    }","","    PROCESS {","        if ($PSBoundParameters['Identity']) { $SearcherArguments['Identity'] = $Identity }","","        Get-DomainGPO @SearcherArguments | ForEach-Object {","            $GPOdisplayName = $_.displayname","            $GPOname = $_.name","            $GPOPath = $_.gpcfilesyspath","","            $ParseArgs =  @{ 'GptTmplPath' = \"$GPOPath\\MACHINE\\Microsoft\\Windows NT\\SecEdit\\GptTmpl.inf\" }","            if ($PSBoundParameters['Credential']) { $ParseArgs['Credential'] = $Credential }","","            # first parse the 'Restricted Groups' file (GptTmpl.inf) if it exists","            $Inf = Get-GptTmpl @ParseArgs","","            if ($Inf -and ($Inf.psbase.Keys -contains 'Group Membership')) {","                $Memberships = @{}","","                # parse the members/memberof fields for each entry","                ForEach ($Membership in $Inf.'Group Membership'.GetEnumerator()) {","                    $Group, $Relation = $Membership.Key.Split('__', $SplitOption) | ForEach-Object {$_.Trim()}","                    # extract out ALL members","                    $MembershipValue = $Membership.Value | Where-Object {$_} | ForEach-Object { $_.Trim('*') } | Where-Object {$_}","","                    if ($PSBoundParameters['ResolveMembersToSIDs']) {","                        # if the resulting member is username and not a SID, attempt to resolve it","                        $GroupMembers = @()","                        ForEach ($Member in $MembershipValue) {","                            if ($Member -and ($Member.Trim() -ne '')) {","                                if ($Member -notmatch '^S-1-.*') {","                                    $ConvertToArguments = @{'ObjectName' = $Member}","                                    if ($PSBoundParameters['Domain']) { $ConvertToArguments['Domain'] = $Domain }","                                    $MemberSID = ConvertTo-SID @ConvertToArguments","","                                    if ($MemberSID) {","                                        $GroupMembers += $MemberSID","                                    }","                                    else {","                                        $GroupMembers += $Member","                                    }","                                }","                                else {","                                    $GroupMembers += $Member","                                }","                            }","                        }","                        $MembershipValue = $GroupMembers","                    }","","                    if (-not $Memberships[$Group]) {","                        $Memberships[$Group] = @{}","                    }","                    if ($MembershipValue -isnot [System.Array]) {$MembershipValue = @($MembershipValue)}","                    $Memberships[$Group].Add($Relation, $MembershipValue)","                }","","                ForEach ($Membership in $Memberships.GetEnumerator()) {","                    if ($Membership -and $Membership.Key -and ($Membership.Key -match '^\\*')) {","                        # if the SID is already resolved (i.e. begins with *) try to resolve SID to a name","                        $GroupSID = $Membership.Key.Trim('*')","                        if ($GroupSID -and ($GroupSID.Trim() -ne '')) {","                            $GroupName = ConvertFrom-SID -ObjectSID $GroupSID @ConvertArguments","                        }","                        else {","                            $GroupName = $False","                        }","                    }","                    else {","                        $GroupName = $Membership.Key","","                        if ($GroupName -and ($GroupName.Trim() -ne '')) {","                            if ($Groupname -match 'Administrators') {","                                $GroupSID = 'S-1-5-32-544'","                            }","                            elseif ($Groupname -match 'Remote Desktop') {","                                $GroupSID = 'S-1-5-32-555'","                            }","                            elseif ($Groupname -match 'Guests') {","                                $GroupSID = 'S-1-5-32-546'","                            }","                            elseif ($GroupName.Trim() -ne '') {","                                $ConvertToArguments = @{'ObjectName' = $Groupname}","                                if ($PSBoundParameters['Domain']) { $ConvertToArguments['Domain'] = $Domain }","                                $GroupSID = ConvertTo-SID @ConvertToArguments","                            }","                            else {","                                $GroupSID = $Null","                            }","                        }","                    }","","                    $GPOGroup = New-Object PSObject","                    $GPOGroup | Add-Member Noteproperty 'GPODisplayName' $GPODisplayName","                    $GPOGroup | Add-Member Noteproperty 'GPOName' $GPOName","                    $GPOGroup | Add-Member Noteproperty 'GPOPath' $GPOPath","                    $GPOGroup | Add-Member Noteproperty 'GPOType' 'RestrictedGroups'","                    $GPOGroup | Add-Member Noteproperty 'Filters' $Null","                    $GPOGroup | Add-Member Noteproperty 'GroupName' $GroupName","                    $GPOGroup | Add-Member Noteproperty 'GroupSID' $GroupSID","                    $GPOGroup | Add-Member Noteproperty 'GroupMemberOf' $Membership.Value.Memberof","                    $GPOGroup | Add-Member Noteproperty 'GroupMembers' $Membership.Value.Members","                    $GPOGroup.PSObject.TypeNames.Insert(0, 'PowerView.GPOGroup')","                    $GPOGroup","                }","            }","","            # now try to the parse group policy preferences file (Groups.xml) if it exists","            $ParseArgs =  @{","                'GroupsXMLpath' = \"$GPOPath\\MACHINE\\Preferences\\Groups\\Groups.xml\"","            }","","            Get-GroupsXML @ParseArgs | ForEach-Object {","                if ($PSBoundParameters['ResolveMembersToSIDs']) {","                    $GroupMembers = @()","                    ForEach ($Member in $_.GroupMembers) {","                        if ($Member -and ($Member.Trim() -ne '')) {","                            if ($Member -notmatch '^S-1-.*') {","","                                # if the resulting member is username and not a SID, attempt to resolve it","                                $ConvertToArguments = @{'ObjectName' = $Groupname}","                                if ($PSBoundParameters['Domain']) { $ConvertToArguments['Domain'] = $Domain }","                                $MemberSID = ConvertTo-SID -Domain $Domain -ObjectName $Member","","                                if ($MemberSID) {","                                    $GroupMembers += $MemberSID","                                }","                                else {","                                    $GroupMembers += $Member","                                }","                            }","                            else {","                                $GroupMembers += $Member","                            }","                        }","                    }","                    $_.GroupMembers = $GroupMembers","                }","","                $_ | Add-Member Noteproperty 'GPODisplayName' $GPODisplayName","                $_ | Add-Member Noteproperty 'GPOName' $GPOName","                $_ | Add-Member Noteproperty 'GPOType' 'GroupPolicyPreferences'","                $_.PSObject.TypeNames.Insert(0, 'PowerView.GPOGroup')","                $_","            }","        }","    }","}","","","function Get-DomainGPOUserLocalGroupMapping {","\u003c#",".SYNOPSIS","","Enumerates the machines where a specific domain user/group is a member of a specific","local group, all through GPO correlation. If no user/group is specified, all","discoverable mappings are returned.","","Author: @harmj0y  ","License: BSD 3-Clause  ","Required Dependencies: Get-DomainGPOLocalGroup, Get-DomainObject, Get-DomainComputer, Get-DomainOU, Get-DomainSite, Get-DomainGroup  ","",".DESCRIPTION","","Takes a user/group name and optional domain, and determines the computers in the domain","the user/group has local admin (or RDP) rights to.","","It does this by:","    1.  resolving the user/group to its proper SID","    2.  enumerating all groups the user/group is a current part of","        and extracting all target SIDs to build a target SID list","    3.  pulling all GPOs that set 'Restricted Groups' or Groups.xml by calling","        Get-DomainGPOLocalGroup","    4.  matching the target SID list to the queried GPO SID list","        to enumerate all GPO the user is effectively applied with","    5.  enumerating all OUs and sites and applicable GPO GUIs are","        applied to through gplink enumerating","    6.  querying for all computers under the given OUs or sites","","If no user/group is specified, all user/group -\u003e machine mappings discovered through","GPO relationships are returned.","",".PARAMETER Identity","","A SamAccountName (e.g. harmj0y), DistinguishedName (e.g. CN=harmj0y,CN=Users,DC=testlab,DC=local),","SID (e.g. S-1-5-21-890171859-3433809279-3366196753-1108), or GUID (e.g. 4c435dd7-dc58-4b14-9a5e-1fdb0e80d201)","for the user/group to identity GPO local group mappings for.","",".PARAMETER LocalGroup","","The local group to check access against.","Can be \"Administrators\" (S-1-5-32-544), \"RDP/Remote Desktop Users\" (S-1-5-32-555),","or a custom local SID. Defaults to local 'Administrators'.","",".PARAMETER Domain","","Specifies the domain to enumerate GPOs for, defaults to the current domain.","",".PARAMETER Server","","Specifies an Active Directory server (domain controller) to bind to.","",".PARAMETER SearchScope","","Specifies the scope to search under, Base/OneLevel/Subtree (default of Subtree).","",".PARAMETER ResultPageSize","","Specifies the PageSize to set for the LDAP searcher object.","",".PARAMETER ServerTimeLimit","","Specifies the maximum amount of time the server spends searching. Default of 120 seconds.","",".PARAMETER Tombstone","","Switch. Specifies that the searcher should also return deleted/tombstoned objects.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target domain.","",".EXAMPLE","","Get-DomainGPOUserLocalGroupMapping","","Find all user/group -\u003e machine relationships where the user/group is a member","of the local administrators group on target machines.","",".EXAMPLE","","Get-DomainGPOUserLocalGroupMapping -Identity dfm -Domain dev.testlab.local","","Find all computers that dfm user has local administrator rights to in","the dev.testlab.local domain.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Get-DomainGPOUserLocalGroupMapping -Credential $Cred","",".OUTPUTS","","PowerView.GPOLocalGroupMapping","","A custom PSObject containing any target identity information and what local","group memberships they're a part of through GPO correlation.","",".LINK","","http://www.harmj0y.net/blog/redteaming/where-my-admins-at-gpo-edition/","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType('PowerView.GPOUserLocalGroupMapping')]","    [CmdletBinding()]","    Param(","        [Parameter(Position = 0, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('DistinguishedName', 'SamAccountName', 'Name')]","        [String]","        $Identity,","","        [String]","        [ValidateSet('Administrators', 'S-1-5-32-544', 'RDP', 'Remote Desktop Users', 'S-1-5-32-555')]","        $LocalGroup = 'Administrators',","","        [ValidateNotNullOrEmpty()]","        [String]","        $Domain,","","        [ValidateNotNullOrEmpty()]","        [Alias('ADSPath')]","        [String]","        $SearchBase,","","        [ValidateNotNullOrEmpty()]","        [Alias('DomainController')]","        [String]","        $Server,","","        [ValidateSet('Base', 'OneLevel', 'Subtree')]","        [String]","        $SearchScope = 'Subtree',","","        [ValidateRange(1, 10000)]","        [Int]","        $ResultPageSize = 200,","","        [ValidateRange(1, 10000)]","        [Int]","        $ServerTimeLimit,","","        [Switch]","        $Tombstone,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    BEGIN {","        $CommonArguments = @{}","        if ($PSBoundParameters['Domain']) { $CommonArguments['Domain'] = $Domain }","        if ($PSBoundParameters['Server']) { $CommonArguments['Server'] = $Server }","        if ($PSBoundParameters['SearchScope']) { $CommonArguments['SearchScope'] = $SearchScope }","        if ($PSBoundParameters['ResultPageSize']) { $CommonArguments['ResultPageSize'] = $ResultPageSize }","        if ($PSBoundParameters['ServerTimeLimit']) { $CommonArguments['ServerTimeLimit'] = $ServerTimeLimit }","        if ($PSBoundParameters['Tombstone']) { $CommonArguments['Tombstone'] = $Tombstone }","        if ($PSBoundParameters['Credential']) { $CommonArguments['Credential'] = $Credential }","    }","","    PROCESS {","        $TargetSIDs = @()","","        if ($PSBoundParameters['Identity']) {","            $TargetSIDs += Get-DomainObject @CommonArguments -Identity $Identity | Select-Object -Expand objectsid","            $TargetObjectSID = $TargetSIDs","            if (-not $TargetSIDs) {","                Throw \"[Get-DomainGPOUserLocalGroupMapping] Unable to retrieve SID for identity '$Identity'\"","            }","        }","        else {","            # no filtering/match all","            $TargetSIDs = @('*')","        }","","        if ($LocalGroup -match 'S-1-5') {","            $TargetLocalSID = $LocalGroup","        }","        elseif ($LocalGroup -match 'Admin') {","            $TargetLocalSID = 'S-1-5-32-544'","        }","        else {","            # RDP","            $TargetLocalSID = 'S-1-5-32-555'","        }","","        if ($TargetSIDs[0] -ne '*') {","            ForEach ($TargetSid in $TargetSids) {","                Write-Verbose \"[Get-DomainGPOUserLocalGroupMapping] Enumerating nested group memberships for: '$TargetSid'\"","                $TargetSIDs += Get-DomainGroup @CommonArguments -Properties 'objectsid' -MemberIdentity $TargetSid | Select-Object -ExpandProperty objectsid","            }","        }","","        Write-Verbose \"[Get-DomainGPOUserLocalGroupMapping] Target localgroup SID: $TargetLocalSID\"","        Write-Verbose \"[Get-DomainGPOUserLocalGroupMapping] Effective target domain SIDs: $TargetSIDs\"","","        $GPOgroups = Get-DomainGPOLocalGroup @CommonArguments -ResolveMembersToSIDs | ForEach-Object {","            $GPOgroup = $_","            # if the locally set group is what we're looking for, check the GroupMembers ('members') for our target SID","            if ($GPOgroup.GroupSID -match $TargetLocalSID) {","                $GPOgroup.GroupMembers | Where-Object {$_} | ForEach-Object {","                    if ( ($TargetSIDs[0] -eq '*') -or ($TargetSIDs -Contains $_) ) {","                        $GPOgroup","                    }","                }","            }","            # if the group is a 'memberof' the group we're looking for, check GroupSID against the targt SIDs","            if ( ($GPOgroup.GroupMemberOf -contains $TargetLocalSID) ) {","                if ( ($TargetSIDs[0] -eq '*') -or ($TargetSIDs -Contains $GPOgroup.GroupSID) ) {","                    $GPOgroup","                }","            }","        } | Sort-Object -Property GPOName -Unique","","        $GPOgroups | Where-Object {$_} | ForEach-Object {","            $GPOname = $_.GPODisplayName","            $GPOguid = $_.GPOName","            $GPOPath = $_.GPOPath","            $GPOType = $_.GPOType","            if ($_.GroupMembers) {","                $GPOMembers = $_.GroupMembers","            }","            else {","                $GPOMembers = $_.GroupSID","            }","","            $Filters = $_.Filters","","            if ($TargetSIDs[0] -eq '*') {","                # if the * wildcard was used, set the targets to all GPO members so everything it output","                $TargetObjectSIDs = $GPOMembers","            }","            else {","                $TargetObjectSIDs = $TargetObjectSID","            }","","            # find any OUs that have this GPO linked through gpLink","            Get-DomainOU @CommonArguments -Raw -Properties 'name,distinguishedname' -GPLink $GPOGuid | ForEach-Object {","                if ($Filters) {","                    $OUComputers = Get-DomainComputer @CommonArguments -Properties 'dnshostname,distinguishedname' -SearchBase $_.Path | Where-Object {$_.distinguishedname -match ($Filters.Value)} | Select-Object -ExpandProperty dnshostname","                }","                else {","                    $OUComputers = Get-DomainComputer @CommonArguments -Properties 'dnshostname' -SearchBase $_.Path | Select-Object -ExpandProperty dnshostname","                }","","                if ($OUComputers) {","                    if ($OUComputers -isnot [System.Array]) {$OUComputers = @($OUComputers)}","","                    ForEach ($TargetSid in $TargetObjectSIDs) {","                        $Object = Get-DomainObject @CommonArguments -Identity $TargetSid -Properties 'samaccounttype,samaccountname,distinguishedname,objectsid'","","                        $IsGroup = @('268435456','268435457','536870912','536870913') -contains $Object.samaccounttype","","                        $GPOLocalGroupMapping = New-Object PSObject","                        $GPOLocalGroupMapping | Add-Member Noteproperty 'ObjectName' $Object.samaccountname","                        $GPOLocalGroupMapping | Add-Member Noteproperty 'ObjectDN' $Object.distinguishedname","                        $GPOLocalGroupMapping | Add-Member Noteproperty 'ObjectSID' $Object.objectsid","                        $GPOLocalGroupMapping | Add-Member Noteproperty 'Domain' $Domain","                        $GPOLocalGroupMapping | Add-Member Noteproperty 'IsGroup' $IsGroup","                        $GPOLocalGroupMapping | Add-Member Noteproperty 'GPODisplayName' $GPOname","                        $GPOLocalGroupMapping | Add-Member Noteproperty 'GPOGuid' $GPOGuid","                        $GPOLocalGroupMapping | Add-Member Noteproperty 'GPOPath' $GPOPath","                        $GPOLocalGroupMapping | Add-Member Noteproperty 'GPOType' $GPOType","                        $GPOLocalGroupMapping | Add-Member Noteproperty 'ContainerName' $_.Properties.distinguishedname","                        $GPOLocalGroupMapping | Add-Member Noteproperty 'ComputerName' $OUComputers","                        $GPOLocalGroupMapping.PSObject.TypeNames.Insert(0, 'PowerView.GPOLocalGroupMapping')","                        $GPOLocalGroupMapping","                    }","                }","            }","","            # find any sites that have this GPO linked through gpLink","            Get-DomainSite @CommonArguments -Properties 'siteobjectbl,distinguishedname' -GPLink $GPOGuid | ForEach-Object {","                ForEach ($TargetSid in $TargetObjectSIDs) {","                    $Object = Get-DomainObject @CommonArguments -Identity $TargetSid -Properties 'samaccounttype,samaccountname,distinguishedname,objectsid'","","                    $IsGroup = @('268435456','268435457','536870912','536870913') -contains $Object.samaccounttype","","                    $GPOLocalGroupMapping = New-Object PSObject","                    $GPOLocalGroupMapping | Add-Member Noteproperty 'ObjectName' $Object.samaccountname","                    $GPOLocalGroupMapping | Add-Member Noteproperty 'ObjectDN' $Object.distinguishedname","                    $GPOLocalGroupMapping | Add-Member Noteproperty 'ObjectSID' $Object.objectsid","                    $GPOLocalGroupMapping | Add-Member Noteproperty 'IsGroup' $IsGroup","                    $GPOLocalGroupMapping | Add-Member Noteproperty 'Domain' $Domain","                    $GPOLocalGroupMapping | Add-Member Noteproperty 'GPODisplayName' $GPOname","                    $GPOLocalGroupMapping | Add-Member Noteproperty 'GPOGuid' $GPOGuid","                    $GPOLocalGroupMapping | Add-Member Noteproperty 'GPOPath' $GPOPath","                    $GPOLocalGroupMapping | Add-Member Noteproperty 'GPOType' $GPOType","                    $GPOLocalGroupMapping | Add-Member Noteproperty 'ContainerName' $_.distinguishedname","                    $GPOLocalGroupMapping | Add-Member Noteproperty 'ComputerName' $_.siteobjectbl","                    $GPOLocalGroupMapping.PSObject.TypeNames.Add('PowerView.GPOLocalGroupMapping')","                    $GPOLocalGroupMapping","                }","            }","        }","    }","}","","","function Get-DomainGPOComputerLocalGroupMapping {","\u003c#",".SYNOPSIS","","Takes a computer (or GPO) object and determines what users/groups are in the specified","local group for the machine through GPO correlation.","","Author: @harmj0y  ","License: BSD 3-Clause  ","Required Dependencies: Get-DomainComputer, Get-DomainOU, Get-NetComputerSiteName, Get-DomainSite, Get-DomainGPOLocalGroup  ","",".DESCRIPTION","","This function is the inverse of Get-DomainGPOUserLocalGroupMapping, and finds what users/groups","are in the specified local group for a target machine through GPO correlation.","","If a -ComputerIdentity is specified, retrieve the complete computer object, attempt to","determine the OU the computer is a part of. Then resolve the computer's site name with","Get-NetComputerSiteName and retrieve all sites object Get-DomainSite. For those results, attempt to","enumerate all linked GPOs and associated local group settings with Get-DomainGPOLocalGroup. For","each resulting GPO group, resolve the resulting user/group name to a full AD object and","return the results. This will return the domain objects that are members of the specified","-LocalGroup for the given computer.","","Otherwise, if -OUIdentity is supplied, the same process is executed to find linked GPOs and","localgroup specifications.","",".PARAMETER ComputerIdentity","","A SamAccountName (e.g. WINDOWS10$), DistinguishedName (e.g. CN=WINDOWS10,CN=Computers,DC=testlab,DC=local),","SID (e.g. S-1-5-21-890171859-3433809279-3366196753-1124), GUID (e.g. 4f16b6bc-7010-4cbf-b628-f3cfe20f6994),","or a dns host name (e.g. windows10.testlab.local) for the computer to identity GPO local group mappings for.","",".PARAMETER OUIdentity","","An OU name (e.g. TestOU), DistinguishedName (e.g. OU=TestOU,DC=testlab,DC=local), or","GUID (e.g. 8a9ba22a-8977-47e6-84ce-8c26af4e1e6a) for the OU to identity GPO local group mappings for.","",".PARAMETER LocalGroup","","The local group to check access against.","Can be \"Administrators\" (S-1-5-32-544), \"RDP/Remote Desktop Users\" (S-1-5-32-555),","or a custom local SID. Defaults to local 'Administrators'.","",".PARAMETER Domain","","Specifies the domain to enumerate GPOs for, defaults to the current domain.","",".PARAMETER Server","","Specifies an Active Directory server (domain controller) to bind to.","",".PARAMETER SearchScope","","Specifies the scope to search under, Base/OneLevel/Subtree (default of Subtree).","",".PARAMETER ResultPageSize","","Specifies the PageSize to set for the LDAP searcher object.","",".PARAMETER ServerTimeLimit","","Specifies the maximum amount of time the server spends searching. Default of 120 seconds.","",".PARAMETER Tombstone","","Switch. Specifies that the searcher should also return deleted/tombstoned objects.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target domain.","",".EXAMPLE","","Get-DomainGPOComputerLocalGroupMapping -ComputerName WINDOWS3.testlab.local","","Finds users who have local admin rights over WINDOWS3 through GPO correlation.","",".EXAMPLE","","Get-DomainGPOComputerLocalGroupMapping -Domain dev.testlab.local -ComputerName WINDOWS4.dev.testlab.local -LocalGroup RDP","","Finds users who have RDP rights over WINDOWS4 through GPO correlation.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Get-DomainGPOComputerLocalGroupMapping -Credential $Cred -ComputerIdentity SQL.testlab.local","",".OUTPUTS","","PowerView.GGPOComputerLocalGroupMember","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType('PowerView.GGPOComputerLocalGroupMember')]","    [CmdletBinding(DefaultParameterSetName = 'ComputerIdentity')]","    Param(","        [Parameter(Position = 0, ParameterSetName = 'ComputerIdentity', Mandatory = $True, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('ComputerName', 'Computer', 'DistinguishedName', 'SamAccountName', 'Name')]","        [String]","        $ComputerIdentity,","","        [Parameter(Mandatory = $True, ParameterSetName = 'OUIdentity')]","        [Alias('OU')]","        [String]","        $OUIdentity,","","        [String]","        [ValidateSet('Administrators', 'S-1-5-32-544', 'RDP', 'Remote Desktop Users', 'S-1-5-32-555')]","        $LocalGroup = 'Administrators',","","        [ValidateNotNullOrEmpty()]","        [String]","        $Domain,","","        [ValidateNotNullOrEmpty()]","        [Alias('ADSPath')]","        [String]","        $SearchBase,","","        [ValidateNotNullOrEmpty()]","        [Alias('DomainController')]","        [String]","        $Server,","","        [ValidateSet('Base', 'OneLevel', 'Subtree')]","        [String]","        $SearchScope = 'Subtree',","","        [ValidateRange(1, 10000)]","        [Int]","        $ResultPageSize = 200,","","        [ValidateRange(1, 10000)]","        [Int]","        $ServerTimeLimit,","","        [Switch]","        $Tombstone,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    BEGIN {","        $CommonArguments = @{}","        if ($PSBoundParameters['Domain']) { $CommonArguments['Domain'] = $Domain }","        if ($PSBoundParameters['Server']) { $CommonArguments['Server'] = $Server }","        if ($PSBoundParameters['SearchScope']) { $CommonArguments['SearchScope'] = $SearchScope }","        if ($PSBoundParameters['ResultPageSize']) { $CommonArguments['ResultPageSize'] = $ResultPageSize }","        if ($PSBoundParameters['ServerTimeLimit']) { $CommonArguments['ServerTimeLimit'] = $ServerTimeLimit }","        if ($PSBoundParameters['Tombstone']) { $CommonArguments['Tombstone'] = $Tombstone }","        if ($PSBoundParameters['Credential']) { $CommonArguments['Credential'] = $Credential }","    }","","    PROCESS {","        if ($PSBoundParameters['ComputerIdentity']) {","            $Computers = Get-DomainComputer @CommonArguments -Identity $ComputerIdentity -Properties 'distinguishedname,dnshostname'","","            if (-not $Computers) {","                throw \"[Get-DomainGPOComputerLocalGroupMapping] Computer $ComputerIdentity not found. Try a fully qualified host name.\"","            }","","            ForEach ($Computer in $Computers) {","","                $GPOGuids = @()","","                # extract any GPOs linked to this computer's OU through gpLink","                $DN = $Computer.distinguishedname","                $OUIndex = $DN.IndexOf('OU=')","                if ($OUIndex -gt 0) {","                    $OUName = $DN.SubString($OUIndex)","                }","                if ($OUName) {","                    $GPOGuids += Get-DomainOU @CommonArguments -SearchBase $OUName -LDAPFilter '(gplink=*)' | ForEach-Object {","                        Select-String -InputObject $_.gplink -Pattern '(\\{){0,1}[0-9a-fA-F]{8}\\-[0-9a-fA-F]{4}\\-[0-9a-fA-F]{4}\\-[0-9a-fA-F]{4}\\-[0-9a-fA-F]{12}(\\}){0,1}' -AllMatches | ForEach-Object {$_.Matches | Select-Object -ExpandProperty Value }","                    }","                }","","                # extract any GPOs linked to this computer's site through gpLink","                Write-Verbose \"Enumerating the sitename for: $($Computer.dnshostname)\"","                $ComputerSite = (Get-NetComputerSiteName -ComputerName $Computer.dnshostname).SiteName","                if ($ComputerSite -and ($ComputerSite -notmatch 'Error')) {","                    $GPOGuids += Get-DomainSite @CommonArguments -Identity $ComputerSite -LDAPFilter '(gplink=*)' | ForEach-Object {","                        Select-String -InputObject $_.gplink -Pattern '(\\{){0,1}[0-9a-fA-F]{8}\\-[0-9a-fA-F]{4}\\-[0-9a-fA-F]{4}\\-[0-9a-fA-F]{4}\\-[0-9a-fA-F]{12}(\\}){0,1}' -AllMatches | ForEach-Object {$_.Matches | Select-Object -ExpandProperty Value }","                    }","                }","","                # process any GPO local group settings from the GPO GUID set","                $GPOGuids | Get-DomainGPOLocalGroup @CommonArguments | Sort-Object -Property GPOName -Unique | ForEach-Object {","                    $GPOGroup = $_","","                    if($GPOGroup.GroupMembers) {","                        $GPOMembers = $GPOGroup.GroupMembers","                    }","                    else {","                        $GPOMembers = $GPOGroup.GroupSID","                    }","","                    $GPOMembers | ForEach-Object {","                        $Object = Get-DomainObject @CommonArguments -Identity $_","                        $IsGroup = @('268435456','268435457','536870912','536870913') -contains $Object.samaccounttype","","                        $GPOComputerLocalGroupMember = New-Object PSObject","                        $GPOComputerLocalGroupMember | Add-Member Noteproperty 'ComputerName' $Computer.dnshostname","                        $GPOComputerLocalGroupMember | Add-Member Noteproperty 'ObjectName' $Object.samaccountname","                        $GPOComputerLocalGroupMember | Add-Member Noteproperty 'ObjectDN' $Object.distinguishedname","                        $GPOComputerLocalGroupMember | Add-Member Noteproperty 'ObjectSID' $_","                        $GPOComputerLocalGroupMember | Add-Member Noteproperty 'IsGroup' $IsGroup","                        $GPOComputerLocalGroupMember | Add-Member Noteproperty 'GPODisplayName' $GPOGroup.GPODisplayName","                        $GPOComputerLocalGroupMember | Add-Member Noteproperty 'GPOGuid' $GPOGroup.GPOName","                        $GPOComputerLocalGroupMember | Add-Member Noteproperty 'GPOPath' $GPOGroup.GPOPath","                        $GPOComputerLocalGroupMember | Add-Member Noteproperty 'GPOType' $GPOGroup.GPOType","                        $GPOComputerLocalGroupMember.PSObject.TypeNames.Add('PowerView.GPOComputerLocalGroupMember')","                        $GPOComputerLocalGroupMember","                    }","                }","            }","        }","    }","}","","","function Get-DomainPolicyData {","\u003c#",".SYNOPSIS","","Returns the default domain policy or the domain controller policy for the current","domain or a specified domain/domain controller.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: Get-DomainGPO, Get-GptTmpl, ConvertFrom-SID  ","",".DESCRIPTION","","Returns the default domain policy or the domain controller policy for the current","domain or a specified domain/domain controller using Get-DomainGPO.","",".PARAMETER Domain","","The domain to query for default policies, defaults to the current domain.","",".PARAMETER Policy","","Extract 'Domain', 'DC' (domain controller) policies, or 'All' for all policies.","Otherwise queries for the particular GPO name or GUID.","",".PARAMETER Server","","Specifies an Active Directory server (domain controller) to bind to.","",".PARAMETER ServerTimeLimit","","Specifies the maximum amount of time the server spends searching. Default of 120 seconds.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target domain.","",".EXAMPLE","","Get-DomainPolicyData","","Returns the default domain policy for the current domain.","",".EXAMPLE","","Get-DomainPolicyData -Domain dev.testlab.local","","Returns the default domain policy for the dev.testlab.local domain.","",".EXAMPLE","","Get-DomainGPO | Get-DomainPolicy","","Parses any GptTmpl.infs found for any policies in the current domain.","",".EXAMPLE","","Get-DomainPolicyData -Policy DC -Domain dev.testlab.local","","Returns the policy for the dev.testlab.local domain controller.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Get-DomainPolicyData -Credential $Cred","",".OUTPUTS","","Hashtable","","Ouputs a hashtable representing the parsed GptTmpl.inf file.","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType([Hashtable])]","    [CmdletBinding()]","    Param(","        [Parameter(Position = 0, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('Source', 'Name')]","        [String]","        $Policy = 'Domain',","","        [ValidateNotNullOrEmpty()]","        [String]","        $Domain,","","        [ValidateNotNullOrEmpty()]","        [Alias('DomainController')]","        [String]","        $Server,","","        [ValidateRange(1, 10000)]","        [Int]","        $ServerTimeLimit,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    BEGIN {","        $SearcherArguments = @{}","        if ($PSBoundParameters['Server']) { $SearcherArguments['Server'] = $Server }","        if ($PSBoundParameters['ServerTimeLimit']) { $SearcherArguments['ServerTimeLimit'] = $ServerTimeLimit }","        if ($PSBoundParameters['Credential']) { $SearcherArguments['Credential'] = $Credential }","","        $ConvertArguments = @{}","        if ($PSBoundParameters['Server']) { $ConvertArguments['Server'] = $Server }","        if ($PSBoundParameters['Credential']) { $ConvertArguments['Credential'] = $Credential }","    }","","    PROCESS {","        if ($PSBoundParameters['Domain']) {","            $SearcherArguments['Domain'] = $Domain","            $ConvertArguments['Domain'] = $Domain","        }","","        if ($Policy -eq 'All') {","            $SearcherArguments['Identity'] = '*'","        }","        elseif ($Policy -eq 'Domain') {","            $SearcherArguments['Identity'] = '{31B2F340-016D-11D2-945F-00C04FB984F9}'","        }","        elseif (($Policy -eq 'DomainController') -or ($Policy -eq 'DC')) {","            $SearcherArguments['Identity'] = '{6AC1786C-016F-11D2-945F-00C04FB984F9}'","        }","        else {","            $SearcherArguments['Identity'] = $Policy","        }","","        $GPOResults = Get-DomainGPO @SearcherArguments","","        ForEach ($GPO in $GPOResults) {","            # grab the GptTmpl.inf file and parse it","            $GptTmplPath = $GPO.gpcfilesyspath + \"\\MACHINE\\Microsoft\\Windows NT\\SecEdit\\GptTmpl.inf\"","","            $ParseArgs =  @{","                'GptTmplPath' = $GptTmplPath","                'OutputObject' = $True","            }","            if ($PSBoundParameters['Credential']) { $ParseArgs['Credential'] = $Credential }","","            # parse the GptTmpl.inf","            Get-GptTmpl @ParseArgs | ForEach-Object {","                $_ | Add-Member Noteproperty 'GPOName' $GPO.name","                $_ | Add-Member Noteproperty 'GPODisplayName' $GPO.displayname","                $_","            }","        }","    }","}","","","########################################################","#","# Functions that enumerate a single host, either through","# WinNT, WMI, remote registry, or API calls","# (with PSReflect).","#","########################################################","","function Get-NetLocalGroup {","\u003c#",".SYNOPSIS","","Enumerates the local groups on the local (or remote) machine.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: PSReflect  ","",".DESCRIPTION","","This function will enumerate the names and descriptions for the","local groups on the current, or remote, machine. By default, the Win32 API","call NetLocalGroupEnum will be used (for speed). Specifying \"-Method WinNT\"","causes the WinNT service provider to be used instead, which returns group","SIDs along with the group names and descriptions/comments.","",".PARAMETER ComputerName","","Specifies the hostname to query for sessions (also accepts IP addresses).","Defaults to the localhost.","",".PARAMETER Method","","The collection method to use, defaults to 'API', also accepts 'WinNT'.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to a remote machine. Only applicable with \"-Method WinNT\".","",".EXAMPLE","","Get-NetLocalGroup","","ComputerName                  GroupName                     Comment","------------                  ---------                     -------","WINDOWS1                      Administrators                Administrators have comple...","WINDOWS1                      Backup Operators              Backup Operators can overr...","WINDOWS1                      Cryptographic Operators       Members are authorized to ...","...","",".EXAMPLE","","Get-NetLocalGroup -Method Winnt","","ComputerName           GroupName              GroupSID              Comment","------------           ---------              --------              -------","WINDOWS1               Administrators         S-1-5-32-544          Administrators hav...","WINDOWS1               Backup Operators       S-1-5-32-551          Backup Operators c...","WINDOWS1               Cryptographic Opera... S-1-5-32-569          Members are author...","...","",".EXAMPLE","","Get-NetLocalGroup -ComputerName primary.testlab.local","","ComputerName                  GroupName                     Comment","------------                  ---------                     -------","primary.testlab.local         Administrators                Administrators have comple...","primary.testlab.local         Users                         Users are prevented from m...","primary.testlab.local         Guests                        Guests have the same acces...","primary.testlab.local         Print Operators               Members can administer dom...","primary.testlab.local         Backup Operators              Backup Operators can overr...","",".OUTPUTS","","PowerView.LocalGroup.API","","Custom PSObject with translated group property fields from API results.","","PowerView.LocalGroup.WinNT","","Custom PSObject with translated group property fields from WinNT results.","",".LINK","","https://msdn.microsoft.com/en-us/library/windows/desktop/aa370440(v=vs.85).aspx","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType('PowerView.LocalGroup.API')]","    [OutputType('PowerView.LocalGroup.WinNT')]","    [CmdletBinding()]","    Param(","        [Parameter(Position = 0, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('HostName', 'dnshostname', 'name')]","        [ValidateNotNullOrEmpty()]","        [String[]]","        $ComputerName = $Env:COMPUTERNAME,","","        [ValidateSet('API', 'WinNT')]","        [Alias('CollectionMethod')]","        [String]","        $Method = 'API',","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    BEGIN {","        if ($PSBoundParameters['Credential']) {","            $LogonToken = Invoke-UserImpersonation -Credential $Credential","        }","    }","","    PROCESS {","        ForEach ($Computer in $ComputerName) {","            if ($Method -eq 'API') {","                # if we're using the Netapi32 NetLocalGroupEnum API call to get the local group information","","                # arguments for NetLocalGroupEnum","                $QueryLevel = 1","                $PtrInfo = [IntPtr]::Zero","                $EntriesRead = 0","                $TotalRead = 0","                $ResumeHandle = 0","","                # get the local user information","                $Result = $Netapi32::NetLocalGroupEnum($Computer, $QueryLevel, [ref]$PtrInfo, -1, [ref]$EntriesRead, [ref]$TotalRead, [ref]$ResumeHandle)","","                # locate the offset of the initial intPtr","                $Offset = $PtrInfo.ToInt64()","","                # 0 = success","                if (($Result -eq 0) -and ($Offset -gt 0)) {","","                    # Work out how much to increment the pointer by finding out the size of the structure","                    $Increment = $LOCALGROUP_INFO_1::GetSize()","","                    # parse all the result structures","                    for ($i = 0; ($i -lt $EntriesRead); $i++) {","                        # create a new int ptr at the given offset and cast the pointer as our result structure","                        $NewIntPtr = New-Object System.Intptr -ArgumentList $Offset","                        $Info = $NewIntPtr -as $LOCALGROUP_INFO_1","","                        $Offset = $NewIntPtr.ToInt64()","                        $Offset += $Increment","","                        $LocalGroup = New-Object PSObject","                        $LocalGroup | Add-Member Noteproperty 'ComputerName' $Computer","                        $LocalGroup | Add-Member Noteproperty 'GroupName' $Info.lgrpi1_name","                        $LocalGroup | Add-Member Noteproperty 'Comment' $Info.lgrpi1_comment","                        $LocalGroup.PSObject.TypeNames.Insert(0, 'PowerView.LocalGroup.API')","                        $LocalGroup","                    }","                    # free up the result buffer","                    $Null = $Netapi32::NetApiBufferFree($PtrInfo)","                }","                else {","                    Write-Verbose \"[Get-NetLocalGroup] Error: $(([ComponentModel.Win32Exception] $Result).Message)\"","                }","            }","            else {","                # otherwise we're using the WinNT service provider","                $ComputerProvider = [ADSI]\"WinNT://$Computer,computer\"","","                $ComputerProvider.psbase.children | Where-Object { $_.psbase.schemaClassName -eq 'group' } | ForEach-Object {","                    $LocalGroup = ([ADSI]$_)","                    $Group = New-Object PSObject","                    $Group | Add-Member Noteproperty 'ComputerName' $Computer","                    $Group | Add-Member Noteproperty 'GroupName' ($LocalGroup.InvokeGet('Name'))","                    $Group | Add-Member Noteproperty 'SID' ((New-Object System.Security.Principal.SecurityIdentifier($LocalGroup.InvokeGet('objectsid'),0)).Value)","                    $Group | Add-Member Noteproperty 'Comment' ($LocalGroup.InvokeGet('Description'))","                    $Group.PSObject.TypeNames.Insert(0, 'PowerView.LocalGroup.WinNT')","                    $Group","                }","            }","        }","    }","    ","    END {","        if ($LogonToken) {","            Invoke-RevertToSelf -TokenHandle $LogonToken","        }","    }","}","","","function Get-NetLocalGroupMember {","\u003c#",".SYNOPSIS","","Enumerates members of a specific local group on the local (or remote) machine.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: PSReflect, Convert-ADName  ","",".DESCRIPTION","","This function will enumerate the members of a specified local group  on the","current, or remote, machine. By default, the Win32 API call NetLocalGroupGetMembers","will be used (for speed). Specifying \"-Method WinNT\" causes the WinNT service provider","to be used instead, which returns a larger amount of information.","",".PARAMETER ComputerName","","Specifies the hostname to query for sessions (also accepts IP addresses).","Defaults to the localhost.","",".PARAMETER GroupName","","The local group name to query for users. If not given, it defaults to \"Administrators\".","",".PARAMETER Method","","The collection method to use, defaults to 'API', also accepts 'WinNT'.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to a remote machine. Only applicable with \"-Method WinNT\".","",".EXAMPLE","","Get-NetLocalGroupMember | ft","","ComputerName   GroupName      MemberName     SID                   IsGroup       IsDomain","------------   ---------      ----------     ---                   -------       --------","WINDOWS1       Administrators WINDOWS1\\Ad... S-1-5-21-25...          False          False","WINDOWS1       Administrators WINDOWS1\\lo... S-1-5-21-25...          False          False","WINDOWS1       Administrators TESTLAB\\Dom... S-1-5-21-89...           True           True","WINDOWS1       Administrators TESTLAB\\har... S-1-5-21-89...          False           True","",".EXAMPLE","","Get-NetLocalGroupMember -Method winnt | ft","","ComputerName   GroupName      MemberName     SID                   IsGroup       IsDomain","------------   ---------      ----------     ---                   -------       --------","WINDOWS1       Administrators WINDOWS1\\Ad... S-1-5-21-25...          False          False","WINDOWS1       Administrators WINDOWS1\\lo... S-1-5-21-25...          False          False","WINDOWS1       Administrators TESTLAB\\Dom... S-1-5-21-89...           True           True","WINDOWS1       Administrators TESTLAB\\har... S-1-5-21-89...          False           True","",".EXAMPLE","","Get-NetLocalGroup | Get-NetLocalGroupMember | ft","","ComputerName   GroupName      MemberName     SID                   IsGroup       IsDomain","------------   ---------      ----------     ---                   -------       --------","WINDOWS1       Administrators WINDOWS1\\Ad... S-1-5-21-25...          False          False","WINDOWS1       Administrators WINDOWS1\\lo... S-1-5-21-25...          False          False","WINDOWS1       Administrators TESTLAB\\Dom... S-1-5-21-89...           True           True","WINDOWS1       Administrators TESTLAB\\har... S-1-5-21-89...          False           True","WINDOWS1       Guests         WINDOWS1\\Guest S-1-5-21-25...          False          False","WINDOWS1       IIS_IUSRS      NT AUTHORIT... S-1-5-17                False          False","WINDOWS1       Users          NT AUTHORIT... S-1-5-4                 False          False","WINDOWS1       Users          NT AUTHORIT... S-1-5-11                False          False","WINDOWS1       Users          WINDOWS1\\lo... S-1-5-21-25...          False        UNKNOWN","WINDOWS1       Users          TESTLAB\\Dom... S-1-5-21-89...           True        UNKNOWN","",".EXAMPLE","","Get-NetLocalGroupMember -ComputerName primary.testlab.local | ft","","ComputerName   GroupName      MemberName     SID                   IsGroup       IsDomain","------------   ---------      ----------     ---                   -------       --------","primary.tes... Administrators TESTLAB\\Adm... S-1-5-21-89...          False          False","primary.tes... Administrators TESTLAB\\loc... S-1-5-21-89...          False          False","primary.tes... Administrators TESTLAB\\Ent... S-1-5-21-89...           True          False","primary.tes... Administrators TESTLAB\\Dom... S-1-5-21-89...           True          False","",".OUTPUTS","","PowerView.LocalGroupMember.API","","Custom PSObject with translated group property fields from API results.","","PowerView.LocalGroupMember.WinNT","","Custom PSObject with translated group property fields from WinNT results.","",".LINK","","http://stackoverflow.com/questions/21288220/get-all-local-members-and-groups-displayed-together","http://msdn.microsoft.com/en-us/library/aa772211(VS.85).aspx","https://msdn.microsoft.com/en-us/library/windows/desktop/aa370601(v=vs.85).aspx","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType('PowerView.LocalGroupMember.API')]","    [OutputType('PowerView.LocalGroupMember.WinNT')]","    Param(","        [Parameter(Position = 0, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('HostName', 'dnshostname', 'name')]","        [ValidateNotNullOrEmpty()]","        [String[]]","        $ComputerName = $Env:COMPUTERNAME,","","        [Parameter(ValueFromPipelineByPropertyName = $True)]","        [ValidateNotNullOrEmpty()]","        [String]","        $GroupName = 'Administrators',","","        [ValidateSet('API', 'WinNT')]","        [Alias('CollectionMethod')]","        [String]","        $Method = 'API',","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    BEGIN {","        if ($PSBoundParameters['Credential']) {","            $LogonToken = Invoke-UserImpersonation -Credential $Credential","        }","    }","","    PROCESS {","        ForEach ($Computer in $ComputerName) {","            if ($Method -eq 'API') {","                # if we're using the Netapi32 NetLocalGroupGetMembers API call to get the local group information","","                # arguments for NetLocalGroupGetMembers","                $QueryLevel = 2","                $PtrInfo = [IntPtr]::Zero","                $EntriesRead = 0","                $TotalRead = 0","                $ResumeHandle = 0","","                # get the local user information","                $Result = $Netapi32::NetLocalGroupGetMembers($Computer, $GroupName, $QueryLevel, [ref]$PtrInfo, -1, [ref]$EntriesRead, [ref]$TotalRead, [ref]$ResumeHandle)","","                # locate the offset of the initial intPtr","                $Offset = $PtrInfo.ToInt64()","","                $Members = @()","","                # 0 = success","                if (($Result -eq 0) -and ($Offset -gt 0)) {","","                    # Work out how much to increment the pointer by finding out the size of the structure","                    $Increment = $LOCALGROUP_MEMBERS_INFO_2::GetSize()","","                    # parse all the result structures","                    for ($i = 0; ($i -lt $EntriesRead); $i++) {","                        # create a new int ptr at the given offset and cast the pointer as our result structure","                        $NewIntPtr = New-Object System.Intptr -ArgumentList $Offset","                        $Info = $NewIntPtr -as $LOCALGROUP_MEMBERS_INFO_2","","                        $Offset = $NewIntPtr.ToInt64()","                        $Offset += $Increment","","                        $SidString = ''","                        $Result2 = $Advapi32::ConvertSidToStringSid($Info.lgrmi2_sid, [ref]$SidString);$LastError = [Runtime.InteropServices.Marshal]::GetLastWin32Error()","","                        if ($Result2 -eq 0) {","                            Write-Verbose \"[Get-NetLocalGroupMember] Error: $(([ComponentModel.Win32Exception] $LastError).Message)\"","                        }","                        else {","                            $Member = New-Object PSObject","                            $Member | Add-Member Noteproperty 'ComputerName' $Computer","                            $Member | Add-Member Noteproperty 'GroupName' $GroupName","                            $Member | Add-Member Noteproperty 'MemberName' $Info.lgrmi2_domainandname","                            $Member | Add-Member Noteproperty 'SID' $SidString","                            $IsGroup = $($Info.lgrmi2_sidusage -eq 'SidTypeGroup')","                            $Member | Add-Member Noteproperty 'IsGroup' $IsGroup","                            $Member.PSObject.TypeNames.Insert(0, 'PowerView.LocalGroupMember.API')","                            $Members += $Member","                        }","                    }","","                    # free up the result buffer","                    $Null = $Netapi32::NetApiBufferFree($PtrInfo)","","                    # try to extract out the machine SID by using the -500 account as a reference","                    $MachineSid = $Members | Where-Object {$_.SID -match '.*-500' -or ($_.SID -match '.*-501')} | Select-Object -Expand SID","                    if ($MachineSid) {","                        $MachineSid = $MachineSid.Substring(0, $MachineSid.LastIndexOf('-'))","","                        $Members | ForEach-Object {","                            if ($_.SID -match $MachineSid) {","                                $_ | Add-Member Noteproperty 'IsDomain' $False","                            }","                            else {","                                $_ | Add-Member Noteproperty 'IsDomain' $True","                            }","                        }","                    }","                    else {","                        $Members | ForEach-Object {","                            if ($_.SID -notmatch 'S-1-5-21') {","                                $_ | Add-Member Noteproperty 'IsDomain' $False","                            }","                            else {","                                $_ | Add-Member Noteproperty 'IsDomain' 'UNKNOWN'","                            }","                        }","                    }","                    $Members","                }","                else {","                    Write-Verbose \"[Get-NetLocalGroupMember] Error: $(([ComponentModel.Win32Exception] $Result).Message)\"","                }","            }","            else {","                # otherwise we're using the WinNT service provider","                try {","                    $GroupProvider = [ADSI]\"WinNT://$Computer/$GroupName,group\"","","                    $GroupProvider.psbase.Invoke('Members') | ForEach-Object {","","                        $Member = New-Object PSObject","                        $Member | Add-Member Noteproperty 'ComputerName' $Computer","                        $Member | Add-Member Noteproperty 'GroupName' $GroupName","","                        $LocalUser = ([ADSI]$_)","                        $AdsPath = $LocalUser.InvokeGet('AdsPath').Replace('WinNT://', '')","                        $IsGroup = ($LocalUser.SchemaClassName -like 'group')","","                        if(([regex]::Matches($AdsPath, '/')).count -eq 1) {","                            # DOMAIN\\user","                            $MemberIsDomain = $True","                            $Name = $AdsPath.Replace('/', '\\')","                        }","                        else {","                            # DOMAIN\\machine\\user","                            $MemberIsDomain = $False","                            $Name = $AdsPath.Substring($AdsPath.IndexOf('/')+1).Replace('/', '\\')","                        }","","                        $Member | Add-Member Noteproperty 'AccountName' $Name","                        $Member | Add-Member Noteproperty 'SID' ((New-Object System.Security.Principal.SecurityIdentifier($LocalUser.InvokeGet('ObjectSID'),0)).Value)","                        $Member | Add-Member Noteproperty 'IsGroup' $IsGroup","                        $Member | Add-Member Noteproperty 'IsDomain' $MemberIsDomain","","                        # if ($MemberIsDomain) {","                        #     # translate the binary sid to a string","                        #     $Member | Add-Member Noteproperty 'SID' ((New-Object System.Security.Principal.SecurityIdentifier($LocalUser.InvokeGet('ObjectSID'),0)).Value)","                        #     $Member | Add-Member Noteproperty 'Description' ''","                        #     $Member | Add-Member Noteproperty 'Disabled' ''","","                        #     if ($IsGroup) {","                        #         $Member | Add-Member Noteproperty 'LastLogin' ''","                        #     }","                        #     else {","                        #         try {","                        #             $Member | Add-Member Noteproperty 'LastLogin' $LocalUser.InvokeGet('LastLogin')","                        #         }","                        #         catch {","                        #             $Member | Add-Member Noteproperty 'LastLogin' ''","                        #         }","                        #     }","                        #     $Member | Add-Member Noteproperty 'PwdLastSet' ''","                        #     $Member | Add-Member Noteproperty 'PwdExpired' ''","                        #     $Member | Add-Member Noteproperty 'UserFlags' ''","                        # }","                        # else {","                        #     # translate the binary sid to a string","                        #     $Member | Add-Member Noteproperty 'SID' ((New-Object System.Security.Principal.SecurityIdentifier($LocalUser.InvokeGet('ObjectSID'),0)).Value)","                        #     $Member | Add-Member Noteproperty 'Description' ($LocalUser.Description)","","                        #     if ($IsGroup) {","                        #         $Member | Add-Member Noteproperty 'PwdLastSet' ''","                        #         $Member | Add-Member Noteproperty 'PwdExpired' ''","                        #         $Member | Add-Member Noteproperty 'UserFlags' ''","                        #         $Member | Add-Member Noteproperty 'Disabled' ''","                        #         $Member | Add-Member Noteproperty 'LastLogin' ''","                        #     }","                        #     else {","                        #         $Member | Add-Member Noteproperty 'PwdLastSet' ( (Get-Date).AddSeconds(-$LocalUser.PasswordAge[0]))","                        #         $Member | Add-Member Noteproperty 'PwdExpired' ( $LocalUser.PasswordExpired[0] -eq '1')","                        #         $Member | Add-Member Noteproperty 'UserFlags' ( $LocalUser.UserFlags[0] )","                        #         # UAC flags of 0x2 mean the account is disabled","                        #         $Member | Add-Member Noteproperty 'Disabled' $(($LocalUser.UserFlags.value -band 2) -eq 2)","                        #         try {","                        #             $Member | Add-Member Noteproperty 'LastLogin' ( $LocalUser.LastLogin[0])","                        #         }","                        #         catch {","                        #             $Member | Add-Member Noteproperty 'LastLogin' ''","                        #         }","                        #     }","                        # }","","                        $Member","                    }","                }","                catch {","                    Write-Verbose \"[Get-NetLocalGroupMember] Error for $Computer : $_\"","                }","            }","        }","    }","    ","    END {","        if ($LogonToken) {","            Invoke-RevertToSelf -TokenHandle $LogonToken","        }","    }","}","","","function Get-NetShare {","\u003c#",".SYNOPSIS","","Returns open shares on the local (or a remote) machine.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: PSReflect, Invoke-UserImpersonation, Invoke-RevertToSelf  ","",".DESCRIPTION","","This function will execute the NetShareEnum Win32API call to query","a given host for open shares. This is a replacement for \"net share \\\\hostname\".","",".PARAMETER ComputerName","","Specifies the hostname to query for shares (also accepts IP addresses).","Defaults to 'localhost'.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the remote system using Invoke-UserImpersonation.","",".EXAMPLE","","Get-NetShare","","Returns active shares on the local host.","",".EXAMPLE","","Get-NetShare -ComputerName sqlserver","","Returns active shares on the 'sqlserver' host","",".EXAMPLE","","Get-DomainComputer | Get-NetShare","","Returns all shares for all computers in the domain.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Get-NetShare -ComputerName sqlserver -Credential $Cred","",".OUTPUTS","","PowerView.ShareInfo","","A PSCustomObject representing a SHARE_INFO_1 structure, including","the name/type/remark for each share, with the ComputerName added.","",".LINK","","http://www.powershellmagazine.com/2014/09/25/easily-defining-enums-structs-and-win32-functions-in-memory/","#\u003e","","    [OutputType('PowerView.ShareInfo')]","    [CmdletBinding()]","    Param(","        [Parameter(Position = 0, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('HostName', 'dnshostname', 'name')]","        [ValidateNotNullOrEmpty()]","        [String[]]","        $ComputerName = 'localhost',","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    BEGIN {","        if ($PSBoundParameters['Credential']) {","            $LogonToken = Invoke-UserImpersonation -Credential $Credential","        }","    }","","    PROCESS {","        ForEach ($Computer in $ComputerName) {","            # arguments for NetShareEnum","            $QueryLevel = 1","            $PtrInfo = [IntPtr]::Zero","            $EntriesRead = 0","            $TotalRead = 0","            $ResumeHandle = 0","","            # get the raw share information","            $Result = $Netapi32::NetShareEnum($Computer, $QueryLevel, [ref]$PtrInfo, -1, [ref]$EntriesRead, [ref]$TotalRead, [ref]$ResumeHandle)","","            # locate the offset of the initial intPtr","            $Offset = $PtrInfo.ToInt64()","","            # 0 = success","            if (($Result -eq 0) -and ($Offset -gt 0)) {","","                # work out how much to increment the pointer by finding out the size of the structure","                $Increment = $SHARE_INFO_1::GetSize()","","                # parse all the result structures","                for ($i = 0; ($i -lt $EntriesRead); $i++) {","                    # create a new int ptr at the given offset and cast the pointer as our result structure","                    $NewIntPtr = New-Object System.Intptr -ArgumentList $Offset","                    $Info = $NewIntPtr -as $SHARE_INFO_1","","                    # return all the sections of the structure - have to do it this way for V2","                    $Share = $Info | Select-Object *","                    $Share | Add-Member Noteproperty 'ComputerName' $Computer","                    $Share.PSObject.TypeNames.Insert(0, 'PowerView.ShareInfo')","                    $Offset = $NewIntPtr.ToInt64()","                    $Offset += $Increment","                    $Share","                }","","                # free up the result buffer","                $Null = $Netapi32::NetApiBufferFree($PtrInfo)","            }","            else {","                Write-Verbose \"[Get-NetShare] Error: $(([ComponentModel.Win32Exception] $Result).Message)\"","            }","        }","    }","","    END {","        if ($LogonToken) {","            Invoke-RevertToSelf -TokenHandle $LogonToken","        }","    }","}","","","function Get-NetLoggedon {","\u003c#",".SYNOPSIS","","Returns users logged on the local (or a remote) machine.","Note: administrative rights needed for newer Windows OSes.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: PSReflect, Invoke-UserImpersonation, Invoke-RevertToSelf  ","",".DESCRIPTION","","This function will execute the NetWkstaUserEnum Win32API call to query","a given host for actively logged on users.","",".PARAMETER ComputerName","","Specifies the hostname to query for logged on users (also accepts IP addresses).","Defaults to 'localhost'.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the remote system using Invoke-UserImpersonation.","",".EXAMPLE","","Get-NetLoggedon","","Returns users actively logged onto the local host.","",".EXAMPLE","","Get-NetLoggedon -ComputerName sqlserver","","Returns users actively logged onto the 'sqlserver' host.","",".EXAMPLE","","Get-DomainComputer | Get-NetLoggedon","","Returns all logged on users for all computers in the domain.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Get-NetLoggedon -ComputerName sqlserver -Credential $Cred","",".OUTPUTS","","PowerView.LoggedOnUserInfo","","A PSCustomObject representing a WKSTA_USER_INFO_1 structure, including","the UserName/LogonDomain/AuthDomains/LogonServer for each user, with the ComputerName added.","",".LINK","","http://www.powershellmagazine.com/2014/09/25/easily-defining-enums-structs-and-win32-functions-in-memory/","#\u003e","","    [OutputType('PowerView.LoggedOnUserInfo')]","    [CmdletBinding()]","    Param(","        [Parameter(Position = 0, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('HostName', 'dnshostname', 'name')]","        [ValidateNotNullOrEmpty()]","        [String[]]","        $ComputerName = 'localhost',","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    BEGIN {","        if ($PSBoundParameters['Credential']) {","            $LogonToken = Invoke-UserImpersonation -Credential $Credential","        }","    }","","    PROCESS {","        ForEach ($Computer in $ComputerName) {","            # declare the reference variables","            $QueryLevel = 1","            $PtrInfo = [IntPtr]::Zero","            $EntriesRead = 0","            $TotalRead = 0","            $ResumeHandle = 0","","            # get logged on user information","            $Result = $Netapi32::NetWkstaUserEnum($Computer, $QueryLevel, [ref]$PtrInfo, -1, [ref]$EntriesRead, [ref]$TotalRead, [ref]$ResumeHandle)","","            # locate the offset of the initial intPtr","            $Offset = $PtrInfo.ToInt64()","","            # 0 = success","            if (($Result -eq 0) -and ($Offset -gt 0)) {","","                # work out how much to increment the pointer by finding out the size of the structure","                $Increment = $WKSTA_USER_INFO_1::GetSize()","","                # parse all the result structures","                for ($i = 0; ($i -lt $EntriesRead); $i++) {","                    # create a new int ptr at the given offset and cast the pointer as our result structure","                    $NewIntPtr = New-Object System.Intptr -ArgumentList $Offset","                    $Info = $NewIntPtr -as $WKSTA_USER_INFO_1","","                    # return all the sections of the structure - have to do it this way for V2","                    $LoggedOn = $Info | Select-Object *","                    $LoggedOn | Add-Member Noteproperty 'ComputerName' $Computer","                    $LoggedOn.PSObject.TypeNames.Insert(0, 'PowerView.LoggedOnUserInfo')","                    $Offset = $NewIntPtr.ToInt64()","                    $Offset += $Increment","                    $LoggedOn","                }","","                # free up the result buffer","                $Null = $Netapi32::NetApiBufferFree($PtrInfo)","            }","            else {","                Write-Verbose \"[Get-NetLoggedon] Error: $(([ComponentModel.Win32Exception] $Result).Message)\"","            }","        }","    }","","    END {","        if ($LogonToken) {","            Invoke-RevertToSelf -TokenHandle $LogonToken","        }","    }","}","","","function Get-NetSession {","\u003c#",".SYNOPSIS","","Returns session information for the local (or a remote) machine.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: PSReflect, Invoke-UserImpersonation, Invoke-RevertToSelf  ","",".DESCRIPTION","","This function will execute the NetSessionEnum Win32API call to query","a given host for active sessions.","",".PARAMETER ComputerName","","Specifies the hostname to query for sessions (also accepts IP addresses).","Defaults to 'localhost'.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the remote system using Invoke-UserImpersonation.","",".EXAMPLE","","Get-NetSession","","Returns active sessions on the local host.","",".EXAMPLE","","Get-NetSession -ComputerName sqlserver","","Returns active sessions on the 'sqlserver' host.","",".EXAMPLE","","Get-DomainController | Get-NetSession","","Returns active sessions on all domain controllers.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Get-NetSession -ComputerName sqlserver -Credential $Cred","",".OUTPUTS","","PowerView.SessionInfo","","A PSCustomObject representing a WKSTA_USER_INFO_1 structure, including","the CName/UserName/Time/IdleTime for each session, with the ComputerName added.","",".LINK","","http://www.powershellmagazine.com/2014/09/25/easily-defining-enums-structs-and-win32-functions-in-memory/","#\u003e","","    [OutputType('PowerView.SessionInfo')]","    [CmdletBinding()]","    Param(","        [Parameter(Position = 0, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('HostName', 'dnshostname', 'name')]","        [ValidateNotNullOrEmpty()]","        [String[]]","        $ComputerName = 'localhost',","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    BEGIN {","        if ($PSBoundParameters['Credential']) {","            $LogonToken = Invoke-UserImpersonation -Credential $Credential","        }","    }","","    PROCESS {","        ForEach ($Computer in $ComputerName) {","            # arguments for NetSessionEnum","            $QueryLevel = 10","            $PtrInfo = [IntPtr]::Zero","            $EntriesRead = 0","            $TotalRead = 0","            $ResumeHandle = 0","","            # get session information","            $Result = $Netapi32::NetSessionEnum($Computer, '', $UserName, $QueryLevel, [ref]$PtrInfo, -1, [ref]$EntriesRead, [ref]$TotalRead, [ref]$ResumeHandle)","","            # locate the offset of the initial intPtr","            $Offset = $PtrInfo.ToInt64()","","            # 0 = success","            if (($Result -eq 0) -and ($Offset -gt 0)) {","","                # work out how much to increment the pointer by finding out the size of the structure","                $Increment = $SESSION_INFO_10::GetSize()","","                # parse all the result structures","                for ($i = 0; ($i -lt $EntriesRead); $i++) {","                    # create a new int ptr at the given offset and cast the pointer as our result structure","                    $NewIntPtr = New-Object System.Intptr -ArgumentList $Offset","                    $Info = $NewIntPtr -as $SESSION_INFO_10","","                    # return all the sections of the structure - have to do it this way for V2","                    $Session = $Info | Select-Object *","                    $Session | Add-Member Noteproperty 'ComputerName' $Computer","                    $Session.PSObject.TypeNames.Insert(0, 'PowerView.SessionInfo')","                    $Offset = $NewIntPtr.ToInt64()","                    $Offset += $Increment","                    $Session","                }","","                # free up the result buffer","                $Null = $Netapi32::NetApiBufferFree($PtrInfo)","            }","            else {","                Write-Verbose \"[Get-NetSession] Error: $(([ComponentModel.Win32Exception] $Result).Message)\"","            }","        }","    }","","","    END {","        if ($LogonToken) {","            Invoke-RevertToSelf -TokenHandle $LogonToken","        }","    }","}","","","function Get-RegLoggedOn {","\u003c#",".SYNOPSIS","","Returns who is logged onto the local (or a remote) machine","through enumeration of remote registry keys.","","Note: This function requires only domain user rights on the","machine you're enumerating, but remote registry must be enabled.","","Author: Matt Kelly (@BreakersAll)  ","License: BSD 3-Clause  ","Required Dependencies: Invoke-UserImpersonation, Invoke-RevertToSelf, ConvertFrom-SID  ","",".DESCRIPTION","","This function will query the HKU registry values to retrieve the local","logged on users SID and then attempt and reverse it.","Adapted technique from Sysinternal's PSLoggedOn script. Benefit over","using the NetWkstaUserEnum API (Get-NetLoggedon) of less user privileges","required (NetWkstaUserEnum requires remote admin access).","",".PARAMETER ComputerName","","Specifies the hostname to query for remote registry values (also accepts IP addresses).","Defaults to 'localhost'.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the remote system using Invoke-UserImpersonation.","",".EXAMPLE","","Get-RegLoggedOn","","Returns users actively logged onto the local host.","",".EXAMPLE","","Get-RegLoggedOn -ComputerName sqlserver","","Returns users actively logged onto the 'sqlserver' host.","",".EXAMPLE","","Get-DomainController | Get-RegLoggedOn","","Returns users actively logged on all domain controllers.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Get-RegLoggedOn -ComputerName sqlserver -Credential $Cred","",".OUTPUTS","","PowerView.RegLoggedOnUser","","A PSCustomObject including the UserDomain/UserName/UserSID of each","actively logged on user, with the ComputerName added.","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType('PowerView.RegLoggedOnUser')]","    [CmdletBinding()]","    Param(","        [Parameter(Position = 0, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('HostName', 'dnshostname', 'name')]","        [ValidateNotNullOrEmpty()]","        [String[]]","        $ComputerName = 'localhost'","    )","","    BEGIN {","        if ($PSBoundParameters['Credential']) {","            $LogonToken = Invoke-UserImpersonation -Credential $Credential","        }","    }","","    PROCESS {","        ForEach ($Computer in $ComputerName) {","            try {","                # retrieve HKU remote registry values","                $Reg = [Microsoft.Win32.RegistryKey]::OpenRemoteBaseKey('Users', \"$ComputerName\")","","                # sort out bogus sid's like _class","                $Reg.GetSubKeyNames() | Where-Object { $_ -match 'S-1-5-21-[0-9]+-[0-9]+-[0-9]+-[0-9]+$' } | ForEach-Object {","                    $UserName = ConvertFrom-SID -ObjectSID $_ -OutputType 'DomainSimple'","","                    if ($UserName) {","                        $UserName, $UserDomain = $UserName.Split('@')","                    }","                    else {","                        $UserName = $_","                        $UserDomain = $Null","                    }","","                    $RegLoggedOnUser = New-Object PSObject","                    $RegLoggedOnUser | Add-Member Noteproperty 'ComputerName' \"$ComputerName\"","                    $RegLoggedOnUser | Add-Member Noteproperty 'UserDomain' $UserDomain","                    $RegLoggedOnUser | Add-Member Noteproperty 'UserName' $UserName","                    $RegLoggedOnUser | Add-Member Noteproperty 'UserSID' $_","                    $RegLoggedOnUser.PSObject.TypeNames.Insert(0, 'PowerView.RegLoggedOnUser')","                    $RegLoggedOnUser","                }","            }","            catch {","                Write-Verbose \"[Get-RegLoggedOn] Error opening remote registry on '$ComputerName' : $_\"","            }","        }","    }","","    END {","        if ($LogonToken) {","            Invoke-RevertToSelf -TokenHandle $LogonToken","        }","    }","}","","","function Get-NetRDPSession {","\u003c#",".SYNOPSIS","","Returns remote desktop/session information for the local (or a remote) machine.","","Note: only members of the Administrators or Account Operators local group","can successfully execute this functionality on a remote target.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: PSReflect, Invoke-UserImpersonation, Invoke-RevertToSelf  ","",".DESCRIPTION","","This function will execute the WTSEnumerateSessionsEx and WTSQuerySessionInformation","Win32API calls to query a given RDP remote service for active sessions and originating","IPs. This is a replacement for qwinsta.","",".PARAMETER ComputerName","","Specifies the hostname to query for active sessions (also accepts IP addresses).","Defaults to 'localhost'.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the remote system using Invoke-UserImpersonation.","",".EXAMPLE","","Get-NetRDPSession","","Returns active RDP/terminal sessions on the local host.","",".EXAMPLE","","Get-NetRDPSession -ComputerName \"sqlserver\"","","Returns active RDP/terminal sessions on the 'sqlserver' host.","",".EXAMPLE","","Get-DomainController | Get-NetRDPSession","","Returns active RDP/terminal sessions on all domain controllers.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Get-NetRDPSession -ComputerName sqlserver -Credential $Cred","",".OUTPUTS","","PowerView.RDPSessionInfo","","A PSCustomObject representing a combined WTS_SESSION_INFO_1 and WTS_CLIENT_ADDRESS structure,","with the ComputerName added.","",".LINK","","https://msdn.microsoft.com/en-us/library/aa383861(v=vs.85).aspx","#\u003e","","    [OutputType('PowerView.RDPSessionInfo')]","    [CmdletBinding()]","    Param(","        [Parameter(Position = 0, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('HostName', 'dnshostname', 'name')]","        [ValidateNotNullOrEmpty()]","        [String[]]","        $ComputerName = 'localhost',","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    BEGIN {","        if ($PSBoundParameters['Credential']) {","            $LogonToken = Invoke-UserImpersonation -Credential $Credential","        }","    }","","    PROCESS {","        ForEach ($Computer in $ComputerName) {","","            # open up a handle to the Remote Desktop Session host","            $Handle = $Wtsapi32::WTSOpenServerEx($Computer)","","            # if we get a non-zero handle back, everything was successful","            if ($Handle -ne 0) {","","                # arguments for WTSEnumerateSessionsEx","                $ppSessionInfo = [IntPtr]::Zero","                $pCount = 0","","                # get information on all current sessions","                $Result = $Wtsapi32::WTSEnumerateSessionsEx($Handle, [ref]1, 0, [ref]$ppSessionInfo, [ref]$pCount);$LastError = [Runtime.InteropServices.Marshal]::GetLastWin32Error()","","                # locate the offset of the initial intPtr","                $Offset = $ppSessionInfo.ToInt64()","","                if (($Result -ne 0) -and ($Offset -gt 0)) {","","                    # work out how much to increment the pointer by finding out the size of the structure","                    $Increment = $WTS_SESSION_INFO_1::GetSize()","","                    # parse all the result structures","                    for ($i = 0; ($i -lt $pCount); $i++) {","","                        # create a new int ptr at the given offset and cast the pointer as our result structure","                        $NewIntPtr = New-Object System.Intptr -ArgumentList $Offset","                        $Info = $NewIntPtr -as $WTS_SESSION_INFO_1","","                        $RDPSession = New-Object PSObject","","                        if ($Info.pHostName) {","                            $RDPSession | Add-Member Noteproperty 'ComputerName' $Info.pHostName","                        }","                        else {","                            # if no hostname returned, use the specified hostname","                            $RDPSession | Add-Member Noteproperty 'ComputerName' $Computer","                        }","","                        $RDPSession | Add-Member Noteproperty 'SessionName' $Info.pSessionName","","                        if ($(-not $Info.pDomainName) -or ($Info.pDomainName -eq '')) {","                            # if a domain isn't returned just use the username","                            $RDPSession | Add-Member Noteproperty 'UserName' \"$($Info.pUserName)\"","                        }","                        else {","                            $RDPSession | Add-Member Noteproperty 'UserName' \"$($Info.pDomainName)\\$($Info.pUserName)\"","                        }","","                        $RDPSession | Add-Member Noteproperty 'ID' $Info.SessionID","                        $RDPSession | Add-Member Noteproperty 'State' $Info.State","","                        $ppBuffer = [IntPtr]::Zero","                        $pBytesReturned = 0","","                        # query for the source client IP with WTSQuerySessionInformation","                        #   https://msdn.microsoft.com/en-us/library/aa383861(v=vs.85).aspx","                        $Result2 = $Wtsapi32::WTSQuerySessionInformation($Handle, $Info.SessionID, 14, [ref]$ppBuffer, [ref]$pBytesReturned);$LastError2 = [Runtime.InteropServices.Marshal]::GetLastWin32Error()","","                        if ($Result2 -eq 0) {","                            Write-Verbose \"[Get-NetRDPSession] Error: $(([ComponentModel.Win32Exception] $LastError2).Message)\"","                        }","                        else {","                            $Offset2 = $ppBuffer.ToInt64()","                            $NewIntPtr2 = New-Object System.Intptr -ArgumentList $Offset2","                            $Info2 = $NewIntPtr2 -as $WTS_CLIENT_ADDRESS","","                            $SourceIP = $Info2.Address","                            if ($SourceIP[2] -ne 0) {","                                $SourceIP = [String]$SourceIP[2]+'.'+[String]$SourceIP[3]+'.'+[String]$SourceIP[4]+'.'+[String]$SourceIP[5]","                            }","                            else {","                                $SourceIP = $Null","                            }","","                            $RDPSession | Add-Member Noteproperty 'SourceIP' $SourceIP","                            $RDPSession.PSObject.TypeNames.Insert(0, 'PowerView.RDPSessionInfo')","                            $RDPSession","","                            # free up the memory buffer","                            $Null = $Wtsapi32::WTSFreeMemory($ppBuffer)","","                            $Offset += $Increment","                        }","                    }","                    # free up the memory result buffer","                    $Null = $Wtsapi32::WTSFreeMemoryEx(2, $ppSessionInfo, $pCount)","                }","                else {","                    Write-Verbose \"[Get-NetRDPSession] Error: $(([ComponentModel.Win32Exception] $LastError).Message)\"","                }","                # close off the service handle","                $Null = $Wtsapi32::WTSCloseServer($Handle)","            }","            else {","                Write-Verbose \"[Get-NetRDPSession] Error opening the Remote Desktop Session Host (RD Session Host) server for: $ComputerName\"","            }","        }","    }","","    END {","        if ($LogonToken) {","            Invoke-RevertToSelf -TokenHandle $LogonToken","        }","    }","}","","","function Test-AdminAccess {","\u003c#",".SYNOPSIS","","Tests if the current user has administrative access to the local (or a remote) machine.","","Idea stolen from the local_admin_search_enum post module in Metasploit written by:  ","    'Brandon McCann \"zeknox\" \u003cbmccann[at]accuvant.com\u003e'  ","    'Thomas McCarthy \"smilingraccoon\" \u003csmilingraccoon[at]gmail.com\u003e'  ","    'Royce Davis \"r3dy\" \u003crdavis[at]accuvant.com\u003e'  ","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: PSReflect, Invoke-UserImpersonation, Invoke-RevertToSelf  ","",".DESCRIPTION","","This function will use the OpenSCManagerW Win32API call to establish","a handle to the remote host. If this succeeds, the current user context","has local administrator acess to the target.","",".PARAMETER ComputerName","","Specifies the hostname to check for local admin access (also accepts IP addresses).","Defaults to 'localhost'.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the remote system using Invoke-UserImpersonation.","",".EXAMPLE","","Test-AdminAccess -ComputerName sqlserver","","Returns results indicating whether the current user has admin access to the 'sqlserver' host.","",".EXAMPLE","","Get-DomainComputer | Test-AdminAccess","","Returns what machines in the domain the current user has access to.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Test-AdminAccess -ComputerName sqlserver -Credential $Cred","",".OUTPUTS","","PowerView.AdminAccess","","A PSCustomObject containing the ComputerName and 'IsAdmin' set to whether","the current user has local admin rights, along with the ComputerName added.","",".LINK","","https://github.com/rapid7/metasploit-framework/blob/master/modules/post/windows/gather/local_admin_search_enum.rb","http://www.powershellmagazine.com/2014/09/25/easily-defining-enums-structs-and-win32-functions-in-memory/","#\u003e","","    [OutputType('PowerView.AdminAccess')]","    [CmdletBinding()]","    Param(","        [Parameter(Position = 0, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('HostName', 'dnshostname', 'name')]","        [ValidateNotNullOrEmpty()]","        [String[]]","        $ComputerName = 'localhost',","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    BEGIN {","        if ($PSBoundParameters['Credential']) {","            $LogonToken = Invoke-UserImpersonation -Credential $Credential","        }","    }","","    PROCESS {","        ForEach ($Computer in $ComputerName) {","            # 0xF003F - SC_MANAGER_ALL_ACCESS","            #   http://msdn.microsoft.com/en-us/library/windows/desktop/ms685981(v=vs.85).aspx","            $Handle = $Advapi32::OpenSCManagerW(\"\\\\$Computer\", 'ServicesActive', 0xF003F);$LastError = [Runtime.InteropServices.Marshal]::GetLastWin32Error()","","            $IsAdmin = New-Object PSObject","            $IsAdmin | Add-Member Noteproperty 'ComputerName' $Computer","","            # if we get a non-zero handle back, everything was successful","            if ($Handle -ne 0) {","                $Null = $Advapi32::CloseServiceHandle($Handle)","                $IsAdmin | Add-Member Noteproperty 'IsAdmin' $True","            }","            else {","                Write-Verbose \"[Test-AdminAccess] Error: $(([ComponentModel.Win32Exception] $LastError).Message)\"","                $IsAdmin | Add-Member Noteproperty 'IsAdmin' $False","            }","            $IsAdmin.PSObject.TypeNames.Insert(0, 'PowerView.AdminAccess')","            $IsAdmin","        }","    }","","    END {","        if ($LogonToken) {","            Invoke-RevertToSelf -TokenHandle $LogonToken","        }","    }","}","","","function Get-NetComputerSiteName {","\u003c#",".SYNOPSIS","","Returns the AD site where the local (or a remote) machine resides.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: PSReflect, Invoke-UserImpersonation, Invoke-RevertToSelf  ","",".DESCRIPTION","","This function will use the DsGetSiteName Win32API call to look up the","name of the site where a specified computer resides.","",".PARAMETER ComputerName","","Specifies the hostname to check the site for (also accepts IP addresses).","Defaults to 'localhost'.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the remote system using Invoke-UserImpersonation.","",".EXAMPLE","","Get-NetComputerSiteName -ComputerName WINDOWS1.testlab.local","","Returns the site for WINDOWS1.testlab.local.","",".EXAMPLE","","Get-DomainComputer | Get-NetComputerSiteName","","Returns the sites for every machine in AD.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Get-NetComputerSiteName -ComputerName WINDOWS1.testlab.local -Credential $Cred","",".OUTPUTS","","PowerView.ComputerSite","","A PSCustomObject containing the ComputerName, IPAddress, and associated Site name.","#\u003e","","    [OutputType('PowerView.ComputerSite')]","    [CmdletBinding()]","    Param(","        [Parameter(Position = 0, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('HostName', 'dnshostname', 'name')]","        [ValidateNotNullOrEmpty()]","        [String[]]","        $ComputerName = 'localhost',","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    BEGIN {","        if ($PSBoundParameters['Credential']) {","            $LogonToken = Invoke-UserImpersonation -Credential $Credential","        }","    }","","    PROCESS {","        ForEach ($Computer in $ComputerName) {","            # if we get an IP address, try to resolve the IP to a hostname","            if ($Computer -match '^(?:[0-9]{1,3}\\.){3}[0-9]{1,3}$') {","                $IPAddress = $Computer","                $Computer = [System.Net.Dns]::GetHostByAddress($Computer) | Select-Object -ExpandProperty HostName","            }","            else {","                $IPAddress = @(Resolve-IPAddress -ComputerName $Computer)[0].IPAddress","            }","","            $PtrInfo = [IntPtr]::Zero","","            $Result = $Netapi32::DsGetSiteName($Computer, [ref]$PtrInfo)","","            $ComputerSite = New-Object PSObject","            $ComputerSite | Add-Member Noteproperty 'ComputerName' $Computer","            $ComputerSite | Add-Member Noteproperty 'IPAddress' $IPAddress","","            if ($Result -eq 0) {","                $Sitename = [System.Runtime.InteropServices.Marshal]::PtrToStringAuto($PtrInfo)","                $ComputerSite | Add-Member Noteproperty 'SiteName' $Sitename","            }","            else {","                Write-Verbose \"[Get-NetComputerSiteName] Error: $(([ComponentModel.Win32Exception] $Result).Message)\"","                $ComputerSite | Add-Member Noteproperty 'SiteName' ''","            }","            $ComputerSite.PSObject.TypeNames.Insert(0, 'PowerView.ComputerSite')","","            # free up the result buffer","            $Null = $Netapi32::NetApiBufferFree($PtrInfo)","","            $ComputerSite","        }","    }","","    END {","        if ($LogonToken) {","            Invoke-RevertToSelf -TokenHandle $LogonToken","        }","    }","}","","","function Get-WMIRegProxy {","\u003c#",".SYNOPSIS","","Enumerates the proxy server and WPAD conents for the current user.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: None  ","",".DESCRIPTION","","Enumerates the proxy server and WPAD specification for the current user","on the local machine (default), or a machine specified with -ComputerName.","It does this by enumerating settings from","HKU:SOFTWARE\\Microsoft\\Windows\\CurrentVersion\\Internet Settings.","",".PARAMETER ComputerName","","Specifies the system to enumerate proxy settings on. Defaults to the local host.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connecting to the remote system.","",".EXAMPLE","","Get-WMIRegProxy","","ComputerName           ProxyServer            AutoConfigURL         Wpad","------------           -----------            -------------         ----","WINDOWS1               http://primary.test...","",".EXAMPLE","","$Cred = Get-Credential \"TESTLAB\\administrator\"","Get-WMIRegProxy -Credential $Cred -ComputerName primary.testlab.local","","ComputerName            ProxyServer            AutoConfigURL         Wpad","------------            -----------            -------------         ----","windows1.testlab.local  primary.testlab.local","",".INPUTS","","String","","Accepts one or more computer name specification strings  on the pipeline (netbios or FQDN).","",".OUTPUTS","","PowerView.ProxySettings","","Outputs custom PSObjects with the ComputerName, ProxyServer, AutoConfigURL, and WPAD contents.","#\u003e","","    [OutputType('PowerView.ProxySettings')]","    [CmdletBinding()]","    Param(","        [Parameter(Position = 0, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('HostName', 'dnshostname', 'name')]","        [ValidateNotNullOrEmpty()]","        [String[]]","        $ComputerName = $Env:COMPUTERNAME,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    PROCESS {","        ForEach ($Computer in $ComputerName) {","            try {","                $WmiArguments = @{","                    'List' = $True","                    'Class' = 'StdRegProv'","                    'Namespace' = 'root\\default'","                    'Computername' = $Computer","                    'ErrorAction' = 'Stop'","                }","                if ($PSBoundParameters['Credential']) { $WmiArguments['Credential'] = $Credential }","","                $RegProvider = Get-WmiObject @WmiArguments","                $Key = 'SOFTWARE\\Microsoft\\Windows\\CurrentVersion\\Internet Settings'","","                # HKEY_CURRENT_USER","                $HKCU = 2147483649","                $ProxyServer = $RegProvider.GetStringValue($HKCU, $Key, 'ProxyServer').sValue","                $AutoConfigURL = $RegProvider.GetStringValue($HKCU, $Key, 'AutoConfigURL').sValue","","                $Wpad = ''","                if ($AutoConfigURL -and ($AutoConfigURL -ne '')) {","                    try {","                        $Wpad = (New-Object Net.WebClient).DownloadString($AutoConfigURL)","                    }","                    catch {","                        Write-Warning \"[Get-WMIRegProxy] Error connecting to AutoConfigURL : $AutoConfigURL\"","                    }","                }","","                if ($ProxyServer -or $AutoConfigUrl) {","                    $Out = New-Object PSObject","                    $Out | Add-Member Noteproperty 'ComputerName' $Computer","                    $Out | Add-Member Noteproperty 'ProxyServer' $ProxyServer","                    $Out | Add-Member Noteproperty 'AutoConfigURL' $AutoConfigURL","                    $Out | Add-Member Noteproperty 'Wpad' $Wpad","                    $Out.PSObject.TypeNames.Insert(0, 'PowerView.ProxySettings')","                    $Out","                }","                else {","                    Write-Warning \"[Get-WMIRegProxy] No proxy settings found for $ComputerName\"","                }","            }","            catch {","                Write-Warning \"[Get-WMIRegProxy] Error enumerating proxy settings for $ComputerName : $_\"","            }","        }","    }","}","","","function Get-WMIRegLastLoggedOn {","\u003c#",".SYNOPSIS","","Returns the last user who logged onto the local (or a remote) machine.","","Note: This function requires administrative rights on the machine you're enumerating.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: None  ","",".DESCRIPTION","","This function uses remote registry to enumerate the LastLoggedOnUser registry key","for the local (or remote) machine.","",".PARAMETER ComputerName","","Specifies the hostname to query for remote registry values (also accepts IP addresses).","Defaults to 'localhost'.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connecting to the remote system.","",".EXAMPLE","","Get-WMIRegLastLoggedOn","","Returns the last user logged onto the local machine.","",".EXAMPLE","","Get-WMIRegLastLoggedOn -ComputerName WINDOWS1","","Returns the last user logged onto WINDOWS1","",".EXAMPLE","","Get-DomainComputer | Get-WMIRegLastLoggedOn","","Returns the last user logged onto all machines in the domain.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Get-WMIRegLastLoggedOn -ComputerName PRIMARY.testlab.local -Credential $Cred","",".OUTPUTS","","PowerView.LastLoggedOnUser","","A PSCustomObject containing the ComputerName and last loggedon user.","#\u003e","","    [OutputType('PowerView.LastLoggedOnUser')]","    [CmdletBinding()]","    Param(","        [Parameter(Position = 0, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('HostName', 'dnshostname', 'name')]","        [ValidateNotNullOrEmpty()]","        [String[]]","        $ComputerName = 'localhost',","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    PROCESS {","        ForEach ($Computer in $ComputerName) {","            # HKEY_LOCAL_MACHINE","            $HKLM = 2147483650","","            $WmiArguments = @{","                'List' = $True","                'Class' = 'StdRegProv'","                'Namespace' = 'root\\default'","                'Computername' = $Computer","                'ErrorAction' = 'SilentlyContinue'","            }","            if ($PSBoundParameters['Credential']) { $WmiArguments['Credential'] = $Credential }","","            # try to open up the remote registry key to grab the last logged on user","            try {","                $Reg = Get-WmiObject @WmiArguments","","                $Key = 'SOFTWARE\\Microsoft\\Windows\\CurrentVersion\\Authentication\\LogonUI'","                $Value = 'LastLoggedOnUser'","                $LastUser = $Reg.GetStringValue($HKLM, $Key, $Value).sValue","","                $LastLoggedOn = New-Object PSObject","                $LastLoggedOn | Add-Member Noteproperty 'ComputerName' $Computer","                $LastLoggedOn | Add-Member Noteproperty 'LastLoggedOn' $LastUser","                $LastLoggedOn.PSObject.TypeNames.Insert(0, 'PowerView.LastLoggedOnUser')","                $LastLoggedOn","            }","            catch {","                Write-Warning \"[Get-WMIRegLastLoggedOn] Error opening remote registry on $Computer. Remote registry likely not enabled.\"","            }","        }","    }","}","","","function Get-WMIRegCachedRDPConnection {","\u003c#",".SYNOPSIS","","Returns information about RDP connections outgoing from the local (or remote) machine.","","Note: This function requires administrative rights on the machine you're enumerating.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: ConvertFrom-SID  ","",".DESCRIPTION","","Uses remote registry functionality to query all entries for the","\"Windows Remote Desktop Connection Client\" on a machine, separated by","user and target server.","",".PARAMETER ComputerName","","Specifies the hostname to query for cached RDP connections (also accepts IP addresses).","Defaults to 'localhost'.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connecting to the remote system.","",".EXAMPLE","","Get-WMIRegCachedRDPConnection","","Returns the RDP connection client information for the local machine.","",".EXAMPLE","","Get-WMIRegCachedRDPConnection  -ComputerName WINDOWS2.testlab.local","","Returns the RDP connection client information for the WINDOWS2.testlab.local machine","",".EXAMPLE","","Get-DomainComputer | Get-WMIRegCachedRDPConnection","","Returns cached RDP information for all machines in the domain.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Get-WMIRegCachedRDPConnection -ComputerName PRIMARY.testlab.local -Credential $Cred","",".OUTPUTS","","PowerView.CachedRDPConnection","","A PSCustomObject containing the ComputerName and cached RDP information.","#\u003e","","    [OutputType('PowerView.CachedRDPConnection')]","    [CmdletBinding()]","    Param(","        [Parameter(Position = 0, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('HostName', 'dnshostname', 'name')]","        [ValidateNotNullOrEmpty()]","        [String[]]","        $ComputerName = 'localhost',","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    PROCESS {","        ForEach ($Computer in $ComputerName) {","            # HKEY_USERS","            $HKU = 2147483651","","            $WmiArguments = @{","                'List' = $True","                'Class' = 'StdRegProv'","                'Namespace' = 'root\\default'","                'Computername' = $Computer","                'ErrorAction' = 'Stop'","            }","            if ($PSBoundParameters['Credential']) { $WmiArguments['Credential'] = $Credential }","","            try {","                $Reg = Get-WmiObject @WmiArguments","","                # extract out the SIDs of domain users in this hive","                $UserSIDs = ($Reg.EnumKey($HKU, '')).sNames | Where-Object { $_ -match 'S-1-5-21-[0-9]+-[0-9]+-[0-9]+-[0-9]+$' }","","                ForEach ($UserSID in $UserSIDs) {","                    try {","                        if ($PSBoundParameters['Credential']) {","                            $UserName = ConvertFrom-SID -ObjectSid $UserSID -Credential $Credential","                        }","                        else {","                            $UserName = ConvertFrom-SID -ObjectSid $UserSID","                        }","","                        # pull out all the cached RDP connections","                        $ConnectionKeys = $Reg.EnumValues($HKU,\"$UserSID\\Software\\Microsoft\\Terminal Server Client\\Default\").sNames","","                        ForEach ($Connection in $ConnectionKeys) {","                            # make sure this key is a cached connection","                            if ($Connection -match 'MRU.*') {","                                $TargetServer = $Reg.GetStringValue($HKU, \"$UserSID\\Software\\Microsoft\\Terminal Server Client\\Default\", $Connection).sValue","","                                $FoundConnection = New-Object PSObject","                                $FoundConnection | Add-Member Noteproperty 'ComputerName' $Computer","                                $FoundConnection | Add-Member Noteproperty 'UserName' $UserName","                                $FoundConnection | Add-Member Noteproperty 'UserSID' $UserSID","                                $FoundConnection | Add-Member Noteproperty 'TargetServer' $TargetServer","                                $FoundConnection | Add-Member Noteproperty 'UsernameHint' $Null","                                $FoundConnection.PSObject.TypeNames.Insert(0, 'PowerView.CachedRDPConnection')","                                $FoundConnection","                            }","                        }","","                        # pull out all the cached server info with username hints","                        $ServerKeys = $Reg.EnumKey($HKU,\"$UserSID\\Software\\Microsoft\\Terminal Server Client\\Servers\").sNames","","                        ForEach ($Server in $ServerKeys) {","","                            $UsernameHint = $Reg.GetStringValue($HKU, \"$UserSID\\Software\\Microsoft\\Terminal Server Client\\Servers\\$Server\", 'UsernameHint').sValue","","                            $FoundConnection = New-Object PSObject","                            $FoundConnection | Add-Member Noteproperty 'ComputerName' $Computer","                            $FoundConnection | Add-Member Noteproperty 'UserName' $UserName","                            $FoundConnection | Add-Member Noteproperty 'UserSID' $UserSID","                            $FoundConnection | Add-Member Noteproperty 'TargetServer' $Server","                            $FoundConnection | Add-Member Noteproperty 'UsernameHint' $UsernameHint","                            $FoundConnection.PSObject.TypeNames.Insert(0, 'PowerView.CachedRDPConnection')","                            $FoundConnection","                        }","                    }","                    catch {","                        Write-Verbose \"[Get-WMIRegCachedRDPConnection] Error: $_\"","                    }","                }","            }","            catch {","                Write-Warning \"[Get-WMIRegCachedRDPConnection] Error accessing $Computer, likely insufficient permissions or firewall rules on host: $_\"","            }","        }","    }","}","","","function Get-WMIRegMountedDrive {","\u003c#",".SYNOPSIS","","Returns information about saved network mounted drives for the local (or remote) machine.","","Note: This function requires administrative rights on the machine you're enumerating.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: ConvertFrom-SID  ","",".DESCRIPTION","","Uses remote registry functionality to enumerate recently mounted network drives.","",".PARAMETER ComputerName","","Specifies the hostname to query for mounted drive information (also accepts IP addresses).","Defaults to 'localhost'.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connecting to the remote system.","",".EXAMPLE","","Get-WMIRegMountedDrive","","Returns the saved network mounted drives for the local machine.","",".EXAMPLE","","Get-WMIRegMountedDrive -ComputerName WINDOWS2.testlab.local","","Returns the saved network mounted drives for the WINDOWS2.testlab.local machine","",".EXAMPLE","","Get-DomainComputer | Get-WMIRegMountedDrive","","Returns the saved network mounted drives for all machines in the domain.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Get-WMIRegMountedDrive -ComputerName PRIMARY.testlab.local -Credential $Cred","",".OUTPUTS","","PowerView.RegMountedDrive","","A PSCustomObject containing the ComputerName and mounted drive information.","#\u003e","","    [OutputType('PowerView.RegMountedDrive')]","    [CmdletBinding()]","    Param(","        [Parameter(Position = 0, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('HostName', 'dnshostname', 'name')]","        [ValidateNotNullOrEmpty()]","        [String[]]","        $ComputerName = 'localhost',","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    PROCESS {","        ForEach ($Computer in $ComputerName) {","            # HKEY_USERS","            $HKU = 2147483651","","            $WmiArguments = @{","                'List' = $True","                'Class' = 'StdRegProv'","                'Namespace' = 'root\\default'","                'Computername' = $Computer","                'ErrorAction' = 'Stop'","            }","            if ($PSBoundParameters['Credential']) { $WmiArguments['Credential'] = $Credential }","","            try {","                $Reg = Get-WmiObject @WmiArguments","","                # extract out the SIDs of domain users in this hive","                $UserSIDs = ($Reg.EnumKey($HKU, '')).sNames | Where-Object { $_ -match 'S-1-5-21-[0-9]+-[0-9]+-[0-9]+-[0-9]+$' }","","                ForEach ($UserSID in $UserSIDs) {","                    try {","                        if ($PSBoundParameters['Credential']) {","                            $UserName = ConvertFrom-SID -ObjectSid $UserSID -Credential $Credential","                        }","                        else {","                            $UserName = ConvertFrom-SID -ObjectSid $UserSID","                        }","","                        $DriveLetters = ($Reg.EnumKey($HKU, \"$UserSID\\Network\")).sNames","","                        ForEach ($DriveLetter in $DriveLetters) {","                            $ProviderName = $Reg.GetStringValue($HKU, \"$UserSID\\Network\\$DriveLetter\", 'ProviderName').sValue","                            $RemotePath = $Reg.GetStringValue($HKU, \"$UserSID\\Network\\$DriveLetter\", 'RemotePath').sValue","                            $DriveUserName = $Reg.GetStringValue($HKU, \"$UserSID\\Network\\$DriveLetter\", 'UserName').sValue","                            if (-not $UserName) { $UserName = '' }","","                            if ($RemotePath -and ($RemotePath -ne '')) {","                                $MountedDrive = New-Object PSObject","                                $MountedDrive | Add-Member Noteproperty 'ComputerName' $Computer","                                $MountedDrive | Add-Member Noteproperty 'UserName' $UserName","                                $MountedDrive | Add-Member Noteproperty 'UserSID' $UserSID","                                $MountedDrive | Add-Member Noteproperty 'DriveLetter' $DriveLetter","                                $MountedDrive | Add-Member Noteproperty 'ProviderName' $ProviderName","                                $MountedDrive | Add-Member Noteproperty 'RemotePath' $RemotePath","                                $MountedDrive | Add-Member Noteproperty 'DriveUserName' $DriveUserName","                                $MountedDrive.PSObject.TypeNames.Insert(0, 'PowerView.RegMountedDrive')","                                $MountedDrive","                            }","                        }","                    }","                    catch {","                        Write-Verbose \"[Get-WMIRegMountedDrive] Error: $_\"","                    }","                }","            }","            catch {","                Write-Warning \"[Get-WMIRegMountedDrive] Error accessing $Computer, likely insufficient permissions or firewall rules on host: $_\"","            }","        }","    }","}","","","function Get-WMIProcess {","\u003c#",".SYNOPSIS","","Returns a list of processes and their owners on the local or remote machine.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: None  ","",".DESCRIPTION","","Uses Get-WMIObject to enumerate all Win32_process instances on the local or remote machine,","including the owners of the particular process.","",".PARAMETER ComputerName","","Specifies the hostname to query for cached RDP connections (also accepts IP addresses).","Defaults to 'localhost'.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the remote system.","",".EXAMPLE","","Get-WMIProcess -ComputerName WINDOWS1","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Get-WMIProcess -ComputerName PRIMARY.testlab.local -Credential $Cred","",".OUTPUTS","","PowerView.UserProcess","","A PSCustomObject containing the remote process information.","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType('PowerView.UserProcess')]","    [CmdletBinding()]","    Param(","        [Parameter(Position = 0, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('HostName', 'dnshostname', 'name')]","        [ValidateNotNullOrEmpty()]","        [String[]]","        $ComputerName = 'localhost',","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    PROCESS {","        ForEach ($Computer in $ComputerName) {","            try {","                $WmiArguments = @{","                    'ComputerName' = $ComputerName","                    'Class' = 'Win32_process'","                }","                if ($PSBoundParameters['Credential']) { $WmiArguments['Credential'] = $Credential }","                Get-WMIobject @WmiArguments | ForEach-Object {","                    $Owner = $_.getowner();","                    $Process = New-Object PSObject","                    $Process | Add-Member Noteproperty 'ComputerName' $Computer","                    $Process | Add-Member Noteproperty 'ProcessName' $_.ProcessName","                    $Process | Add-Member Noteproperty 'ProcessID' $_.ProcessID","                    $Process | Add-Member Noteproperty 'Domain' $Owner.Domain","                    $Process | Add-Member Noteproperty 'User' $Owner.User","                    $Process.PSObject.TypeNames.Insert(0, 'PowerView.UserProcess')","                    $Process","                }","            }","            catch {","                Write-Verbose \"[Get-WMIProcess] Error enumerating remote processes on '$Computer', access likely denied: $_\"","            }","        }","    }","}","","","function Find-InterestingFile {","\u003c#",".SYNOPSIS","","Searches for files on the given path that match a series of specified criteria.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: Add-RemoteConnection, Remove-RemoteConnection  ","",".DESCRIPTION","","This function recursively searches a given UNC path for files with","specific keywords in the name (default of pass, sensitive, secret, admin,","login and unattend*.xml). By default, hidden files/folders are included","in search results. If -Credential is passed, Add-RemoteConnection/Remove-RemoteConnection","is used to temporarily map the remote share.","",".PARAMETER Path","","UNC/local path to recursively search.","",".PARAMETER Include","","Only return files/folders that match the specified array of strings,","i.e. @(*.doc*, *.xls*, *.ppt*)","",".PARAMETER LastAccessTime","","Only return files with a LastAccessTime greater than this date value.","",".PARAMETER LastWriteTime","","Only return files with a LastWriteTime greater than this date value.","",".PARAMETER CreationTime","","Only return files with a CreationTime greater than this date value.","",".PARAMETER OfficeDocs","","Switch. Search for office documents (*.doc*, *.xls*, *.ppt*)","",".PARAMETER FreshEXEs","","Switch. Find .EXEs accessed within the last 7 days.","",".PARAMETER ExcludeFolders","","Switch. Exclude folders from the search results.","",".PARAMETER ExcludeHidden","","Switch. Exclude hidden files and folders from the search results.","",".PARAMETER CheckWriteAccess","","Switch. Only returns files the current user has write access to.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","to connect to remote systems for file enumeration.","",".EXAMPLE","","Find-InterestingFile -Path \"C:\\Backup\\\"","","Returns any files on the local path C:\\Backup\\ that have the default","search term set in the title.","",".EXAMPLE","","Find-InterestingFile -Path \"\\\\WINDOWS7\\Users\\\" -LastAccessTime (Get-Date).AddDays(-7)","","Returns any files on the remote path \\\\WINDOWS7\\Users\\ that have the default","search term set in the title and were accessed within the last week.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Find-InterestingFile -Credential $Cred -Path \"\\\\PRIMARY.testlab.local\\C$\\Temp\\\"","",".OUTPUTS","","PowerView.FoundFile","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType('PowerView.FoundFile')]","    [CmdletBinding(DefaultParameterSetName = 'FileSpecification')]","    Param(","        [Parameter(Position = 0, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [ValidateNotNullOrEmpty()]","        [String[]]","        $Path = '.\\',","","        [Parameter(ParameterSetName = 'FileSpecification')]","        [ValidateNotNullOrEmpty()]","        [Alias('SearchTerms', 'Terms')]","        [String[]]","        $Include = @('*password*', '*sensitive*', '*admin*', '*login*', '*secret*', 'unattend*.xml', '*.vmdk', '*creds*', '*credential*', '*.config'),","","        [Parameter(ParameterSetName = 'FileSpecification')]","        [ValidateNotNullOrEmpty()]","        [DateTime]","        $LastAccessTime,","","        [Parameter(ParameterSetName = 'FileSpecification')]","        [ValidateNotNullOrEmpty()]","        [DateTime]","        $LastWriteTime,","","        [Parameter(ParameterSetName = 'FileSpecification')]","        [ValidateNotNullOrEmpty()]","        [DateTime]","        $CreationTime,","","        [Parameter(ParameterSetName = 'OfficeDocs')]","        [Switch]","        $OfficeDocs,","","        [Parameter(ParameterSetName = 'FreshEXEs')]","        [Switch]","        $FreshEXEs,","","        [Parameter(ParameterSetName = 'FileSpecification')]","        [Switch]","        $ExcludeFolders,","","        [Parameter(ParameterSetName = 'FileSpecification')]","        [Switch]","        $ExcludeHidden,","","        [Switch]","        $CheckWriteAccess,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    BEGIN {","        $SearcherArguments =  @{","            'Recurse' = $True","            'ErrorAction' = 'SilentlyContinue'","            'Include' = $Include","        }","        if ($PSBoundParameters['OfficeDocs']) {","            $SearcherArguments['Include'] = @('*.doc', '*.docx', '*.xls', '*.xlsx', '*.ppt', '*.pptx')","        }","        elseif ($PSBoundParameters['FreshEXEs']) {","            # find .exe's accessed within the last 7 days","            $LastAccessTime = (Get-Date).AddDays(-7).ToString('MM/dd/yyyy')","            $SearcherArguments['Include'] = @('*.exe')","        }","        $SearcherArguments['Force'] = -not $PSBoundParameters['ExcludeHidden']","","        $MappedComputers = @{}","","        function Test-Write {","            # short helper to check is the current user can write to a file","            [CmdletBinding()]Param([String]$Path)","            try {","                $Filetest = [IO.File]::OpenWrite($Path)","                $Filetest.Close()","                $True","            }","            catch {","                $False","            }","        }","    }","","    PROCESS {","        ForEach ($TargetPath in $Path) {","            if (($TargetPath -Match '\\\\\\\\.*\\\\.*') -and ($PSBoundParameters['Credential'])) {","                $HostComputer = (New-Object System.Uri($TargetPath)).Host","                if (-not $MappedComputers[$HostComputer]) {","                    # map IPC$ to this computer if it's not already","                    Add-RemoteConnection -ComputerName $HostComputer -Credential $Credential","                    $MappedComputers[$HostComputer] = $True","                }","            }","","            $SearcherArguments['Path'] = $TargetPath","            Get-ChildItem @SearcherArguments | ForEach-Object {","                # check if we're excluding folders","                $Continue = $True","                if ($PSBoundParameters['ExcludeFolders'] -and ($_.PSIsContainer)) {","                    Write-Verbose \"Excluding: $($_.FullName)\"","                    $Continue = $False","                }","                if ($LastAccessTime -and ($_.LastAccessTime -lt $LastAccessTime)) {","                    $Continue = $False","                }","                if ($PSBoundParameters['LastWriteTime'] -and ($_.LastWriteTime -lt $LastWriteTime)) {","                    $Continue = $False","                }","                if ($PSBoundParameters['CreationTime'] -and ($_.CreationTime -lt $CreationTime)) {","                    $Continue = $False","                }","                if ($PSBoundParameters['CheckWriteAccess'] -and (-not (Test-Write -Path $_.FullName))) {","                    $Continue = $False","                }","                if ($Continue) {","                    $FileParams = @{","                        'Path' = $_.FullName","                        'Owner' = $((Get-Acl $_.FullName).Owner)","                        'LastAccessTime' = $_.LastAccessTime","                        'LastWriteTime' = $_.LastWriteTime","                        'CreationTime' = $_.CreationTime","                        'Length' = $_.Length","                    }","                    $FoundFile = New-Object -TypeName PSObject -Property $FileParams","                    $FoundFile.PSObject.TypeNames.Insert(0, 'PowerView.FoundFile')","                    $FoundFile","                }","            }","        }","    }","","    END {","        # remove the IPC$ mappings","        $MappedComputers.Keys | Remove-RemoteConnection","    }","}","","","########################################################","#","# 'Meta'-functions start below","#","########################################################","","function New-ThreadedFunction {","    # Helper used by any threaded host enumeration functions","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSUseShouldProcessForStateChangingFunctions', '')]","    [CmdletBinding()]","    Param(","        [Parameter(Position = 0, Mandatory = $True, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [String[]]","        $ComputerName,","","        [Parameter(Position = 1, Mandatory = $True)]","        [System.Management.Automation.ScriptBlock]","        $ScriptBlock,","","        [Parameter(Position = 2)]","        [Hashtable]","        $ScriptParameters,","","        [Int]","        [ValidateRange(1,  100)]","        $Threads = 20,","","        [Switch]","        $NoImports","    )","","    BEGIN {","        # Adapted from:","        #   http://powershell.org/wp/forums/topic/invpke-parallel-need-help-to-clone-the-current-runspace/","        $SessionState = [System.Management.Automation.Runspaces.InitialSessionState]::CreateDefault()","","        # # $SessionState.ApartmentState = [System.Threading.Thread]::CurrentThread.GetApartmentState()","        # force a single-threaded apartment state (for token-impersonation stuffz)","        $SessionState.ApartmentState = [System.Threading.ApartmentState]::STA","","        # import the current session state's variables and functions so the chained PowerView","        #   functionality can be used by the threaded blocks","        if (-not $NoImports) {","            # grab all the current variables for this runspace","            $MyVars = Get-Variable -Scope 2","","            # these Variables are added by Runspace.Open() Method and produce Stop errors if you add them twice","            $VorbiddenVars = @('?','args','ConsoleFileName','Error','ExecutionContext','false','HOME','Host','input','InputObject','MaximumAliasCount','MaximumDriveCount','MaximumErrorCount','MaximumFunctionCount','MaximumHistoryCount','MaximumVariableCount','MyInvocation','null','PID','PSBoundParameters','PSCommandPath','PSCulture','PSDefaultParameterValues','PSHOME','PSScriptRoot','PSUICulture','PSVersionTable','PWD','ShellId','SynchronizedHash','true')","","            # add Variables from Parent Scope (current runspace) into the InitialSessionState","            ForEach ($Var in $MyVars) {","                if ($VorbiddenVars -NotContains $Var.Name) {","                $SessionState.Variables.Add((New-Object -TypeName System.Management.Automation.Runspaces.SessionStateVariableEntry -ArgumentList $Var.name,$Var.Value,$Var.description,$Var.options,$Var.attributes))","                }","            }","","            # add Functions from current runspace to the InitialSessionState","            ForEach ($Function in (Get-ChildItem Function:)) {","                $SessionState.Commands.Add((New-Object -TypeName System.Management.Automation.Runspaces.SessionStateFunctionEntry -ArgumentList $Function.Name, $Function.Definition))","            }","        }","","        # threading adapted from","        # https://github.com/darkoperator/Posh-SecMod/blob/master/Discovery/Discovery.psm1#L407","        #   Thanks Carlos!","","        # create a pool of maxThread runspaces","        $Pool = [RunspaceFactory]::CreateRunspacePool(1, $Threads, $SessionState, $Host)","        $Pool.Open()","","        # do some trickery to get the proper BeginInvoke() method that allows for an output queue","        $Method = $Null","        ForEach ($M in [PowerShell].GetMethods() | Where-Object { $_.Name -eq 'BeginInvoke' }) {","            $MethodParameters = $M.GetParameters()","            if (($MethodParameters.Count -eq 2) -and $MethodParameters[0].Name -eq 'input' -and $MethodParameters[1].Name -eq 'output') {","                $Method = $M.MakeGenericMethod([Object], [Object])","                break","            }","        }","","        $Jobs = @()","        $ComputerName = $ComputerName | Where-Object {$_ -and $_.Trim()}","        Write-Verbose \"[New-ThreadedFunction] Total number of hosts: $($ComputerName.count)\"","","        # partition all hosts from -ComputerName into $Threads number of groups","        if ($Threads -ge $ComputerName.Length) {","            $Threads = $ComputerName.Length","        }","        $ElementSplitSize = [Int]($ComputerName.Length/$Threads)","        $ComputerNamePartitioned = @()","        $Start = 0","        $End = $ElementSplitSize","","        for($i = 1; $i -le $Threads; $i++) {","            $List = New-Object System.Collections.ArrayList","            if ($i -eq $Threads) {","                $End = $ComputerName.Length","            }","            $List.AddRange($ComputerName[$Start..($End-1)])","            $Start += $ElementSplitSize","            $End += $ElementSplitSize","            $ComputerNamePartitioned += @(,@($List.ToArray()))","        }","","        Write-Verbose \"[New-ThreadedFunction] Total number of threads/partitions: $Threads\"","","        ForEach ($ComputerNamePartition in $ComputerNamePartitioned) {","            # create a \"powershell pipeline runner\"","            $PowerShell = [PowerShell]::Create()","            $PowerShell.runspacepool = $Pool","","            # add the script block + arguments with the given computer partition","            $Null = $PowerShell.AddScript($ScriptBlock).AddParameter('ComputerName', $ComputerNamePartition)","            if ($ScriptParameters) {","                ForEach ($Param in $ScriptParameters.GetEnumerator()) {","                    $Null = $PowerShell.AddParameter($Param.Name, $Param.Value)","                }","            }","","            # create the output queue","            $Output = New-Object Management.Automation.PSDataCollection[Object]","","            # kick off execution using the BeginInvok() method that allows queues","            $Jobs += @{","                PS = $PowerShell","                Output = $Output","                Result = $Method.Invoke($PowerShell, @($Null, [Management.Automation.PSDataCollection[Object]]$Output))","            }","        }","    }","","    END {","        Write-Verbose \"[New-ThreadedFunction] Threads executing\"","","        # continuously loop through each job queue, consuming output as appropriate","        Do {","            ForEach ($Job in $Jobs) {","                $Job.Output.ReadAll()","            }","            Start-Sleep -Seconds 1","        }","        While (($Jobs | Where-Object { -not $_.Result.IsCompleted }).Count -gt 0)","","        $SleepSeconds = 100","        Write-Verbose \"[New-ThreadedFunction] Waiting $SleepSeconds seconds for final cleanup...\"","","        # cleanup- make sure we didn't miss anything","        for ($i=0; $i -lt $SleepSeconds; $i++) {","            ForEach ($Job in $Jobs) {","                $Job.Output.ReadAll()","                $Job.PS.Dispose()","            }","            Start-Sleep -S 1","        }","","        $Pool.Dispose()","        Write-Verbose \"[New-ThreadedFunction] all threads completed\"","    }","}","","","function Find-DomainUserLocation {","\u003c#",".SYNOPSIS","","Finds domain machines where specific users are logged into.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: Get-DomainFileServer, Get-DomainDFSShare, Get-DomainController, Get-DomainComputer, Get-DomainUser, Get-DomainGroupMember, Invoke-UserImpersonation, Invoke-RevertToSelf, Get-NetSession, Test-AdminAccess, Get-NetLoggedon, Resolve-IPAddress, New-ThreadedFunction  ","",".DESCRIPTION","","This function enumerates all machines on the current (or specified) domain","using Get-DomainComputer, and queries the domain for users of a specified group","(default 'Domain Admins') with Get-DomainGroupMember. Then for each server the","function enumerates any active user sessions with Get-NetSession/Get-NetLoggedon","The found user list is compared against the target list, and any matches are","displayed. If -ShowAll is specified, all results are displayed instead of","the filtered set. If -Stealth is specified, then likely highly-trafficed servers","are enumerated with Get-DomainFileServer/Get-DomainController, and session","enumeration is executed only against those servers. If -Credential is passed,","then Invoke-UserImpersonation is used to impersonate the specified user","before enumeration, reverting after with Invoke-RevertToSelf.","",".PARAMETER ComputerName","","Specifies an array of one or more hosts to enumerate, passable on the pipeline.","If -ComputerName is not passed, the default behavior is to enumerate all machines","in the domain returned by Get-DomainComputer.","",".PARAMETER Domain","","Specifies the domain to query for computers AND users, defaults to the current domain.","",".PARAMETER ComputerDomain","","Specifies the domain to query for computers, defaults to the current domain.","",".PARAMETER ComputerLDAPFilter","","Specifies an LDAP query string that is used to search for computer objects.","",".PARAMETER ComputerSearchBase","","Specifies the LDAP source to search through for computers,","e.g. \"LDAP://OU=secret,DC=testlab,DC=local\". Useful for OU queries.","",".PARAMETER ComputerUnconstrained","","Switch. Search computer objects that have unconstrained delegation.","",".PARAMETER ComputerOperatingSystem","","Search computers with a specific operating system, wildcards accepted.","",".PARAMETER ComputerServicePack","","Search computers with a specific service pack, wildcards accepted.","",".PARAMETER ComputerSiteName","","Search computers in the specific AD Site name, wildcards accepted.","",".PARAMETER UserIdentity","","Specifies one or more user identities to search for.","",".PARAMETER UserDomain","","Specifies the domain to query for users to search for, defaults to the current domain.","",".PARAMETER UserLDAPFilter","","Specifies an LDAP query string that is used to search for target users.","",".PARAMETER UserSearchBase","","Specifies the LDAP source to search through for target users.","e.g. \"LDAP://OU=secret,DC=testlab,DC=local\". Useful for OU queries.","",".PARAMETER UserGroupIdentity","","Specifies a group identity to query for target users, defaults to 'Domain Admins.","If any other user specifications are set, then UserGroupIdentity is ignored.","",".PARAMETER UserAdminCount","","Switch. Search for users users with '(adminCount=1)' (meaning are/were privileged).","",".PARAMETER UserAllowDelegation","","Switch. Search for user accounts that are not marked as 'sensitive and not allowed for delegation'.","",".PARAMETER CheckAccess","","Switch. Check if the current user has local admin access to computers where target users are found.","",".PARAMETER Server","","Specifies an Active Directory server (domain controller) to bind to.","",".PARAMETER SearchScope","","Specifies the scope to search under for computers, Base/OneLevel/Subtree (default of Subtree).","",".PARAMETER ResultPageSize","","Specifies the PageSize to set for the LDAP searcher object.","",".PARAMETER ServerTimeLimit","","Specifies the maximum amount of time the server spends searching. Default of 120 seconds.","",".PARAMETER Tombstone","","Switch. Specifies that the searcher should also return deleted/tombstoned objects.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target domain and target systems.","",".PARAMETER StopOnSuccess","","Switch. Stop hunting after finding after finding a target user.","",".PARAMETER Delay","","Specifies the delay (in seconds) between enumerating hosts, defaults to 0.","",".PARAMETER Jitter","","Specifies the jitter (0-1.0) to apply to any specified -Delay, defaults to +/- 0.3","",".PARAMETER ShowAll","","Switch. Return all user location results instead of filtering based on target","specifications.","",".PARAMETER Stealth","","Switch. Only enumerate sessions from connonly used target servers.","",".PARAMETER StealthSource","","The source of target servers to use, 'DFS' (distributed file servers),","'DC' (domain controllers), 'File' (file servers), or 'All' (the default).","",".PARAMETER Threads","","The number of threads to use for user searching, defaults to 20.","",".EXAMPLE","","Find-DomainUserLocation","","Searches for 'Domain Admins' by enumerating every computer in the domain.","",".EXAMPLE","","Find-DomainUserLocation -Stealth -ShowAll","","Enumerates likely highly-trafficked servers, performs just session enumeration","against each, and outputs all results.","",".EXAMPLE","","Find-DomainUserLocation -UserAdminCount -ComputerOperatingSystem 'Windows 7*' -Domain dev.testlab.local","","Enumerates Windows 7 computers in dev.testlab.local and returns user results for privileged","users in dev.testlab.local.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Find-DomainUserLocation -Domain testlab.local -Credential $Cred","","Searches for domain admin locations in the testlab.local using the specified alternate credentials.","",".OUTPUTS","","PowerView.UserLocation","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType('PowerView.UserLocation')]","    [CmdletBinding(DefaultParameterSetName = 'UserGroupIdentity')]","    Param(","        [Parameter(Position = 0, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('DNSHostName')]","        [String[]]","        $ComputerName,","","        [ValidateNotNullOrEmpty()]","        [String]","        $Domain,","","        [ValidateNotNullOrEmpty()]","        [String]","        $ComputerDomain,","","        [ValidateNotNullOrEmpty()]","        [String]","        $ComputerLDAPFilter,","","        [ValidateNotNullOrEmpty()]","        [String]","        $ComputerSearchBase,","","        [Alias('Unconstrained')]","        [Switch]","        $ComputerUnconstrained,","","        [ValidateNotNullOrEmpty()]","        [Alias('OperatingSystem')]","        [String]","        $ComputerOperatingSystem,","","        [ValidateNotNullOrEmpty()]","        [Alias('ServicePack')]","        [String]","        $ComputerServicePack,","","        [ValidateNotNullOrEmpty()]","        [Alias('SiteName')]","        [String]","        $ComputerSiteName,","","        [Parameter(ParameterSetName = 'UserIdentity')]","        [ValidateNotNullOrEmpty()]","        [String[]]","        $UserIdentity,","","        [ValidateNotNullOrEmpty()]","        [String]","        $UserDomain,","","        [ValidateNotNullOrEmpty()]","        [String]","        $UserLDAPFilter,","","        [ValidateNotNullOrEmpty()]","        [String]","        $UserSearchBase,","","        [Parameter(ParameterSetName = 'UserGroupIdentity')]","        [ValidateNotNullOrEmpty()]","        [Alias('GroupName', 'Group')]","        [String[]]","        $UserGroupIdentity = 'Domain Admins',","","        [Alias('AdminCount')]","        [Switch]","        $UserAdminCount,","","        [Alias('AllowDelegation')]","        [Switch]","        $UserAllowDelegation,","","        [Switch]","        $CheckAccess,","","        [ValidateNotNullOrEmpty()]","        [Alias('DomainController')]","        [String]","        $Server,","","        [ValidateSet('Base', 'OneLevel', 'Subtree')]","        [String]","        $SearchScope = 'Subtree',","","        [ValidateRange(1, 10000)]","        [Int]","        $ResultPageSize = 200,","","        [ValidateRange(1, 10000)]","        [Int]","        $ServerTimeLimit,","","        [Switch]","        $Tombstone,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty,","","        [Switch]","        $StopOnSuccess,","","        [ValidateRange(1, 10000)]","        [Int]","        $Delay = 0,","","        [ValidateRange(0.0, 1.0)]","        [Double]","        $Jitter = .3,","","        [Parameter(ParameterSetName = 'ShowAll')]","        [Switch]","        $ShowAll,","","        [Switch]","        $Stealth,","","        [String]","        [ValidateSet('DFS', 'DC', 'File', 'All')]","        $StealthSource = 'All',","","        [Int]","        [ValidateRange(1, 100)]","        $Threads = 20","    )","","    BEGIN {","","        $ComputerSearcherArguments = @{","            'Properties' = 'dnshostname'","        }","        if ($PSBoundParameters['Domain']) { $ComputerSearcherArguments['Domain'] = $Domain }","        if ($PSBoundParameters['ComputerDomain']) { $ComputerSearcherArguments['Domain'] = $ComputerDomain }","        if ($PSBoundParameters['ComputerLDAPFilter']) { $ComputerSearcherArguments['LDAPFilter'] = $ComputerLDAPFilter }","        if ($PSBoundParameters['ComputerSearchBase']) { $ComputerSearcherArguments['SearchBase'] = $ComputerSearchBase }","        if ($PSBoundParameters['Unconstrained']) { $ComputerSearcherArguments['Unconstrained'] = $Unconstrained }","        if ($PSBoundParameters['ComputerOperatingSystem']) { $ComputerSearcherArguments['OperatingSystem'] = $OperatingSystem }","        if ($PSBoundParameters['ComputerServicePack']) { $ComputerSearcherArguments['ServicePack'] = $ServicePack }","        if ($PSBoundParameters['ComputerSiteName']) { $ComputerSearcherArguments['SiteName'] = $SiteName }","        if ($PSBoundParameters['Server']) { $ComputerSearcherArguments['Server'] = $Server }","        if ($PSBoundParameters['SearchScope']) { $ComputerSearcherArguments['SearchScope'] = $SearchScope }","        if ($PSBoundParameters['ResultPageSize']) { $ComputerSearcherArguments['ResultPageSize'] = $ResultPageSize }","        if ($PSBoundParameters['ServerTimeLimit']) { $ComputerSearcherArguments['ServerTimeLimit'] = $ServerTimeLimit }","        if ($PSBoundParameters['Tombstone']) { $ComputerSearcherArguments['Tombstone'] = $Tombstone }","        if ($PSBoundParameters['Credential']) { $ComputerSearcherArguments['Credential'] = $Credential }","","        $UserSearcherArguments = @{","            'Properties' = 'samaccountname'","        }","        if ($PSBoundParameters['UserIdentity']) { $UserSearcherArguments['Identity'] = $UserIdentity }","        if ($PSBoundParameters['Domain']) { $UserSearcherArguments['Domain'] = $Domain }","        if ($PSBoundParameters['UserDomain']) { $UserSearcherArguments['Domain'] = $UserDomain }","        if ($PSBoundParameters['UserLDAPFilter']) { $UserSearcherArguments['LDAPFilter'] = $UserLDAPFilter }","        if ($PSBoundParameters['UserSearchBase']) { $UserSearcherArguments['SearchBase'] = $UserSearchBase }","        if ($PSBoundParameters['UserAdminCount']) { $UserSearcherArguments['AdminCount'] = $UserAdminCount }","        if ($PSBoundParameters['UserAllowDelegation']) { $UserSearcherArguments['AllowDelegation'] = $UserAllowDelegation }","        if ($PSBoundParameters['Server']) { $UserSearcherArguments['Server'] = $Server }","        if ($PSBoundParameters['SearchScope']) { $UserSearcherArguments['SearchScope'] = $SearchScope }","        if ($PSBoundParameters['ResultPageSize']) { $UserSearcherArguments['ResultPageSize'] = $ResultPageSize }","        if ($PSBoundParameters['ServerTimeLimit']) { $UserSearcherArguments['ServerTimeLimit'] = $ServerTimeLimit }","        if ($PSBoundParameters['Tombstone']) { $UserSearcherArguments['Tombstone'] = $Tombstone }","        if ($PSBoundParameters['Credential']) { $UserSearcherArguments['Credential'] = $Credential }","","        $TargetComputers = @()","","        # first, build the set of computers to enumerate","        if ($PSBoundParameters['ComputerName']) {","            $TargetComputers = @($ComputerName)","        }","        else {","            if ($PSBoundParameters['Stealth']) {","                Write-Verbose \"[Find-DomainUserLocation] Stealth enumeration using source: $StealthSource\"","                $TargetComputerArrayList = New-Object System.Collections.ArrayList","","                if ($StealthSource -match 'File|All') {","                    Write-Verbose '[Find-DomainUserLocation] Querying for file servers'","                    $FileServerSearcherArguments = @{}","                    if ($PSBoundParameters['Domain']) { $FileServerSearcherArguments['Domain'] = $Domain }","                    if ($PSBoundParameters['ComputerDomain']) { $FileServerSearcherArguments['Domain'] = $ComputerDomain }","                    if ($PSBoundParameters['ComputerSearchBase']) { $FileServerSearcherArguments['SearchBase'] = $ComputerSearchBase }","                    if ($PSBoundParameters['Server']) { $FileServerSearcherArguments['Server'] = $Server }","                    if ($PSBoundParameters['SearchScope']) { $FileServerSearcherArguments['SearchScope'] = $SearchScope }","                    if ($PSBoundParameters['ResultPageSize']) { $FileServerSearcherArguments['ResultPageSize'] = $ResultPageSize }","                    if ($PSBoundParameters['ServerTimeLimit']) { $FileServerSearcherArguments['ServerTimeLimit'] = $ServerTimeLimit }","                    if ($PSBoundParameters['Tombstone']) { $FileServerSearcherArguments['Tombstone'] = $Tombstone }","                    if ($PSBoundParameters['Credential']) { $FileServerSearcherArguments['Credential'] = $Credential }","                    $FileServers = Get-DomainFileServer @FileServerSearcherArguments","                    if ($FileServers -isnot [System.Array]) { $FileServers = @($FileServers) }","                    $TargetComputerArrayList.AddRange( $FileServers )","                }","                if ($StealthSource -match 'DFS|All') {","                    Write-Verbose '[Find-DomainUserLocation] Querying for DFS servers'","                    # # TODO: fix the passed parameters to Get-DomainDFSShare","                    # $ComputerName += Get-DomainDFSShare -Domain $Domain -Server $DomainController | ForEach-Object {$_.RemoteServerName}","                }","                if ($StealthSource -match 'DC|All') {","                    Write-Verbose '[Find-DomainUserLocation] Querying for domain controllers'","                    $DCSearcherArguments = @{","                        'LDAP' = $True","                    }","                    if ($PSBoundParameters['Domain']) { $DCSearcherArguments['Domain'] = $Domain }","                    if ($PSBoundParameters['ComputerDomain']) { $DCSearcherArguments['Domain'] = $ComputerDomain }","                    if ($PSBoundParameters['Server']) { $DCSearcherArguments['Server'] = $Server }","                    if ($PSBoundParameters['Credential']) { $DCSearcherArguments['Credential'] = $Credential }","                    $DomainControllers = Get-DomainController @DCSearcherArguments | Select-Object -ExpandProperty dnshostname","                    if ($DomainControllers -isnot [System.Array]) { $DomainControllers = @($DomainControllers) }","                    $TargetComputerArrayList.AddRange( $DomainControllers )","                }","                $TargetComputers = $TargetComputerArrayList.ToArray()","            }","            else {","                Write-Verbose '[Find-DomainUserLocation] Querying for all computers in the domain'","                $TargetComputers = Get-DomainComputer @ComputerSearcherArguments | Select-Object -ExpandProperty dnshostname","            }","        }","        Write-Verbose \"[Find-DomainUserLocation] TargetComputers length: $($TargetComputers.Length)\"","        if ($TargetComputers.Length -eq 0) {","            throw '[Find-DomainUserLocation] No hosts found to enumerate'","        }","","        # get the current user so we can ignore it in the results","        if ($PSBoundParameters['Credential']) {","            $CurrentUser = $Credential.GetNetworkCredential().UserName","        }","        else {","            $CurrentUser = ([Environment]::UserName).ToLower()","        }","","        # now build the user target set","        if ($PSBoundParameters['ShowAll']) {","            $TargetUsers = @()","        }","        elseif ($PSBoundParameters['UserIdentity'] -or $PSBoundParameters['UserLDAPFilter'] -or $PSBoundParameters['UserSearchBase'] -or $PSBoundParameters['UserAdminCount'] -or $PSBoundParameters['UserAllowDelegation']) {","            $TargetUsers = Get-DomainUser @UserSearcherArguments | Select-Object -ExpandProperty samaccountname","        }","        else {","            $GroupSearcherArguments = @{","                'Identity' = $UserGroupIdentity","                'Recurse' = $True","            }","            if ($PSBoundParameters['UserDomain']) { $GroupSearcherArguments['Domain'] = $UserDomain }","            if ($PSBoundParameters['UserSearchBase']) { $GroupSearcherArguments['SearchBase'] = $UserSearchBase }","            if ($PSBoundParameters['Server']) { $GroupSearcherArguments['Server'] = $Server }","            if ($PSBoundParameters['SearchScope']) { $GroupSearcherArguments['SearchScope'] = $SearchScope }","            if ($PSBoundParameters['ResultPageSize']) { $GroupSearcherArguments['ResultPageSize'] = $ResultPageSize }","            if ($PSBoundParameters['ServerTimeLimit']) { $GroupSearcherArguments['ServerTimeLimit'] = $ServerTimeLimit }","            if ($PSBoundParameters['Tombstone']) { $GroupSearcherArguments['Tombstone'] = $Tombstone }","            if ($PSBoundParameters['Credential']) { $GroupSearcherArguments['Credential'] = $Credential }","            $TargetUsers = Get-DomainGroupMember @GroupSearcherArguments | Select-Object -ExpandProperty MemberName","        }","","        Write-Verbose \"[Find-DomainUserLocation] TargetUsers length: $($TargetUsers.Length)\"","        if ((-not $ShowAll) -and ($TargetUsers.Length -eq 0)) {","            throw '[Find-DomainUserLocation] No users found to target'","        }","","        # the host enumeration block we're using to enumerate all servers","        $HostEnumBlock = {","            Param($ComputerName, $TargetUsers, $CurrentUser, $Stealth, $TokenHandle)","","            if ($TokenHandle) {","                # impersonate the the token produced by LogonUser()/Invoke-UserImpersonation","                $Null = Invoke-UserImpersonation -TokenHandle $TokenHandle -Quiet","            }","","            ForEach ($TargetComputer in $ComputerName) {","                $Up = Test-Connection -Count 1 -Quiet -ComputerName $TargetComputer","                if ($Up) {","                    $Sessions = Get-NetSession -ComputerName $TargetComputer","                    ForEach ($Session in $Sessions) {","                        $UserName = $Session.UserName","                        $CName = $Session.CName","","                        if ($CName -and $CName.StartsWith('\\\\')) {","                            $CName = $CName.TrimStart('\\')","                        }","","                        # make sure we have a result, and ignore computer$ sessions","                        if (($UserName) -and ($UserName.Trim() -ne '') -and ($UserName -notmatch $CurrentUser) -and ($UserName -notmatch '\\$$')) {","","                            if ( (-not $TargetUsers) -or ($TargetUsers -contains $UserName)) {","                                $UserLocation = New-Object PSObject","                                $UserLocation | Add-Member Noteproperty 'UserDomain' $Null","                                $UserLocation | Add-Member Noteproperty 'UserName' $UserName","                                $UserLocation | Add-Member Noteproperty 'ComputerName' $TargetComputer","                                $UserLocation | Add-Member Noteproperty 'SessionFrom' $CName","","                                # try to resolve the DNS hostname of $Cname","                                try {","                                    $CNameDNSName = [System.Net.Dns]::GetHostEntry($CName) | Select-Object -ExpandProperty HostName","                                    $UserLocation | Add-Member NoteProperty 'SessionFromName' $CnameDNSName","                                }","                                catch {","                                    $UserLocation | Add-Member NoteProperty 'SessionFromName' $Null","                                }","","                                # see if we're checking to see if we have local admin access on this machine","                                if ($CheckAccess) {","                                    $Admin = (Test-AdminAccess -ComputerName $CName).IsAdmin","                                    $UserLocation | Add-Member Noteproperty 'LocalAdmin' $Admin.IsAdmin","                                }","                                else {","                                    $UserLocation | Add-Member Noteproperty 'LocalAdmin' $Null","                                }","                                $UserLocation.PSObject.TypeNames.Insert(0, 'PowerView.UserLocation')","                                $UserLocation","                            }","                        }","                    }","                    if (-not $Stealth) {","                        # if we're not 'stealthy', enumerate loggedon users as well","                        $LoggedOn = Get-NetLoggedon -ComputerName $TargetComputer","                        ForEach ($User in $LoggedOn) {","                            $UserName = $User.UserName","                            $UserDomain = $User.LogonDomain","","                            # make sure wet have a result","                            if (($UserName) -and ($UserName.trim() -ne '')) {","                                if ( (-not $TargetUsers) -or ($TargetUsers -contains $UserName) -and ($UserName -notmatch '\\$$')) {","                                    $IPAddress = @(Resolve-IPAddress -ComputerName $TargetComputer)[0].IPAddress","                                    $UserLocation = New-Object PSObject","                                    $UserLocation | Add-Member Noteproperty 'UserDomain' $UserDomain","                                    $UserLocation | Add-Member Noteproperty 'UserName' $UserName","                                    $UserLocation | Add-Member Noteproperty 'ComputerName' $TargetComputer","                                    $UserLocation | Add-Member Noteproperty 'IPAddress' $IPAddress","                                    $UserLocation | Add-Member Noteproperty 'SessionFrom' $Null","                                    $UserLocation | Add-Member Noteproperty 'SessionFromName' $Null","","                                    # see if we're checking to see if we have local admin access on this machine","                                    if ($CheckAccess) {","                                        $Admin = Test-AdminAccess -ComputerName $TargetComputer","                                        $UserLocation | Add-Member Noteproperty 'LocalAdmin' $Admin.IsAdmin","                                    }","                                    else {","                                        $UserLocation | Add-Member Noteproperty 'LocalAdmin' $Null","                                    }","                                    $UserLocation.PSObject.TypeNames.Insert(0, 'PowerView.UserLocation')","                                    $UserLocation","                                }","                            }","                        }","                    }","                }","            }","","            if ($TokenHandle) {","                Invoke-RevertToSelf","            }","        }","","        $LogonToken = $Null","        if ($PSBoundParameters['Credential']) {","            if ($PSBoundParameters['Delay'] -or $PSBoundParameters['StopOnSuccess']) {","                $LogonToken = Invoke-UserImpersonation -Credential $Credential","            }","            else {","                $LogonToken = Invoke-UserImpersonation -Credential $Credential -Quiet","            }","        }","    }","","    PROCESS {","        # only ignore threading if -Delay is passed","        if ($PSBoundParameters['Delay'] -or $PSBoundParameters['StopOnSuccess']) {","","            Write-Verbose \"[Find-DomainUserLocation] Total number of hosts: $($TargetComputers.count)\"","            Write-Verbose \"[Find-DomainUserLocation] Delay: $Delay, Jitter: $Jitter\"","            $Counter = 0","            $RandNo = New-Object System.Random","","            ForEach ($TargetComputer in $TargetComputers) {","                $Counter = $Counter + 1","","                # sleep for our semi-randomized interval","                Start-Sleep -Seconds $RandNo.Next((1-$Jitter)*$Delay, (1+$Jitter)*$Delay)","","                Write-Verbose \"[Find-DomainUserLocation] Enumerating server $Computer ($Counter of $($TargetComputers.Count))\"","                Invoke-Command -ScriptBlock $HostEnumBlock -ArgumentList $TargetComputer, $TargetUsers, $CurrentUser, $Stealth, $LogonToken","","                if ($Result -and $StopOnSuccess) {","                    Write-Verbose \"[Find-DomainUserLocation] Target user found, returning early\"","                    return","                }","            }","        }","        else {","            Write-Verbose \"[Find-DomainUserLocation] Using threading with threads: $Threads\"","            Write-Verbose \"[Find-DomainUserLocation] TargetComputers length: $($TargetComputers.Length)\"","","            # if we're using threading, kick off the script block with New-ThreadedFunction","            $ScriptParams = @{","                'TargetUsers' = $TargetUsers","                'CurrentUser' = $CurrentUser","                'Stealth' = $Stealth","                'TokenHandle' = $LogonToken","            }","","            # if we're using threading, kick off the script block with New-ThreadedFunction using the $HostEnumBlock + params","            New-ThreadedFunction -ComputerName $TargetComputers -ScriptBlock $HostEnumBlock -ScriptParameters $ScriptParams -Threads $Threads","        }","    }","","    END {","        if ($LogonToken) {","            Invoke-RevertToSelf -TokenHandle $LogonToken","        }","    }","}","","","function Find-DomainProcess {","\u003c#",".SYNOPSIS","","Searches for processes on the domain using WMI, returning processes","that match a particular user specification or process name.","","Thanks to @paulbrandau for the approach idea.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: Get-DomainComputer, Get-DomainUser, Get-DomainGroupMember, Get-WMIProcess, New-ThreadedFunction  ","",".DESCRIPTION","","This function enumerates all machines on the current (or specified) domain","using Get-DomainComputer, and queries the domain for users of a specified group","(default 'Domain Admins') with Get-DomainGroupMember. Then for each server the","function enumerates any current processes running with Get-WMIProcess,","searching for processes running under any target user contexts or with the","specified -ProcessName. If -Credential is passed, it is passed through to","the underlying WMI commands used to enumerate the remote machines.","",".PARAMETER ComputerName","","Specifies an array of one or more hosts to enumerate, passable on the pipeline.","If -ComputerName is not passed, the default behavior is to enumerate all machines","in the domain returned by Get-DomainComputer.","",".PARAMETER Domain","","Specifies the domain to query for computers AND users, defaults to the current domain.","",".PARAMETER ComputerDomain","","Specifies the domain to query for computers, defaults to the current domain.","",".PARAMETER ComputerLDAPFilter","","Specifies an LDAP query string that is used to search for computer objects.","",".PARAMETER ComputerSearchBase","","Specifies the LDAP source to search through for computers,","e.g. \"LDAP://OU=secret,DC=testlab,DC=local\". Useful for OU queries.","",".PARAMETER ComputerUnconstrained","","Switch. Search computer objects that have unconstrained delegation.","",".PARAMETER ComputerOperatingSystem","","Search computers with a specific operating system, wildcards accepted.","",".PARAMETER ComputerServicePack","","Search computers with a specific service pack, wildcards accepted.","",".PARAMETER ComputerSiteName","","Search computers in the specific AD Site name, wildcards accepted.","",".PARAMETER ProcessName","","Search for processes with one or more specific names.","",".PARAMETER UserIdentity","","Specifies one or more user identities to search for.","",".PARAMETER UserDomain","","Specifies the domain to query for users to search for, defaults to the current domain.","",".PARAMETER UserLDAPFilter","","Specifies an LDAP query string that is used to search for target users.","",".PARAMETER UserSearchBase","","Specifies the LDAP source to search through for target users.","e.g. \"LDAP://OU=secret,DC=testlab,DC=local\". Useful for OU queries.","",".PARAMETER UserGroupIdentity","","Specifies a group identity to query for target users, defaults to 'Domain Admins.","If any other user specifications are set, then UserGroupIdentity is ignored.","",".PARAMETER UserAdminCount","","Switch. Search for users users with '(adminCount=1)' (meaning are/were privileged).","",".PARAMETER Server","","Specifies an Active Directory server (domain controller) to bind to.","",".PARAMETER SearchScope","","Specifies the scope to search under for computers, Base/OneLevel/Subtree (default of Subtree).","",".PARAMETER ResultPageSize","","Specifies the PageSize to set for the LDAP searcher object.","",".PARAMETER ServerTimeLimit","","Specifies the maximum amount of time the server spends searching. Default of 120 seconds.","",".PARAMETER Tombstone","","Switch. Specifies that the searcher should also return deleted/tombstoned objects.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target domain and target systems.","",".PARAMETER StopOnSuccess","","Switch. Stop hunting after finding after finding a target user.","",".PARAMETER Delay","","Specifies the delay (in seconds) between enumerating hosts, defaults to 0.","",".PARAMETER Jitter","","Specifies the jitter (0-1.0) to apply to any specified -Delay, defaults to +/- 0.3","",".PARAMETER Threads","","The number of threads to use for user searching, defaults to 20.","",".EXAMPLE","","Find-DomainProcess","","Searches for processes run by 'Domain Admins' by enumerating every computer in the domain.","",".EXAMPLE","","Find-DomainProcess -UserAdminCount -ComputerOperatingSystem 'Windows 7*' -Domain dev.testlab.local","","Enumerates Windows 7 computers in dev.testlab.local and returns any processes being run by","privileged users in dev.testlab.local.","",".EXAMPLE","","Find-DomainProcess -ProcessName putty.exe","","Searchings for instances of putty.exe running on the current domain.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Find-DomainProcess -Domain testlab.local -Credential $Cred","","Searches processes being run by 'domain admins' in the testlab.local using the specified alternate credentials.","",".OUTPUTS","","PowerView.UserProcess","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSUsePSCredentialType', '')]","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSAvoidUsingPlainTextForPassword', '')]","    [OutputType('PowerView.UserProcess')]","    [CmdletBinding(DefaultParameterSetName = 'None')]","    Param(","        [Parameter(Position = 0, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('DNSHostName')]","        [String[]]","        $ComputerName,","","        [ValidateNotNullOrEmpty()]","        [String]","        $Domain,","","        [ValidateNotNullOrEmpty()]","        [String]","        $ComputerDomain,","","        [ValidateNotNullOrEmpty()]","        [String]","        $ComputerLDAPFilter,","","        [ValidateNotNullOrEmpty()]","        [String]","        $ComputerSearchBase,","","        [Alias('Unconstrained')]","        [Switch]","        $ComputerUnconstrained,","","        [ValidateNotNullOrEmpty()]","        [Alias('OperatingSystem')]","        [String]","        $ComputerOperatingSystem,","","        [ValidateNotNullOrEmpty()]","        [Alias('ServicePack')]","        [String]","        $ComputerServicePack,","","        [ValidateNotNullOrEmpty()]","        [Alias('SiteName')]","        [String]","        $ComputerSiteName,","","        [Parameter(ParameterSetName = 'TargetProcess')]","        [ValidateNotNullOrEmpty()]","        [String[]]","        $ProcessName,","","        [Parameter(ParameterSetName = 'TargetUser')]","        [Parameter(ParameterSetName = 'UserIdentity')]","        [ValidateNotNullOrEmpty()]","        [String[]]","        $UserIdentity,","","        [Parameter(ParameterSetName = 'TargetUser')]","        [ValidateNotNullOrEmpty()]","        [String]","        $UserDomain,","","        [Parameter(ParameterSetName = 'TargetUser')]","        [ValidateNotNullOrEmpty()]","        [String]","        $UserLDAPFilter,","","        [Parameter(ParameterSetName = 'TargetUser')]","        [ValidateNotNullOrEmpty()]","        [String]","        $UserSearchBase,","","        [ValidateNotNullOrEmpty()]","        [Alias('GroupName', 'Group')]","        [String[]]","        $UserGroupIdentity = 'Domain Admins',","","        [Parameter(ParameterSetName = 'TargetUser')]","        [Alias('AdminCount')]","        [Switch]","        $UserAdminCount,","","        [ValidateNotNullOrEmpty()]","        [Alias('DomainController')]","        [String]","        $Server,","","        [ValidateSet('Base', 'OneLevel', 'Subtree')]","        [String]","        $SearchScope = 'Subtree',","","        [ValidateRange(1, 10000)]","        [Int]","        $ResultPageSize = 200,","","        [ValidateRange(1, 10000)]","        [Int]","        $ServerTimeLimit,","","        [Switch]","        $Tombstone,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty,","","        [Switch]","        $StopOnSuccess,","","        [ValidateRange(1, 10000)]","        [Int]","        $Delay = 0,","","        [ValidateRange(0.0, 1.0)]","        [Double]","        $Jitter = .3,","","        [Int]","        [ValidateRange(1, 100)]","        $Threads = 20","    )","","    BEGIN {","        $ComputerSearcherArguments = @{","            'Properties' = 'dnshostname'","        }","        if ($PSBoundParameters['Domain']) { $ComputerSearcherArguments['Domain'] = $Domain }","        if ($PSBoundParameters['ComputerDomain']) { $ComputerSearcherArguments['Domain'] = $ComputerDomain }","        if ($PSBoundParameters['ComputerLDAPFilter']) { $ComputerSearcherArguments['LDAPFilter'] = $ComputerLDAPFilter }","        if ($PSBoundParameters['ComputerSearchBase']) { $ComputerSearcherArguments['SearchBase'] = $ComputerSearchBase }","        if ($PSBoundParameters['Unconstrained']) { $ComputerSearcherArguments['Unconstrained'] = $Unconstrained }","        if ($PSBoundParameters['ComputerOperatingSystem']) { $ComputerSearcherArguments['OperatingSystem'] = $OperatingSystem }","        if ($PSBoundParameters['ComputerServicePack']) { $ComputerSearcherArguments['ServicePack'] = $ServicePack }","        if ($PSBoundParameters['ComputerSiteName']) { $ComputerSearcherArguments['SiteName'] = $SiteName }","        if ($PSBoundParameters['Server']) { $ComputerSearcherArguments['Server'] = $Server }","        if ($PSBoundParameters['SearchScope']) { $ComputerSearcherArguments['SearchScope'] = $SearchScope }","        if ($PSBoundParameters['ResultPageSize']) { $ComputerSearcherArguments['ResultPageSize'] = $ResultPageSize }","        if ($PSBoundParameters['ServerTimeLimit']) { $ComputerSearcherArguments['ServerTimeLimit'] = $ServerTimeLimit }","        if ($PSBoundParameters['Tombstone']) { $ComputerSearcherArguments['Tombstone'] = $Tombstone }","        if ($PSBoundParameters['Credential']) { $ComputerSearcherArguments['Credential'] = $Credential }","","        $UserSearcherArguments = @{","            'Properties' = 'samaccountname'","        }","        if ($PSBoundParameters['UserIdentity']) { $UserSearcherArguments['Identity'] = $UserIdentity }","        if ($PSBoundParameters['Domain']) { $UserSearcherArguments['Domain'] = $Domain }","        if ($PSBoundParameters['UserDomain']) { $UserSearcherArguments['Domain'] = $UserDomain }","        if ($PSBoundParameters['UserLDAPFilter']) { $UserSearcherArguments['LDAPFilter'] = $UserLDAPFilter }","        if ($PSBoundParameters['UserSearchBase']) { $UserSearcherArguments['SearchBase'] = $UserSearchBase }","        if ($PSBoundParameters['UserAdminCount']) { $UserSearcherArguments['AdminCount'] = $UserAdminCount }","        if ($PSBoundParameters['Server']) { $UserSearcherArguments['Server'] = $Server }","        if ($PSBoundParameters['SearchScope']) { $UserSearcherArguments['SearchScope'] = $SearchScope }","        if ($PSBoundParameters['ResultPageSize']) { $UserSearcherArguments['ResultPageSize'] = $ResultPageSize }","        if ($PSBoundParameters['ServerTimeLimit']) { $UserSearcherArguments['ServerTimeLimit'] = $ServerTimeLimit }","        if ($PSBoundParameters['Tombstone']) { $UserSearcherArguments['Tombstone'] = $Tombstone }","        if ($PSBoundParameters['Credential']) { $UserSearcherArguments['Credential'] = $Credential }","","","        # first, build the set of computers to enumerate","        if ($PSBoundParameters['ComputerName']) {","            $TargetComputers = $ComputerName","        }","        else {","            Write-Verbose '[Find-DomainProcess] Querying computers in the domain'","            $TargetComputers = Get-DomainComputer @ComputerSearcherArguments | Select-Object -ExpandProperty dnshostname","        }","        Write-Verbose \"[Find-DomainProcess] TargetComputers length: $($TargetComputers.Length)\"","        if ($TargetComputers.Length -eq 0) {","            throw '[Find-DomainProcess] No hosts found to enumerate'","        }","","        # now build the user target set","        if ($PSBoundParameters['ProcessName']) {","            $TargetProcessName = @()","            ForEach ($T in $ProcessName) {","                $TargetProcessName += $T.Split(',')","            }","            if ($TargetProcessName -isnot [System.Array]) {","                $TargetProcessName = [String[]] @($TargetProcessName)","            }","        }","        elseif ($PSBoundParameters['UserIdentity'] -or $PSBoundParameters['UserLDAPFilter'] -or $PSBoundParameters['UserSearchBase'] -or $PSBoundParameters['UserAdminCount'] -or $PSBoundParameters['UserAllowDelegation']) {","            $TargetUsers = Get-DomainUser @UserSearcherArguments | Select-Object -ExpandProperty samaccountname","        }","        else {","            $GroupSearcherArguments = @{","                'Identity' = $UserGroupIdentity","                'Recurse' = $True","            }","            if ($PSBoundParameters['UserDomain']) { $GroupSearcherArguments['Domain'] = $UserDomain }","            if ($PSBoundParameters['UserSearchBase']) { $GroupSearcherArguments['SearchBase'] = $UserSearchBase }","            if ($PSBoundParameters['Server']) { $GroupSearcherArguments['Server'] = $Server }","            if ($PSBoundParameters['SearchScope']) { $GroupSearcherArguments['SearchScope'] = $SearchScope }","            if ($PSBoundParameters['ResultPageSize']) { $GroupSearcherArguments['ResultPageSize'] = $ResultPageSize }","            if ($PSBoundParameters['ServerTimeLimit']) { $GroupSearcherArguments['ServerTimeLimit'] = $ServerTimeLimit }","            if ($PSBoundParameters['Tombstone']) { $GroupSearcherArguments['Tombstone'] = $Tombstone }","            if ($PSBoundParameters['Credential']) { $GroupSearcherArguments['Credential'] = $Credential }","            $GroupSearcherArguments","            $TargetUsers = Get-DomainGroupMember @GroupSearcherArguments | Select-Object -ExpandProperty MemberName","        }","","        # the host enumeration block we're using to enumerate all servers","        $HostEnumBlock = {","            Param($ComputerName, $ProcessName, $TargetUsers, $Credential)","","            ForEach ($TargetComputer in $ComputerName) {","                $Up = Test-Connection -Count 1 -Quiet -ComputerName $TargetComputer","                if ($Up) {","                    # try to enumerate all active processes on the remote host","                    # and search for a specific process name","                    if ($Credential) {","                        $Processes = Get-WMIProcess -Credential $Credential -ComputerName $TargetComputer -ErrorAction SilentlyContinue","                    }","                    else {","                        $Processes = Get-WMIProcess -ComputerName $TargetComputer -ErrorAction SilentlyContinue","                    }","                    ForEach ($Process in $Processes) {","                        # if we're hunting for a process name or comma-separated names","                        if ($ProcessName) {","                            if ($ProcessName -Contains $Process.ProcessName) {","                                $Process","                            }","                        }","                        # if the session user is in the target list, display some output","                        elseif ($TargetUsers -Contains $Process.User) {","                            $Process","                        }","                    }","                }","            }","        }","    }","","    PROCESS {","        # only ignore threading if -Delay is passed","        if ($PSBoundParameters['Delay'] -or $PSBoundParameters['StopOnSuccess']) {","","            Write-Verbose \"[Find-DomainProcess] Total number of hosts: $($TargetComputers.count)\"","            Write-Verbose \"[Find-DomainProcess] Delay: $Delay, Jitter: $Jitter\"","            $Counter = 0","            $RandNo = New-Object System.Random","","            ForEach ($TargetComputer in $TargetComputers) {","                $Counter = $Counter + 1","","                # sleep for our semi-randomized interval","                Start-Sleep -Seconds $RandNo.Next((1-$Jitter)*$Delay, (1+$Jitter)*$Delay)","","                Write-Verbose \"[Find-DomainProcess] Enumerating server $TargetComputer ($Counter of $($TargetComputers.count))\"","                $Result = Invoke-Command -ScriptBlock $HostEnumBlock -ArgumentList $TargetComputer, $TargetProcessName, $TargetUsers, $Credential","                $Result","","                if ($Result -and $StopOnSuccess) {","                    Write-Verbose \"[Find-DomainProcess] Target user found, returning early\"","                    return","                }","            }","        }","        else {","            Write-Verbose \"[Find-DomainProcess] Using threading with threads: $Threads\"","","            # if we're using threading, kick off the script block with New-ThreadedFunction","            $ScriptParams = @{","                'ProcessName' = $TargetProcessName","                'TargetUsers' = $TargetUsers","                'Credential' = $Credential","            }","","            # if we're using threading, kick off the script block with New-ThreadedFunction using the $HostEnumBlock + params","            New-ThreadedFunction -ComputerName $TargetComputers -ScriptBlock $HostEnumBlock -ScriptParameters $ScriptParams -Threads $Threads","        }","    }","}","","","function Find-DomainUserEvent {","\u003c#",".SYNOPSIS","","Finds logon events on the current (or remote domain) for the specified users.","","Author: Lee Christensen (@tifkin_), Justin Warner (@sixdub), Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: Get-DomainUser, Get-DomainGroupMember, Get-DomainController, Get-DomainUserEvent, New-ThreadedFunction  ","",".DESCRIPTION","","Enumerates all domain controllers from the specified -Domain","(default of the local domain) using Get-DomainController, enumerates","the logon events for each using Get-DomainUserEvent, and filters","the results based on the targeting criteria.","",".PARAMETER ComputerName","","Specifies an explicit computer name to retrieve events from.","",".PARAMETER Domain","","Specifies a domain to query for domain controllers to enumerate.","Defaults to the current domain.","",".PARAMETER Filter","","A hashtable of PowerView.LogonEvent properties to filter for.","The 'op|operator|operation' clause can have '\u0026', '|', 'and', or 'or',","and is 'or' by default, meaning at least one clause matches instead of all.","See the exaples for usage.","",".PARAMETER StartTime","","The [DateTime] object representing the start of when to collect events.","Default of [DateTime]::Now.AddDays(-1).","",".PARAMETER EndTime","","The [DateTime] object representing the end of when to collect events.","Default of [DateTime]::Now.","",".PARAMETER MaxEvents","","The maximum number of events (per host) to retrieve. Default of 5000.","",".PARAMETER UserIdentity","","Specifies one or more user identities to search for.","",".PARAMETER UserDomain","","Specifies the domain to query for users to search for, defaults to the current domain.","",".PARAMETER UserLDAPFilter","","Specifies an LDAP query string that is used to search for target users.","",".PARAMETER UserSearchBase","","Specifies the LDAP source to search through for target users.","e.g. \"LDAP://OU=secret,DC=testlab,DC=local\". Useful for OU queries.","",".PARAMETER UserGroupIdentity","","Specifies a group identity to query for target users, defaults to 'Domain Admins.","If any other user specifications are set, then UserGroupIdentity is ignored.","",".PARAMETER UserAdminCount","","Switch. Search for users users with '(adminCount=1)' (meaning are/were privileged).","",".PARAMETER Server","","Specifies an Active Directory server (domain controller) to bind to.","",".PARAMETER SearchScope","","Specifies the scope to search under for computers, Base/OneLevel/Subtree (default of Subtree).","",".PARAMETER ResultPageSize","","Specifies the PageSize to set for the LDAP searcher object.","",".PARAMETER ServerTimeLimit","","Specifies the maximum amount of time the server spends searching. Default of 120 seconds.","",".PARAMETER Tombstone","","Switch. Specifies that the searcher should also return deleted/tombstoned objects.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target computer(s).","",".PARAMETER StopOnSuccess","","Switch. Stop hunting after finding after finding a target user.","",".PARAMETER Delay","","Specifies the delay (in seconds) between enumerating hosts, defaults to 0.","",".PARAMETER Jitter","","Specifies the jitter (0-1.0) to apply to any specified -Delay, defaults to +/- 0.3","",".PARAMETER Threads","","The number of threads to use for user searching, defaults to 20.","",".EXAMPLE","","Find-DomainUserEvent","","Search for any user events matching domain admins on every DC in the current domain.","",".EXAMPLE","","$cred = Get-Credential dev\\administrator","Find-DomainUserEvent -ComputerName 'secondary.dev.testlab.local' -UserIdentity 'john'","","Search for any user events matching the user 'john' on the 'secondary.dev.testlab.local'","domain controller using the alternate credential","",".EXAMPLE","","'primary.testlab.local | Find-DomainUserEvent -Filter @{'IpAddress'='192.168.52.200|192.168.52.201'}","","Find user events on the primary.testlab.local system where the event matches","the IPAddress '192.168.52.200' or '192.168.52.201'.","",".EXAMPLE","","$cred = Get-Credential testlab\\administrator","Find-DomainUserEvent -Delay 1 -Filter @{'LogonGuid'='b8458aa9-b36e-eaa1-96e0-4551000fdb19'; 'TargetLogonId' = '10238128'; 'op'='\u0026'}","","Find user events mathing the specified GUID AND the specified TargetLogonId, searching","through every domain controller in the current domain, enumerating each DC in serial","instead of in a threaded manner, using the alternate credential.","",".OUTPUTS","","PowerView.LogonEvent","","PowerView.ExplicitCredentialLogon","",".LINK","","http://www.sixdub.net/2014/11/07/offensive-event-parsing-bringing-home-trophies/","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSUseDeclaredVarsMoreThanAssignments', '')]","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSUsePSCredentialType', '')]","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSAvoidUsingPlainTextForPassword', '')]","    [OutputType('PowerView.LogonEvent')]","    [OutputType('PowerView.ExplicitCredentialLogon')]","    [CmdletBinding(DefaultParameterSetName = 'Domain')]","    Param(","        [Parameter(ParameterSetName = 'ComputerName', Position = 0, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('dnshostname', 'HostName', 'name')]","        [ValidateNotNullOrEmpty()]","        [String[]]","        $ComputerName,","","        [Parameter(ParameterSetName = 'Domain')]","        [ValidateNotNullOrEmpty()]","        [String]","        $Domain,","","        [ValidateNotNullOrEmpty()]","        [Hashtable]","        $Filter,","","        [Parameter(ValueFromPipelineByPropertyName = $True)]","        [ValidateNotNullOrEmpty()]","        [DateTime]","        $StartTime = [DateTime]::Now.AddDays(-1),","","        [Parameter(ValueFromPipelineByPropertyName = $True)]","        [ValidateNotNullOrEmpty()]","        [DateTime]","        $EndTime = [DateTime]::Now,","","        [ValidateRange(1, 1000000)]","        [Int]","        $MaxEvents = 5000,","","        [ValidateNotNullOrEmpty()]","        [String[]]","        $UserIdentity,","","        [ValidateNotNullOrEmpty()]","        [String]","        $UserDomain,","","        [ValidateNotNullOrEmpty()]","        [String]","        $UserLDAPFilter,","","        [ValidateNotNullOrEmpty()]","        [String]","        $UserSearchBase,","","        [ValidateNotNullOrEmpty()]","        [Alias('GroupName', 'Group')]","        [String[]]","        $UserGroupIdentity = 'Domain Admins',","","        [Alias('AdminCount')]","        [Switch]","        $UserAdminCount,","","        [Switch]","        $CheckAccess,","","        [ValidateNotNullOrEmpty()]","        [Alias('DomainController')]","        [String]","        $Server,","","        [ValidateSet('Base', 'OneLevel', 'Subtree')]","        [String]","        $SearchScope = 'Subtree',","","        [ValidateRange(1, 10000)]","        [Int]","        $ResultPageSize = 200,","","        [ValidateRange(1, 10000)]","        [Int]","        $ServerTimeLimit,","","        [Switch]","        $Tombstone,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty,","","        [Switch]","        $StopOnSuccess,","","        [ValidateRange(1, 10000)]","        [Int]","        $Delay = 0,","","        [ValidateRange(0.0, 1.0)]","        [Double]","        $Jitter = .3,","","        [Int]","        [ValidateRange(1, 100)]","        $Threads = 20","    )","","    BEGIN {","        $UserSearcherArguments = @{","            'Properties' = 'samaccountname'","        }","        if ($PSBoundParameters['UserIdentity']) { $UserSearcherArguments['Identity'] = $UserIdentity }","        if ($PSBoundParameters['UserDomain']) { $UserSearcherArguments['Domain'] = $UserDomain }","        if ($PSBoundParameters['UserLDAPFilter']) { $UserSearcherArguments['LDAPFilter'] = $UserLDAPFilter }","        if ($PSBoundParameters['UserSearchBase']) { $UserSearcherArguments['SearchBase'] = $UserSearchBase }","        if ($PSBoundParameters['UserAdminCount']) { $UserSearcherArguments['AdminCount'] = $UserAdminCount }","        if ($PSBoundParameters['Server']) { $UserSearcherArguments['Server'] = $Server }","        if ($PSBoundParameters['SearchScope']) { $UserSearcherArguments['SearchScope'] = $SearchScope }","        if ($PSBoundParameters['ResultPageSize']) { $UserSearcherArguments['ResultPageSize'] = $ResultPageSize }","        if ($PSBoundParameters['ServerTimeLimit']) { $UserSearcherArguments['ServerTimeLimit'] = $ServerTimeLimit }","        if ($PSBoundParameters['Tombstone']) { $UserSearcherArguments['Tombstone'] = $Tombstone }","        if ($PSBoundParameters['Credential']) { $UserSearcherArguments['Credential'] = $Credential }","","        if ($PSBoundParameters['UserIdentity'] -or $PSBoundParameters['UserLDAPFilter'] -or $PSBoundParameters['UserSearchBase'] -or $PSBoundParameters['UserAdminCount']) {","            $TargetUsers = Get-DomainUser @UserSearcherArguments | Select-Object -ExpandProperty samaccountname","        }","        elseif ($PSBoundParameters['UserGroupIdentity'] -or (-not $PSBoundParameters['Filter'])) {","            # otherwise we're querying a specific group","            $GroupSearcherArguments = @{","                'Identity' = $UserGroupIdentity","                'Recurse' = $True","            }","            Write-Verbose \"UserGroupIdentity: $UserGroupIdentity\"","            if ($PSBoundParameters['UserDomain']) { $GroupSearcherArguments['Domain'] = $UserDomain }","            if ($PSBoundParameters['UserSearchBase']) { $GroupSearcherArguments['SearchBase'] = $UserSearchBase }","            if ($PSBoundParameters['Server']) { $GroupSearcherArguments['Server'] = $Server }","            if ($PSBoundParameters['SearchScope']) { $GroupSearcherArguments['SearchScope'] = $SearchScope }","            if ($PSBoundParameters['ResultPageSize']) { $GroupSearcherArguments['ResultPageSize'] = $ResultPageSize }","            if ($PSBoundParameters['ServerTimeLimit']) { $GroupSearcherArguments['ServerTimeLimit'] = $ServerTimeLimit }","            if ($PSBoundParameters['Tombstone']) { $GroupSearcherArguments['Tombstone'] = $Tombstone }","            if ($PSBoundParameters['Credential']) { $GroupSearcherArguments['Credential'] = $Credential }","            $TargetUsers = Get-DomainGroupMember @GroupSearcherArguments | Select-Object -ExpandProperty MemberName","        }","","        # build the set of computers to enumerate","        if ($PSBoundParameters['ComputerName']) {","            $TargetComputers = $ComputerName","        }","        else {","            # if not -ComputerName is passed, query the current (or target) domain for domain controllers","            $DCSearcherArguments = @{","                'LDAP' = $True","            }","            if ($PSBoundParameters['Domain']) { $DCSearcherArguments['Domain'] = $Domain }","            if ($PSBoundParameters['Server']) { $DCSearcherArguments['Server'] = $Server }","            if ($PSBoundParameters['Credential']) { $DCSearcherArguments['Credential'] = $Credential }","            Write-Verbose \"[Find-DomainUserEvent] Querying for domain controllers in domain: $Domain\"","            $TargetComputers = Get-DomainController @DCSearcherArguments | Select-Object -ExpandProperty dnshostname","        }","        if ($TargetComputers -and ($TargetComputers -isnot [System.Array])) {","            $TargetComputers = @(,$TargetComputers)","        }","        Write-Verbose \"[Find-DomainUserEvent] TargetComputers length: $($TargetComputers.Length)\"","        Write-Verbose \"[Find-DomainUserEvent] TargetComputers $TargetComputers\"","        if ($TargetComputers.Length -eq 0) {","            throw '[Find-DomainUserEvent] No hosts found to enumerate'","        }","","        # the host enumeration block we're using to enumerate all servers","        $HostEnumBlock = {","            Param($ComputerName, $StartTime, $EndTime, $MaxEvents, $TargetUsers, $Filter, $Credential)","","            ForEach ($TargetComputer in $ComputerName) {","                $Up = Test-Connection -Count 1 -Quiet -ComputerName $TargetComputer","                if ($Up) {","                    $DomainUserEventArgs = @{","                        'ComputerName' = $TargetComputer","                    }","                    if ($StartTime) { $DomainUserEventArgs['StartTime'] = $StartTime }","                    if ($EndTime) { $DomainUserEventArgs['EndTime'] = $EndTime }","                    if ($MaxEvents) { $DomainUserEventArgs['MaxEvents'] = $MaxEvents }","                    if ($Credential) { $DomainUserEventArgs['Credential'] = $Credential }","                    if ($Filter -or $TargetUsers) {","                        if ($TargetUsers) {","                            Get-DomainUserEvent @DomainUserEventArgs | Where-Object {$TargetUsers -contains $_.TargetUserName}","                        }","                        else {","                            $Operator = 'or'","                            $Filter.Keys | ForEach-Object {","                                if (($_ -eq 'Op') -or ($_ -eq 'Operator') -or ($_ -eq 'Operation')) {","                                    if (($Filter[$_] -match '\u0026') -or ($Filter[$_] -eq 'and')) {","                                        $Operator = 'and'","                                    }","                                }","                            }","                            $Keys = $Filter.Keys | Where-Object {($_ -ne 'Op') -and ($_ -ne 'Operator') -and ($_ -ne 'Operation')}","                            Get-DomainUserEvent @DomainUserEventArgs | ForEach-Object {","                                if ($Operator -eq 'or') {","                                    ForEach ($Key in $Keys) {","                                        if ($_.\"$Key\" -match $Filter[$Key]) {","                                            $_","                                        }","                                    }","                                }","                                else {","                                    # and all clauses","                                    ForEach ($Key in $Keys) {","                                        if ($_.\"$Key\" -notmatch $Filter[$Key]) {","                                            break","                                        }","                                        $_","                                    }","                                }","                            }","                        }","                    }","                    else {","                        Get-DomainUserEvent @DomainUserEventArgs","                    }","                }","            }","        }","    }","","    PROCESS {","        # only ignore threading if -Delay is passed","        if ($PSBoundParameters['Delay'] -or $PSBoundParameters['StopOnSuccess']) {","","            Write-Verbose \"[Find-DomainUserEvent] Total number of hosts: $($TargetComputers.count)\"","            Write-Verbose \"[Find-DomainUserEvent] Delay: $Delay, Jitter: $Jitter\"","            $Counter = 0","            $RandNo = New-Object System.Random","","            ForEach ($TargetComputer in $TargetComputers) {","                $Counter = $Counter + 1","","                # sleep for our semi-randomized interval","                Start-Sleep -Seconds $RandNo.Next((1-$Jitter)*$Delay, (1+$Jitter)*$Delay)","","                Write-Verbose \"[Find-DomainUserEvent] Enumerating server $TargetComputer ($Counter of $($TargetComputers.count))\"","                $Result = Invoke-Command -ScriptBlock $HostEnumBlock -ArgumentList $TargetComputer, $StartTime, $EndTime, $MaxEvents, $TargetUsers, $Filter, $Credential","                $Result","","                if ($Result -and $StopOnSuccess) {","                    Write-Verbose \"[Find-DomainUserEvent] Target user found, returning early\"","                    return","                }","            }","        }","        else {","            Write-Verbose \"[Find-DomainUserEvent] Using threading with threads: $Threads\"","","            # if we're using threading, kick off the script block with New-ThreadedFunction","            $ScriptParams = @{","                'StartTime' = $StartTime","                'EndTime' = $EndTime","                'MaxEvents' = $MaxEvents","                'TargetUsers' = $TargetUsers","                'Filter' = $Filter","                'Credential' = $Credential","            }","","            # if we're using threading, kick off the script block with New-ThreadedFunction using the $HostEnumBlock + params","            New-ThreadedFunction -ComputerName $TargetComputers -ScriptBlock $HostEnumBlock -ScriptParameters $ScriptParams -Threads $Threads","        }","    }","}","","","function Find-DomainShare {","\u003c#",".SYNOPSIS","","Searches for computer shares on the domain. If -CheckShareAccess is passed,","then only shares the current user has read access to are returned.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: Get-DomainComputer, Invoke-UserImpersonation, Invoke-RevertToSelf, Get-NetShare, New-ThreadedFunction  ","",".DESCRIPTION","","This function enumerates all machines on the current (or specified) domain","using Get-DomainComputer, and enumerates the available shares for each","machine with Get-NetShare. If -CheckShareAccess is passed, then","[IO.Directory]::GetFiles() is used to check if the current user has read","access to the given share. If -Credential is passed, then","Invoke-UserImpersonation is used to impersonate the specified user before","enumeration, reverting after with Invoke-RevertToSelf.","",".PARAMETER ComputerName","","Specifies an array of one or more hosts to enumerate, passable on the pipeline.","If -ComputerName is not passed, the default behavior is to enumerate all machines","in the domain returned by Get-DomainComputer.","",".PARAMETER ComputerDomain","","Specifies the domain to query for computers, defaults to the current domain.","",".PARAMETER ComputerLDAPFilter","","Specifies an LDAP query string that is used to search for computer objects.","",".PARAMETER ComputerSearchBase","","Specifies the LDAP source to search through for computers,","e.g. \"LDAP://OU=secret,DC=testlab,DC=local\". Useful for OU queries.","",".PARAMETER ComputerOperatingSystem","","Search computers with a specific operating system, wildcards accepted.","",".PARAMETER ComputerServicePack","","Search computers with a specific service pack, wildcards accepted.","",".PARAMETER ComputerSiteName","","Search computers in the specific AD Site name, wildcards accepted.","",".PARAMETER CheckShareAccess","","Switch. Only display found shares that the local user has access to.","",".PARAMETER Server","","Specifies an Active Directory server (domain controller) to bind to.","",".PARAMETER SearchScope","","Specifies the scope to search under for computers, Base/OneLevel/Subtree (default of Subtree).","",".PARAMETER ResultPageSize","","Specifies the PageSize to set for the LDAP searcher object.","",".PARAMETER ServerTimeLimit","","Specifies the maximum amount of time the server spends searching. Default of 120 seconds.","",".PARAMETER Tombstone","","Switch. Specifies that the searcher should also return deleted/tombstoned objects.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target domain and target systems.","",".PARAMETER Delay","","Specifies the delay (in seconds) between enumerating hosts, defaults to 0.","",".PARAMETER Jitter","","Specifies the jitter (0-1.0) to apply to any specified -Delay, defaults to +/- 0.3","",".PARAMETER Threads","","The number of threads to use for user searching, defaults to 20.","",".EXAMPLE","","Find-DomainShare","","Find all domain shares in the current domain.","",".EXAMPLE","","Find-DomainShare -CheckShareAccess","","Find all domain shares in the current domain that the current user has","read access to.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Find-DomainShare -Domain testlab.local -Credential $Cred","","Searches for domain shares in the testlab.local domain using the specified alternate credentials.","",".OUTPUTS","","PowerView.ShareInfo","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType('PowerView.ShareInfo')]","    Param(","        [Parameter(Position = 0, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('DNSHostName')]","        [String[]]","        $ComputerName,","","        [ValidateNotNullOrEmpty()]","        [Alias('Domain')]","        [String]","        $ComputerDomain,","","        [ValidateNotNullOrEmpty()]","        [String]","        $ComputerLDAPFilter,","","        [ValidateNotNullOrEmpty()]","        [String]","        $ComputerSearchBase,","","        [ValidateNotNullOrEmpty()]","        [Alias('OperatingSystem')]","        [String]","        $ComputerOperatingSystem,","","        [ValidateNotNullOrEmpty()]","        [Alias('ServicePack')]","        [String]","        $ComputerServicePack,","","        [ValidateNotNullOrEmpty()]","        [Alias('SiteName')]","        [String]","        $ComputerSiteName,","","        [Alias('CheckAccess')]","        [Switch]","        $CheckShareAccess,","","        [ValidateNotNullOrEmpty()]","        [Alias('DomainController')]","        [String]","        $Server,","","        [ValidateSet('Base', 'OneLevel', 'Subtree')]","        [String]","        $SearchScope = 'Subtree',","","        [ValidateRange(1, 10000)]","        [Int]","        $ResultPageSize = 200,","","        [ValidateRange(1, 10000)]","        [Int]","        $ServerTimeLimit,","","        [Switch]","        $Tombstone,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty,","","        [ValidateRange(1, 10000)]","        [Int]","        $Delay = 0,","","        [ValidateRange(0.0, 1.0)]","        [Double]","        $Jitter = .3,","","        [Int]","        [ValidateRange(1, 100)]","        $Threads = 20","    )","","    BEGIN {","","        $ComputerSearcherArguments = @{","            'Properties' = 'dnshostname'","        }","        if ($PSBoundParameters['ComputerDomain']) { $ComputerSearcherArguments['Domain'] = $ComputerDomain }","        if ($PSBoundParameters['ComputerLDAPFilter']) { $ComputerSearcherArguments['LDAPFilter'] = $ComputerLDAPFilter }","        if ($PSBoundParameters['ComputerSearchBase']) { $ComputerSearcherArguments['SearchBase'] = $ComputerSearchBase }","        if ($PSBoundParameters['Unconstrained']) { $ComputerSearcherArguments['Unconstrained'] = $Unconstrained }","        if ($PSBoundParameters['ComputerOperatingSystem']) { $ComputerSearcherArguments['OperatingSystem'] = $OperatingSystem }","        if ($PSBoundParameters['ComputerServicePack']) { $ComputerSearcherArguments['ServicePack'] = $ServicePack }","        if ($PSBoundParameters['ComputerSiteName']) { $ComputerSearcherArguments['SiteName'] = $SiteName }","        if ($PSBoundParameters['Server']) { $ComputerSearcherArguments['Server'] = $Server }","        if ($PSBoundParameters['SearchScope']) { $ComputerSearcherArguments['SearchScope'] = $SearchScope }","        if ($PSBoundParameters['ResultPageSize']) { $ComputerSearcherArguments['ResultPageSize'] = $ResultPageSize }","        if ($PSBoundParameters['ServerTimeLimit']) { $ComputerSearcherArguments['ServerTimeLimit'] = $ServerTimeLimit }","        if ($PSBoundParameters['Tombstone']) { $ComputerSearcherArguments['Tombstone'] = $Tombstone }","        if ($PSBoundParameters['Credential']) { $ComputerSearcherArguments['Credential'] = $Credential }","","        if ($PSBoundParameters['ComputerName']) {","            $TargetComputers = $ComputerName","        }","        else {","            Write-Verbose '[Find-DomainShare] Querying computers in the domain'","            $TargetComputers = Get-DomainComputer @ComputerSearcherArguments | Select-Object -ExpandProperty dnshostname","        }","        Write-Verbose \"[Find-DomainShare] TargetComputers length: $($TargetComputers.Length)\"","        if ($TargetComputers.Length -eq 0) {","            throw '[Find-DomainShare] No hosts found to enumerate'","        }","","        # the host enumeration block we're using to enumerate all servers","        $HostEnumBlock = {","            Param($ComputerName, $CheckShareAccess, $TokenHandle)","","            if ($TokenHandle) {","                # impersonate the the token produced by LogonUser()/Invoke-UserImpersonation","                $Null = Invoke-UserImpersonation -TokenHandle $TokenHandle -Quiet","            }","","            ForEach ($TargetComputer in $ComputerName) {","                $Up = Test-Connection -Count 1 -Quiet -ComputerName $TargetComputer","                if ($Up) {","                    # get the shares for this host and check what we find","                    $Shares = Get-NetShare -ComputerName $TargetComputer","                    ForEach ($Share in $Shares) {","                        $ShareName = $Share.Name","                        # $Remark = $Share.Remark","                        $Path = '\\\\'+$TargetComputer+'\\'+$ShareName","","                        if (($ShareName) -and ($ShareName.trim() -ne '')) {","                            # see if we want to check access to this share","                            if ($CheckShareAccess) {","                                # check if the user has access to this path","                                try {","                                    $Null = [IO.Directory]::GetFiles($Path)","                                    $Share","                                }","                                catch {","                                    Write-Verbose \"Error accessing share path $Path : $_\"","                                }","                            }","                            else {","                                $Share","                            }","                        }","                    }","                }","            }","","            if ($TokenHandle) {","                Invoke-RevertToSelf","            }","        }","","        $LogonToken = $Null","        if ($PSBoundParameters['Credential']) {","            if ($PSBoundParameters['Delay'] -or $PSBoundParameters['StopOnSuccess']) {","                $LogonToken = Invoke-UserImpersonation -Credential $Credential","            }","            else {","                $LogonToken = Invoke-UserImpersonation -Credential $Credential -Quiet","            }","        }","    }","","    PROCESS {","        # only ignore threading if -Delay is passed","        if ($PSBoundParameters['Delay'] -or $PSBoundParameters['StopOnSuccess']) {","","            Write-Verbose \"[Find-DomainShare] Total number of hosts: $($TargetComputers.count)\"","            Write-Verbose \"[Find-DomainShare] Delay: $Delay, Jitter: $Jitter\"","            $Counter = 0","            $RandNo = New-Object System.Random","","            ForEach ($TargetComputer in $TargetComputers) {","                $Counter = $Counter + 1","","                # sleep for our semi-randomized interval","                Start-Sleep -Seconds $RandNo.Next((1-$Jitter)*$Delay, (1+$Jitter)*$Delay)","","                Write-Verbose \"[Find-DomainShare] Enumerating server $TargetComputer ($Counter of $($TargetComputers.count))\"","                Invoke-Command -ScriptBlock $HostEnumBlock -ArgumentList $TargetComputer, $CheckShareAccess, $LogonToken","            }","        }","        else {","            Write-Verbose \"[Find-DomainShare] Using threading with threads: $Threads\"","","            # if we're using threading, kick off the script block with New-ThreadedFunction","            $ScriptParams = @{","                'CheckShareAccess' = $CheckShareAccess","                'TokenHandle' = $LogonToken","            }","","            # if we're using threading, kick off the script block with New-ThreadedFunction using the $HostEnumBlock + params","            New-ThreadedFunction -ComputerName $TargetComputers -ScriptBlock $HostEnumBlock -ScriptParameters $ScriptParams -Threads $Threads","        }","    }","","    END {","        if ($LogonToken) {","            Invoke-RevertToSelf -TokenHandle $LogonToken","        }","    }","}","","","function Find-InterestingDomainShareFile {","\u003c#",".SYNOPSIS","","Searches for files matching specific criteria on readable shares","in the domain.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: Get-DomainComputer, Invoke-UserImpersonation, Invoke-RevertToSelf, Get-NetShare, Find-InterestingFile, New-ThreadedFunction  ","",".DESCRIPTION","","This function enumerates all machines on the current (or specified) domain","using Get-DomainComputer, and enumerates the available shares for each","machine with Get-NetShare. It will then use Find-InterestingFile on each","readhable share, searching for files marching specific criteria. If -Credential","is passed, then Invoke-UserImpersonation is used to impersonate the specified","user before enumeration, reverting after with Invoke-RevertToSelf.","",".PARAMETER ComputerName","","Specifies an array of one or more hosts to enumerate, passable on the pipeline.","If -ComputerName is not passed, the default behavior is to enumerate all machines","in the domain returned by Get-DomainComputer.","",".PARAMETER ComputerDomain","","Specifies the domain to query for computers, defaults to the current domain.","",".PARAMETER ComputerLDAPFilter","","Specifies an LDAP query string that is used to search for computer objects.","",".PARAMETER ComputerSearchBase","","Specifies the LDAP source to search through for computers,","e.g. \"LDAP://OU=secret,DC=testlab,DC=local\". Useful for OU queries.","",".PARAMETER ComputerOperatingSystem","","Search computers with a specific operating system, wildcards accepted.","",".PARAMETER ComputerServicePack","","Search computers with a specific service pack, wildcards accepted.","",".PARAMETER ComputerSiteName","","Search computers in the specific AD Site name, wildcards accepted.","",".PARAMETER Include","","Only return files/folders that match the specified array of strings,","i.e. @(*.doc*, *.xls*, *.ppt*)","",".PARAMETER SharePath","","Specifies one or more specific share paths to search, in the form \\\\COMPUTER\\Share","",".PARAMETER ExcludedShares","","Specifies share paths to exclude, default of C$, Admin$, Print$, IPC$.","",".PARAMETER LastAccessTime","","Only return files with a LastAccessTime greater than this date value.","",".PARAMETER LastWriteTime","","Only return files with a LastWriteTime greater than this date value.","",".PARAMETER CreationTime","","Only return files with a CreationTime greater than this date value.","",".PARAMETER OfficeDocs","","Switch. Search for office documents (*.doc*, *.xls*, *.ppt*)","",".PARAMETER FreshEXEs","","Switch. Find .EXEs accessed within the last 7 days.","",".PARAMETER Server","","Specifies an Active Directory server (domain controller) to bind to.","",".PARAMETER SearchScope","","Specifies the scope to search under for computers, Base/OneLevel/Subtree (default of Subtree).","",".PARAMETER ResultPageSize","","Specifies the PageSize to set for the LDAP searcher object.","",".PARAMETER ServerTimeLimit","","Specifies the maximum amount of time the server spends searching. Default of 120 seconds.","",".PARAMETER Tombstone","","Switch. Specifies that the searcher should also return deleted/tombstoned objects.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target domain and target systems.","",".PARAMETER Delay","","Specifies the delay (in seconds) between enumerating hosts, defaults to 0.","",".PARAMETER Jitter","","Specifies the jitter (0-1.0) to apply to any specified -Delay, defaults to +/- 0.3","",".PARAMETER Threads","","The number of threads to use for user searching, defaults to 20.","",".EXAMPLE","","Find-InterestingDomainShareFile","","Finds 'interesting' files on the current domain.","",".EXAMPLE","","Find-InterestingDomainShareFile -ComputerName @('windows1.testlab.local','windows2.testlab.local')","","Finds 'interesting' files on readable shares on the specified systems.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('DEV\\dfm.a', $SecPassword)","Find-DomainShare -Domain testlab.local -Credential $Cred","","Searches interesting files in the testlab.local domain using the specified alternate credentials.","",".OUTPUTS","","PowerView.FoundFile","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType('PowerView.FoundFile')]","    [CmdletBinding(DefaultParameterSetName = 'FileSpecification')]","    Param(","        [Parameter(Position = 0, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('DNSHostName')]","        [String[]]","        $ComputerName,","","        [ValidateNotNullOrEmpty()]","        [String]","        $ComputerDomain,","","        [ValidateNotNullOrEmpty()]","        [String]","        $ComputerLDAPFilter,","","        [ValidateNotNullOrEmpty()]","        [String]","        $ComputerSearchBase,","","        [ValidateNotNullOrEmpty()]","        [Alias('OperatingSystem')]","        [String]","        $ComputerOperatingSystem,","","        [ValidateNotNullOrEmpty()]","        [Alias('ServicePack')]","        [String]","        $ComputerServicePack,","","        [ValidateNotNullOrEmpty()]","        [Alias('SiteName')]","        [String]","        $ComputerSiteName,","","        [Parameter(ParameterSetName = 'FileSpecification')]","        [ValidateNotNullOrEmpty()]","        [Alias('SearchTerms', 'Terms')]","        [String[]]","        $Include = @('*password*', '*sensitive*', '*admin*', '*login*', '*secret*', 'unattend*.xml', '*.vmdk', '*creds*', '*credential*', '*.config'),","","        [ValidateNotNullOrEmpty()]","        [ValidatePattern('\\\\\\\\')]","        [Alias('Share')]","        [String[]]","        $SharePath,","","        [String[]]","        $ExcludedShares = @('C$', 'Admin$', 'Print$', 'IPC$'),","","        [Parameter(ParameterSetName = 'FileSpecification')]","        [ValidateNotNullOrEmpty()]","        [DateTime]","        $LastAccessTime,","","        [Parameter(ParameterSetName = 'FileSpecification')]","        [ValidateNotNullOrEmpty()]","        [DateTime]","        $LastWriteTime,","","        [Parameter(ParameterSetName = 'FileSpecification')]","        [ValidateNotNullOrEmpty()]","        [DateTime]","        $CreationTime,","","        [Parameter(ParameterSetName = 'OfficeDocs')]","        [Switch]","        $OfficeDocs,","","        [Parameter(ParameterSetName = 'FreshEXEs')]","        [Switch]","        $FreshEXEs,","","        [ValidateNotNullOrEmpty()]","        [Alias('DomainController')]","        [String]","        $Server,","","        [ValidateSet('Base', 'OneLevel', 'Subtree')]","        [String]","        $SearchScope = 'Subtree',","","        [ValidateRange(1, 10000)]","        [Int]","        $ResultPageSize = 200,","","        [ValidateRange(1, 10000)]","        [Int]","        $ServerTimeLimit,","","        [Switch]","        $Tombstone,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty,","","        [ValidateRange(1, 10000)]","        [Int]","        $Delay = 0,","","        [ValidateRange(0.0, 1.0)]","        [Double]","        $Jitter = .3,","","        [Int]","        [ValidateRange(1, 100)]","        $Threads = 20","    )","","    BEGIN {","        $ComputerSearcherArguments = @{","            'Properties' = 'dnshostname'","        }","        if ($PSBoundParameters['ComputerDomain']) { $ComputerSearcherArguments['Domain'] = $ComputerDomain }","        if ($PSBoundParameters['ComputerLDAPFilter']) { $ComputerSearcherArguments['LDAPFilter'] = $ComputerLDAPFilter }","        if ($PSBoundParameters['ComputerSearchBase']) { $ComputerSearcherArguments['SearchBase'] = $ComputerSearchBase }","        if ($PSBoundParameters['ComputerOperatingSystem']) { $ComputerSearcherArguments['OperatingSystem'] = $OperatingSystem }","        if ($PSBoundParameters['ComputerServicePack']) { $ComputerSearcherArguments['ServicePack'] = $ServicePack }","        if ($PSBoundParameters['ComputerSiteName']) { $ComputerSearcherArguments['SiteName'] = $SiteName }","        if ($PSBoundParameters['Server']) { $ComputerSearcherArguments['Server'] = $Server }","        if ($PSBoundParameters['SearchScope']) { $ComputerSearcherArguments['SearchScope'] = $SearchScope }","        if ($PSBoundParameters['ResultPageSize']) { $ComputerSearcherArguments['ResultPageSize'] = $ResultPageSize }","        if ($PSBoundParameters['ServerTimeLimit']) { $ComputerSearcherArguments['ServerTimeLimit'] = $ServerTimeLimit }","        if ($PSBoundParameters['Tombstone']) { $ComputerSearcherArguments['Tombstone'] = $Tombstone }","        if ($PSBoundParameters['Credential']) { $ComputerSearcherArguments['Credential'] = $Credential }","","        if ($PSBoundParameters['ComputerName']) {","            $TargetComputers = $ComputerName","        }","        else {","            Write-Verbose '[Find-InterestingDomainShareFile] Querying computers in the domain'","            $TargetComputers = Get-DomainComputer @ComputerSearcherArguments | Select-Object -ExpandProperty dnshostname","        }","        Write-Verbose \"[Find-InterestingDomainShareFile] TargetComputers length: $($TargetComputers.Length)\"","        if ($TargetComputers.Length -eq 0) {","            throw '[Find-InterestingDomainShareFile] No hosts found to enumerate'","        }","","        # the host enumeration block we're using to enumerate all servers","        $HostEnumBlock = {","            Param($ComputerName, $Include, $ExcludedShares, $OfficeDocs, $ExcludeHidden, $FreshEXEs, $CheckWriteAccess, $TokenHandle)","","            if ($TokenHandle) {","                # impersonate the the token produced by LogonUser()/Invoke-UserImpersonation","                $Null = Invoke-UserImpersonation -TokenHandle $TokenHandle -Quiet","            }","","            ForEach ($TargetComputer in $ComputerName) {","","                $SearchShares = @()","                if ($TargetComputer.StartsWith('\\\\')) {","                    # if a share is passed as the server","                    $SearchShares += $TargetComputer","                }","                else {","                    $Up = Test-Connection -Count 1 -Quiet -ComputerName $TargetComputer","                    if ($Up) {","                        # get the shares for this host and display what we find","                        $Shares = Get-NetShare -ComputerName $TargetComputer","                        ForEach ($Share in $Shares) {","                            $ShareName = $Share.Name","                            $Path = '\\\\'+$TargetComputer+'\\'+$ShareName","                            # make sure we get a real share name back","                            if (($ShareName) -and ($ShareName.Trim() -ne '')) {","                                # skip this share if it's in the exclude list","                                if ($ExcludedShares -NotContains $ShareName) {","                                    # check if the user has access to this path","                                    try {","                                        $Null = [IO.Directory]::GetFiles($Path)","                                        $SearchShares += $Path","                                    }","                                    catch {","                                        Write-Verbose \"[!] No access to $Path\"","                                    }","                                }","                            }","                        }","                    }","                }","","                ForEach ($Share in $SearchShares) {","                    Write-Verbose \"Searching share: $Share\"","                    $SearchArgs = @{","                        'Path' = $Share","                        'Include' = $Include","                    }","                    if ($OfficeDocs) {","                        $SearchArgs['OfficeDocs'] = $OfficeDocs","                    }","                    if ($FreshEXEs) {","                        $SearchArgs['FreshEXEs'] = $FreshEXEs","                    }","                    if ($LastAccessTime) {","                        $SearchArgs['LastAccessTime'] = $LastAccessTime","                    }","                    if ($LastWriteTime) {","                        $SearchArgs['LastWriteTime'] = $LastWriteTime","                    }","                    if ($CreationTime) {","                        $SearchArgs['CreationTime'] = $CreationTime","                    }","                    if ($CheckWriteAccess) {","                        $SearchArgs['CheckWriteAccess'] = $CheckWriteAccess","                    }","                    Find-InterestingFile @SearchArgs","                }","            }","","            if ($TokenHandle) {","                Invoke-RevertToSelf","            }","        }","","        $LogonToken = $Null","        if ($PSBoundParameters['Credential']) {","            if ($PSBoundParameters['Delay'] -or $PSBoundParameters['StopOnSuccess']) {","                $LogonToken = Invoke-UserImpersonation -Credential $Credential","            }","            else {","                $LogonToken = Invoke-UserImpersonation -Credential $Credential -Quiet","            }","        }","    }","","    PROCESS {","        # only ignore threading if -Delay is passed","        if ($PSBoundParameters['Delay'] -or $PSBoundParameters['StopOnSuccess']) {","","            Write-Verbose \"[Find-InterestingDomainShareFile] Total number of hosts: $($TargetComputers.count)\"","            Write-Verbose \"[Find-InterestingDomainShareFile] Delay: $Delay, Jitter: $Jitter\"","            $Counter = 0","            $RandNo = New-Object System.Random","","            ForEach ($TargetComputer in $TargetComputers) {","                $Counter = $Counter + 1","","                # sleep for our semi-randomized interval","                Start-Sleep -Seconds $RandNo.Next((1-$Jitter)*$Delay, (1+$Jitter)*$Delay)","","                Write-Verbose \"[Find-InterestingDomainShareFile] Enumerating server $TargetComputer ($Counter of $($TargetComputers.count))\"","                Invoke-Command -ScriptBlock $HostEnumBlock -ArgumentList $TargetComputer, $Include, $ExcludedShares, $OfficeDocs, $ExcludeHidden, $FreshEXEs, $CheckWriteAccess, $LogonToken","            }","        }","        else {","            Write-Verbose \"[Find-InterestingDomainShareFile] Using threading with threads: $Threads\"","","            # if we're using threading, kick off the script block with New-ThreadedFunction","            $ScriptParams = @{","                'Include' = $Include","                'ExcludedShares' = $ExcludedShares","                'OfficeDocs' = $OfficeDocs","                'ExcludeHidden' = $ExcludeHidden","                'FreshEXEs' = $FreshEXEs","                'CheckWriteAccess' = $CheckWriteAccess","                'TokenHandle' = $LogonToken","            }","","            # if we're using threading, kick off the script block with New-ThreadedFunction using the $HostEnumBlock + params","            New-ThreadedFunction -ComputerName $TargetComputers -ScriptBlock $HostEnumBlock -ScriptParameters $ScriptParams -Threads $Threads","        }","    }","","    END {","        if ($LogonToken) {","            Invoke-RevertToSelf -TokenHandle $LogonToken","        }","    }","}","","","function Find-LocalAdminAccess {","\u003c#",".SYNOPSIS","","Finds machines on the local domain where the current user has local administrator access.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: Get-DomainComputer, Invoke-UserImpersonation, Invoke-RevertToSelf, Test-AdminAccess, New-ThreadedFunction  ","",".DESCRIPTION","","This function enumerates all machines on the current (or specified) domain","using Get-DomainComputer, and for each computer it checks if the current user","has local administrator access using Test-AdminAccess. If -Credential is passed,","then Invoke-UserImpersonation is used to impersonate the specified user","before enumeration, reverting after with Invoke-RevertToSelf.","","Idea adapted from the local_admin_search_enum post module in Metasploit written by:","    'Brandon McCann \"zeknox\" \u003cbmccann[at]accuvant.com\u003e'","    'Thomas McCarthy \"smilingraccoon\" \u003csmilingraccoon[at]gmail.com\u003e'","    'Royce Davis \"r3dy\" \u003crdavis[at]accuvant.com\u003e'","",".PARAMETER ComputerName","","Specifies an array of one or more hosts to enumerate, passable on the pipeline.","If -ComputerName is not passed, the default behavior is to enumerate all machines","in the domain returned by Get-DomainComputer.","",".PARAMETER ComputerDomain","","Specifies the domain to query for computers, defaults to the current domain.","",".PARAMETER ComputerLDAPFilter","","Specifies an LDAP query string that is used to search for computer objects.","",".PARAMETER ComputerSearchBase","","Specifies the LDAP source to search through for computers,","e.g. \"LDAP://OU=secret,DC=testlab,DC=local\". Useful for OU queries.","",".PARAMETER ComputerOperatingSystem","","Search computers with a specific operating system, wildcards accepted.","",".PARAMETER ComputerServicePack","","Search computers with a specific service pack, wildcards accepted.","",".PARAMETER ComputerSiteName","","Search computers in the specific AD Site name, wildcards accepted.","",".PARAMETER CheckShareAccess","","Switch. Only display found shares that the local user has access to.","",".PARAMETER Server","","Specifies an Active Directory server (domain controller) to bind to.","",".PARAMETER SearchScope","","Specifies the scope to search under for computers, Base/OneLevel/Subtree (default of Subtree).","",".PARAMETER ResultPageSize","","Specifies the PageSize to set for the LDAP searcher object.","",".PARAMETER ServerTimeLimit","","Specifies the maximum amount of time the server spends searching. Default of 120 seconds.","",".PARAMETER Tombstone","","Switch. Specifies that the searcher should also return deleted/tombstoned objects.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target domain and target systems.","",".PARAMETER Delay","","Specifies the delay (in seconds) between enumerating hosts, defaults to 0.","",".PARAMETER Jitter","","Specifies the jitter (0-1.0) to apply to any specified -Delay, defaults to +/- 0.3","",".PARAMETER Threads","","The number of threads to use for user searching, defaults to 20.","",".EXAMPLE","","Find-LocalAdminAccess","","Finds machines in the current domain the current user has admin access to.","",".EXAMPLE","","Find-LocalAdminAccess -Domain dev.testlab.local","","Finds machines in the dev.testlab.local domain the current user has admin access to.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Find-LocalAdminAccess -Domain testlab.local -Credential $Cred","","Finds machines in the testlab.local domain that the user with the specified -Credential","has admin access to.","",".OUTPUTS","","String","","Computer dnshostnames the current user has administrative access to.","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType([String])]","    Param(","        [Parameter(Position = 0, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('DNSHostName')]","        [String[]]","        $ComputerName,","","        [ValidateNotNullOrEmpty()]","        [String]","        $ComputerDomain,","","        [ValidateNotNullOrEmpty()]","        [String]","        $ComputerLDAPFilter,","","        [ValidateNotNullOrEmpty()]","        [String]","        $ComputerSearchBase,","","        [ValidateNotNullOrEmpty()]","        [Alias('OperatingSystem')]","        [String]","        $ComputerOperatingSystem,","","        [ValidateNotNullOrEmpty()]","        [Alias('ServicePack')]","        [String]","        $ComputerServicePack,","","        [ValidateNotNullOrEmpty()]","        [Alias('SiteName')]","        [String]","        $ComputerSiteName,","","        [Switch]","        $CheckShareAccess,","","        [ValidateNotNullOrEmpty()]","        [Alias('DomainController')]","        [String]","        $Server,","","        [ValidateSet('Base', 'OneLevel', 'Subtree')]","        [String]","        $SearchScope = 'Subtree',","","        [ValidateRange(1, 10000)]","        [Int]","        $ResultPageSize = 200,","","        [ValidateRange(1, 10000)]","        [Int]","        $ServerTimeLimit,","","        [Switch]","        $Tombstone,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty,","","        [ValidateRange(1, 10000)]","        [Int]","        $Delay = 0,","","        [ValidateRange(0.0, 1.0)]","        [Double]","        $Jitter = .3,","","        [Int]","        [ValidateRange(1, 100)]","        $Threads = 20","    )","","    BEGIN {","        $ComputerSearcherArguments = @{","            'Properties' = 'dnshostname'","        }","        if ($PSBoundParameters['ComputerDomain']) { $ComputerSearcherArguments['Domain'] = $ComputerDomain }","        if ($PSBoundParameters['ComputerLDAPFilter']) { $ComputerSearcherArguments['LDAPFilter'] = $ComputerLDAPFilter }","        if ($PSBoundParameters['ComputerSearchBase']) { $ComputerSearcherArguments['SearchBase'] = $ComputerSearchBase }","        if ($PSBoundParameters['Unconstrained']) { $ComputerSearcherArguments['Unconstrained'] = $Unconstrained }","        if ($PSBoundParameters['ComputerOperatingSystem']) { $ComputerSearcherArguments['OperatingSystem'] = $OperatingSystem }","        if ($PSBoundParameters['ComputerServicePack']) { $ComputerSearcherArguments['ServicePack'] = $ServicePack }","        if ($PSBoundParameters['ComputerSiteName']) { $ComputerSearcherArguments['SiteName'] = $SiteName }","        if ($PSBoundParameters['Server']) { $ComputerSearcherArguments['Server'] = $Server }","        if ($PSBoundParameters['SearchScope']) { $ComputerSearcherArguments['SearchScope'] = $SearchScope }","        if ($PSBoundParameters['ResultPageSize']) { $ComputerSearcherArguments['ResultPageSize'] = $ResultPageSize }","        if ($PSBoundParameters['ServerTimeLimit']) { $ComputerSearcherArguments['ServerTimeLimit'] = $ServerTimeLimit }","        if ($PSBoundParameters['Tombstone']) { $ComputerSearcherArguments['Tombstone'] = $Tombstone }","        if ($PSBoundParameters['Credential']) { $ComputerSearcherArguments['Credential'] = $Credential }","","        if ($PSBoundParameters['ComputerName']) {","            $TargetComputers = $ComputerName","        }","        else {","            Write-Verbose '[Find-LocalAdminAccess] Querying computers in the domain'","            $TargetComputers = Get-DomainComputer @ComputerSearcherArguments | Select-Object -ExpandProperty dnshostname","        }","        Write-Verbose \"[Find-LocalAdminAccess] TargetComputers length: $($TargetComputers.Length)\"","        if ($TargetComputers.Length -eq 0) {","            throw '[Find-LocalAdminAccess] No hosts found to enumerate'","        }","","        # the host enumeration block we're using to enumerate all servers","        $HostEnumBlock = {","            Param($ComputerName, $TokenHandle)","","            if ($TokenHandle) {","                # impersonate the the token produced by LogonUser()/Invoke-UserImpersonation","                $Null = Invoke-UserImpersonation -TokenHandle $TokenHandle -Quiet","            }","","            ForEach ($TargetComputer in $ComputerName) {","                $Up = Test-Connection -Count 1 -Quiet -ComputerName $TargetComputer","                if ($Up) {","                    # check if the current user has local admin access to this server","                    $Access = Test-AdminAccess -ComputerName $TargetComputer","                    if ($Access.IsAdmin) {","                        $TargetComputer","                    }","                }","            }","","            if ($TokenHandle) {","                Invoke-RevertToSelf","            }","        }","","        $LogonToken = $Null","        if ($PSBoundParameters['Credential']) {","            if ($PSBoundParameters['Delay'] -or $PSBoundParameters['StopOnSuccess']) {","                $LogonToken = Invoke-UserImpersonation -Credential $Credential","            }","            else {","                $LogonToken = Invoke-UserImpersonation -Credential $Credential -Quiet","            }","        }","    }","","    PROCESS {","        # only ignore threading if -Delay is passed","        if ($PSBoundParameters['Delay'] -or $PSBoundParameters['StopOnSuccess']) {","","            Write-Verbose \"[Find-LocalAdminAccess] Total number of hosts: $($TargetComputers.count)\"","            Write-Verbose \"[Find-LocalAdminAccess] Delay: $Delay, Jitter: $Jitter\"","            $Counter = 0","            $RandNo = New-Object System.Random","","            ForEach ($TargetComputer in $TargetComputers) {","                $Counter = $Counter + 1","","                # sleep for our semi-randomized interval","                Start-Sleep -Seconds $RandNo.Next((1-$Jitter)*$Delay, (1+$Jitter)*$Delay)","","                Write-Verbose \"[Find-LocalAdminAccess] Enumerating server $TargetComputer ($Counter of $($TargetComputers.count))\"","                Invoke-Command -ScriptBlock $HostEnumBlock -ArgumentList $TargetComputer, $LogonToken","            }","        }","        else {","            Write-Verbose \"[Find-LocalAdminAccess] Using threading with threads: $Threads\"","","            # if we're using threading, kick off the script block with New-ThreadedFunction","            $ScriptParams = @{","                'TokenHandle' = $LogonToken","            }","","            # if we're using threading, kick off the script block with New-ThreadedFunction using the $HostEnumBlock + params","            New-ThreadedFunction -ComputerName $TargetComputers -ScriptBlock $HostEnumBlock -ScriptParameters $ScriptParams -Threads $Threads","        }","    }","}","","","function Find-DomainLocalGroupMember {","\u003c#",".SYNOPSIS","","Enumerates the members of specified local group (default administrators)","for all the targeted machines on the current (or specified) domain.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: Get-DomainComputer, Invoke-UserImpersonation, Invoke-RevertToSelf, Get-NetLocalGroupMember, New-ThreadedFunction  ","",".DESCRIPTION","","This function enumerates all machines on the current (or specified) domain","using Get-DomainComputer, and enumerates the members of the specified local","group (default of Administrators) for each machine using Get-NetLocalGroupMember.","By default, the API method is used, but this can be modified with '-Method winnt'","to use the WinNT service provider.","",".PARAMETER ComputerName","","Specifies an array of one or more hosts to enumerate, passable on the pipeline.","If -ComputerName is not passed, the default behavior is to enumerate all machines","in the domain returned by Get-DomainComputer.","",".PARAMETER ComputerDomain","","Specifies the domain to query for computers, defaults to the current domain.","",".PARAMETER ComputerLDAPFilter","","Specifies an LDAP query string that is used to search for computer objects.","",".PARAMETER ComputerSearchBase","","Specifies the LDAP source to search through for computers,","e.g. \"LDAP://OU=secret,DC=testlab,DC=local\". Useful for OU queries.","",".PARAMETER ComputerOperatingSystem","","Search computers with a specific operating system, wildcards accepted.","",".PARAMETER ComputerServicePack","","Search computers with a specific service pack, wildcards accepted.","",".PARAMETER ComputerSiteName","","Search computers in the specific AD Site name, wildcards accepted.","",".PARAMETER GroupName","","The local group name to query for users. If not given, it defaults to \"Administrators\".","",".PARAMETER Method","","The collection method to use, defaults to 'API', also accepts 'WinNT'.","",".PARAMETER Server","","Specifies an Active Directory server (domain controller) to bind to.","",".PARAMETER SearchScope","","Specifies the scope to search under for computers, Base/OneLevel/Subtree (default of Subtree).","",".PARAMETER ResultPageSize","","Specifies the PageSize to set for the LDAP searcher object.","",".PARAMETER ServerTimeLimit","","Specifies the maximum amount of time the server spends searching. Default of 120 seconds.","",".PARAMETER Tombstone","","Switch. Specifies that the searcher should also return deleted/tombstoned objects.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target domain and target systems.","",".PARAMETER Delay","","Specifies the delay (in seconds) between enumerating hosts, defaults to 0.","",".PARAMETER Jitter","","Specifies the jitter (0-1.0) to apply to any specified -Delay, defaults to +/- 0.3","",".PARAMETER Threads","","The number of threads to use for user searching, defaults to 20.","",".EXAMPLE","","Find-DomainLocalGroupMember","","Enumerates the local group memberships for all reachable machines in the current domain.","",".EXAMPLE","","Find-DomainLocalGroupMember -Domain dev.testlab.local","","Enumerates the local group memberships for all reachable machines the dev.testlab.local domain.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Find-DomainLocalGroupMember -Domain testlab.local -Credential $Cred","","Enumerates the local group memberships for all reachable machines the dev.testlab.local","domain using the alternate credentials.","",".OUTPUTS","","PowerView.LocalGroupMember.API","","Custom PSObject with translated group property fields from API results.","","PowerView.LocalGroupMember.WinNT","","Custom PSObject with translated group property fields from WinNT results.","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType('PowerView.LocalGroupMember.API')]","    [OutputType('PowerView.LocalGroupMember.WinNT')]","    Param(","        [Parameter(Position = 0, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('DNSHostName')]","        [String[]]","        $ComputerName,","","        [ValidateNotNullOrEmpty()]","        [String]","        $ComputerDomain,","","        [ValidateNotNullOrEmpty()]","        [String]","        $ComputerLDAPFilter,","","        [ValidateNotNullOrEmpty()]","        [String]","        $ComputerSearchBase,","","        [ValidateNotNullOrEmpty()]","        [Alias('OperatingSystem')]","        [String]","        $ComputerOperatingSystem,","","        [ValidateNotNullOrEmpty()]","        [Alias('ServicePack')]","        [String]","        $ComputerServicePack,","","        [ValidateNotNullOrEmpty()]","        [Alias('SiteName')]","        [String]","        $ComputerSiteName,","","        [Parameter(ValueFromPipelineByPropertyName = $True)]","        [ValidateNotNullOrEmpty()]","        [String]","        $GroupName = 'Administrators',","","        [ValidateSet('API', 'WinNT')]","        [Alias('CollectionMethod')]","        [String]","        $Method = 'API',","","        [ValidateNotNullOrEmpty()]","        [Alias('DomainController')]","        [String]","        $Server,","","        [ValidateSet('Base', 'OneLevel', 'Subtree')]","        [String]","        $SearchScope = 'Subtree',","","        [ValidateRange(1, 10000)]","        [Int]","        $ResultPageSize = 200,","","        [ValidateRange(1, 10000)]","        [Int]","        $ServerTimeLimit,","","        [Switch]","        $Tombstone,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty,","","        [ValidateRange(1, 10000)]","        [Int]","        $Delay = 0,","","        [ValidateRange(0.0, 1.0)]","        [Double]","        $Jitter = .3,","","        [Int]","        [ValidateRange(1, 100)]","        $Threads = 20","    )","","    BEGIN {","        $ComputerSearcherArguments = @{","            'Properties' = 'dnshostname'","        }","        if ($PSBoundParameters['ComputerDomain']) { $ComputerSearcherArguments['Domain'] = $ComputerDomain }","        if ($PSBoundParameters['ComputerLDAPFilter']) { $ComputerSearcherArguments['LDAPFilter'] = $ComputerLDAPFilter }","        if ($PSBoundParameters['ComputerSearchBase']) { $ComputerSearcherArguments['SearchBase'] = $ComputerSearchBase }","        if ($PSBoundParameters['Unconstrained']) { $ComputerSearcherArguments['Unconstrained'] = $Unconstrained }","        if ($PSBoundParameters['ComputerOperatingSystem']) { $ComputerSearcherArguments['OperatingSystem'] = $OperatingSystem }","        if ($PSBoundParameters['ComputerServicePack']) { $ComputerSearcherArguments['ServicePack'] = $ServicePack }","        if ($PSBoundParameters['ComputerSiteName']) { $ComputerSearcherArguments['SiteName'] = $SiteName }","        if ($PSBoundParameters['Server']) { $ComputerSearcherArguments['Server'] = $Server }","        if ($PSBoundParameters['SearchScope']) { $ComputerSearcherArguments['SearchScope'] = $SearchScope }","        if ($PSBoundParameters['ResultPageSize']) { $ComputerSearcherArguments['ResultPageSize'] = $ResultPageSize }","        if ($PSBoundParameters['ServerTimeLimit']) { $ComputerSearcherArguments['ServerTimeLimit'] = $ServerTimeLimit }","        if ($PSBoundParameters['Tombstone']) { $ComputerSearcherArguments['Tombstone'] = $Tombstone }","        if ($PSBoundParameters['Credential']) { $ComputerSearcherArguments['Credential'] = $Credential }","","        if ($PSBoundParameters['ComputerName']) {","            $TargetComputers = $ComputerName","        }","        else {","            Write-Verbose '[Find-DomainLocalGroupMember] Querying computers in the domain'","            $TargetComputers = Get-DomainComputer @ComputerSearcherArguments | Select-Object -ExpandProperty dnshostname","        }","        Write-Verbose \"[Find-DomainLocalGroupMember] TargetComputers length: $($TargetComputers.Length)\"","        if ($TargetComputers.Length -eq 0) {","            throw '[Find-DomainLocalGroupMember] No hosts found to enumerate'","        }","","        # the host enumeration block we're using to enumerate all servers","        $HostEnumBlock = {","            Param($ComputerName, $GroupName, $Method, $TokenHandle)","","            # Add check if user defaults to/selects \"Administrators\"","            if ($GroupName -eq \"Administrators\") {","                $AdminSecurityIdentifier = New-Object System.Security.Principal.SecurityIdentifier([System.Security.Principal.WellKnownSidType]::BuiltinAdministratorsSid,$null)","                $GroupName = ($AdminSecurityIdentifier.Translate([System.Security.Principal.NTAccount]).Value -split \"\\\\\")[-1]","            }","","            if ($TokenHandle) {","                # impersonate the the token produced by LogonUser()/Invoke-UserImpersonation","                $Null = Invoke-UserImpersonation -TokenHandle $TokenHandle -Quiet","            }","","            ForEach ($TargetComputer in $ComputerName) {","                $Up = Test-Connection -Count 1 -Quiet -ComputerName $TargetComputer","                if ($Up) {","                    $NetLocalGroupMemberArguments = @{","                        'ComputerName' = $TargetComputer","                        'Method' = $Method","                        'GroupName' = $GroupName","                    }","                    Get-NetLocalGroupMember @NetLocalGroupMemberArguments","                }","            }","","            if ($TokenHandle) {","                Invoke-RevertToSelf","            }","        }","","        $LogonToken = $Null","        if ($PSBoundParameters['Credential']) {","            if ($PSBoundParameters['Delay'] -or $PSBoundParameters['StopOnSuccess']) {","                $LogonToken = Invoke-UserImpersonation -Credential $Credential","            }","            else {","                $LogonToken = Invoke-UserImpersonation -Credential $Credential -Quiet","            }","        }","    }","","    PROCESS {","        # only ignore threading if -Delay is passed","        if ($PSBoundParameters['Delay'] -or $PSBoundParameters['StopOnSuccess']) {","","            Write-Verbose \"[Find-DomainLocalGroupMember] Total number of hosts: $($TargetComputers.count)\"","            Write-Verbose \"[Find-DomainLocalGroupMember] Delay: $Delay, Jitter: $Jitter\"","            $Counter = 0","            $RandNo = New-Object System.Random","","            ForEach ($TargetComputer in $TargetComputers) {","                $Counter = $Counter + 1","","                # sleep for our semi-randomized interval","                Start-Sleep -Seconds $RandNo.Next((1-$Jitter)*$Delay, (1+$Jitter)*$Delay)","","                Write-Verbose \"[Find-DomainLocalGroupMember] Enumerating server $TargetComputer ($Counter of $($TargetComputers.count))\"","                Invoke-Command -ScriptBlock $HostEnumBlock -ArgumentList $TargetComputer, $GroupName, $Method, $LogonToken","            }","        }","        else {","            Write-Verbose \"[Find-DomainLocalGroupMember] Using threading with threads: $Threads\"","","            # if we're using threading, kick off the script block with New-ThreadedFunction","            $ScriptParams = @{","                'GroupName' = $GroupName","                'Method' = $Method","                'TokenHandle' = $LogonToken","            }","","            # if we're using threading, kick off the script block with New-ThreadedFunction using the $HostEnumBlock + params","            New-ThreadedFunction -ComputerName $TargetComputers -ScriptBlock $HostEnumBlock -ScriptParameters $ScriptParams -Threads $Threads","        }","    }","","    END {","        if ($LogonToken) {","            Invoke-RevertToSelf -TokenHandle $LogonToken","        }","    }","}","","","########################################################","#","# Domain trust functions below.","#","########################################################","","function Get-DomainTrust {","\u003c#",".SYNOPSIS","","Return all domain trusts for the current domain or a specified domain.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: Get-Domain, Get-DomainSearcher, Get-DomainSID, PSReflect  ","",".DESCRIPTION","","This function will enumerate domain trust relationships for the current (or a remote)","domain using a number of methods. By default, and LDAP search using the filter","'(objectClass=trustedDomain)' is used- if any LDAP-appropriate parameters are specified","LDAP is used as well. If the -NET flag is specified, the .NET method","GetAllTrustRelationships() is used on the System.DirectoryServices.ActiveDirectory.Domain","object. If the -API flag is specified, the Win32 API DsEnumerateDomainTrusts() call is","used to enumerate instead.","",".PARAMETER Domain","","Specifies the domain to query for trusts, defaults to the current domain.","",".PARAMETER API","","Switch. Use an API call (DsEnumerateDomainTrusts) to enumerate the trusts instead of the built-in",".NET methods.","",".PARAMETER NET","","Switch. Use .NET queries to enumerate trusts instead of the default LDAP method.","",".PARAMETER LDAPFilter","","Specifies an LDAP query string that is used to filter Active Directory objects.","",".PARAMETER Properties","","Specifies the properties of the output object to retrieve from the server.","",".PARAMETER SearchBase","","The LDAP source to search through, e.g. \"LDAP://OU=secret,DC=testlab,DC=local\"","Useful for OU queries.","",".PARAMETER Server","","Specifies an Active Directory server (domain controller) to bind to.","",".PARAMETER SearchScope","","Specifies the scope to search under, Base/OneLevel/Subtree (default of Subtree).","",".PARAMETER ResultPageSize","","Specifies the PageSize to set for the LDAP searcher object.","",".PARAMETER ServerTimeLimit","","Specifies the maximum amount of time the server spends searching. Default of 120 seconds.","",".PARAMETER Tombstone","","Switch. Specifies that the searcher should also return deleted/tombstoned objects.","",".PARAMETER FindOne","","Only return one result object.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target domain.","",".EXAMPLE","","Get-DomainTrust","","Return domain trusts for the current domain using built in .LDAP methods.","",".EXAMPLE","","Get-DomainTrust -NET -Domain \"prod.testlab.local\"","","Return domain trusts for the \"prod.testlab.local\" domain using .NET methods","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Get-DomainTrust -Domain \"prod.testlab.local\" -Server \"PRIMARY.testlab.local\" -Credential $Cred","","Return domain trusts for the \"prod.testlab.local\" domain enumerated through LDAP","queries, binding to the PRIMARY.testlab.local server for queries, and using the specified","alternate credenitals.","",".EXAMPLE","","Get-DomainTrust -API -Domain \"prod.testlab.local\"","","Return domain trusts for the \"prod.testlab.local\" domain enumerated through API calls.","",".OUTPUTS","","PowerView.DomainTrust.LDAP","","Custom PSObject with translated domain LDAP trust result fields (default).","","PowerView.DomainTrust.NET","","A TrustRelationshipInformationCollection returned when using .NET methods.","","PowerView.DomainTrust.API","","Custom PSObject with translated domain API trust result fields.","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType('PowerView.DomainTrust.NET')]","    [OutputType('PowerView.DomainTrust.LDAP')]","    [OutputType('PowerView.DomainTrust.API')]","    [CmdletBinding(DefaultParameterSetName = 'LDAP')]","    Param(","        [Parameter(Position = 0, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('Name')]","        [ValidateNotNullOrEmpty()]","        [String]","        $Domain,","","        [Parameter(ParameterSetName = 'API')]","        [Switch]","        $API,","","        [Parameter(ParameterSetName = 'NET')]","        [Switch]","        $NET,","","        [Parameter(ParameterSetName = 'LDAP')]","        [ValidateNotNullOrEmpty()]","        [Alias('Filter')]","        [String]","        $LDAPFilter,","","        [Parameter(ParameterSetName = 'LDAP')]","        [ValidateNotNullOrEmpty()]","        [String[]]","        $Properties,","","        [Parameter(ParameterSetName = 'LDAP')]","        [ValidateNotNullOrEmpty()]","        [Alias('ADSPath')]","        [String]","        $SearchBase,","","        [Parameter(ParameterSetName = 'LDAP')]","        [Parameter(ParameterSetName = 'API')]","        [ValidateNotNullOrEmpty()]","        [Alias('DomainController')]","        [String]","        $Server,","","        [Parameter(ParameterSetName = 'LDAP')]","        [ValidateSet('Base', 'OneLevel', 'Subtree')]","        [String]","        $SearchScope = 'Subtree',","","        [Parameter(ParameterSetName = 'LDAP')]","        [ValidateRange(1, 10000)]","        [Int]","        $ResultPageSize = 200,","","        [Parameter(ParameterSetName = 'LDAP')]","        [ValidateRange(1, 10000)]","        [Int]","        $ServerTimeLimit,","","        [Parameter(ParameterSetName = 'LDAP')]","        [Switch]","        $Tombstone,","","        [Alias('ReturnOne')]","        [Switch]","        $FindOne,","","        [Parameter(ParameterSetName = 'LDAP')]","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    BEGIN {","        $TrustAttributes = @{","            [uint32]'0x00000001' = 'NON_TRANSITIVE'","            [uint32]'0x00000002' = 'UPLEVEL_ONLY'","            [uint32]'0x00000004' = 'FILTER_SIDS'","            [uint32]'0x00000008' = 'FOREST_TRANSITIVE'","            [uint32]'0x00000010' = 'CROSS_ORGANIZATION'","            [uint32]'0x00000020' = 'WITHIN_FOREST'","            [uint32]'0x00000040' = 'TREAT_AS_EXTERNAL'","            [uint32]'0x00000080' = 'TRUST_USES_RC4_ENCRYPTION'","            [uint32]'0x00000100' = 'TRUST_USES_AES_KEYS'","            [uint32]'0x00000200' = 'CROSS_ORGANIZATION_NO_TGT_DELEGATION'","            [uint32]'0x00000400' = 'PIM_TRUST'","        }","","        $LdapSearcherArguments = @{}","        if ($PSBoundParameters['Domain']) { $LdapSearcherArguments['Domain'] = $Domain }","        if ($PSBoundParameters['LDAPFilter']) { $LdapSearcherArguments['LDAPFilter'] = $LDAPFilter }","        if ($PSBoundParameters['Properties']) { $LdapSearcherArguments['Properties'] = $Properties }","        if ($PSBoundParameters['SearchBase']) { $LdapSearcherArguments['SearchBase'] = $SearchBase }","        if ($PSBoundParameters['Server']) { $LdapSearcherArguments['Server'] = $Server }","        if ($PSBoundParameters['SearchScope']) { $LdapSearcherArguments['SearchScope'] = $SearchScope }","        if ($PSBoundParameters['ResultPageSize']) { $LdapSearcherArguments['ResultPageSize'] = $ResultPageSize }","        if ($PSBoundParameters['ServerTimeLimit']) { $LdapSearcherArguments['ServerTimeLimit'] = $ServerTimeLimit }","        if ($PSBoundParameters['Tombstone']) { $LdapSearcherArguments['Tombstone'] = $Tombstone }","        if ($PSBoundParameters['Credential']) { $LdapSearcherArguments['Credential'] = $Credential }","    }","","    PROCESS {","        if ($PsCmdlet.ParameterSetName -ne 'API') {","            $NetSearcherArguments = @{}","            if ($Domain -and $Domain.Trim() -ne '') {","                $SourceDomain = $Domain","            }","            else {","                if ($PSBoundParameters['Credential']) {","                    $SourceDomain = (Get-Domain -Credential $Credential).Name","                }","                else {","                    $SourceDomain = (Get-Domain).Name","                }","            }","        }","        elseif ($PsCmdlet.ParameterSetName -ne 'NET') {","            if ($Domain -and $Domain.Trim() -ne '') {","                $SourceDomain = $Domain","            }","            else {","                $SourceDomain = $Env:USERDNSDOMAIN","            }","        }","","        if ($PsCmdlet.ParameterSetName -eq 'LDAP') {","            # if we're searching for domain trusts through LDAP/ADSI","            $TrustSearcher = Get-DomainSearcher @LdapSearcherArguments","            $SourceSID = Get-DomainSID @NetSearcherArguments","","            if ($TrustSearcher) {","","                $TrustSearcher.Filter = '(objectClass=trustedDomain)'","","                if ($PSBoundParameters['FindOne']) { $Results = $TrustSearcher.FindOne() }","                else { $Results = $TrustSearcher.FindAll() }","                $Results | Where-Object {$_} | ForEach-Object {","                    $Props = $_.Properties","                    $DomainTrust = New-Object PSObject","","                    $TrustAttrib = @()","                    $TrustAttrib += $TrustAttributes.Keys | Where-Object { $Props.trustattributes[0] -band $_ } | ForEach-Object { $TrustAttributes[$_] }","","                    $Direction = Switch ($Props.trustdirection) {","                        0 { 'Disabled' }","                        1 { 'Inbound' }","                        2 { 'Outbound' }","                        3 { 'Bidirectional' }","                    }","","                    $TrustType = Switch ($Props.trusttype) {","                        1 { 'WINDOWS_NON_ACTIVE_DIRECTORY' }","                        2 { 'WINDOWS_ACTIVE_DIRECTORY' }","                        3 { 'MIT' }","                    }","","                    $Distinguishedname = $Props.distinguishedname[0]","                    $SourceNameIndex = $Distinguishedname.IndexOf('DC=')","                    if ($SourceNameIndex) {","                        $SourceDomain = $($Distinguishedname.SubString($SourceNameIndex)) -replace 'DC=','' -replace ',','.'","                    }","                    else {","                        $SourceDomain = \"\"","                    }","","                    $TargetNameIndex = $Distinguishedname.IndexOf(',CN=System')","                    if ($SourceNameIndex) {","                        $TargetDomain = $Distinguishedname.SubString(3, $TargetNameIndex-3)","                    }","                    else {","                        $TargetDomain = \"\"","                    }","","                    $ObjectGuid = New-Object Guid @(,$Props.objectguid[0])","                    $TargetSID = (New-Object System.Security.Principal.SecurityIdentifier($Props.securityidentifier[0],0)).Value","","                    $DomainTrust | Add-Member Noteproperty 'SourceName' $SourceDomain","                    $DomainTrust | Add-Member Noteproperty 'TargetName' $Props.name[0]","                    # $DomainTrust | Add-Member Noteproperty 'TargetGuid' \"{$ObjectGuid}\"","                    $DomainTrust | Add-Member Noteproperty 'TrustType' $TrustType","                    $DomainTrust | Add-Member Noteproperty 'TrustAttributes' $($TrustAttrib -join ',')","                    $DomainTrust | Add-Member Noteproperty 'TrustDirection' \"$Direction\"","                    $DomainTrust | Add-Member Noteproperty 'WhenCreated' $Props.whencreated[0]","                    $DomainTrust | Add-Member Noteproperty 'WhenChanged' $Props.whenchanged[0]","                    $DomainTrust.PSObject.TypeNames.Insert(0, 'PowerView.DomainTrust.LDAP')","                    $DomainTrust","                }","                if ($Results) {","                    try { $Results.dispose() }","                    catch {","                        Write-Verbose \"[Get-DomainTrust] Error disposing of the Results object: $_\"","                    }","                }","                $TrustSearcher.dispose()","            }","        }","        elseif ($PsCmdlet.ParameterSetName -eq 'API') {","            # if we're searching for domain trusts through Win32 API functions","            if ($PSBoundParameters['Server']) {","                $TargetDC = $Server","            }","            elseif ($Domain -and $Domain.Trim() -ne '') {","                $TargetDC = $Domain","            }","            else {","                # see https://msdn.microsoft.com/en-us/library/ms675976(v=vs.85).aspx for default NULL behavior","                $TargetDC = $Null","            }","","            # arguments for DsEnumerateDomainTrusts","            $PtrInfo = [IntPtr]::Zero","","            # 63 = DS_DOMAIN_IN_FOREST + DS_DOMAIN_DIRECT_OUTBOUND + DS_DOMAIN_TREE_ROOT + DS_DOMAIN_PRIMARY + DS_DOMAIN_NATIVE_MODE + DS_DOMAIN_DIRECT_INBOUND","            $Flags = 63","            $DomainCount = 0","","            # get the trust information from the target server","            $Result = $Netapi32::DsEnumerateDomainTrusts($TargetDC, $Flags, [ref]$PtrInfo, [ref]$DomainCount)","","            # Locate the offset of the initial intPtr","            $Offset = $PtrInfo.ToInt64()","","            # 0 = success","            if (($Result -eq 0) -and ($Offset -gt 0)) {","","                # Work out how much to increment the pointer by finding out the size of the structure","                $Increment = $DS_DOMAIN_TRUSTS::GetSize()","","                # parse all the result structures","                for ($i = 0; ($i -lt $DomainCount); $i++) {","                    # create a new int ptr at the given offset and cast the pointer as our result structure","                    $NewIntPtr = New-Object System.Intptr -ArgumentList $Offset","                    $Info = $NewIntPtr -as $DS_DOMAIN_TRUSTS","","                    $Offset = $NewIntPtr.ToInt64()","                    $Offset += $Increment","","                    $SidString = ''","                    $Result = $Advapi32::ConvertSidToStringSid($Info.DomainSid, [ref]$SidString);$LastError = [Runtime.InteropServices.Marshal]::GetLastWin32Error()","","                    if ($Result -eq 0) {","                        Write-Verbose \"[Get-DomainTrust] Error: $(([ComponentModel.Win32Exception] $LastError).Message)\"","                    }","                    else {","                        $DomainTrust = New-Object PSObject","                        $DomainTrust | Add-Member Noteproperty 'SourceName' $SourceDomain","                        $DomainTrust | Add-Member Noteproperty 'TargetName' $Info.DnsDomainName","                        $DomainTrust | Add-Member Noteproperty 'TargetNetbiosName' $Info.NetbiosDomainName","                        $DomainTrust | Add-Member Noteproperty 'Flags' $Info.Flags","                        $DomainTrust | Add-Member Noteproperty 'ParentIndex' $Info.ParentIndex","                        $DomainTrust | Add-Member Noteproperty 'TrustType' $Info.TrustType","                        $DomainTrust | Add-Member Noteproperty 'TrustAttributes' $Info.TrustAttributes","                        $DomainTrust | Add-Member Noteproperty 'TargetSid' $SidString","                        $DomainTrust | Add-Member Noteproperty 'TargetGuid' $Info.DomainGuid","                        $DomainTrust.PSObject.TypeNames.Insert(0, 'PowerView.DomainTrust.API')","                        $DomainTrust","                    }","                }","                # free up the result buffer","                $Null = $Netapi32::NetApiBufferFree($PtrInfo)","            }","            else {","                Write-Verbose \"[Get-DomainTrust] Error: $(([ComponentModel.Win32Exception] $Result).Message)\"","            }","        }","        else {","            # if we're searching for domain trusts through .NET methods","            $FoundDomain = Get-Domain @NetSearcherArguments","            if ($FoundDomain) {","                $FoundDomain.GetAllTrustRelationships() | ForEach-Object {","                    $_.PSObject.TypeNames.Insert(0, 'PowerView.DomainTrust.NET')","                    $_","                }","            }","        }","    }","}","","","function Get-ForestTrust {","\u003c#",".SYNOPSIS","","Return all forest trusts for the current forest or a specified forest.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: Get-Forest  ","",".DESCRIPTION","","This function will enumerate domain trust relationships for the current (or a remote)","forest using number of method using the .NET method GetAllTrustRelationships() on a","System.DirectoryServices.ActiveDirectory.Forest returned by Get-Forest.","",".PARAMETER Forest","","Specifies the forest to query for trusts, defaults to the current forest.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target domain.","",".EXAMPLE","","Get-ForestTrust","","Return current forest trusts.","",".EXAMPLE","","Get-ForestTrust -Forest \"external.local\"","","Return trusts for the \"external.local\" forest.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Get-ForestTrust -Forest \"external.local\" -Credential $Cred","","Return trusts for the \"external.local\" forest using the specified alternate credenitals.","",".OUTPUTS","","PowerView.DomainTrust.NET","","A TrustRelationshipInformationCollection returned when using .NET methods (default).","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType('PowerView.ForestTrust.NET')]","    [CmdletBinding()]","    Param(","        [Parameter(Position = 0, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('Name')]","        [ValidateNotNullOrEmpty()]","        [String]","        $Forest,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    PROCESS {","        $NetForestArguments = @{}","        if ($PSBoundParameters['Forest']) { $NetForestArguments['Forest'] = $Forest }","        if ($PSBoundParameters['Credential']) { $NetForestArguments['Credential'] = $Credential }","","        $FoundForest = Get-Forest @NetForestArguments","","        if ($FoundForest) {","            $FoundForest.GetAllTrustRelationships() | ForEach-Object {","                $_.PSObject.TypeNames.Insert(0, 'PowerView.ForestTrust.NET')","                $_","            }","        }","    }","}","","","function Get-DomainForeignUser {","\u003c#",".SYNOPSIS","","Enumerates users who are in groups outside of the user's domain.","This is a domain's \"outgoing\" access.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: Get-Domain, Get-DomainUser  ","",".DESCRIPTION","","Uses Get-DomainUser to enumerate all users for the current (or target) domain,","then calculates the given user's domain name based on the user's distinguishedName.","This domain name is compared to the queried domain, and the user object is","output if they differ.","",".PARAMETER Domain","","Specifies the domain to use for the query, defaults to the current domain.","",".PARAMETER LDAPFilter","","Specifies an LDAP query string that is used to filter Active Directory objects.","",".PARAMETER Properties","","Specifies the properties of the output object to retrieve from the server.","",".PARAMETER SearchBase","","The LDAP source to search through, e.g. \"LDAP://OU=secret,DC=testlab,DC=local\"","Useful for OU queries.","",".PARAMETER Server","","Specifies an Active Directory server (domain controller) to bind to.","",".PARAMETER SearchScope","","Specifies the scope to search under, Base/OneLevel/Subtree (default of Subtree).","",".PARAMETER ResultPageSize","","Specifies the PageSize to set for the LDAP searcher object.","",".PARAMETER ServerTimeLimit","","Specifies the maximum amount of time the server spends searching. Default of 120 seconds.","",".PARAMETER SecurityMasks","","Specifies an option for examining security information of a directory object.","One of 'Dacl', 'Group', 'None', 'Owner', 'Sacl'.","",".PARAMETER Tombstone","","Switch. Specifies that the searcher should also return deleted/tombstoned objects.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target domain.","",".EXAMPLE","","Get-DomainForeignUser","","Return all users in the current domain who are in groups not in the","current domain.","",".EXAMPLE","","Get-DomainForeignUser -Domain dev.testlab.local","","Return all users in the dev.testlab.local domain who are in groups not in the","dev.testlab.local domain.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Get-DomainForeignUser -Domain dev.testlab.local -Server secondary.dev.testlab.local -Credential $Cred","","Return all users in the dev.testlab.local domain who are in groups not in the","dev.testlab.local domain, binding to the secondary.dev.testlab.local for queries, and","using the specified alternate credentials.","",".OUTPUTS","","PowerView.ForeignUser","","Custom PSObject with translated user property fields.","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType('PowerView.ForeignUser')]","    [CmdletBinding()]","    Param(","        [Parameter(Position = 0, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('Name')]","        [ValidateNotNullOrEmpty()]","        [String]","        $Domain,","","        [ValidateNotNullOrEmpty()]","        [Alias('Filter')]","        [String]","        $LDAPFilter,","","        [ValidateNotNullOrEmpty()]","        [String[]]","        $Properties,","","        [ValidateNotNullOrEmpty()]","        [Alias('ADSPath')]","        [String]","        $SearchBase,","","        [ValidateNotNullOrEmpty()]","        [Alias('DomainController')]","        [String]","        $Server,","","        [ValidateSet('Base', 'OneLevel', 'Subtree')]","        [String]","        $SearchScope = 'Subtree',","","        [ValidateRange(1, 10000)]","        [Int]","        $ResultPageSize = 200,","","        [ValidateRange(1, 10000)]","        [Int]","        $ServerTimeLimit,","","        [ValidateSet('Dacl', 'Group', 'None', 'Owner', 'Sacl')]","        [String]","        $SecurityMasks,","","        [Switch]","        $Tombstone,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    BEGIN {","        $SearcherArguments = @{}","        $SearcherArguments['LDAPFilter'] = '(memberof=*)'","        if ($PSBoundParameters['Domain']) { $SearcherArguments['Domain'] = $Domain }","        if ($PSBoundParameters['Properties']) { $SearcherArguments['Properties'] = $Properties }","        if ($PSBoundParameters['SearchBase']) { $SearcherArguments['SearchBase'] = $SearchBase }","        if ($PSBoundParameters['Server']) { $SearcherArguments['Server'] = $Server }","        if ($PSBoundParameters['SearchScope']) { $SearcherArguments['SearchScope'] = $SearchScope }","        if ($PSBoundParameters['ResultPageSize']) { $SearcherArguments['ResultPageSize'] = $ResultPageSize }","        if ($PSBoundParameters['ServerTimeLimit']) { $SearcherArguments['ServerTimeLimit'] = $ServerTimeLimit }","        if ($PSBoundParameters['SecurityMasks']) { $SearcherArguments['SecurityMasks'] = $SecurityMasks }","        if ($PSBoundParameters['Tombstone']) { $SearcherArguments['Tombstone'] = $Tombstone }","        if ($PSBoundParameters['Credential']) { $SearcherArguments['Credential'] = $Credential }","        if ($PSBoundParameters['Raw']) { $SearcherArguments['Raw'] = $Raw }","    }","","    PROCESS {","        Get-DomainUser @SearcherArguments  | ForEach-Object {","            ForEach ($Membership in $_.memberof) {","                $Index = $Membership.IndexOf('DC=')","                if ($Index) {","","                    $GroupDomain = $($Membership.SubString($Index)) -replace 'DC=','' -replace ',','.'","                    $UserDistinguishedName = $_.distinguishedname","                    $UserIndex = $UserDistinguishedName.IndexOf('DC=')","                    $UserDomain = $($_.distinguishedname.SubString($UserIndex)) -replace 'DC=','' -replace ',','.'","","                    if ($GroupDomain -ne $UserDomain) {","                        # if the group domain doesn't match the user domain, display it","                        $GroupName = $Membership.Split(',')[0].split('=')[1]","                        $ForeignUser = New-Object PSObject","                        $ForeignUser | Add-Member Noteproperty 'UserDomain' $UserDomain","                        $ForeignUser | Add-Member Noteproperty 'UserName' $_.samaccountname","                        $ForeignUser | Add-Member Noteproperty 'UserDistinguishedName' $_.distinguishedname","                        $ForeignUser | Add-Member Noteproperty 'GroupDomain' $GroupDomain","                        $ForeignUser | Add-Member Noteproperty 'GroupName' $GroupName","                        $ForeignUser | Add-Member Noteproperty 'GroupDistinguishedName' $Membership","                        $ForeignUser.PSObject.TypeNames.Insert(0, 'PowerView.ForeignUser')","                        $ForeignUser","                    }","                }","            }","        }","    }","}","","","function Get-DomainForeignGroupMember {","\u003c#",".SYNOPSIS","","Enumerates groups with users outside of the group's domain and returns","each foreign member. This is a domain's \"incoming\" access.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: Get-Domain, Get-DomainGroup  ","",".DESCRIPTION","","Uses Get-DomainGroup to enumerate all groups for the current (or target) domain,","then enumerates the members of each group, and compares the member's domain","name to the parent group's domain name, outputting the member if the domains differ.","",".PARAMETER Domain","","Specifies the domain to use for the query, defaults to the current domain.","",".PARAMETER LDAPFilter","","Specifies an LDAP query string that is used to filter Active Directory objects.","",".PARAMETER Properties","","Specifies the properties of the output object to retrieve from the server.","",".PARAMETER SearchBase","","The LDAP source to search through, e.g. \"LDAP://OU=secret,DC=testlab,DC=local\"","Useful for OU queries.","",".PARAMETER Server","","Specifies an Active Directory server (domain controller) to bind to.","",".PARAMETER SearchScope","","Specifies the scope to search under, Base/OneLevel/Subtree (default of Subtree).","",".PARAMETER ResultPageSize","","Specifies the PageSize to set for the LDAP searcher object.","",".PARAMETER ServerTimeLimit","","Specifies the maximum amount of time the server spends searching. Default of 120 seconds.","",".PARAMETER SecurityMasks","","Specifies an option for examining security information of a directory object.","One of 'Dacl', 'Group', 'None', 'Owner', 'Sacl'.","",".PARAMETER Tombstone","","Switch. Specifies that the searcher should also return deleted/tombstoned objects.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target domain.","",".EXAMPLE","","Get-DomainForeignGroupMember","","Return all group members in the current domain where the group and member differ.","",".EXAMPLE","","Get-DomainForeignGroupMember -Domain dev.testlab.local","","Return all group members in the dev.testlab.local domain where the member is not in dev.testlab.local.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Get-DomainForeignGroupMember -Domain dev.testlab.local -Server secondary.dev.testlab.local -Credential $Cred","","Return all group members in the dev.testlab.local domain where the member is","not in dev.testlab.local. binding to the secondary.dev.testlab.local for","queries, and using the specified alternate credentials.","",".OUTPUTS","","PowerView.ForeignGroupMember","","Custom PSObject with translated group member property fields.","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType('PowerView.ForeignGroupMember')]","    [CmdletBinding()]","    Param(","        [Parameter(Position = 0, ValueFromPipeline = $True, ValueFromPipelineByPropertyName = $True)]","        [Alias('Name')]","        [ValidateNotNullOrEmpty()]","        [String]","        $Domain,","","        [ValidateNotNullOrEmpty()]","        [Alias('Filter')]","        [String]","        $LDAPFilter,","","        [ValidateNotNullOrEmpty()]","        [String[]]","        $Properties,","","        [ValidateNotNullOrEmpty()]","        [Alias('ADSPath')]","        [String]","        $SearchBase,","","        [ValidateNotNullOrEmpty()]","        [Alias('DomainController')]","        [String]","        $Server,","","        [ValidateSet('Base', 'OneLevel', 'Subtree')]","        [String]","        $SearchScope = 'Subtree',","","        [ValidateRange(1, 10000)]","        [Int]","        $ResultPageSize = 200,","","        [ValidateRange(1, 10000)]","        [Int]","        $ServerTimeLimit,","","        [ValidateSet('Dacl', 'Group', 'None', 'Owner', 'Sacl')]","        [String]","        $SecurityMasks,","","        [Switch]","        $Tombstone,","","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    BEGIN {","        $SearcherArguments = @{}","        $SearcherArguments['LDAPFilter'] = '(member=*)'","        if ($PSBoundParameters['Domain']) { $SearcherArguments['Domain'] = $Domain }","        if ($PSBoundParameters['Properties']) { $SearcherArguments['Properties'] = $Properties }","        if ($PSBoundParameters['SearchBase']) { $SearcherArguments['SearchBase'] = $SearchBase }","        if ($PSBoundParameters['Server']) { $SearcherArguments['Server'] = $Server }","        if ($PSBoundParameters['SearchScope']) { $SearcherArguments['SearchScope'] = $SearchScope }","        if ($PSBoundParameters['ResultPageSize']) { $SearcherArguments['ResultPageSize'] = $ResultPageSize }","        if ($PSBoundParameters['ServerTimeLimit']) { $SearcherArguments['ServerTimeLimit'] = $ServerTimeLimit }","        if ($PSBoundParameters['SecurityMasks']) { $SearcherArguments['SecurityMasks'] = $SecurityMasks }","        if ($PSBoundParameters['Tombstone']) { $SearcherArguments['Tombstone'] = $Tombstone }","        if ($PSBoundParameters['Credential']) { $SearcherArguments['Credential'] = $Credential }","        if ($PSBoundParameters['Raw']) { $SearcherArguments['Raw'] = $Raw }","    }","","    PROCESS {","        # standard group names to ignore","        $ExcludeGroups = @('Users', 'Domain Users', 'Guests')","","        Get-DomainGroup @SearcherArguments | Where-Object { $ExcludeGroups -notcontains $_.samaccountname } | ForEach-Object {","            $GroupName = $_.samAccountName","            $GroupDistinguishedName = $_.distinguishedname","            $GroupDomain = $GroupDistinguishedName.SubString($GroupDistinguishedName.IndexOf('DC=')) -replace 'DC=','' -replace ',','.'","","            $_.member | ForEach-Object {","                # filter for foreign SIDs in the cn field for users in another domain,","                #   or if the DN doesn't end with the proper DN for the queried domain","                $MemberDomain = $_.SubString($_.IndexOf('DC=')) -replace 'DC=','' -replace ',','.'","                if (($_ -match 'CN=S-1-5-21.*-.*') -or ($GroupDomain -ne $MemberDomain)) {","                    $MemberDistinguishedName = $_","                    $MemberName = $_.Split(',')[0].split('=')[1]","","                    $ForeignGroupMember = New-Object PSObject","                    $ForeignGroupMember | Add-Member Noteproperty 'GroupDomain' $GroupDomain","                    $ForeignGroupMember | Add-Member Noteproperty 'GroupName' $GroupName","                    $ForeignGroupMember | Add-Member Noteproperty 'GroupDistinguishedName' $GroupDistinguishedName","                    $ForeignGroupMember | Add-Member Noteproperty 'MemberDomain' $MemberDomain","                    $ForeignGroupMember | Add-Member Noteproperty 'MemberName' $MemberName","                    $ForeignGroupMember | Add-Member Noteproperty 'MemberDistinguishedName' $MemberDistinguishedName","                    $ForeignGroupMember.PSObject.TypeNames.Insert(0, 'PowerView.ForeignGroupMember')","                    $ForeignGroupMember","                }","            }","        }","    }","}","","","function Get-DomainTrustMapping {","\u003c#",".SYNOPSIS","","This function enumerates all trusts for the current domain and then enumerates","all trusts for each domain it finds.","","Author: Will Schroeder (@harmj0y)  ","License: BSD 3-Clause  ","Required Dependencies: Get-Domain, Get-DomainTrust, Get-ForestTrust  ","",".DESCRIPTION","","This function will enumerate domain trust relationships for the current domain using","a number of methods, and then enumerates all trusts for each found domain, recursively","mapping all reachable trust relationships. By default, and LDAP search using the filter","'(objectClass=trustedDomain)' is used- if any LDAP-appropriate parameters are specified","LDAP is used as well. If the -NET flag is specified, the .NET method","GetAllTrustRelationships() is used on the System.DirectoryServices.ActiveDirectory.Domain","object. If the -API flag is specified, the Win32 API DsEnumerateDomainTrusts() call is","used to enumerate instead. If any ","",".PARAMETER API","","Switch. Use an API call (DsEnumerateDomainTrusts) to enumerate the trusts instead of the","built-in LDAP method.","",".PARAMETER NET","","Switch. Use .NET queries to enumerate trusts instead of the default LDAP method.","",".PARAMETER LDAPFilter","","Specifies an LDAP query string that is used to filter Active Directory objects.","",".PARAMETER Properties","","Specifies the properties of the output object to retrieve from the server.","",".PARAMETER SearchBase","","The LDAP source to search through, e.g. \"LDAP://OU=secret,DC=testlab,DC=local\"","Useful for OU queries.","",".PARAMETER Server","","Specifies an Active Directory server (domain controller) to bind to.","",".PARAMETER SearchScope","","Specifies the scope to search under, Base/OneLevel/Subtree (default of Subtree).","",".PARAMETER ResultPageSize","","Specifies the PageSize to set for the LDAP searcher object.","",".PARAMETER ServerTimeLimit","","Specifies the maximum amount of time the server spends searching. Default of 120 seconds.","",".PARAMETER Tombstone","","Switch. Specifies that the searcher should also return deleted/tombstoned objects.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object of alternate credentials","for connection to the target domain.","",".EXAMPLE","","Get-DomainTrustMapping | Export-CSV -NoTypeInformation trusts.csv","","Map all reachable domain trusts using .NET methods and output everything to a .csv file.","",".EXAMPLE","","Get-DomainTrustMapping -API | Export-CSV -NoTypeInformation trusts.csv","","Map all reachable domain trusts using Win32 API calls and output everything to a .csv file.","",".EXAMPLE","","Get-DomainTrustMapping -NET | Export-CSV -NoTypeInformation trusts.csv","","Map all reachable domain trusts using .NET methods and output everything to a .csv file.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Get-DomainTrustMapping -Server 'PRIMARY.testlab.local' | Export-CSV -NoTypeInformation trusts.csv","","Map all reachable domain trusts using LDAP, binding to the PRIMARY.testlab.local server for queries","using the specified alternate credentials, and output everything to a .csv file.","",".OUTPUTS","","PowerView.DomainTrust.LDAP","","Custom PSObject with translated domain LDAP trust result fields (default).","","PowerView.DomainTrust.NET","","A TrustRelationshipInformationCollection returned when using .NET methods.","","PowerView.DomainTrust.API","","Custom PSObject with translated domain API trust result fields.","#\u003e","","    [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSShouldProcess', '')]","    [OutputType('PowerView.DomainTrust.NET')]","    [OutputType('PowerView.DomainTrust.LDAP')]","    [OutputType('PowerView.DomainTrust.API')]","    [CmdletBinding(DefaultParameterSetName = 'LDAP')]","    Param(","        [Parameter(ParameterSetName = 'API')]","        [Switch]","        $API,","","        [Parameter(ParameterSetName = 'NET')]","        [Switch]","        $NET,","","        [Parameter(ParameterSetName = 'LDAP')]","        [ValidateNotNullOrEmpty()]","        [Alias('Filter')]","        [String]","        $LDAPFilter,","","        [Parameter(ParameterSetName = 'LDAP')]","        [ValidateNotNullOrEmpty()]","        [String[]]","        $Properties,","","        [Parameter(ParameterSetName = 'LDAP')]","        [ValidateNotNullOrEmpty()]","        [Alias('ADSPath')]","        [String]","        $SearchBase,","","        [Parameter(ParameterSetName = 'LDAP')]","        [Parameter(ParameterSetName = 'API')]","        [ValidateNotNullOrEmpty()]","        [Alias('DomainController')]","        [String]","        $Server,","","        [Parameter(ParameterSetName = 'LDAP')]","        [ValidateSet('Base', 'OneLevel', 'Subtree')]","        [String]","        $SearchScope = 'Subtree',","","        [Parameter(ParameterSetName = 'LDAP')]","        [ValidateRange(1, 10000)]","        [Int]","        $ResultPageSize = 200,","","        [Parameter(ParameterSetName = 'LDAP')]","        [ValidateRange(1, 10000)]","        [Int]","        $ServerTimeLimit,","","        [Parameter(ParameterSetName = 'LDAP')]","        [Switch]","        $Tombstone,","","        [Parameter(ParameterSetName = 'LDAP')]","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential = [Management.Automation.PSCredential]::Empty","    )","","    # keep track of domains seen so we don't hit infinite recursion","    $SeenDomains = @{}","","    # our domain status tracker","    $Domains = New-Object System.Collections.Stack","","    $DomainTrustArguments = @{}","    if ($PSBoundParameters['API']) { $DomainTrustArguments['API'] = $API }","    if ($PSBoundParameters['NET']) { $DomainTrustArguments['NET'] = $NET }","    if ($PSBoundParameters['LDAPFilter']) { $DomainTrustArguments['LDAPFilter'] = $LDAPFilter }","    if ($PSBoundParameters['Properties']) { $DomainTrustArguments['Properties'] = $Properties }","    if ($PSBoundParameters['SearchBase']) { $DomainTrustArguments['SearchBase'] = $SearchBase }","    if ($PSBoundParameters['Server']) { $DomainTrustArguments['Server'] = $Server }","    if ($PSBoundParameters['SearchScope']) { $DomainTrustArguments['SearchScope'] = $SearchScope }","    if ($PSBoundParameters['ResultPageSize']) { $DomainTrustArguments['ResultPageSize'] = $ResultPageSize }","    if ($PSBoundParameters['ServerTimeLimit']) { $DomainTrustArguments['ServerTimeLimit'] = $ServerTimeLimit }","    if ($PSBoundParameters['Tombstone']) { $DomainTrustArguments['Tombstone'] = $Tombstone }","    if ($PSBoundParameters['Credential']) { $DomainTrustArguments['Credential'] = $Credential }","","    # get the current domain and push it onto the stack","    if ($PSBoundParameters['Credential']) {","        $CurrentDomain = (Get-Domain -Credential $Credential).Name","    }","    else {","        $CurrentDomain = (Get-Domain).Name","    }","    $Domains.Push($CurrentDomain)","","    while($Domains.Count -ne 0) {","","        $Domain = $Domains.Pop()","","        # if we haven't seen this domain before","        if ($Domain -and ($Domain.Trim() -ne '') -and (-not $SeenDomains.ContainsKey($Domain))) {","","            Write-Verbose \"[Get-DomainTrustMapping] Enumerating trusts for domain: '$Domain'\"","","            # mark it as seen in our list","            $Null = $SeenDomains.Add($Domain, '')","","            try {","                # get all the trusts for this domain","                $DomainTrustArguments['Domain'] = $Domain","                $Trusts = Get-DomainTrust @DomainTrustArguments","","                if ($Trusts -isnot [System.Array]) {","                    $Trusts = @($Trusts)","                }","","                # get any forest trusts, if they exist","                if ($PsCmdlet.ParameterSetName -eq 'NET') {","                    $ForestTrustArguments = @{}","                    if ($PSBoundParameters['Forest']) { $ForestTrustArguments['Forest'] = $Forest }","                    if ($PSBoundParameters['Credential']) { $ForestTrustArguments['Credential'] = $Credential }","                    $Trusts += Get-ForestTrust @ForestTrustArguments","                }","","                if ($Trusts) {","                    if ($Trusts -isnot [System.Array]) {","                        $Trusts = @($Trusts)","                    }","","                    # enumerate each trust found","                    ForEach ($Trust in $Trusts) {","                        if ($Trust.SourceName -and $Trust.TargetName) {","                            # make sure we process the target","                            $Null = $Domains.Push($Trust.TargetName)","                            $Trust","                        }","                    }","                }","            }","            catch {","                Write-Verbose \"[Get-DomainTrustMapping] Error: $_\"","            }","        }","    }","}","","","function Get-GPODelegation {","\u003c#",".SYNOPSIS","","Finds users with write permissions on GPO objects which may allow privilege escalation within the domain.","","Author: Itamar Mizrahi (@MrAnde7son)  ","License: BSD 3-Clause  ","Required Dependencies: None  ","",".PARAMETER GPOName","","The GPO display name to query for, wildcards accepted.","",".PARAMETER PageSize","","Specifies the PageSize to set for the LDAP searcher object.","",".EXAMPLE","","Get-GPODelegation","","Returns all GPO delegations in current forest.","",".EXAMPLE","","Get-GPODelegation -GPOName","","Returns all GPO delegations on a given GPO.","#\u003e","","    [CmdletBinding()]","    Param (","        [String]","        $GPOName = '*',","","        [ValidateRange(1,10000)] ","        [Int]","        $PageSize = 200","    )","","    $Exclusions = @('SYSTEM','Domain Admins','Enterprise Admins')","","    $Forest = [System.DirectoryServices.ActiveDirectory.Forest]::GetCurrentForest()","    $DomainList = @($Forest.Domains)","    $Domains = $DomainList | foreach { $_.GetDirect